ine','','','checkbox','Operator'),(52,'aircraft-area-affected','Antenna','http://virtualskies.arc.nasa.gov/glossary/A.html','An arrangement of wire, metal rods, etc. used in sending or receiving electromagnetic waves.','checkbox','Operator'),(53,'aircraft-area-affected','Avionics','http://www.srtechnics.com/cms/index.asp?TopicID=214','The computers and other electronic systems that monitor and control an aircraft\'s electrical and mechanical systems such as communications, autopilots, and navigation, including the various computers themselves, plus items such as interfaces, display generators, sensors, signal distributors, etc.','checkbox','Operator'),(54,'aircraft-area-affected','Bottom','','','checkbox','Operator'),(55,'aircraft-area-affected','Cargo Bay','http://members.airlines.org/about/d.aspx?nid=7949','This is the area of the fuselage below the passenger deck where cargo and baggage are carried. It is basically the lower half of the fuselage cylinder. It is pressurized, along with the rest of the fuselage, and has heating systems for areas designated for the carriage of live animals. Aircraft also have ventilation systems that force air into these areas. Access to the cargo holds is through doors in the belly of the aircraft. There is no access from the cabin area.','checkbox','Operator'),(56,'aircraft-area-affected','Cargo Door','','','checkbox','Operator'),(57,'aircraft-area-affected','Cargo Liner','','','checkbox','Operator'),(58,'aircraft-area-affected','Center','','','checkbox','Operator'),(59,'aircraft-area-affected','Center Gear','','Issues associated with the wheels of an aircraft\'s landing gear that supports the major part of the aircraft\'s weight.','checkbox','Operator'),(60,'aircraft-area-affected','Cowling','http://www.airweb.faa.gov/Regulatory_and_Guidance_Library%5CrgFAR.nsf/0/3B224F5FFC5F8BFB852566EF006B6A98?OpenDocument','Issues associated with the skin covering the engine and components (ATA code 71-10) and specifications in FAR Sec. 121.249.','checkbox','Operator'),(61,'aircraft-area-affected','Electrical','','','checkbox','Operator'),(62,'aircraft-area-affected','EEC','','Electronic Engine Controls','checkbox','USAF'),(63,'aircraft-area-affected','Elevator','http://www.faa.gov/library/manuals/aircraft/airplane_handbook/media/faa-h-8083-3a-7of7.pdf','The horizontal, movable primary control surface in the tail section, or empennage, of an airplane. The elevator is hinged to the trailing edge of the fixed horizontal stabilizer. Movement of the elevator will force the nose of an aircraft up or down.','checkbox','Operator'),(64,'aircraft-area-affected','Emergency Equipment','http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/65020F664E8C966786256A6500582F36?OpenDocument&Highlight=sec.,121.309','Emergency and flotation equipment as specified in FAR Sec. 121.309: Emergency equipment (http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/65020F664E8C966786256A6500582F36?OpenDocument&Highlight=sec.,121.309)','checkbox','Operator'),(66,'aircraft-area-affected','Engine','http://www.airweb.faa.gov/Regulatory_and_Guidance_Library%5CrgFAR.nsf/0/7B29C0FFCE0C430A86256EDF00478339?OpenDocument','An engine that is used or intended to be used for propelling aircraft. It includes turbosuperchargers, appurtenances, and accessories necessary for its functioning, but does not include propellers.','combo-box','Operator'),(67,'aircraft-area-affected','Engine #1','','','checkbox','Operator'),(68,'aircraft-area-affected','Engine #2','','','checkbox','Operator'),(69,'aircraft-area-affected','Engine #3','','','checkbox','Operator'),(70,'aircraft-area-affected','Engine #4','','','checkbox','Operator'),(71,'aircraft-area-affected','Entry','','','checkbox','Operator'),(72,'aircraft-area-affected','Environmental','http://www.faa.gov/library/manuals/aircraft/airplane_handbook/media/faa-h-8083-3a-7of7.pdf','Environmental systems include the supplemental oxygen systems, air condition systems, heaters, and pressurization systems, which make it possible for an occupant to function at high altitude.','checkbox','Operator'),(73,'aircraft-area-affected','Fairing','','','checkbox','Operator'),(74,'aircraft-area-affected','Fire suppression system','','This includes liquid or gas systems','checkbox','USAF'),(75,'aircraft-area-affected','Flap','http://www.faa.gov/library/manuals/aircraft/airplane_handbook/media/faa-h-8083-3a-7of7.pdf','Flaps: Control surfaces installed on the trailing edge of a wing and used to increase the amount of lift generated by the wing at slow speeds used during takeoffs and landings. Flaps also have the effect of slowing an aircraft during its landing approach. Flaps also are commonly deployed during final approach to increase lift, which provides control and stability at slower speeds. Flap and slat settings are controlled by the pilots, although automatic extension/retraction systems are sometimes provided to protect flight and structural integrity. Flaps/Slats-Leading Edge are the control surface on the wing?s leading edge used to increase the slow speed lifting efficiency of the wing and decrease stall speed [Refer to ATA code 57-54 (Slat Surface) and 27-8* (Slat Control System)]. Flaps-Trailing Edge are the control surface on the wing?s trailing edge used to increase the slow speed lifting efficiency of the wing and decrease stall speed [Refer to ATA code 57-53 (Trailing Edge Flap Surface) and 27-5* (Trailing Edge Control System)].','checkbox','Operator'),(76,'aircraft-area-affected','flight controls','','Aircraft flight control systems consist of flight control surfaces, the respective cockpit controls, connecting linkages, and the necessary operating mechanisms to control an aircraft\'s direction in flight. Aircraft engine controls are also considered as flight controls as they change speed.','checkbox','USAF'),(77,'aircraft-area-affected','Flight Deck','http://members.airlines.org/about/d.aspx?nid=7949','Also called the cockpit, it the compartment in the front of the airplane where the flight crew performs their job of flying the aircraft. It is the most forward part of the fuselage and contains all the instruments needed to fly the plane. The flight deck has seats for the pilot and co-pilot; a flight engineer, on some planes; and seats for one or two observers that could be from the airline itself, or from FAA. The flight deck is off limits to passengers during flight and to flight attendants during takeoffs and landings.','checkbox','Operator'),(78,'aircraft-area-affected','Fly by Cable System','','Mechanical or manually-operated flight control systems','checkbox','USAF'),(79,'aircraft-area-affected','Fly by Wire System','','Computer-configured controls, where a computer system is interposed between the operator and the final control actuators or surfaces','checkbox','USAF'),(80,'aircraft-area-affected','Forward','','In, near, or toward the  nose of aircraft.','checkbox','Operator'),(81,'aircraft-area-affected','Fuel','','','checkbox','Operator'),(82,'aircraft-area-affected','Fuselage','http://www.faa.gov/library/manuals/aircraft/airplane_handbook/media/faa-h-8083-3a-7of7.pdf','The main body of an aircraft, cylindrical in shape. It contains the cockpit, main cabin and cargo compartments.','checkbox','Operator'),(83,'aircraft-area-affected','Galley','','Compartment of a aircraft where on-board meal service equipment is used to cook and prepare food.','checkbox','Operator'),(84,'aircraft-area-affected','Horizontal Stabilizer','','','checkbox','UTRS'),(85,'aircraft-area-affected','Hydraulics','http://www.faa.gov/library/manuals/aircraft/airplane_handbook/media/faa-h-8083-3a-7of7.pdf','Issues associated with the transmission of power by incompressible fluids under pressure and hydraulic system components (ATA code 29-**). Also Refer to FAR Sec. 25.1435: Hydraulic Systems (http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/BED86D5AD36A22B786256A6B0057CE4B?OpenDocument&Highlight=25.1541).','checkbox','Operator'),(86,'aircraft-area-affected','Interior','','','checkbox','Operator'),(87,'aircraft-area-affected','Lavatory','','All events occurring within the toilet area including the triggering of smoke warnings either genuine or nuisance. ATA code 25-40 (failure of lavatory-related components).','checkbox','Operator'),(88,'aircraft-area-affected','Left','','','checkbox','Operator'),(89,'aircraft-area-affected','Main Gear','http://www.faa.gov/library/manuals/aircraft/airplane_handbook/media/faa-h-8083-3a-7of7.pdf','Issues associated with the wheels of an aircraft\'s landing gear that supports the major part of the aircraft\'s weight.','checkbox','Operator'),(90,'aircraft-area-affected','Nose Gear','http://virtualskies.arc.nasa.gov/glossary/N.html','The landing gear nearest the nose of the aircraft; usually under the cockpit.','checkbox','Operator'),(91,'aircraft-area-affected','Other Area Affected','','Description of additional factor(s), not listed, associated with other aircraft areas affected.','text-field','Operator'),(92,'aircraft-area-affected','Oxygen','','Failures of aircraft fixed or portable oxygen supply/equipment. ATA code 35-** Example: Oxygen used by passenger during a medical event. Employee err. Example: passenger oxygen was not properly boarded. Pilot deployed oxygen masks accidentally. Employee prevented accessibility to oxygen by stacking bags a top).','checkbox','Operator'),(93,'aircraft-area-affected','Passenger Door','','','checkbox','Operator'),(94,'aircraft-area-affected','Propeller','','','checkbox','UTRS'),(95,'aircraft-area-affected','Radome','','A detachable nose cone made of plastic-type material, used to cover and protect an airplane\'s radar antenna.','checkbox','Operator'),(96,'aircraft-area-affected','Right','','','checkbox','Operator'),(97,'aircraft-area-affected','Rotor','','','checkbox','UTRS'),(98,'aircraft-area-affected','Rudder','','The hinged part of the vertical stabilizer','checkbox','UTRS'),(99,'aircraft-area-affected','Seat Track','','','checkbox','Operator'),(100,'aircraft-area-affected','Slats','','','checkbox','UTRS'),(102,'aircraft-area-affected','Structural','','','checkbox','Operator'),(103,'aircraft-area-affected','Tail Rotor','','','checkbox','UTRS'),(104,'aircraft-area-affected','Tail Rotor Shaft','','','checkbox','UTRS'),(105,'aircraft-area-affected','Top','','','checkbox','Operator'),(106,'aircraft-area-affected','Vertical Stabilizer','','','checkbox','UTRS'),(107,'aircraft-area-affected','Wing','http://www.faa.gov/library/manuals/aircraft/airplane_handbook/media/faa-h-8083-3a-7of7.pdf','The wings are the airfoil that generates the lift necessary to get and keep, an aircraft off the ground. Like the fuselage to which they are attached, they are made of aluminum alloy panels riveted together. The point of attachment is the aircraft\'s center of gravity, or balance point. ATA Code 57-**','checkbox','Operator'),(108,'aircraft-configuration','Aircraft Configuration Notes','','Used to supplement aircraft-configuration tax_attributes','memo-field','UTRS'),(109,'aircraft-configuration','Aircraft Type','http://intlaviationstandards.org/Documents/AircraftMakeModelSeriesBusinessRules1.pdf','Specifies the aircraft manufacturer and model (e.g., EMB-145, B757-200, A320-200) from a drop-down list.','combo-box','DAWG'),(110,'aircraft-configuration','Altitude (Ft) MSL','http://www.faa.gov/airports_airtraffic/air_traffic/publications/atpubs/PCG/A.HTM','Specification of the height of a level, point, or object measured in feet from Mean Sea Level (MSL) at which the event occurred.','real-field','DAWG'),(111,'aircraft-configuration','Auto-Flight Status','','Indicates whether the pilots are controlling flight control movements through manual control or use of the auto pilot systems.','combo-box','Operator'),(112,'aircraft-configuration','Autopilot','http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/BDEC6530B3BFFE6F8525668700724671?OpenDocument&Highlight=23.1329','Specifies whether the autopilot was on or off at the time of the occurrence. Autopilot is the automation system that controls aircraft attitude, altitude and heading and keeps an aircraft in level flight or on a set course. Automatic pilots can be directed by the pilot, or they may be coupled to a radio navigation signal. Refer to ATA Code 2210) and FAR Part 23.1329: Autopilot (http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/BDEC6530B3BFFE6F8525668700724671?OpenDocument&Highlight=23.1329).','combo-box','DAWG'),(113,'aircraft-configuration','Auto Throttle','','Specifies whether the auto throttle [the automation system that controls airspeed by adjusting engine thrust (ATA Code 22-30)] was on or off at the time of the occurrence.','combo-box','DAWG'),(114,'aircraft-configuration','Auto Throttle Mode','','','combo-box','Operator'),(115,'aircraft-configuration','CVR Installed','','','checkbox','UTRS'),(116,'aircraft-configuration','ELT Installed','','Check if ELT was installed in the aircraft','checkbox','NTSB 6120-1'),(117,'aircraft-configuration','Engines Running','','','combo-box','Operator'),(118,'aircraft-configuration','Engine Type','','Manufacturer and model (e.g., PW4000, RB211-524, CF6-80A, etc.)','text-field','MEDA Rev g.'),(119,'aircraft-configuration','Fire Extinguishing System','','','text-field','NTSB 6120-1'),(120,'aircraft-configuration','Flap Setting','','Aircraft flap setting','text-field','DAWG'),(121,'aircraft-configuration','Fleet Number','','Letter or number designator','text-field','MEDA Rev g.'),(122,'aircraft-configuration','FDR Installed','','','checkbox','UTRS'),(123,'aircraft-configuration','Landing Gear','http://intlaviationstandards.org/Glossary.html','Specifies whether the landing gear was up or down at the time of the occurrence. Landing Gear is the system that supports aircraft maneuvering on land or water and supports the weight of the aircraft when it lands.','combo-box','DAWG'),(124,'aircraft-configuration','Tail Number','http://www.tc.gc.ca/CivilAviation/RegServ/terminology/glossary/a2.htm','The registration number of an aircraft specified as a group of letters or figures, or a combination thereof, that is either identical to, or the coded equivalent of the aircraft call sign to be used in air-ground communication and that is used to identify the aircraft in ground-ground ATS communications.','combo-box/values','UTRS'),(125,'aircraft-configuration','Nickname','http://www.tc.gc.ca/CivilAviation/RegServ/terminology/glossary/a2.htm','The nickname for this aircraft.','combo-box','UTRS'),(126,'aircraft-configuration','Number of Floor Level Exits','','','integer-field','ASRS'),(127,'aircraft-configuration','Number of Seats','','','integer-field','ASRS'),(128,'aircraft-configuration','Number of Window Exits','','','integer-field','ASRS'),(130,'aircraft-configuration','If large aircraft, how many seats for cabin crew?','','number of seats reserved for cabin crew','integer-field','NTSB 6120-1'),(131,'aircraft-configuration','If large aircraft, how many seats for flight crew?','','number of seats reserved for flight crew','integer-field','NTSB 6120-1'),(132,'aircraft-configuration','If large aircraft, how many seats for passengers?','','number of passenger seats','integer-field','NTSB 6120-1'),(133,'aircraft-configuration','Speed IAS (Knots)','http://www.faa.gov/library/manuals/aircraft/airplane_handbook/media/faa-h-8083-3a-7of7.pdf','Specification of the Indicated Air Speed (IAS) at the time of the occurrence. IAS is defined as the speed, expressed in knots, an aircraft is moving through the air as is shown on the aircraft pitot static airspeed indicator calibrated to reflect standard atmosphere adiabatic compressible flow at sea level, uncorrected for variations in atmospheric density, installation error, or instrument error. Manufacturers use this airspeed as the basis for determining airplane performance. Takeoff, landing, and stall speeds listed in the AFM or POH are indicated airspeeds and do not normally vary with altitude or temperature. This is the speed used in pilot/controller communications. Refer to 14 CFR Part 1 (http://www.airweb.faa.gov/Regulatory_and_Guidance_Library%5CrgFAR.nsf/0/7B29C0FFCE0C430A86256EDF00478339?OpenDocument).','integer-field','DAWG'),(134,'aircraft-configuration','Speed (Mach Number)','http://www.airweb.faa.gov/Regulatory_and_Guidance_Library%5CrgFAR.nsf/0/7B29C0FFCE0C430A86256EDF00478339?OpenDocument','Specification of the speed, expressed as Mach Number, at the time of occurrence. Mach number is defined as the ratio of true airspeed to the speed of sound.','real-field','DAWG'),(135,'aircraft-configuration','Spoilers','http://www.faa.gov/library/manuals/aircraft/airplane_handbook/media/faa-h-8083-3a-7of7.pdf','Specifies whether the spoilers were extended or retracted at the time of the occurrence.','combo-box','DAWG'),(136,'aircraft-configuration','Stall Warning Installed','','','combo-box','NTSB 6120-1'),(137,'aircraft-configuration','Sterile Cockpit','http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/DD19266CEBDAC9DB852566EF006D346F?OpenDocument&Highlight=121.542','http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/DD19266CEBDAC9DB852566EF006D346F?OpenDocument&Highlight=121.542','checkbox','DAWG'),(138,'aircraft-configuration','Tailcone Exits','http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/C6B2C95B4160B7BF86256E9B0069AB55?OpenDocument&Highlight=25.807','Indicated the number of exits through the tailcone which are aft exits from the passenger compartment through the pressure shell and through an openable cone of the fuselage aft of the pressure shell. The means of opening the tailcone must be simple and obvious and must employ a single operation.','checkbox','ASRS'),(139,'aircraft-configuration','Was Aircraft on Ground?','','','combo-box','Operator'),(140,'aircraft-configuration','Weight at Time of Event (Lb)','http://www.airweb.faa.gov/Regulatory_and_Guidance_Library%5CrgFAR.nsf/0/379F43D4014D86E8852566720048360B?OpenDocument','Specifies the aircraft weight, including the fuel, oil, crew, passengers, and cargo, in pounds at the time of the occurrence.','real-field','DAWG'),(141,'aircraft-damage/encounter','Aft Door','','','checkbox','Operator'),(142,'aircraft-damage/encounter','Aircraft Damage','http://www.faa.gov/library/manuals/aviation/risk_management/ss_handbook/media/app_a_1200.PDF','Occurrences associated with damage to an aircraft from a company employee, contract vendor, or an external source (non-company employee, animal, etc). Damage is the severity of injury, and / or the physical, and/ or functional, and /or monetary loss that could result if hazard control is less then adequate.','combo-box','DNAA'),(143,'aircraft-damage/encounter','Aircraft Damage Description','','Narrative that supplements the damage tax_attributes','memo-field','Operator'),(144,'aircraft-damage/encounter','Aircraft Damage/Encounter','http://www.faa.gov/library/manuals/aviation/risk_management/ss_handbook/media/app_a_1200.PDF','Physical deterioration of the aircraft caused by a company employee, contract vendor, or any external source (non-company employee, animal, etc) during the operation of the aircraft, ground, or maintenance practices. Damage is the severity of injury, and/or the physical, and/or functional, and/or monetary loss that could result if hazard control is less then adequate. Should include ATA code of damage (example: bag cart hits an engine include ATA 72-00).','checkbox','DNAA'),(145,'aircraft-damage/encounter','Auxiliary Door','','','checkbox','Operator'),(146,'aircraft-damage/encounter','Birds','http://wildlife-mitigation.tc.faa.gov/public_html/index.html#info','An aircraft-wildlife strike is deemed to have occurred when: 1. a pilot reports that an aircraft struck 1 or more birds or other wildlife; 2. aircraft maintenance personnel identify aircraft damage as having been caused by an aircraft-wildlife strike; 3. personnel on the ground report seeing an aircraft strike 1 or more birds or other wildlife; 4. bird or other wildlife remains, whether in whole or in part, are found within 200 feet of a runway centerline, unless another reason for the animal\'s death is identified; or 5. the animal\'s presence on the airport had a significant, negative effect on a flight (i.e., aborted takeoff, aborted landing, high-speed emergency stop, aircraft left pavement area to avoid collision with animal). In AC: 150/1500-32A: Reporting Wildlife Aircraft Stirkes (http://www.faa.gov/airports_airtraffic/airports/resources/advisory_circulars/media/150-5200-32a/150_5200_32a.pdf), the FAA requests that bird and other wildlife strikes be reported using FAA Form 5200-7 (http://forms.faa.gov/info_new.asp?form_number=5200-7&open_doc=N). http://www.birdstrike.us/guidances).','combo-box','DNAA'),(147,'aircraft-damage/encounter','Birdstrike Avoidance Lights On','','','combo-box','Operator'),(148,'aircraft-damage/encounter','Blow Out Panel','','','combo-box','Operator'),(149,'aircraft-damage/encounter','Cargo','http://rgl.faa.gov/Regulatory_and_Guidance_Library/rgAdvisoryCircular.nsf/0/84087a61b8fb9582862570220064e03c/$FILE/AC120-27E.pdf','Refers to everything carried in the cargo compartments of the aircraft. This includes bags, mail, freight, express, and company material. It also includes live animals, dangerous goods, and hazardous materials.','checkbox','DNAA'),(150,'aircraft-damage/encounter','Cargo Door','','','checkbox','REDA'),(151,'aircraft-damage/encounter','Cargo Pit/Interior','','','checkbox','Operator'),(152,'aircraft-damage/encounter','Estimated Repair Cost','','','real-field','Operator'),(153,'aircraft-damage/encounter','Fixed Object','','','checkbox','DNAA'),(154,'aircraft-damage/encounter','FOD','','Foreign Object Debris. Debris on the ramp, taxiway or runway that may cause damage to the aircraft.','checkbox','DNAA'),(155,'aircraft-damage/encounter','Graffiti','','','checkbox','Operator'),(156,'aircraft-damage/encounter','In-Flight VFR in IMC','','','checkbox','ASRS'),(157,'aircraft-damage/encounter','Jetbridge','http://members.airlines.org/about/d.aspx?nid=7954','A registered trademark for a certain kind of aircraft loading bridge which allows passengers direct, protected access to an aircraft from the terminal.','checkbox','DNAA'),(158,'aircraft-damage/encounter','Landing Gear/Doors','http://intlaviationstandards.org/Glossary.html','Landing Gear is the system that supports aircraft maneuvering on land or water and supports the weight of the aircraft when it lands.','checkbox','REDA'),(159,'aircraft-damage/encounter','Lavatory Service Port','','','checkbox','Operator'),(160,'aircraft-damage/encounter','Main Cabin Door','','','checkbox','Operator'),(161,'aircraft-damage/encounter','Nose/Radome','','','checkbox','REDA'),(162,'aircraft-damage/encounter','Other Aircraft','','Description of additional factor(s), not listed, associated with the aircraft damage of encounter incident or event.','text-field','DNAA'),(163,'aircraft-damage/encounter','Other Aircraft Damage/Encounter: Ground','','Description of additional factor(s), not listed, associated with the aircraft damage of encounter incident or event on the ground.','text-field','DNAA'),(164,'aircraft-damage/encounter','Other Aircraft Damage/Encounter: In-Flight','','Description of additional factor(s), not listed, associated with the aircraft damage of encounter incident or event that occurred in-flight.','text-field','ASRS'),(165,'aircraft-damage/encounter','Panel Open on Arrival','','','checkbox','Operator'),(166,'aircraft-damage/encounter','Passenger Door','','','checkbox','REDA'),(167,'aircraft-damage/encounter','Person','http://www.airweb.faa.gov/Regulatory_and_Guidance_Library%5CrgFAR.nsf/0/7B29C0FFCE0C430A86256EDF00478339?OpenDocument','An individual, firm, partnership, corporation, company, association, joint-stock association, or governmental entity. It includes a trustee, receiver, assignee, or similar representative of any of them.','checkbox','DNAA'),(168,'aircraft-damage/encounter','Prop Strike','','','combo-box','Operator'),(169,'aircraft-damage/encounter','Recordable','','','combo-box','Operator'),(170,'aircraft-damage/encounter','Repair Required to Maintain Airworthiness','','','checkbox','Operator'),(171,'aircraft-damage/encounter','Parachutists','http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFar.nsf/0/e19a6716704c949f86256eec00667df3?OpenDocument','A person who intends to exit an aircraft while in flight using a single-harness, dual parachute system to descend to the surface. Refer to FAR Sec. 105.3: Parachute Operations (http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFar.nsf/0/e19a6716704c949f86256eec00667df3?OpenDocument) and AIM Chapter 3-5-4. Parachute Jump Aircraft Operations (http://www.faa.gov/airports_airtraffic/air_traffic/publications/atpubs/aim/Chap3/aim0305.html#3-5-4).','checkbox','ASRS'),(172,'aircraft-damage/encounter','Tail','','','checkbox','REDA'),(173,'aircraft-damage/encounter','TFOA (Things Falling Off Aircraft)','','','checkbox','Operator'),(174,'aircraft-damage/encounter','Tires/Wheels','','','checkbox','Operator'),(175,'aircraft-damage/encounter','Upper Deck','','','checkbox','Operator'),(176,'aircraft-damage/encounter','Vehicle','','Conveyances, except aircraft, used on the ground to transport persons, cargo, fuel, or equipment','checkbox','DNAA'),(177,'aircraft-damage/encounter','Wild Life','http://www.birdstrike.us/guidances/FAA%20Advisory%20Circular%20150%205200%2032A%20Reporting%20Wildlife%20Aircraft%20Strikes%2012%20%2022%202004.pdf','Includes feral animals and domestic animals while out of their owner\'s control','combo-box','DNAA'),(178,'aircraft-damage/encounter','Engine/Cowl','','','checkbox','REDA'),(179,'aircraft-damage/encounter','Wing/Flaps/Slats/Ailerons','http://virtualskies.arc.nasa.gov/glossary/A.html','Wing - A part of an airplane that is attached to the fuselage. Wings are shaped like airfoils and are used to provide lift for the airplane. There are four basic types of wings: straight, sweep, delta and variable sweep. Flaps - Moveable parts of the trailing edge of a wing that are used to increase lift at slower air speeds. Flaps increase lift by changing the shape of the airfoil. A pilot will extend the flaps when the airplane is landing. By extending the flaps, the pilot is increasing the camber of the wing, the size of the wing and the wing\'s angle of attack. All of these actions will cause lift to decrease so the airplane can land more slowly. Slats-Auxiliary curved or mini-aerofoil surface designed to prevent flow breakaway from a wing or tail. On a tail leading-edge it may be fixed, leaving a narrow slot. On a wing it is almost always retractable, normally flush with the wing profile but extended (under power or by aerodynamic lift) to leave a narrow slot for take-off, low-speed loiter or landing. Ailerons - Control surfaces on the trailing edge of each wing that are used to make the aircraft roll. When flying straight and level, moving the control stick to the right will raise the aileron on the right wing and lower the aileron on the left wing. This will cause the aircraft to roll to the right.','checkbox','REDA'),(180,'aircraft-damage/encounter','Wing Strike','','','combo-box','Operator'),(181,'aircraft-design/configuration/parts','Aircraft Configuration Variability','','','checkbox','MEDA Rev g.'),(182,'aircraft-design/configuration/parts','Aircraft Design/Configuration/Parts','http://www.hf.faa.gov/opsmanual/assets/pdfs/MEDA_guide.pdf','Issues associated with the design of the aircraft for accessibility of parts and systems, configuration variability between models and aircraft that require ground personnel or maintenance tasks to be carried out differently or require slightly different parts, and aircraft parts that are to be replaced, including labeling and availability.','checkbox','MEDA Rev g.'),(183,'aircraft-design/configuration/parts','Bad from Stock','','','checkbox','Operator'),(184,'aircraft-design/configuration/parts','Complex','','Involved or intricate in structure and consisting of interconnected parts','checkbox','MEDA Rev g.'),(185,'aircraft-design/configuration/parts','Consumable Unavailable','','','checkbox','MEDA'),(186,'aircraft-design/configuration/parts','Easy to Install Incorrectly','','Indicates that that the tasks associated with connection, setting-in position, and/or preparing for use of equipment or part, including not closing access, causing damage, improper deactivation/reactivation, incorrect installation, use of wrong equipment or part are complicated and can readily be misinterpreted.','checkbox','MEDA Rev g.'),(187,'aircraft-design/configuration/parts','Expired Consumable Used','','','checkbox','MEDA'),(188,'aircraft-design/configuration/parts','Inaccessible','','Capable of being reached only with great difficulty or not at all.','checkbox','MEDA Rev g.'),(189,'aircraft-design/configuration/parts','Not User Friendly','','','checkbox','MEDA'),(190,'aircraft-design/configuration/parts','Other Aircraft Design/Configuration/Parts','','Description of additional factor(s), not listed,  are associated with the design of the aircraft for accessibility of parts and systems, configuration variability between models and aircraft that require ground personnel or maintenance tasks to be carried out differently or require slightly different parts, and aircraft parts that are to be replaced, including labeling and availability.','text-field','MEDA Rev g.'),(191,'aircraft-design/configuration/parts','Parts Hard to See','','Including antenna, masts, etc.','checkbox','REDA'),(192,'aircraft-design/configuration/parts','Parts Incorrectly Labeled','http://hf.tc.faa.gov/hfds/hfds_pdfs/Ch4_Designing_equipment_for_maintenance.pdf','Errors associated with the alphanumeric information (label) or nonverbal information, such as colors or symbols (markings) that identifies or describes an object. Labels on equipment can be used to (a) identify the equipment, (b) state warnings or cautions, (c) supply useful information, such as instructions, the weight of the equipment, or calibration information, and (d) record and supply historical data, such as periodic readings or the date of servicing or replacement. (Refer to Sect. 4.3.5 Labeling and Marking).','checkbox','MEDA Rev g.'),(193,'aircraft-design/configuration/parts','Parts Not Available','','Indicates that the required parts are not available, accessible, or at hand.','checkbox','MEDA Rev g.'),(194,'aircraft-design/configuration/parts','Poorly Marked','','','checkbox','REDA'),(195,'aircraft-design/configuration/parts','Wrong Consumable Used','','','checkbox','MEDA'),(196,'aircraft-design/configuration/parts','Wrong Effectivity Code','','','checkbox','Operator'),(197,'aircraft-equipment','Aircraft Equipment','','Specific equipment on the aircraft, such as GPWS and TCAS.','checkbox','ASRS'),(198,'aircraft-equipment','Aircraft Warning/Message System','','','checkbox','Operator'),(199,'aircraft-equipment','Altitude Alert','','','checkbox','ASRS'),(200,'aircraft-equipment','GPWS','http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/C45DB475D77EFC1B862568C80064DDF6?OpenDocument&Highlight=121.360','Ground Proximity Warning System (GPWS) is a system on board the aircraft that provided warnings of: excessive descent rate; excessive terrain closure rate; excessive altitude loss after take-off or go-around; unsafe terrain clearance while not in landing configuration, i.e., gear not locked down or flaps not in a landing position; and excessive descent below the instrument glide path. (warns of inadequate separation from ground and excessive sink rate close to ground). Refer to FAR 121.360: Ground proximity warning-glide slope deviation alerting system (http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/C45DB475D77EFC1B862568C80064DDF6?OpenDocument&Highlight=121.360).','checkbox','ASRS'),(201,'aircraft-equipment','Other Aircraft Equipment','','Description of additional factor(s), not listed, associated with the specific equipment on the aircraft, such as GPWS and TCAS.','text-field','ASRS'),(202,'aircraft-equipment','Other Aircraft Equipment Specifics','','Description of additional factor(s), not listed, on the specific equipment on the aircraft.','text-field','ASRS'),(203,'aircraft-equipment','TCAS','http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgAdvisoryCircular.nsf/0/76056bd8e04b1cc086256fb0006a579b/$FILE/AC%2020-151.pdf','Traffic Alert And Collision Avoidance System (TCAS)-An airborne collision avoidance system based on radar beacon signals which operates independent of ground-based equipment. TCAS-I generates traffic advisories only. TCAS-II generates traffic advisories, and resolution (collision avoidance) advisories in the vertical plane.','checkbox','ASRS'),(204,'aircraft-equipment-damage','Aircraft/Equipment Damage','','','checkbox','MEDA/REDA'),(205,'aircraft-equipment-damage','ATA Category','','','combo-box','Operator'),(206,'aircraft-equipment-damage','ATA Category','','','combo-box','Operator'),(207,'aircraft-equipment-damage','Defective Tools/Equipment Used','','','checkbox','MEDA/REDA'),(208,'aircraft-equipment-damage','Dropped Object','','','checkbox','MEDA/REDA'),(209,'aircraft-equipment-damage','Fire/Smoke','','','checkbox','MEDA'),(210,'aircraft-equipment-damage','Incorrect Pressure','','Includes hydraulics, pneumatics, and pneudraulics','checkbox','USAF'),(211,'aircraft-equipment-damage','Incorrect Voltage','','Includes over, under, and unstable voltages','checkbox','USAF'),(212,'aircraft-equipment-damage','Other Aircraft/Equipment Damage','','Description of additional factor(s), not listed, associated with the aircraft or equipment damage incident or event.','text-field','MEDA/REDA'),(213,'aircraft-equipment-damage','Pulled/Pushed/Drove Into','','','checkbox','MEDA/REDA'),(214,'aircraft-equipment-damage','Struck By/Against','','','checkbox','MEDA/REDA'),(215,'aircraft-equipment-damage','Tools/Equipment Used Improperly','','','checkbox','MEDA/REDA'),(216,'aircraft-events','Aircraft Events','','Occurrences and issues related to the aircraft as a whole including dimensions, inspection, movement, maintenance, placards, servicing, and towing.','checkbox','DNAA'),(217,'aircraft-events','Dimensions and Areas','http://www.s-techent.com/ATA100.htm#[08]','Includes charts, diagrams, and text which show the area, dimensions, stations, access doors / zoning and physical locations, of the major structural members of the aircraft, including an explanation of the system of zoning and measurement used. Refer to ATA 100 (now ATA iSpec 2200) Chapter 6: Dimensions and Areas (http://www.s-techent.com/ATA100.htm#[08]).','checkbox','DNAA'),(218,'aircraft-events','Jet Blast','http://www.faa.gov/airports_airtraffic/air_traffic/publications/atpubs/PCG/j.HTM','Jet engine exhaust or propeller wash (thrust stream turbulence).','checkbox','Operator'),(219,'aircraft-events','Laser Beam Exposure','http://www.faa.gov/airports_airtraffic/air_traffic/publications/atpubs/aim/Chap7/aim0705.html#7-5-5','Unauthorized illumination of aircraft by lasers. Pilots are also encouraged to complete the Laser Beam Exposure Questionnaire (http://www.faa.gov/airports_airtraffic/air_traffic/publications/atpubs/aim/Appendices/aimapd3.html#Appendix3), and fax it to the Washington Operations Center Complex (WOCC) as soon as possible after landing.','checkbox','UTRS'),(220,'aircraft-events','Leveling and Weighing','http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/F8C6A62E2A93DE0A85256673004F66B2?OpenDocument&Highlight=h25.3','Includes activities to properly level the aircraft for any of the various maintenance, overhaul or major repairs which might become necessary during the life of the aircraft. It shall also include those units or components which are specifically dedicated to record, store or compute weight and balance data. Includes those maintenance practices necessary to prepare the aircraft for weighing. Refer to FAR Part 25 Sec. H.23 and ATA 100 (now ATA iSpec 2200) Chapter 8: Leveling and Weighing (http://www.s-techent.com/ATA100.htm#[08])).','checkbox','DNAA'),(221,'aircraft-events','Lifting and Shoring','http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/F8C6A62E2A93DE0A85256673004F66B2?OpenDocument&Highlight=h25.3','This chapter shall include the necessary procedures to lift and shore aircraft in any of the conditions to which it may be subjected. Includes lifting and shoring procedures that may be employed during aircraft maintenance and repair.\n\nIncludes lifting and shoring procedures to support the aircraft in any of the conditions to which it may be subjected. during maintenance and repair, including jacking aircraft nose or tail wheel, jacking complete aircraft, slinging or trestling major component. Refer to FAR Part 25 Sec. H.23 and ATA 100 (now ATA iSpec 2200) Chapter 7: Lifting and Shoring (http://www.s-techent.com/ATA100.htm#[08]).','checkbox','DNAA'),(222,'aircraft-events','Other Aircraft Events','','Description of additional factor(s), not listed, associated with the aircraft incident or event.','text-field','DNAA'),(223,'aircraft-events','Parking, Mooring, Storage and Return to Service','http://www.faa.gov/library/manuals/aircraft/airplane_handbook/media/faa-h-8083-3a-7of7.pdf','Includes maintenance practices necessary to prepare the aircraft for parking, mooring, or storage for service in any of the conditions to which it may be subjected. Includes charts showing location of landing gear and control surface locks, blanking plugs and covers, mooring points, etc. Parking: practices necessary to park or store the aircraft in normal or abnormal conditions such as with engines removed, or aircraft damaged for short or long terms, including equipment and materials required such as landing gear and control surface locks, wheel chocks, blanking plugs and covers, cocooning materials, etc; procedures such as periodic engine running, control or drainage of fluid systems, static grounding, etc; precautions and limitations, such as landing gear strut pressures and wheel rotation, control of lifted equipment, etc. Mooring: Practices necessary to moor or picket the aircraft in normal or abnormal conditions or with engines removed, etc.; for short or long terms in extremes of weather condition, including equipment and materials required such as wheel chocks, mooring blocks, mooring cables, etc.; procedures such as ballasting, etc.; precautions and limitations such as control in high wind conditions, etc Return To Service: practices for preparing the aircraft for operation following mooring, parking, or a period of storage. Refer to FAR Part 25 Sec. H.23 and ATA 100 (now ATA iSpec 2200) Chapter 10: Parking, Mooring, Storage and Return to Service (http://www.s-techent.com/ATA100.htm#[08]).','checkbox','DNAA'),(224,'aircraft-events','Periodic Inspections','http://www.faa.gov/library/manuals/aircraft/airplane_handbook/media/faa-h-8083-3a-7of7.pdf','Procedures for complying with manufacturers\' recommended time limits for inspections, maintenance checks, overhaul, and inspections (both scheduled and unscheduled) of the aircraft, its systems and units, and life of parts. Refer to FAR 135.425: Maintenance, preventive maintenance, and alteration programs (http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/26CD1335E9C5D5388625694A00712282?OpenDocument&Highlight=135.425). For engine manufacturers this will include the flight cycle lives of major rotating components and other items designated critical. Refer to FAR Part 25 Sec. H.23 and ATA 100 (now ATA iSpec 2200) Chapter 5: Periodic Inspections (http://www.s-techent.com/ATA100.htm#[08]).','checkbox','DNAA'),(225,'aircraft-events','Placards and Markings','http://www.s-techent.com/ATA100.htm#[08]','Required signs, label, markings, self-illuminating signs, etc. required for safety information, maintenance significant information or by government regulations. Interior placards and markings provide general and emergency information, instructions, cautions, warnings, etc. to crew or passengers. Exterior placards and markings provide ground servicing instructions, inspections, cautions, warnings, etc. Those required by government regulations must be so identified. Refer to ATA 100 (now ATA iSpec 2200) Chapter 11: Placards and Markings (http://www.s-techent.com/ATA100.htm#[08]).','checkbox','DNAA'),(228,'aircraft-events','Vibration and Noise Analysis','http://www.s-techent.com/ATA100.htm#[08]','Procedures to monitor, measure, diagnose and locate sources of vibration and noise in dynamic and structural components. Refer to ATA 100 (now ATA iSpec 2200) Chapter 18: Vibration And Noise Analysis (http://www.s-techent.com/ATA100.htm#[08]).','checkbox','DNAA'),(229,'aircraft-handling/configuration/performance-contr','Aircraft Handling/Configuration/Performance Control','http://www.faa.gov/library/manuals/aircraft/airplane_handbook/media/faa-h-8083-3a-7of7.pdf','Occurrences and issues associated with the handling, configuration, and performance of the aircraft, including flaps, flight controls, Spoilers/Speed Brakes, and Power Settings/Speed.','checkbox','DNAA'),(230,'aircraft-handling/configuration/performance-contr','Automation','','','checkbox','Operator'),(231,'aircraft-handling/configuration/performance-contr','Automation Overrode Flight Crew','','','checkbox','ASRS'),(232,'aircraft-handling/configuration/performance-contr','Configuration Warning','','','checkbox','Operator'),(233,'aircraft-handling/configuration/performance-contr','Flap Altitude Exceedence','','Altitude at which flaps are extended and have exceeded manufacturers recommended flap extend altitude.','checkbox','Operator'),(234,'aircraft-handling/configuration/performance-contr','Flap Setting','','Aircraft flap setting','checkbox','DNAA'),(235,'aircraft-handling/configuration/performance-contr','Loss of Aircraft Control','','Indicates occurrences and issues associated with loss of aircraft control while the aircraft is on the ground or while inflight.','checkbox','ASRS'),(236,'aircraft-handling/configuration/performance-contr','Other Aircraft Handling/Configuration/Performance Control','','Description of additional factor(s), not listed, associated with the aircraft handling, configuration, and/or performance control incident or event.','text-field','DNAA'),(237,'aircraft-handling/configuration/performance-contr','Power Settings/Speed Control-Thrust Reversers, Auto-Throttle','','','checkbox','DNAA'),(239,'aircraft-handling/configuration/performance-contr','Trim','http://ecfr.gpoaccess.gov/cgi/t/text/text-idx?c=ecfr;sid=6d92d5a00b5d947ba62916750fc66814;rgn=div5;view=text;node=14%3A1.0.1.3.11;idno=14;cc=ecfr#14:1.0.1.3.11.2.157.25','Secondary flight control surface or control used to fine tune the position of a primary flight control surface (ATA code 27-**). Refer to 14 CFR 25.161 Trim (http://ecfr.gpoaccess.gov/cgi/t/text/text-idx?c=ecfr;sid=6d92d5a00b5d947ba62916750fc66814;rgn=div5;view=text;node=14%3A1.0.1.3.11;idno=14;cc=ecfr#14:1.0.1.3.11.2.157.25).','checkbox','DNAA'),(240,'aircraft-handling/configuration/performance-contr','Use of Primary/Manual Flight Controls (Airborne)-Aileron, Rudder, or Elevator','','','checkbox','DNAA'),(241,'aircraft-handling/configuration/performance-contr','Use of Flight Controls (On Ground)','http://virtualskies.arc.nasa.gov/glossary/C.html','Uses of the devices which allow the pilot to direct the movements of an aircraft. Examples of controls are: rudder pedals that control the rudders and cause the airplane to yaw; throttles that control the engines which generate thrust for the airplane; and the control stick that controls the ailerons and elevators which cause the airplane to roll and pitch while the aircraft is not in the air.','checkbox','DNAA'),(242,'aircraft-information','Company/Manufacturer Part No','','','text-field','M-DNAA V7.0 A4.7'),(243,'aircraft-information','Component Name','http://www.srtechnics.com/cms/index.asp?TopicID=214','Name of a rotable or repairable part (re-usable). Aircraft components whose maintenance intervals are individually scheduled separately to the maintenance intervals of the aircraft itself.','text-field','M-DNAA V7.0 A4.6'),(244,'aircraft-information','Condition','','The actual appearance or status of a part or component.','combo-box','M-DNAA V7.0 A4.9'),(245,'aircraft-information','Engine Model (Manufacturer)','','','combo-box','M-DNAA V7.0 A4.5'),(246,'aircraft-information','Maintenance Record Information: Log Page No','','','checkbox','M-DNAA V7.0 A4.12'),(247,'aircraft-information','Maintenance Record Information: NRR','','A Non-Routine Repair (NRR) report, or a Squawk is generated for each defect identifies during inspections and is added to the work pack of repairs required before the aircraft can complete its check.','text-field','M-DNAA V7.0 A4.12'),(248,'aircraft-information','Maintenance Record Information: Placards No','','','checkbox','M-DNAA V7.0 A4.12'),(249,'aircraft-information','Maintenance Record Information: Work Card(s) No','','Number specified on the instructions included on the document that provides the details of the required maintenance steps for repairing an aircraft system or component that leads to failure to correctly perform a task','checkbox','M-DNAA V7.0 A4.12'),(250,'aircraft-information','Serial No','','Internal number, for the use of the manufacturer to identify a particular aircraft within the same model.','text-field','M-DNAA V7.0 A4.8'),(251,'aircraft-information-detail','Category of Aircraft','','select one','combo-box','NTSB 6120-1'),(252,'aircraft-information-detail','Type of Airworthiness Certificate','','allow for multiple selections','checkbox','NTSB 6120-1'),(253,'aircraft-information-detail','Last Inspectio