ld','Operator'),(331,'aircraft-involved','Call Sign','','','text-field','Operator'),(332,'aircraft-involved','Type/Suffix','','','text-field','Operator'),(333,'aircraft-system/equipment-malfunction','Abnormal Engine Indications','','','checkbox','Operator'),(334,'aircraft-system/equipment-malfunction','Air Conditioning/Pressurization','','Indicates an occurrence associated with the Air Conditioning or Pressurization System (ATA/JASC code 21-**).','combo-box','Operator'),(335,'aircraft-system/equipment-malfunction','Aircraft System/Equipment Malfunction','http://www.faa.gov/library/manuals/aviation/risk_management/ss_handbook/media/app_a_1200.PDF','Issue associated with the inability of an aircraft system, subsystem, component, or part to perform its required function within specified limits, under specified conditions for a specified duration. A failure may result in an unsafe condition and / or act, i.e. a hazard; the termination of the ability of a system element to perform a required function; the lack of correct performance.','checkbox','DNAA'),(336,'aircraft-system/equipment-malfunction','Aircraft Vibration','','','checkbox','Operator'),(337,'aircraft-system/equipment-malfunction','APU Operations','','The Auxiliary Power Unit provides power for engine-starting and other systems while on the ground (ATA code 49-**)','combo-box','Operator'),(338,'aircraft-system/equipment-malfunction','Communication Equipment','','Failure of communications equipment, which includes ATC, Ground, PAX. Not restricted to flight deck communications. ATA code 23-**:','combo-box','Operator'),(339,'aircraft-system/equipment-malfunction','Compressor Stall','http://ecfr.gpoaccess.gov/cgi/t/text/text-idx?c=ecfr&sid=43d67d5e1e3a78768e6d4ec4741be468&rgn=div8&view=text&node=14:1.0.1.3.11.2.155.9&idno=14','Issues associated with a condition in gas turbine engines in an axial-flow compressor in which one or more stages of rotor blades fail to pass air smoothly to the succeeding stages. A stall condition is caused by a pressure ratio that is incompatible with the engine RPM. Compressor stall will be indicated by a rise in the exhaust temperature or RPM fluctuation, and if allowed to continue, may result in flameout and physical damage to the engine. (FAR Sec. 25.103 - Stall speed).','checkbox','Operator'),(340,'aircraft-system/equipment-malfunction','Configuration Warning','','','checkbox','Operator'),(341,'aircraft-system/equipment-malfunction','Deferred Items-MEL/CDL','http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/58CF936FD6E2A36186256959004E132E?OpenDocument&Highlight=125.201','Minimum Equipment List (MEL)/Configuration Deviation List (CDL) faults or defects found on an aircraft which do not need immediate action and can be deferred for repair at a later date. This deferred defect status is only given for a strictly limited period of time and rectification must take place before that time has elapsed. Refer to FAR 125.201: Inoperable instruments and equipment (http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/58CF936FD6E2A36186256959004E132E?OpenDocument&Highlight=125.201).','checkbox','DNAA'),(342,'aircraft-system/equipment-malfunction','Doors/Windows','','','combo-box','Operator'),(343,'aircraft-system/equipment-malfunction','EFIS/EICAS Failure','Failure of  the Electronic Flight Instrument System or the Engine Indicating and Crew Alert System.','','checkbox','UTRS'),(344,'aircraft-system/equipment-malfunction','Electrical System Failure','http://www.faa.gov/airports_airtraffic/air_traffic/publications/atpubs/aim/Chap7/aim0706.html#7-6-2','The operator of an aircraft shall immediately, and by the most expeditious means available, notify the nearest NTSB Field Office when an inflight failure of electrical systems which requires the sustained use of an emergency bus powered by a back-up source such as a battery, auxiliary power unit, or air-driven generator to retain flight control or essential instruments occurs. Refer to AIM Chapter 7-6-2. Aircraft Accident and Incident Reporting (http://www.faa.gov/airports_airtraffic/air_traffic/publications/atpubs/aim/Chap7/aim0706.html#7-6-2).','checkbox','Operator'),(345,'aircraft-system/equipment-malfunction','Engine EGT','http://www.faa.gov/library/manuals/aircraft/airplane_handbook/media/faa-h-8083-3a-7of7.pdf','Exhaust Gas Temperature provides a cockpit readout of the EGT of an aircraft\'s (piston) engine(s), enabling the pilot to lean the mixture for maximum fuel efficiency.','combo-box','Operator'),(346,'aircraft-system/equipment-malfunction','Engine EPR/N1/N2','http://www.faa.gov/library/manuals/aircraft/airplane_handbook/media/faa-h-8083-3a-7of7.pdf','Engine Pressure Ratio (EPR) is the ratio of turbine discharge pressure divided by the compressor inlet pressure that is used as an indication of the amount of thrust being developed by a turbine engine. N1 on a turboprop is the gas produced speed. N1 on a turbofan or turbojet engine is the fan speed or low pressure spool speed. N2 is the high pressure spool speed on engine with 2 spools and medium pressure spool on engines with 3 spools with N3 being the high pressure spool.','combo-box','Operator'),(347,'aircraft-system/equipment-malfunction','Engine Failure/Flameout','http://www.faa.gov/airports_airtraffic/air_traffic/publications/atpubs/aim/Chap7/aim0706.html#7-6-2','The operator of an aircraft shall immediately, and by the most expeditious means available, notify the nearest NTSB Field Office when a failure of structural components of a turbine engine excluding compressor and turbine blades and vane occurs. Refer to AIM Chapter 7-6-2. Aircraft Accident and Incident Reporting (http://www.faa.gov/airports_airtraffic/air_traffic/publications/atpubs/aim/Chap7/aim0706.html#7-6-2).','combo-box','Operator'),(348,'aircraft-system/equipment-malfunction','Engine Fire/Overheat','http://www.faa.gov/airports_airtraffic/air_traffic/publications/atpubs/aim/Chap7/aim0706.html#7-6-2','The operator of an aircraft shall immediately, and by the most expeditious means available, notify the nearest NTSB Field Office when an inflight fire occurs. Refer to AIM Chapter 7-6-2. Aircraft Accident and Incident Reporting (http://www.faa.gov/airports_airtraffic/air_traffic/publications/atpubs/aim/Chap7/aim0706.html#7-6-2).','combo-box','Operator'),(349,'aircraft-system/equipment-malfunction','Engine Oil/Pressure/Temperature/Quantity','','','combo-box','Operator'),(350,'aircraft-system/equipment-malfunction','Engine Shutdown','http://66.89.54.147/Documents/PhaseofFlightDefinitions.pdf','http://66.89.54.147/Documents/PhaseofFlightDefinitions.pdf','combo-box','Operator'),(351,'aircraft-system/equipment-malfunction','Engine Vibration','','','combo-box','Operator'),(352,'aircraft-system/equipment-malfunction','Equipment Malfunction','','','text-field','Operator'),(353,'aircraft-system/equipment-malfunction','Equipment Malfunction Type','','','combo-box','Operator'),(354,'aircraft-system/equipment-malfunction','Equipment Problem Dissipated','','','checkbox','ASRS'),(355,'aircraft-system/equipment-malfunction','Fire Warning System Alert/Malfunction','','','checkbox','USAF'),(356,'aircraft-system/equipment-malfunction','First Time or Repeated','','Indicates where malfunction is the first known failure of equipment to operate correctly or equipment fails again and again to operate correctly, despite check by maintenance personnel.','combo-box','DNAA'),(357,'aircraft-system/equipment-malfunction','Flight Controls/Computers','http://virtualskies.arc.nasa.gov/glossary/C.html','Failures of primary and secondary flight controls. ATA code 27-**. The aircraft operator shall immediately, and by the most expeditious means available, notify the nearest NTSB Field Office when a flight control system malfunction or failure occurs. Refer to AIM Chapter 7-6-2. Aircraft Accident and Incident Reporting (http://www.faa.gov/airports_airtraffic/air_traffic/publications/atpubs/aim/Chap7/aim0706.html#7-6-2).','combo-box','Operator'),(358,'aircraft-system/equipment-malfunction','Flight Instruments-AS/ADI/HIS','','','combo-box','Operator'),(359,'aircraft-system/equipment-malfunction','Fuel System Malfuntion','','','checkbox','USAF'),(360,'aircraft-system/equipment-malfunction','Hydraulic Fluid-Quantity/PSI','','','checkbox','Operator'),(361,'aircraft-system/equipment-malfunction','Hydraulic System','http://www.faa.gov/library/manuals/aircraft/airplane_handbook/media/faa-h-8083-3a-7of7.pdf','Issues associated with the transmission of power by incompressible fluids under pressure and hydraulic System components. ATA code 29-**','combo-box','Operator'),(362,'aircraft-system/equipment-malfunction','In-flight Hoist Malfunction','','','checkbox','USAF'),(363,'aircraft-system/equipment-malfunction','Landing Gear/Tires/Brakes','http://virtualskies.arc.nasa.gov/glossary/L.html','Landing Gear-The collection of devices including wheels, skis, and floats that enable a flight vehicle to land and move about on land, water or other surfaces and supports the weight of the aircraft when it lands. The landing gear is often retractable - it can be pulled into the fuselage of the aircraft to reduce drag during flight. Another word for undercarriage.','combo-box','Operator'),(364,'aircraft-system/equipment-malfunction','Loss of Power/Thrust','http://www.faa.gov/airports_airtraffic/air_traffic/publications/atpubs/aim/Chap7/aim0706.html#7-6-2','The operator of an aircraft shall immediately, and by the most expeditious means available, notify the nearest NTSB Field Office when a sustained loss of the power or thrust produced by two or more engines occurs. Refer to AIM Chapter 7-6-2. Aircraft Accident and Incident Reporting (http://www.faa.gov/airports_airtraffic/air_traffic/publications/atpubs/aim/Chap7/aim0706.html#7-6-2).','checkbox','Operator'),(365,'aircraft-system/equipment-malfunction','Navigation Equipment/Radar','','Failure of any equipment on the aircraft used for navigation. ATA code 34-** Example: Inaccurate FMS Database due to due to lack of updates by company personnel.','combo-box','Operator'),(366,'aircraft-system/equipment-malfunction','Other Aircraft System/Equipment Malfunction','','Description of additional factor(s), not listed, associated with tbe failure of additional aircraft systems/equipment to operate in the normal or usual manner or any anomaly which results in system deviation.','text-field','DNAA'),(367,'aircraft-system/equipment-malfunction','Oxygen/Safety Equipment','','','combo-box','Operator'),(368,'aircraft-system/equipment-malfunction','Pitch Instability','','','checkbox','DNAA'),(369,'aircraft-system/equipment-malfunction','Stall Warning/Stick Shaker','','','checkbox','Operator'),(370,'aircraft-system/equipment-malfunction','Uncommanded Control Inputs','','','checkbox','DNAA'),(371,'aircraft-system/equipment-malfunction','Unresponsive Controls','','','checkbox','DNAA'),(372,'aircraft-system/equipment-malfunction','Windshield','http://www.faa.gov/library/manuals/aircraft/airplane_handbook/media/faa-h-8083-3a-7of7.pdf','Issues associated with deficiencies in the windshield as: Cracked: Partial separation of material; Crazing: small fractures in aircraft windshields and windows caused from being exposed to the ultraviolet rays of the sun and temperature extremes; Failure: mechanical malfunction; Hazed: Milky appearance or fogged (not by moisture); overheated; Heat Damage: caused by environmental heat (summer); Leak: caused by the release of any substance as a result of a technical defect including fuel, oil, water, gas, hydraulic fluid or dangerous goods; Scratched: light narrow, shallow mark or marks caused by movement of a sharp object or particle across a surface, the material is displaced, not removed.; Shattered: splintered or fragmented condition.','combo-box','Operator'),(373,'airline-operations-complications','Airline Operations Factors','','Occurrences and issues associated with airline specific factors that affect all the employees at the airline such as crew qualifications, scheduling, manuals, procedures, etc.','checkbox','DNAA'),(374,'airline-operations-complications','Crew Notification','','Issues where crew scheduling didn\'t notify the crew in a timely manner.)','checkbox','Operator'),(375,'airline-operations-complications','Crew Scheduling Event-Late Arriving Crew or Aircraft','','','checkbox','DNAA'),(376,'airline-operations-complications','Inaccurate, Confusing or New Flight Plan, NOTAMs or Logbook','','Issues associated with Flight Plans, NOTAMS, or Logbooks being incorrect, not realistic with day-to-day operations, or provides information or guidance that is difficult to understand or follow.','checkbox','DNAA'),(377,'airline-operations-complications','Inaccurate, Confusing or New Manuals/Procedure/SOP','','Issues associated with Manuals, Procedures, and SOPS being incorrect, not realistic with day-to-day operations, or provides information or guidance that is difficult to understand or follow.','checkbox','DNAA'),(378,'airline-operations-complications','Inaccurate, Confusing or New MEL Procedure','','Issues associated with new MEL procedures being incorrect, not realistic with day-to-day operations, or provides information or guidance that is difficult to understand or follow.','checkbox','DNAA'),(379,'airline-operations-complications','New or Unfamiliar Airport','','','checkbox','DNAA'),(380,'airline-operations-complications','Other Airline Operations Factors','','Description of additional factor(s), not listed, associated with the airline operations factor incident or event.','text-field','DNAA'),(381,'air-medical-crew-employee-information','Consecutive Days on Duty','','','integer-field','UTRS'),(382,'air-medical-crew-employee-information','Duty Off Time','','','date-time-field','Operator'),(383,'air-medical-crew-employee-information','Duty On Time','','','date-time-field','Operator'),(384,'air-medical-crew-employee-information','Experience in Current Position (Years)','','Specifies the total number of years of experience for the technician employee in the current position.','real-field','UTRS'),(385,'air-medical-crew-employee-information','Experience (Total Years)','','Specifies the total number of years of experience for the technician employee in years.','real-field','UTRS'),(386,'air-medical-crew-employee-information','Position','','','combo-box','UTRS'),(387,'air-medical-crew-employee-information','Primary Duties During Time of Event','','','combo-box','DAWG'),(388,'air-medical-crew-employee-information','Submitter\'s Department','','','combo-box','UTRS'),(389,'airport-facility-issues','Airport Complexity','','Wrong runway risk factor in which the complexity of an airport layout includes factors such as a high traffic volume, requiring an airplane to cross multiple runways to reach the departure runway, and complicated taxi instructions that involve the use of several taxiways.','checkbox','Operator'),(390,'airport-facility-issues','Airport Facility Issue Notes','','Used to supplement airport facility issue tax_attributes','memo-field','UTRS'),(391,'airport-facility-issues','Airport Facility Issues','http://66.89.54.147/Documents/CICTTOccurrenceCategoryDefinitions.pdf','Occurrences and issues involving airport design, service, or functionality issues.','checkbox','DNAA'),(392,'airport-facility-issues','Airport/NAVAID Equipment Failure','','','checkbox','Operator'),(393,'airport-facility-issues','Approach/Landing System','','Ground equipment for visual and instrument approaches including automatic landings under All Weather Ops conditions. Example: Failure of the Approach or landing systems at the airport.','checkbox','UTRS'),(395,'airport-facility-issues','Building/Structures/Surfaces Conditions','','','checkbox','DNAA'),(396,'airport-facility-issues','Call for Release','http://www.faa.gov/airports_airtraffic/air_traffic/publications/atpubs/PCG/C.HTM','Call For Release (CFR)-Wherein the overlying Air Route Traffic Control Center (ARTCC) requires a terminal facility to initiate verbal coordination to secure ARTCC approval for release of a departure into the en route environment.','checkbox','Operator'),(397,'airport-facility-issues','Close Proximity of Multiple Runway Thresholds','','Wrong runway risk factor in which the analysis of the wrong runway events revealed that they usually took place in areas with multiple runway thresholds in close proximity. In some cases, multiple runway ends are in the same location.','checkbox','Operator'),(398,'airport-facility-issues','Construction','','','checkbox','ASRS'),(399,'airport-facility-issues','Design','','','checkbox','ASRS'),(400,'airport-facility-issues','Emergency Services','','Fixed and mobile equipment and services for operation under emergency situation.','checkbox','UTRS'),(401,'airport-facility-issues','Gate Layout','','The location of and or separation of gates (a controlled entrance or exit for aircraft passengers or cargo at an airport), clearance areas, etc.','checkbox','DNAA'),(402,'airport-facility-issues','Groundskeeping','','','checkbox','ASRS'),(403,'airport-facility-issues','Ground/Satellite Malfunction','','Failure of the ground/satellite at a facility to operate in the normal or usual manner or any anomaly which results in system deviation.','checkbox','DNAA'),(404,'airport-facility-issues','High Terrain in Proximity to Airport','','','checkbox','DNAA'),(405,'airport-facility-issues','Inaccurate/Confusing Airport Diagram','','Issues associated with airport diagrams being incorrect, not realistic with day-to-day operations, or provides information or guidance that is difficult to understand or follow.','checkbox','DNAA'),(406,'airport-facility-issues','Inaccurate/Confusing Approach Plate','','Issues associated with approach plates being incorrect, not realistic with day-to-day operations, or provides information or guidance that is difficult to understand or follow.','checkbox','DNAA'),(407,'airport-facility-issues','Inaccurate/Confusing Enroute Charts','','Issues associated with enroute charts being incorrect, not realistic with day-to-day operations, or provides information or guidance that is difficult to understand or follow.','checkbox','DNAA'),(408,'airport-facility-issues','Joint Use Runway/Taxiway','','Wrong runway risk factor in which the wrong runway events, identified pilots. had a tendency to depart on the runway that they were taxiing on instead of turning onto the correct runway when a takeoff clearance was issued.','checkbox','Operator'),(409,'airport-facility-issues','Lighting/Illumination','http://www.faa.gov/airports_airtraffic/air_traffic/publications/atpubs/PCG/A.HTM','Various lighting aids that may be installed on an airport.','checkbox','Operator'),(410,'airport-facility-issues','Markings/Signage','','Structures, markings signs, and lights for aircraft guidance on the ground.','checkbox','Operator'),(411,'airport-facility-issues','More than 2 Taxiways Intersecting in One Area','','Wrong runway risk factor in which these areas often confuse pilots and present the opportunity to turn in an incorrect direction.','checkbox','Operator'),(412,'airport-facility-issues','Noise Abatement Issues','http://www.faa.gov/ats/nar/mase/ApxA_Glossary_122805.pdf','Issues associated with the approach and take-off procedures to reduce the impact of ambient noise on persons on the ground or near an airport. Procedures developed by airport operators in cooperation with the FAA, and local community officials, to mitigate aircraft noise near airports.','checkbox','DNAA'),(413,'airport-facility-issues','NOTAMs','http://www.faa.gov/airports_airtraffic/airports/resources/advisory_circulars/media/150-5200-28C/150_5200_28c.pdf','Notices to Airmen (NOTAM) ? a notice containing information (not known sufficiently in advance to publicize by other means) concerning the establishment, condition, or change in any component (facility, service, or procedure) of, or hazard in, the National Airspace System (NAS); the timely knowledge of which is essential to personnel concerned with flight operations.Refer to AC 150/5200-28C: Notices to Airmen (NOTAMS (http://www.faa.gov/airports_airtraffic/airports/resources/advisory_circulars/media/150-5200-28C/150_5200_28c.pdf).','checkbox','UTRS'),(414,'airport-facility-issues','One Taxiway Leading to Multiple Runway Thresholds','','Wrong runway risk factor in which these areas present an opportunity for flight crew members to taxi the airplane onto the wrong runway. This is especially true when the airplane have to cross one or more runways on the same taxiway.','checkbox','Operator'),(415,'airport-facility-issues','Other Airport Facility Issues','','Description of additional factor(s), not listed, associated with issues associated with the airport facility.','text-field','DNAA'),(416,'airport-facility-issues','Runway/Taxiway','http://www.faa.gov/library/manuals/aviation/instrument_procedures_handbook/media/AppendixD1.pdf','Runway-a defined rectangular area on a land airport prepared for the landing and takeoff run of aircraft along its length. Taxiway-the paved airport surfaces which allow aircraft to travel between runways and other airport locations such as the hangars or terminals.','combo-box','UTRS'),(417,'airport-facility-issues','Short Runway (< 5,000 feet)','','Wrong runway risk factor in which wrong runway departures typically result in the airplane taking off without conflict because there is sufficient runway available. Part 139 Class I airports with runways less then 5,000 feet were identified to point out potential situations where the runway is too short for a large air carrier jet to safely takeoff.','checkbox','Operator'),(418,'airport-facility-issues','Short Taxi Distance','','Wrong runway risk factor in which a short distance between the terminal and the runway requires pilots to complete the same number of checklist items in a shorter time frame and can lead to flight crew rushing to complete their checklists or expedite their departure.','checkbox','Operator'),(419,'airport-facility-issues','Single Runway','','Wrong runway risk factor in which airports with a single runway layout present the opportunity for airplane to taking off in the wrong direction, especially when intersection departures are made.','checkbox','Operator'),(420,'airport-facility-issues','Snow Removal','','','checkbox','ASRS'),(421,'airport-facility-issues','Special Airport Procedures','','','checkbox','DNAA'),(422,'airport-facility-issues','Visual Illusions at Takeoff or Landing','http://www.faa.gov/airports_airtraffic/air_traffic/publications/atpubs/aim/Chap8/aim0801.html','Various surface features and atmospheric conditions that can create illusions of incorrect height above and distance from the runway threshold. Refer to AIM Section 8-1-5b(3): Illusions Leading to Landing Errors (http://www.faa.gov/airports_airtraffic/air_traffic/publications/atpubs/aim/Chap8/aim0801.html).','checkbox','DNAA'),(424,'airspace-deviation','Airspace Violation','','','combo-box','ASRS'),(425,'airspace-deviation','Military Operations Area','http://www.airweb.faa.gov/Regulatory_and_Guidance_Library%5CrgFAR.nsf/0/7B29C0FFCE0C430A86256EDF00478339?OpenDocument','A military operations area (MOA) is airspace established outside Class A airspace to separate or segregate certain nonhazardous military activities from IFR Traffic and to identify for VFR traffic where these activities are conducted.','checkbox','DNAA'),(426,'airspace-deviation','Other Airspace Deviation','http://www.faa.gov/airports_airtraffic/air_traffic/publications/atpubs/PCG/A.HTM','Description of additional factor(s), not listed, involving divergences from the provisions of a visual flight rules (VFR) or instrument flight rules (IFR) air traffic clearance.','text-field','DNAA'),(427,'airspace-deviation','Restricted Airspace','http://www.faa.gov/airports_airtraffic/air_traffic/publications/atpubs/PCG/R.HTM','An airspace of defined dimensions, above the land areas or territorial waters of a State, within which the flight of aircraft is restricted in accordance with certain specified conditions.','checkbox','DNAA'),(428,'airspace-deviation','RVSM','http://www.faa.gov/ats/ato/rvsm1.htm','Reduced Vertical Separation Minimums (RVSM) is the airspace where Air Traffic Control separates aircraft by a minimum of 1,000 feet vertically between flight level (FL) 290 and FL 410 inclusive. RVSM airspace is special qualification airspace; the operator and the aircraft used by the operator must be approved by the Administrator. Air traffic control notifies operators of RVSM by providing route planning information. Refer to AIM Section 6. Operational Policy/Procedures for Reduced Vertical Separation Minimum (RVSM) in the Domestic U.S., Alaska, Offshore Airspace and the San Juan FIR (http://www.faa.gov/airports_airtraffic/air_traffic/publications/atpubs/aim/Chap4/aim0406.html).','checkbox','DNAA'),(429,'airspace-deviation','Warning Area','http://www.airweb.faa.gov/Regulatory_and_Guidance_Library%5CrgFAR.nsf/0/7B29C0FFCE0C430A86256EDF00478339?OpenDocument','A warning area is airspace of defined dimensions, extending from 3 nautical miles outward from the coast of the United States, that contains activity that may be hazardous to nonparticipating aircraft. The purpose of such warning areas is to warn nonparticipating pilots of the potential danger. A warning area may be located over domestic or international waters or both.','checkbox','DNAA'),(430,'airworthiness/documentation-event','Aircraft Manuals/Checklists Missing','http://www.airweb.faa.gov/Regulatory_and_Guidance_Library%5CrgFAR.nsf/0/5A7D9BBEC7F6249C852566EF006AE42E?OpenDocument','Occurrences associated any of the written material for the operation of the flight including the FOM, aircraft manuals, MEL, checklist placards, and the Quick Reference Handbook (QRH) to fulfill the requirements specified in FAR Sec 121.137 (Distribution and Availability) and FAR Sec 121.141 (http://www.airweb.faa.gov/Regulatory_and_Guidance_Library%5CrgFAR.nsf/0/92C0A5E206F6E565852566EF006AE70A?OpenDocument) to carry the applicable aircraft manuals specified in FAR Sec 121.133 (http://www.airweb.faa.gov/Regulatory_and_Guidance_Library%5CrgFAR.nsf/0/179F1A91CC78182F852566EF006AE171?OpenDocument) that supply guidance of flight, ground operations, and management personnel in conducting its operations.','checkbox','Operator'),(432,'airworthiness/documentation-event','Airworthiness/Documentation Event','http://www.faa.gov/library/manuals/aircraft/airplane_handbook/media/faa-h-8083-3a-7of7.pdf','Airworthiness/Documentation Event: Occurrences and issues involving the condition in which the aircraft conforms to its type certificated design including supplemental type certificates and field approved alterations. The aircraft must also be in a condition for safe flight as determined by annual, 100 hour, preflight, and any other required inspections. Also, issues associated official company paperwork or documents used to record flight specific information, e.g., Flight Release, Weather Package, Weight and Balance Form.','checkbox','DNAA'),(433,'airworthiness/documentation-event','Departed without Logbook or Wrong Logbook','','','checkbox','DNAA'),(434,'airworthiness/documentation-event','Departed with Wrong or Missing Dispatch/Flight Release','http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/71F65AFDE4568E12852566EF006DF4F3?OpenDocument&Highlight=121.687','The aircraft took off with incorrect or unavailable paperwork by which an air carrier ensures all activities required for safe dispatch and continuation of a flight to its destination. Refer to Sec. 121.689 (http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/71F65AFDE4568E12852566EF006DF4F3?OpenDocument&Highlight=121.687).','checkbox','DNAA'),(435,'airworthiness/documentation-event','Departed with Wrong or Missing Maintenance Release','','','checkbox','DNAA'),(436,'airworthiness/documentation-event','Flew Wrong Aircraft','','Flew aircraft with different tail number then on release.','checkbox','UTRS'),(437,'airworthiness/documentation-event','Incorrect/Missing Aircraft Documents','','','checkbox','Operator'),(438,'airworthiness/documentation-event','Logbook/CML-Entry Incomplete','http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/B27A93B74434C071852566EF006DF972?OpenDocument&Highlight=121.695','Official record used to document maintenance activity and airworthiness status on an aircraft. Example: Significant error by company personnel in the preparation, or the handling of the aircraft\'s maintenance logbook.','checkbox','Operator'),(439,'airworthiness/documentation-event','Logbook Item Open or Not Closed Correctly','','Significant error by company personnel in the preparation, or the handling of the aircraft\'s maintenance logbook.','checkbox','DNAA'),(440,'airworthiness/documentation-event','Maintenance Inspection Not Completed','','','checkbox','DNAA'),(441,'airworthiness/documentation-event','Maintenance Testing','http://www.faa.gov/library/manuals/aviation/risk_management/ss_handbook/media/app_a_1200.PDF','Issues associated with maintenance operating an aircraft system, subsystem, component, or part under specified conditions, observing or recording the results, and making an evaluation of some aspect of the system.','checkbox','ASRS'),(442,'airworthiness/documentation-event','Medical/Pilot Certificate','','','checkbox','Operator'),(443,'airworthiness/documentation-event','MEL','http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/58CF936FD6E2A36186256959004E132E?OpenDocument&Highlight=125.201','Airworthiness issues associated official company paperwork or documents used to record flight specific information, e.g., Flight Release, Weather Package, Weight and Balance Form. Minimum Equipment List (MEL)/Configuration Deviation List (CDL) faults or defects found on an aircraft which do not need immediate action and can be deferred for repair at a later date. This deferred defect status is only given for a strictly limited period of time and rectification must take place before that time has elapsed. Refer to FAR 125.201: Inoperable instruments and equipment (http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/58CF936FD6E2A36186256959004E132E?OpenDocument&Highlight=125.201).','checkbox','DNAA'),(444,'airworthiness/documentation-event','MEL/CDL-Incorrect Application','http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/58CF936FD6E2A36186256959004E132E?OpenDocument&Highlight=125.201','Ambiguity, erroneous, or lack of written description for the use of policies, processes, procedures, objectives, requirements, authorities, responsibilities, or work instructions related t Minimum Equipment List (MEL)/Configuration Deviation List (CDL) Refer to FAR 125.201: Inoperable instruments and equipment (http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/58CF936FD6E2A36186256959004E132E?OpenDocument&Highlight=125.201).','checkbox','DNAA'),(445,'airworthiness/documentation-event','MEL-Non Compliance','http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgAdvisoryCircular.nsf/0/6485143d5ec81aae8625719b0055c9e5/$FILE/AC%20120-92.pdf','Indicates non fulfillment of Minimum Equipment List (MEL) requirements, including noncompliance with Federal regulations, company requirements, operator developed risk controls, and/or operator specified policies and procedures. Refer to AC 120-92: Introduction to Safety Management Systems for Air Operators) (http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgAdvisoryCircular.nsf/0/6485143d5ec81aae8625719b0055c9e5/$FILE/AC%20120-92.pdf).','checkbox','DNAA'),(446,'airworthiness/documentation-event','Other Airworthiness/Documentation Event','','Description of additional factor(s), not listed, involving the official company paperwork or documents used to record flight specific information, e.g., Flight Release, Weather Package, Weight and Balance Form.','text-field','DNAA'),(447,'airworthiness/documentation-event','Preflight Not Completed or Incorrect','','','checkbox','DNAA'),(448,'airworthiness/documentation-event','Preflight/Postflight Inspection Inadequate','http://www.faa.gov/library/manuals/aviation/pilot_handbook/media/faa-h-8083-25-2of4.pdf','Deficiencies in the preflight or post flight inspection by which a pilot determines if the aircraft is airworthy and in condition for safe operation.','checkbox','Operator'),(449,'airworthiness/documentation-event','Weight and Balance Documentation Issue','http://www.faa.gov/library/manuals/aviation/pilot_handbook/media/faa-h-8083-25-1of4.pdf','Issues associated with the form completed by pilots determining the weight and balance of the aircraft and its load.','checkbox','DNAA'),(450,'altitude-deviation','Aircraft at Improper Altitude','http://www.airweb.faa.gov/Regulatory_and_Guidance_Library%5CrgFAR.nsf/0/78096E016AFA36F8852566CF006150B1?OpenDocument','Except when necessary for takeoff or landing, no person may operate an aircraft below the following altitudes: (a) Anywhere. An altitude allowing, if a power unit fails, an emergency landing without undue hazard to persons or property on the surface; (b) Over congested areas. Over any congested area of a city, town, or settlement, or over any open air assembly of persons, an altitude of 1,000 feet above the highest obstacle within a horizontal radius of 2,000 feet of the aircraft; (c) Over other than congested areas. An altitude of 500 feet above the surface, except over open water or sparsely populated areas. In those cases, the aircraft may not be operated closer than 500 feet to any person, vessel, vehicle, or structure. Refer to FAR 91.119: Minimum Safe Altitudes (http://www.airweb.faa.gov/Regulatory_and_Guidance_Library%5CrgFAR.nsf/0/78096E016AFA36F8852566CF006150B1?OpenDocument).','checkbox','DNAA'),(451,'altitude-deviation','Altitude (Ft) MSL','http://www.faa.gov/airports_airtraffic/air_traffic/publications/atpubs/PCG/A.HTM','Specification of the height of a level, point, or object measured in feet Above Ground Level (AGL) at which the deviation occurred.','integer-field','ASRS'),(452,'altitude-deviation','Altitude Deviation','http://www.faa.gov/airports_airtraffic/air_traffic/publications/atpubs/PCG/A.HTM','Divergences of an aircraft from assigned flight level/altitude by 300 feet or more as observed on a verified (reading correctly) automatic altitude readout (Mode C).','checkbox','DNAA'),(453,'altitude-deviation','Amount of Altitude Deviation (Ft)','http://www.faa.gov/airports_airtraffic/air_traffic/publications/atpubs/PCG/A.HTM','The amount of the divergence (in feet) of an aircraft from the assigned flight level/altitude by 300 feet or more as observed on a verified (reading correctly) automatic altitude readout (Mode C).','integer-field','UTRS'),(454,'altitude-deviation','Altitude Deviation Misread','','','checkbox','Operator'),(455,'altitude-deviation','Assigned Crossing Restriction (ft)','','','integer-field','Operator'),(456,'altitude-deviation','Assigned Flight Level (FL)','http://www.airweb.faa.gov/Regulatory_and_Guidance_Library%5CrgFAR.nsf/0/7B29C0FFCE0C430A86256EDF00478339?OpenDocument','The aircraft flight level at the time of the occurrence. A level of constant atmospheric pressure related to a reference datum of 29.92 inches of mercury. Each is stated in three digits that represent hundreds of feet. For example, flight level 250 represents a barometric altimeter indication of 25,000 feet; flight level 255, an indication of 25,500 feet.','integer-field','UTRS'),(457,'altitude-deviation','Crossing Restriction Not Met','','Issues associated with compliancy with the point at which an aircraft should be at a certain lateral location and altitude','checkbox','DNAA'),(458,'altitude-deviation','Excursion From Assigned Altitude','http://human-factors.arc.nasa.gov/IHpersonnel/ev/AltDevTM/AltDevTM.html','An altitude deviation in which the aircraft levels off at the assigned altitude but later deviates from the assigned altitude without clearance.','checkbox','DNAA'),(459,'altitude-deviation','Incorrect Altimeter Setting','','','checkbox','Operator'),(460,'altitude-deviation','Missed Top of Descent/Missed Next Descent Point','','Crew did not start descent at proper point.','checkbox','UTRS'),(461,'altitude-deviation','Other Altitude Deviation','','Description of additional factor(s), not listed, associated with the altitude deviation incident or event.','text-field','DNAA'),(462,'altitude-deviation','Overshoot','http://rgl.faa.gov/Regulatory_and_Guidance_Library/rgAdvisoryCircular.nsf/0/b173ba8a295764f086256cde006a44ad/$FILE/AC120-71A.pdf','An altitude deviation in which the aircraft levels off after reaching the assigned altitude. Normal bracketing corrections occasionally involve momentary overshoots made necessary by atmospheric conditions. Such overshoots are acceptable. Frequent or sustained overshoots caused by poor pilot technique are not normal bracketing corrections. Refer to AC 120-71A: Standard Operating Procedures for Flight Deck Crewmembers (http://rgl.faa.gov/Regulatory_and_Guidance_Library/rgAdvisoryCircular.nsf/0/b173ba8a295764f086256cde006a44ad/$FILE/AC120-71A.pdf).','checkbox','DNAA'),(463,'altitude-deviation','Transition Altitude (29.92)','','','checkbox','Operator'),(464,'altitude-deviation','Undershoot','http://human-factors.arc.nasa.gov/IHpersonnel/ev/AltDevTM/AltDevTM.html','An altitude deviation in which the aircraft levels off before reaching the assigned altitude.','checkbox','DNAA'),(465,'analyst-asap-processing','Accepted into ASAP','','Was this report accepted into ASAP?','combo-box','UTRS'),(466,'analyst-asap-processing','Anticipated Effort Code','','Anticipated Effort Code','combo-box','UTRS'),(467,'analyst-asap-processing','Air Carrier','','','combo-box','UTRS'),(468,'analyst-asap-processing','Analyst','