rn entry, or 1000 feet above the runway elevation, to the beginning of the landing flare.','checkbox','DNAA'),(695,'approach/arrival-event','Incorrect Approach to Uncontrolled Airport','','','checkbox','DNAA'),(696,'approach/arrival-event','Misconfiguration','','','checkbox','DNAA'),(697,'approach/arrival-event','Other Approach/Arrival Events','','Description of additional factor(s), not listed, associated with approach and arrival incident or event.','text-field','DNAA'),(698,'approach/arrival-event','Overshoot','http://human-factors.arc.nasa.gov/IHpersonnel/ev/AltDevTM/AltDevTM.html','An altitude deviation in which the aircraft levels off after reaching the assigned altitude.','checkbox','DNAA'),(699,'approach/arrival-event','Undershoot','http://human-factors.arc.nasa.gov/IHpersonnel/ev/AltDevTM/AltDevTM.html','An altitude deviation in which the aircraft levels off before reaching the assigned altitude.','checkbox','DNAA'),(700,'approach/arrival-event','Unstable Approach','http://www.faa.gov/library/manuals/aircraft/airplane_handbook/media/faa-h-8083-3a-7of7.pdf','An approach that is not in accordance with the definition of a stabilized approach, that is characterized by a constant-angle, constant-rate of descent approach profile ending near the touchdown point, where the landing maneuver begins. All appropriate briefings and checklists should be accomplished before 1000? height above touchdown (HAT) in instrument meteorological conditions (IMC), and before 500? HAT in visual meteorological conditions (VMC). Flight should be stabilized by 1000? HAT in IMC, and by 500? HAT in VMC. \n\nAn approach is stabilized when all of the following criteria are maintained from 1000 HAT (or 500 HAT in VMC) to landing in the touchdown zone: (1) The airplane is on the correct track; (2) The airplane is in the proper landing configuration; (3) After glide path intercept, or after the final approach fix (FAF), or after the derived fly-off point (per Jeppesen) the pilot flying requires no more than normal bracketing corrections to maintain the correct track and desired profile (3? descent angle, nominal) to landing within the touchdown zone. Level-off below 1000? HAT is not recommended; (4) The airplane speed is within the acceptable range specified in the approved operating manual used by the pilot; (5) The rate of descent is no greater than 1000 feet per minute (fpm): (a) If an expected rate of descent greater than 1000 fpm is planned, a special approach briefing should be performed. (b) If an unexpected, sustained rate of descent greater than 1000 fpm is encountered during the approach, a missed approach should be performed. A second approach may be attempted after a special approach briefing, if conditions permit; (6) Power setting is appropriate for the landing configuration selected, and is within the permissible power range for approach specified in the approved operating manual used by the pilot. Refer to AC 120-71A: Standard Operating Procedures for Flight Deck Crewmembers (http://rgl.faa.gov/Regulatory_and_Guidance_Library/rgAdvisoryCircular.nsf/0/b173ba8a295764f086256cde006a44ad/$FILE/AC120-71A.pdf).','checkbox','DNAA'),(701,'approach/arrival-event','Wrong Airport','','Aircraft approaches and/or lands at the wrong airport.','checkbox','DNAA'),(702,'approach/arrival-event','Wrong Arrival/STAR','','','checkbox','DNAA'),(703,'approach/arrival-event','Wrong Runway','','Aircraft approaches and/or lands at the wrong runway at an airport.','checkbox','DNAA'),(704,'arrival-location','Arrival Location','combo-box','','combo-box','Operator'),(705,'asrs','Cleared for Submission','','','combo-box','UTRS'),(706,'asrs','Cleared for Submission Date/Time','','','date-time-field','UTRS'),(707,'asrs','Completed','','','combo-box','UTRS'),(708,'asrs','Completed Date/Time','','','date-time-field','UTRS'),(709,'asrs','Mark Date/Time','','','date-time-field','UTRS'),(710,'asrs','Narrative','','','memo-field','UTRS'),(711,'asrs','Do you want to submit your report to NASA ASRS?','','','combo-box','UTRS'),(712,'asrs','Request Date/Time','','','date-time-field','UTRS'),(713,'ata-category-list','ATA Category','','','combo-box','Operator'),(714,'atc-complications/errors','ATC Complications/Errors','http://66.89.54.147/Documents/CICTTOccurrenceCategoryDefinitions.pdf','Issues associated with a human action (or human behavior) that unintentionally deviates from the expected action (or behavior) or fails to achieve what should be done related to interfaces with Air Traffic Control systems or ATC personnel duties/responsibilities, including clearances, communication, congestion, handling, wake turbulence.','checkbox','Operator'),(715,'atc-complications/errors','Handling Error','http://66.89.54.147/Documents/CICTTOccurrenceCategoryDefinitions.pdf','Issues associated with a human action (or human behavior) that unintentionally deviates from the expected action (or behavior) or fails to achieve what should be done related to ATC management or communication, navigation, or surveillance service issues, including ATC facility/personnel failure/degradation.','checkbox','DNAA'),(716,'atc-complications/errors','Air Traffic Congestion','','A condition that occurs when demand on air traffic exceeds the capacity of the system.','checkbox','Operator'),(717,'atc-complications/errors','Conflicting ATC Clearance','http://www.faa.gov/airports_airtraffic/air_traffic/publications/atpubs/PCG/C.HTM','The resolution of potential conflictions between aircraft that are radar identified and in communication with ATC by ensuring that radar targets do not touch. Pertinent traffic advisories shall be issued when this procedure is applied.','checkbox','Operator'),(718,'atc-complications/errors','Expected vs. Assigned ATC Clearance','','ATC clearance received was different than what was anticipated','checkbox','Operator'),(719,'atc-complications/errors','Frequency Change','','','checkbox','Operator'),(720,'atc-complications/errors','Frequency Congestion','','Heavy voice traffic on radio frequency','checkbox','Operator'),(721,'atc-complications/errors','Incorrect ATC Clearance','','Two or more ATC clearances that provided inaccurate guidance, instructions, or information regarding the same operation.','checkbox','Operator'),(722,'atc-complications/errors','Late ATC Clearance','','ATC did not provide guidance or information in a timely manner','checkbox','Operator'),(723,'atc-complications/errors','Lost Communication','http://www.faa.gov/airports_airtraffic/air_traffic/publications/atpubs/PCG/L.HTM','Loss of the ability to communicate by radio. Aircraft are sometimes referred to as NORDO (No Radio). Standard pilot procedures are specified in 14 CFR Part 91. Radar controllers issue procedures for pilots to follow in the event of lost communications during a radar approach when weather reports indicate that an aircraft will likely encounter IFR weather conditions during the approach.','checkbox','DNAA'),(724,'atc-complications/errors','Other ATC Complications/Errors','','Description of additional factor(s), not listed, associated with ATC complications and errors.','text-field','DNAA'),(725,'atc-complications/errors','Pre-Departure Clearance','http://www.faa.gov/airports_airtraffic/air_traffic/publications/atpubs/PCG/P.htm#PRE-DEPARTURE%20CLEARANCE','Pre-Departure Clearance (PDC)-An authorization by ATC for an aircraft to proceed under specified traffic conditions within controlled airspace. An application with the Terminal Data Link System (TDLS) that provides clearance information to subscribers, through a service provider, in text to the cockpit or gate printer.','checkbox','DNAA'),(726,'atc-complications/errors','Radio Congestion','','','checkbox','DNAA'),(727,'atc-complications/errors','Shift Change','','','checkbox','Operator'),(728,'atc-complications/errors','Similar Call Signs','','Events in which two or more call signs are confused because they sound very nearly alike when transmitted over a radio.','checkbox','DNAA'),(729,'atc-complications/errors','TCAS RA/TA','http://www.faa.gov/airports_airtraffic/air_traffic/publications/atpubs/ATC/Chp7/atc0702.html','Indicates whether a TCAS Resolution Advisory (RA) or TCAS Traffic Advisory (TA) was generated. A RA is an aural voice and display information provided by TCAS II to a flight crew, advising that a particular maneuver should, or should not, be performed to attain or maintain minimum safe vertical separation from an intruder (AC 20-151). A TA is an aural voice and display information from TCAS II to a flight crew, identifying the location of nearby traffic meeting certain minimum separation criteria. Refer to FAAO 7110.65 Section 2: Vertical Separation (http://www.faa.gov/airports_airtraffic/air_traffic/publications/atpubs/ATC/Chp7/atc0702.html)','checkbox','Operator'),(730,'atc-complications/errors','Unclear ATC Clearance','','Ambiguous ATC clearances and instructions containing altitude assignments or vector.','checkbox','Operator'),(731,'atc-complications/errors','Unpublished Restriction','','','checkbox','UTRS'),(732,'atc-complications/errors','Wake Turbulence','http://www.faa.gov/airports_airtraffic/air_traffic/publications/atpubs/PCG/W.HTM','Wingtip vortices that are created when an airplane generates lift. When an airplane generates lift, air spills over the wingtips from the high pressure areas below the wings to the low pressure areas above them. This flow causes rapidly rotating whirlpools of air called wingtip vortices or wake turbulence. The term includes vortices, thrust stream turbulence, jet blast, jet wash, propeller wash, and rotor wash both on the ground and in the air.','checkbox','ASRS'),(733,'atc-equipment','ATC Equipment','','Occurrences associated with the specific equipment used by ATC, such as Minimum Safe Altitude Warning (MSAW).','checkbox','ASRS'),(734,'atc-equipment','Conflict Alert','http://www.faa.gov/airports_airtraffic/air_traffic/publications/atpubs/PCG/C.HTM','A function of certain air tr