h scheduling issues.','text-field','Operator'),(1125,'ato-scheduling-issues','Sector','','','checkbox','Operator'),(1126,'ato-scheduling-issues','Sector Position Assistance','','The probability that required crewmembers will be operationally ready to perform their duties when called upon at any point in time.','checkbox','Operator'),(1127,'ato-scheduling-issues','Staff Shortage','','','checkbox','Operator'),(1128,'ato-scheduling-issues','Supervision','','','checkbox','Operator'),(1129,'ato-scheduling-issues','Transitioning To/From Combined to Decombined','','','checkbox','Operator'),(1130,'atos-elements','Authority','','A clearly identifiable, qualified, and knowledgeable person who has the authority to set up and change a process.','checkbox','UTRS'),(1131,'atos-elements','Controls','','Checks and restraints designed into a process to ensure a desired result.','checkbox','UTRS'),(1132,'atos-elements','Interfaces','','Interactions between processes that must be managed in order to ensure desired outcomes.','checkbox','UTRS'),(1133,'atos-elements','Other','','','text-field','UTRS'),(1134,'atos-elements','Policy','','An overall plan, principle, philosophy or','checkbox','UTRS'),(1135,'atos-elements','Procedures','','Documented methods to accomplish a process','checkbox','UTRS'),(1136,'atos-elements','Process Measures','','Measures used to Validate a process and identify problems or potential problems in order to correct them.','checkbox','UTRS'),(1137,'atos-elements','Responsibility','','A clearly identifiable, qualified, and knowledgeable person who is accountable for the quality of a process.','checkbox','UTRS'),(1138,'ato-separation-criteria','Horizontal(SM)','','','combo-box','Operator'),(1139,'ato-separation-criteria','Other Seperation Criteria','','','text-field','Operator'),(1140,'ato-separation-criteria','Vertical(FT)','','','integer-field','Operator'),(1141,'ato-separation-criteria','Visual','','','checkbox','Operator'),(1142,'ato-separation-criteria','Wake Turbulence','','','text-field','Operator'),(1143,'ato-surface-event','Excursion Event','','ID Associated with Source','checkbox','Operator'),(1144,'ato-surface-event','Incursion Event','','','checkbox','Operator'),(1145,'ato-surface-event','Other Surface Event','','','text-field','Operator'),(1146,'ato-technical-knowledge/skills','Configuration Knowledge','','','checkbox','Operator'),(1147,'ato-technical-knowledge/skills','Inadequate System Knowledge','','','checkbox','Operator'),(1148,'ato-technical-knowledge/skills','Inadequate Task Experience','','','checkbox','Operator'),(1149,'ato-technical-knowledge/skills','Inadequate Task Knowledge','','','checkbox','Operator'),(1150,'ato-technical-knowledge/skills','Inadequate Task Planning','','','checkbox','Operator'),(1151,'ato-technical-knowledge/skills','Other Technical Knowledge/Skills/Training','','Description of additional factor(s), not listed, associated with technical knowledge, skills, and training.','text-field','Operator'),(1152,'ato-technical-knowledge/skills','Inadequate Process Knowledge','','','checkbox','Operator'),(1153,'ato-technical-knowledge/skills','Inadequate Skills','http://www.faa.gov/library/manuals/aviation/pilot_handbook/media/faa-h-8083-25-4of4.pdf','Not having the appropriate procedural, psychomotor, and perceptual skills required for tasking. They are the abilities that are gained through conventional training, are perfected, and become almost automatic through experience.','checkbox','Operator'),(1154,'ato-technical-knowledge/skills','Technical Knowledge/Skills/Training','','','checkbox','Operator'),(1155,'ato-technical-knowledge/skills','Training Issues','','','combo-box','Operator'),(1156,'ato-technical-knowledge/skills','Training Situation','','','combo-box','Operator'),(1157,'ato-terrain-proximity','Airborne Conflict','','','combo-box','Operator'),(1158,'ato-terrain-proximity','ATC Low Altitude Warning','','','checkbox','Operator'),(1159,'ato-terrain-proximity','Below Minimum Altitude','','','checkbox','Operator'),(1160,'ato-terrain-proximity','GPWS Warning','','The type of warning that originate from the Ground Proximity Warning System (GPWS). Warnings are provided by the GPWS in the following circumstances: 1) excessive descent rate; 2) excessive terrain closure rate; 3) excessive altitude loss after take-off or go-around; 4) unsafe terrain clearance while not in landing configuration; a) gear not locked down; b) flaps not in a landing position; and 5) excessive descent below the instrument glide path.','checkbox','Operator'),(1161,'ato-terrain-proximity','Ground Conflict','','','checkbox','Operator'),(1162,'ato-terrain-proximity','Other Terrain Proximity Event','','Description of additional factor(s), not listed, associated with terrain proximity incidents or events.','text-field','Operator'),(1163,'ato-terrain-proximity','Terrain Proximity','http://www.airweb.faa.gov/Regulatory_and_Guidance_Library%5CrgFAR.nsf/0/465764AB441B0864862568C8006451A9?OpenDocument','Occurrences associated with potential terrain hazards such as excessive closure rate to terrain and/or insufficient terrain clearance, including GPSW warnings.','checkbox','Operator'),(1164,'ato-traffic-complexity','Arrival/Departure Flows','','','checkbox','Operator'),(1165,'ato-traffic-complexity','Emergency Situation','','','checkbox','Operator'),(1166,'ato-traffic-complexity','Flight Training/Student Pilots','','','checkbox','Operator'),(1167,'ato-traffic-complexity','Other Traffic Complexity','','','text-field','Operator'),(1168,'ato-traffic-complexity','Runway Configuration','','','checkbox','Operator'),(1169,'ato-traffic-complexity','Traffic Complexity','','','combo-box','Operator'),(1170,'ato-traffic-complexity','Traffic Management','','','checkbox','Operator'),(1171,'ato-traffic-complexity','Traffic Volume','','','checkbox','Operator'),(1172,'ato-traffic-complexity','Variety of Aircraft','','','checkbox','Operator'),(1173,'ato-traffic-complexity','Weather','','','checkbox','Operator'),(1174,'ato-traffic-management-initiatives-tools','Add Spacing Tools','','','checkbox','Operator'),(1175,'ato-traffic-management-initiatives-tools','Adjust Weather Restrictions','','','checkbox','Operator'),(1176,'ato-traffic-management-initiatives-tools','Other Traffic Management Initiatives','','','text-field','Operator'),(1177,'ato-traffic-management-initiatives-tools','Provide Earlier Speed Control','','','checkbox','Operator'),(1178,'ato-traffic-management-initiatives-tools','Restrict Traffic Densitiy','','','checkbox','Operator'),(1179,'ato-traffic-proximity','ATC Conflict','','','checkbox','Operator'),(1180,'ato-traffic-proximity','Closest Horizontal Proximity (Ft)','','Proximity at closest point horizontally in feet.','real-field','Operator'),(1181,'ato-traffic-proximity','Closest Vertical Proximity (Ft)','','Proximity at closest point vertically in feet.','real-field','Operator'),(1182,'ato-traffic-proximity','Complied with RA Command','','','checkbox','Operator'),(1183,'ato-traffic-proximity','Direction of Traffic (Horizontal) (Ft)','','','real-field','Operator'),(1184,'ato-traffic-proximity','Direction of Traffic (Vertical) (Ft)','','','real-field','Operator'),(1185,'ato-traffic-proximity','Took Evasive Action','http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgAdvisoryCircular.nsf/0/76056bd8e04b1cc086256fb0006a579b/$FILE/AC%2020-151.pdf','Indicates that the flight crew','checkbox','Operator'),(1186,'ato-traffic-proximity','NMAC','http://www.faa.gov/airports_airtraffic/air_traffic/publications/atpubs/aim/Chap7/aim0706.html#7-6-3','Near Mid-Air Collision (NMAC) is an incident associated with the operation of an aircraft in which the possibility of a collision occurs as a result of proximity of less than 500 feet to another aircraft, or a report is received from a pilot or flight crew member stating that a collision hazard existed between two or more aircraft. It is the responsibility of the pilot and/or flight crew to determine whether a Near Midair Collision situation actually occurred and, if so, to initiate an NMAC report. For the initial report, the pilot/crew should notify the nearest Air Traffic facility on the ATC frequency while airborne, or by phone immediately after landing. Refer to AIM Section 7.6.3 (http://www.faa.gov/airports_airtraffic/air_traffic/publications/atpubs/aim/Chap7/aim0706.html#7-6-3).','checkbox','Operator'),(1187,'ato-traffic-proximity','Other Traffic Proximity','','Description of additional factor(s), not listed, associated with traffic proximity','text-field','Operator'),(1188,'ato-traffic-proximity','TCAS RA','http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgAdvisoryCircular.nsf/0/76056bd8e04b1cc086256fb0006a579b/$FILE/AC%2020-151.pdf','If the intruder gets within 15 to 35 seconds, depending upon altitude, of Closest Point of Approach (CPA), it is considered a threat, and an aural and visual TCAS Resolution Advisory (RA) is issued to the flight crew advising that a particular maneuver should, or should not, be performed to attain or maintain minimum safe vertical separation from an intruder. This level provides a recommended vertical maneuver using modified Instantaneous Vertical Speed Indicators (IVSIs), and voice messages to provide adequate vertical separation from the threat aircraft or prevents initiation of a maneuver that would place the TCAS II aircraft in jeopardy. The TCAS II is considered a backup system to the ?SEE AND AVOID? concept and the ATC radar environment. Refer to AC 20-151 (http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgAdvisoryCircular.nsf/0/76056bd8e04b1cc086256fb0006a579b/$FILE/AC%2020-151.pdf).','checkbox','Operator'),(1189,'ato-traffic-proximity','TCAS TA','http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgAdvisoryCircular.nsf/0/76056bd8e04b1cc086256fb0006a579b/$FILE/AC%2020-151.pdf','If the traffic gets within 25 to 48 seconds, depending upon altitude, of projected Closest Point of Approach (CPA), it is then considered an intruder, and an aural and visual Traffic Advisory (TA) is issued to a flight crew, identifying the location of nearby traffic meeting certain minimum separation criteria.. This level calls attention to what may develop into a collision threat using the traffic advisory display and the voice message, ?TRAFFIC - TRAFFIC.? It permits mental and physical preparation for a possible maneuver to follow and assists the pilot in achieving visual acquisition of the intruding aircraft. Refer to AC 20-151 (http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgAdvisoryCircular.nsf/0/76056bd8e04b1cc086256fb0006a579b/$FILE/AC%2020-151.pdf).','checkbox','Operator'),(1190,'ato-traffic-proximity','TCAS/Traffic Conflict','http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgAdvisoryCircular.nsf/0/76056bd8e04b1cc086256fb0006a579b/$FILE/AC%2020-151.pdf','Traffic Alert And Collision Avoidance System (TCAS)-An airborne collision avoidance system based on radar beacon signals which operates independent of ground-based equipment. TCAS-I generates traffic advisories only. TCAS-II generates traffic advisories, and resolution (collision avoidance) advisories in the vertical plane.','checkbox','Operator'),(1191,'ato-training-controllers','Increase Realistic Training','','','checkbox','Operator'),(1192,'ato-training-controllers','Practice Emergency Responses','','','checkbox','Operator'),(1193,'ato-training-controllers','Training Controllers','','','checkbox','Operator'),(1194,'ato-training-organization','Other Organization Training','','Description of additional factor(s), not listed, associated with organzational training.','text-field','Operator'),(1195,'ato-training-organization','Publish Article','','','checkbox','Operator'),(1196,'ato-training-organization','Standardization','','','checkbox','Operator'),(1197,'ato-training-organization','Supplement','','','checkbox','Operator'),(1198,'ato-training-organization','Organization Training','','','checkbox','Operator'),(1199,'ato-unmanned-aerial-systems','Unmanned Aerial Systems (UAS)','','','checkbox','Operator'),(1200,'ato-visual-separation','Radar','','','checkbox','Operator'),(1201,'ato-visual-separation','Tower','','','checkbox','Operator'),(1202,'ato-weather','Adverse Conditions','','','combo-box','Operator'),(1203,'ato-weather','Ceiling in Feet','','','integer-field','Operator'),(1204,'ato-weather','Clear Air Turbulence','http://www.faa.gov/airports_airtraffic/air_traffic/publications/atpubs/PCG/C.HTM','Clear Air Turbulence is turbulence encountered in air where no clouds are present. This term is commonly applied to high-level turbulence associated with wind shear. CAT is often encountered in the vicinity of the jet stream. CAT has become a very serious operational factor to flight operations at all levels and especially to jet traffic flying in excess of 15,000 feet. All pilots encountering CAT conditions are urgently requested to report time, location, and intensity (light, moderate, severe, or extreme) of the element to the FAA facility with which they are maintaining radio contact. If time and conditions permit, elements should be reported according to the standards for other PIREPs and position reports. Refer to AIM Chapters 7-1-26: Clear Air Turbulence (CAT) PIREPs and 7-1-24. PIREPs Relating to Turbulence (http://www.faa.gov/airports_airtraffic/air_traffic/publications/atpubs/aim/Chap7/aim0701.html#7-1-26).','checkbox','Operator'),(1205,'ato-weather','Cloud Conditions','http://www.weather.com/glossary/c.html','A visible collection of minute particle matter, such as water droplets and/or ice crystals, in the free air. A cloud forms in the atmosphere as a result of condensation of water vapor. Condensation nuclei, such as in smoke or dust particles, form a surface upon which water vapor can condense. The state of the clouds are defined as: Broken--Clouds which cover between 5/8ths and 7/8ths of the sky; Few--Used to describe a cloud layer that covers between 1/8th and 2/8ths of the sky; Overcast--Sky condition when greater than 9/10 of the sky is covered by clouds; Scattered--A cloud layer that covers between 3/8ths and 1/2 of the sky; Sky Clear--Sky condition of less than 1/10 cloud coverage; Vertical Visibility--means the vertical visibility through a layer of obstructing cloud based on the ground.','combo-box','Operator'),(1208,'ato-weather','Hurricane','http://www.weather.com/glossary/h.html','A severe tropical cyclone with sustained winds over 74 miles per hour (65 knots) or greater in the North Atlantic Ocean, Caribbean Sea, Gulf of Mexico, and in the eastern North Pacific Ocean','checkbox','Operator'),(1209,'ato-weather','Ice Pellets','http://www.faa.gov/airports_airtraffic/air_traffic/publications/atpubs/aim/Chap7/aim0701.html#7-1-19','A type of precipitation consisting of transparent or translucent pellets of ice, 5 mm or less in diameter. They may be spherical, irregular, or (rarely) conical in shape. Ice pellets usually bounce when hitting hard ground, and make a sound upon impact with the following categories (AIM Chapter 7-1-19): (1) Light-Scattered pellets that do not completely cover an exposed surface regardless of duration. Visibility is not affected; (2) Moderate-Slow accumulation on ground. Visibility reduced by ice pellets to less than 7 statute miles; (3) Heavy-Rapid accumulation on ground. Visibility reduced by ice pellets to less than 3 statute miles (http://www.faa.gov/airports_airtraffic/air_traffic/publications/atpubs/aim/Chap7/aim0701.html#7-1-19).','checkbox','Operator'),(1210,'ato-weather','Lightning/Static','http://weather.aviation.ca//content/view/21/36/','Any and all forms of visible electrical discharge produced by a thunderstorm, including a static discharge generated by weather that causes damage or has a significant affect on the operation of the aircraft; this includes St Elmo\'s fire.','checkbox','Operator'),(1211,'ato-weather','Meteorological Conditions','http://www.faa.gov/airports_airtraffic/air_traffic/publications/atpubs/aim/Chap7/aim0701.html#7-1-28','The state of the atmosphere, mainly with respect to its effects upon life and human activities. Weather consists of the short-term (minutes to months) variations of the atmosphere. Refer to AIM Chapter 7. Safety of Flight Section 1. Meteorology (http://www.faa.gov/airports_airtraffic/air_traffic/publications/atpubs/aim/Chap7/aim0701.html#7-1-28).','combo-box','Operator'),(1212,'ato-weather','Mountain Wave','http://www.weather.com/glossary/m.html','A wave in the atmosphere caused by a barrier, such as a mountain. Sometimes it is marked by lenticular clouds to the lee side of mountain barriers. May be called a standing wave or a lee wave.','checkbox','Operator'),(1213,'ato-weather','Other Weather','','Description of additional factor(s), not listed, associated with the weather.','text-field','Operator'),(1214,'ato-weather','Precipitation Type','','','combo-box','Operator'),(1215,'ato-weather','Tornado','http://www.weather.com/glossary/t.html','A violently rotating column of air in contact with and extending between a convective cloud and the surface of the earth. It is the most destructive of all storm-scale atmospheric phenomena. They can occur anywhere in the world given the right conditions, but are most frequent in the United States in an area bounded by the Rockies on the west and the Appalachians in the east.','checkbox','Operator'),(1216,'ato-weather','Volcanic Ash','http://www.faa.gov/airports_airtraffic/air_traffic/publications/atpubs/aim/Chap7/aim0701.html#7-1-28','Fine particles of pulverized rock blown from an explosion vent of a volcano. Measuring less than 1/10 inch in diameter, ash may be either solid or molten when first erupted. By far the most common variety is vitric ash (glassy particles formed by gas bubbles bursting through liquid magma). AIM Section 7-1-28: PIREPs Relating to Volcanic Ash Activity (http://www.faa.gov/airports_airtraffic/air_traffic/publications/atpubs/aim/Chap7/aim0701.html#7-1-28) indicates that pilots should submit PIREPs regarding volcanic activity using the Volcanic Activity Reporting (VAR) form (http://www.faa.gov/airports_airtraffic/air_traffic/publications/atpubs/aim/Appendices/aimapd2.html#Appendix2). If a VAR form is not immediately available, relay enough information to identify the position and type of volcanic activity. Further, pilots should verbally transmit the data required in items 1 through 8 of the VAR as soon as possible. The data required in items 9 through 16 of the VAR should be relayed after landing if possible.','checkbox','Operator'),(1217,'ato-weather','Wind Direction (Degrees)','http://www.weather.com/glossary/w.html','The direction, in degrees, from which the wind is blowing. For example, an easterly wind is blowing from the east, not toward the east. It is reported with reference to true north, or 360 degrees on the compass, and expressed to the nearest 10 degrees, or to one of the 16 points of the compass (N, NE, WNW, etc.).','integer-field','Operator'),(1218,'ato-weather','Wind Speed (Knots)','http://www.weather.com/glossary/w.html','The velocity of air in motion relative to the surface of the earth specified in knots.','integer-field','Operator'),(1219,'ato-weather','Wind Type','http://virtualskies.arc.nasa.gov/glossary/W.html','Specifies the direction from which the wind is blowing as: Cross Wind--A wind blowing in a direction perpendicular to the course of a moving object; Headwind-- A wind that opposes the intended progress of an exposed, moving object; Tail Wind --A wind blowing in the same direction as the heading of a moving object thus assisting the object\'s intended progress; Wind Shift--A change in wind direction of 45 degrees or more, which takes place in less than 15 minutes. It may the result of a frontal passage, from katabatic winds, sea breezes, or thunderstorms, and in some instances, the change may be gradual or abrupt.','combo-box','Operator'),(1220,'atsap','Completed',''