equipment designed to relieve the pilot of the constant need to manually control the aircraft attitude, altitude and heading and/or airspeed.','checkbox','DNAA'),(1265,'automation-management/configuration','Dropped Fix','','Waypoint dropped out of flight plan.','checkbox','UTRS'),(1266,'automation-management/configuration','Dropped Restraint','','Speed/Altitude restriction dropped from flight plan','checkbox','UTRS'),(1267,'automation-management/configuration','FMC/CDU','','','checkbox','DNAA'),(1268,'automation-management/configuration','Improper Use or Confusion with Automation/Autoflight/Mode','','','checkbox','DNAA'),(1269,'automation-management/configuration','Monitoring','','','checkbox','DNAA'),(1270,'automation-management/configuration','Other Automation Management/Configuration','','Description of additional factor(s), not listed, associated with automation management/configuration.','text-field','DNAA'),(1271,'automation-management/configuration','Verification of Automation Settings','','','checkbox','DNAA'),(1272,'avionics','ACARS','http://www.eurocontrol.int/communications/public/site_preferences/display_glossary_list.html','Aircraft Communications Addressing and Reporting System. ACARS is a VHF air/ground data link that uses nearly 600 VHF frequency locations throughout North and Central America, Hawaii, the Caribbean, and several U.S. territories. It relays Aircraft Operational Control (AOC), Airline Administrative Control (AAC), and Air Traffic Control (ATC) messages between ground-based organizations and the cockpit.','combo-box','Operator'),(1273,'avionics','Autopilot','http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/BDEC6530B3BFFE6F8525668700724671?OpenDocument&Highlight=23.1329','Autopilot is the automation system that controls aircraft attitude, altitude and heading and keeps an aircraft in level flight or on a set course. Automatic pilots can be directed by the pilot, or they may be coupled to a radio navigation signal. (ATA Code 22-10), Part 23.1329: Autopilot (http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/BDEC6530B3BFFE6F8525668700724671?OpenDocument&Highlight=23.1329)','combo-box','Operator'),(1274,'avionics','Avionics','http://www.srtechnics.com/cms/index.asp?TopicID=214','The computers and other electronic systems that monitor and control an aircraft\'s electrical and mechanical systems such as communications, autopilots, and navigation, including the various computers themselves, plus items such as interfaces, display generators, sensors, signal distributors, etc.','checkbox','Operator'),(1275,'avionics','Company Radio Net','','Cactus net is basically the radio communication system used between pilots & dispatchers.','combo-box','Operator'),(1276,'avionics','Communication Radio','','','combo-box','Operator'),(1277,'avionics','FMS','http://www.faa.gov/airports_airtraffic/air_traffic/publications/atpubs/PCG/F.HTM#FLIGHT%20MANAGEMENT%20SYSTEMS','Flight Management System (FMS) is a navigation computer combining a navaid /airport database and integrating various navigation sensors (i.e., GPS, IRS, VOR, ILS, etc.). An aircraft area navigation (RNAV) system and associated displays and input/output devices(s) having complex multiwaypoint lateral (LNAV) and vertical (VNAV) capability (or equivalent), data entry capability, data base memory to store route and instrument flight procedure information, and display readout of NAV parameters. The flight management system (FMS) provides guidance commands to the FGS for the purpose of automatic navigation and speed control when the FGS is engaged in an appropriate mode or modes (for example, VNAV, LNAV, RNAV). Refer to ATA Codes 34-60 (Hardware) and 34-61 (Software) and AIM Chapter 1-2-1: Area Navigation (RNAV) (http://www.faa.gov/airports_airtraffic/air_traffic/publications/atpubs/aim/Chap2/aim0201.html#2-1-1).','combo-box','Operator'),(1278,'avionics','GPWS','http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/C45DB475D77EFC1B862568C80064DDF6?OpenDocument&Highlight=121.360','Ground Proximity Warning System (GPWS) is a system on board the aircraft that provided warnings of: excessive descent rate; excessive terrain closure rate; excessive altitude loss after take-off or go-around; unsafe terrain clearance while not in landing configuration, i.e., gear not locked down or flaps not in a landing position; and excessive descent below the instrument glide path. (warns of inadequate separation from ground and excessive sink rate close to ground). Refer to FAR 121.360: Ground proximity warning-glide slope deviation alerting system (http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/C45DB475D77EFC1B862568C80064DDF6?OpenDocument&Highlight=121.360).','combo-box','Operator'),(1279,'avionics','Inertial Reference System','','Navigational system that uses gyroscopes to provide attitude and heading information to the flight crew. ATA code 34-45.','combo-box','Operator'),(1280,'avionics','Navigation Radio','','','combo-box','Operator'),(1281,'avionics','Other Avionics','','Description of additional factor(s), not listed, associated with avionics.','text-field','Operator'),(1282,'avionics','PFD/ND','','','combo-box','Operator'),(1283,'avionics','Radar Altimeter','http://www.faa.gov/airports_airtraffic/air_traffic/publications/atpubs/PCG/R.HTM','Aircraft equipment which makes use of the reflection of radio waves from the ground to determine the height of the aircraft above the surface.','combo-box','Operator'),(1284,'avionics','Switch Positions','','','combo-box','Operator'),(1285,'avionics','TCAS','http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgAdvisoryCircular.nsf/0/76056bd8e04b1cc086256fb0006a579b/$FILE/AC%2020-151.pdf','Traffic Alert And Collision Avoidance System (TCAS)-An airborne collision avoidance system based on radar beacon signals which operates independent of ground-based equipment. TCAS-I generates traffic advisories only. TCAS-II gener