r'),(1484,'cabin-employee-information','Position List Numeric','','Indicates FA position in the cabin.','combo-box','Operator'),(1485,'cabin-employee-information','Primary Duties During Time of Event','','','combo-box','DAWG'),(1486,'cabin-employee-information','Submitter\'s Department','','','combo-box','UTRS'),(1487,'cabin-equipment','66N O2','','','checkbox','Operator'),(1488,'cabin-equipment','AED','http://rgl.faa.gov/Regulatory_and_Guidance_Library/rgAdvisoryCircular.nsf/0/ad17ac650d9b89748625710700523941/$FILE/AC121-33B.pdf','Automated External Defibrillator (AED) is a portable devices that contain sophisticated electronics to monitor and identify the cardiac rhythm. The AED will only permit the operator to deliver the shock if ventricular fibrillation or certain ventricular tachycardias are detected. The FAA requires AEDs on all airplanes of air carriers operating under part 121 with a maximum payload capacity of more than 7,500 pounds and with at least one flight attendant. Affected airplanes typically would have a capacity for 30 passengers or more requiring at least one flight attendant. AEDs are ?no-go? items and must be carried as indicated on the Minimum Equipment List. Refer to AC 121-33B: Emergency Medical Equipment (http://rgl.faa.gov/Regulatory_and_Guidance_Library/rgAdvisoryCircular.nsf/0/ad17ac650d9b89748625710700523941/$FILE/AC121-33B.pdf).','checkbox','Operator'),(1489,'cabin-equipment','AED Serial No','','Serial no for the Automated External Defibrillator (AED)','text-field','UTRS'),(1490,'cabin-equipment','Blood Pressure Cuff','','','checkbox','Operator'),(1491,'cabin-equipment','Briefing Cards','http://rgl.faa.gov/Regulatory_and_Guidance_Library/rgAdvisoryCircular.nsf/0/2026259a7a7247f986256d7a00508ba7/$FILE/AC121-24C.pdf','Briefing cards must show the most common method used to operate the emergency exits in an emergency. They must also show other instructions necessary for the use of emergency equipment. Refer to AC 121-24C: Passenger Safety Information Briefing and Briefing Cards (http://rgl.faa.gov/Regulatory_and_Guidance_Library/rgAdvisoryCircular.nsf/0/2026259a7a7247f986256d7a00508ba7/$FILE/AC121-24C.pdf).','checkbox','Operator'),(1492,'cabin-equipment','Cabin Equipment','','Issues associated with the tools and materials on the aircraft necessary for the safe performance of a cabin crew tasks, including baggage storage, communication systems, fire protection, food and beverage service, jumpseat, lavatory, passenger entertainment, and safety equipment..','checkbox','UTRS'),(1493,'cabin-equipment','Cart Repair Tag No','','','text-field','Operator'),(1494,'cabin-equipment','CD Player','','The CD Player system used to play announcements, etc.','combo-box','UTRS'),(1495,'cabin-equipment','Ceiling Panel','','The overhead lining of the aircraft. ATA Code 25-**','combo-box','UTRS'),(1496,'cabin-equipment','Circuit Breakers Pulled','','','checkbox','Operator'),(1497,'cabin-equipment','Closet','','The closet in the cabin used to store excess bags, crew bags, etc.','combo-box','UTRS'),(1498,'cabin-equipment','Coffee Maker','','','combo-box','UTRS'),(1499,'cabin-equipment','Communication System','','','combo-box','Operator'),(1500,'cabin-equipment','Crash Ax','http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/65020F664E8C966786256A6500582F36?OpenDocument&Highlight=sec.,121.309','Each airplane must be equipped with a crash ax as specified in FAR Sec. 121.309: Emergency equipment (http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/65020F664E8C966786256A6500582F36?OpenDocument&Highlight=sec.,121.309).','checkbox','Operator'),(1501,'cabin-equipment','Crew Oxygen System','','The portion of the main system which furnishes oxygen to the crew. Refer to ATA Code 35-10','checkbox','Operator'),(1502,'cabin-equipment','Demo Equipment Pouches','','','checkbox','Operator'),(1503,'cabin-equipment','Door Indication','','','text-field','Operator'),(1504,'cabin-equipment','ELTs','http://www.faa.gov/airports_airtraffic/air_traffic/publications/atpubs/PCG/E.HTM','Emergency Locator Transmitter: a radio transmitter attached to the aircraft structure which operates from its own power source on 121.5 MHz and 243.0 MHz. It aids in locating downed aircraft by radiating a downward sweeping audio tone, 2-4 times per second. It is designed to function without human action after an accident.','checkbox','Operator'),(1505,'cabin-equipment','Emergency/Safety Equipment','http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/65020F664E8C966786256A6500582F36?OpenDocument&Highlight=sec.,121.309','http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/65020F664E8C966786256A6500582F36?OpenDocument&Highlight=sec.,121.309','checkbox','Operator'),(1506,'cabin-equipment','EMK/EEMK','http://rgl.faa.gov/Regulatory_and_Guidance_Library/rgAdvisoryCircular.nsf/0/ad17ac650d9b89748625710700523941/$FILE/AC121-33B.pdf','The FAA requires an Emergency Medical Kit (EMK) or Enhanced Emergency Medical Kits (EEMK) on all airplanes of air carriers operating under part 121 for which at least one flight attendant is required. EMKs are ?no-go? items and must be carried as indicated on the Minimum Equipment List. EMKs are ?no-go? items and must be carried as indicated on the Minimum Equipment List. Refer to AC 121-33B: Emergency Medical Equipment (http://rgl.faa.gov/Regulatory_and_Guidance_Library/rgAdvisoryCircular.nsf/0/ad17ac650d9b89748625710700523941/$FILE/AC121-33B.pdf).','checkbox','Operator'),(1507,'cabin-equipment','Entertainment System','','Any part of the system used for passenger entertainment (video display, player, etc.)','combo-box','UTRS'),(1508,'cabin-equipment','First Aid Kit','','','checkbox','Operator'),(1509,'cabin-equipment','F/A Breakaway Flashlight','','Required safety equipment in the flight deck and/or cabin.','checkbox','Operator'),(1510,'cabin-equipment','Galley Cart-Equipment Repair Tag No','','','text-field','Operator'),(1511,'cabin-equipment','Galley Cart','','Any mobile equipment for cabin service. ATA Code 25-30.','combo-box','Operator'),(1512,'cabin-equipment','Galley Storage Bins','','Storage areas in the galley used for storage.','combo-box','UTRS'),(1513,'cabin-equipment','Halon Fire Extinguisher','http://rgl.faa.gov/Regulatory_and_Guidance_Library/rgAdvisoryCircular.nsf/0/ed51f1681e9d8c5e86256e4a00744607/$FILE/AC120-80.pdf','Halon extinguishing equipment uses a liquefied gas that extinguishes fires by chemically interrupting a fire?s combustion chain reaction, rather than physically smothering it. This characteristic is one of the main reasons that Halon extinguishers are effective when the exact source of the fire cannot be positively determined. Halon fire extinguishing agents that have been approved for use in aircraft include Halon 1211, Halon 1301, and a combination of the two (Halon 1211/1301) Both are typified as ?clean agents,? leaving no agent residue after discharge. Refer to AC 120-80: In-Flight Fires (http://rgl.faa.gov/Regulatory_and_Guidance_Library/rgAdvisoryCircular.nsf/0/ed51f1681e9d8c5e86256e4a00744607/$FILE/AC120-80.pdf).','checkbox','Operator'),(1514,'cabin-equipment','Ice Bucket','','','checkbox','Operator'),(1515,'cabin-equipment','Jumpseat','','An additional crew seat available only to qualified individuals.','combo-box','Operator'),(1516,'cabin-equipment','Lavatory','','All events occurring within the toilet area including the triggering of smoke warnings either genuine or nuisance. ATA code 25-40 (failure of lavatory-related components).','combo-box','Operator'),(1517,'cabin-equipment','Life Jackets','','A floatation device for an individual.','checkbox','Operator'),(1518,'cabin-equipment','Life Raft','','A floatation device for a group of people. Required whenever the aircraft is more than 50 miles from a shoreline. ATA code 25-61','checkbox','Operator'),(1519,'cabin-equipment','Lithium Ion Battery','','','checkbox','Operator'),(1520,'cabin-equipment','Megaphone','http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/65020F664E8C966786256A6500582F36?OpenDocument&Highlight=sec.,121.309','Each passenger-carrying airplane must have a portable battery-powered megaphone or megaphones readily accessible to the crewmembers assigned to direct emergency evacuation as specified in FAR Sec. 121.309: Emergency equipment (http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/65020F664E8C966786256A6500582F36?OpenDocument&Highlight=sec.,121.309).','checkbox','Operator'),(1521,'cabin-equipment','Onboard Wheelchair','','','checkbox','Operator'),(1522,'cabin-equipment','Other Cabin Equipment','','Description of additional factor(s), not listed, associated with cabin equipment.','text-field','UTRS'),(1523,'cabin-equipment','Other Emergency Equipment','','Description of additional factor(s), not listed, associated with emergency equipment.','text-field','Operator'),(1524,'cabin-equipment','Other Galley Equipment','','Description of additional factors, not listed, associated with galley equipment.','checkbox','Operator'),(1525,'cabin-equipment','Other Galley Equipment-Compartment Number','','Specifieds the compartment number for galley equipment.','text-field','Operator'),(1526,'cabin-equipment','Oven','','Part of cabin or galley equipment. ATA code 25-30.','combo-box','UTRS'),(1527,'cabin-equipment','Overhead Bin','','Fixed stowage in the cabin, galley or crew area for baggage stowage. ATA code 25-23.','combo-box','UTRS'),(1528,'cabin-equipment','Oxygen Box Tool','','The tool used to deploy the oxygen masks.','checkbox','Operator'),(1529,'cabin-equipment','Passenger Oxygen System','','System to provide an emergency oxygen supply to the passengers in the event of a cabin decompression. Refer to ATA Code 35-20.','checkbox','Operator'),(1530,'cabin-equipment','PBE','http://www.airweb.faa.gov/Regulatory_and_Guidance_Library%5CrgFAR.nsf/0/B3AD45700DF6705F852566EF006C4693?OpenDocument','Protective Breathing Equipment-device which provides a limited supply of oxygen inside a face mask to allow the wearer to fight an onboard fire.','checkbox','Operator'),(1531,'cabin-equipment','Portable Oxygen Bottle','','','checkbox','Operator'),(1532,'cabin-equipment','Portable Oxygen Concentrator','','','checkbox','Operator'),(1533,'cabin-equipment','Passenger Seat','','Cabin or flight deck located. ATA code 25-**','combo-box','UTRS'),(1534,'cabin-equipment','Serial Number','','','text-field','Operator'),(1535,'cabin-equipment','Smoke Detectors','http://www.airweb.faa.gov/Regulatory_and_Guidance_Library%5CrgFAR.nsf/0/19F361F192E8D87D852566EF006B91A3?OpenDocument','Smoke detector system or equivalent that provides a warning light in the cockpit or provides a warning light or audio warning in the passenger cabin which would be readily detected by a flight attendant, taking into consideration the positioning of flight attendants throughout the passenger compartment during various phases of flight. Refer to FAR Sec. 25.854: Lavatory fire protection (http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/6FEEDA1FE296DDD2852566720051A398?OpenDocument&Highlight=25.854).','combo-box','Operator'),(1536,'cabin-equipment','Smoke Goggles','','','checkbox','Operator'),(1537,'cabin-equipment','Supplemental Oxygen','','','checkbox','Operator'),(1538,'cabin-equipment','Trash Containers','','','combo-box','UTRS'),(1539,'cabin-equipment','Wall Panel','','The vertical lining inside the aircraft cabin.','combo-box','UTRS'),(1540,'cabin-equipment','Water Fire Extinguisher','http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/65020F664E8C966786256A6500582F36?OpenDocument&Highlight=sec.,121.309','Extinguishing equipment suitable for the kinds of fires likely to occur in the compartment where the extinguisher is intended to be used and, for passenger compartments, must be designed to minimize the hazard of toxic gas concentrations as specified in FAR Sec. 121.309: Emergency equipment (http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/65020F664E8C966786256A6500582F36?OpenDocument&Highlight=sec.,121.309).','checkbox','Operator'),(1541,'cabin-events','Exposure to Blood Borne Pathogens','','','checkbox','UTRS'),(1542,'cabin-events','Exposure to Bodily Fluid','','','checkbox','Operator'),(1543,'cabin-events','Cabin/Catering Provisions','','','checkbox','Operator'),(1544,'cabin-events','Cabin Events','http://intlaviationstandards.org/Documents/CICTTOccurrenceCategoryDefinitions.pdf','Occurrences and issues in the passenger cabin of aircraft, including cabin crew interactions with passengers and safety related duties.','checkbox','Operator'),(1545,'cabin-events','Gate/Staff Not Available','','','checkbox','Operator'),(1546,'cabin-events','Cabin Lighting','','Non-safety related lighting in the cabin, such as reading lights, lav lights, etc. ATA Code 33-20','combo-box','ASRS'),(1547,'cabin-events','Cabin Maintenance Log No','','','text-field','Operator'),(1548,'cabin-events','Cabin Pet/Service Animal','','','checkbox','Operator'),(1549,'cabin-events','Cabin Pressurization','http://www.faa.gov/library/manuals/aircraft/airplane_handbook/media/faa-h-8083-3a-7of7.pdf','Issues associated with conditions where pressurized air is forced into the cabin simulating pressure conditions at a much lower altitude and increasing the aircraft occupants comfort.','checkbox','UTRS'),(1550,'cabin-events','Cabin Service Animal Issues','','','checkbox','Operator'),(1551,'cabin-events','Cabin Temperature','','A specific degree of hotness or coldness of the cabin environment and issues associated with passengers and crewmembers discomfort.','checkbox','Operator'),(1552,'cabin-events','Child Restraint Device','','','combo-box','Operator'),(1553,'cabin-events','Combative Patient','','','checkbox','Operator'),(1554,'cabin-events','Communication','http://www.hf.faa.gov/opsmanual/assets/pdfs/MEDA_guide.pdf','Issues associated with the transfer of information (written, verbal, or non-verbal) within the organization.','checkbox','DNAA'),(1555,'cabin-events','Compliance with Crew Requests','','Issues associated with acting in accordance with established guidelines and accepted standards in response to actions specified by the crew.','combo-box','DNAA'),(1556,'cabin-events','CPR','http://www.webmd.com/a-to-z-guides/Dealing-With-Emergencies-Rescue-Breathing-and-CPR','Cardio-Pulmonary Resuscitation (CPR) is a combination of chest compressions and mouth-to-mouth rescue breathing used during cardiac and respiratory arrest to keep oxygenated blood flowing to the brain until advanced life support can be initiated.','checkbox','Operator'),(1557,'cabin-events','Customer Service','','Ability to constantly and consistently to give customers what they want and need.','checkbox','Operator'),(1558,'cabin-events','Death Onboard','http://www.eurocontrol.int/src/gallery/content/public/documents/deliverables/esarr2_awareness_framework-package/esarr2e20ri.pdf','Indicates death of crew, passengers, or third party persons resulting from operation of an aircraft.','checkbox','Operator'),(1559,'cabin-events','Decompression','http://www.faa.gov/library/manuals/aviation/pilot_handbook/media/faa-h-8083-25-1of4.pdf','Occurrences associated with the inability of the airplane\'s pressurization system to maintain its designed pressure differential. This can be caused by a malfunction in the pressurization system or structural damage to the aircraft. Physiologically, decompressions fall into two categories. (1) Explosive Decompression: a change in cabin pressure faster than the lungs can decompress; therefore, it is possible that lung damage may occur. Normally, the time required to release air from the lungs without restrictions, such as masks, is 0.2 seconds. Most authorities consider any decompression that occurs in less than 0.5 seconds as explosive and potentially dangerous. (2) Rapid Decompression: a change in cabin pressure where the lungs can decompress faster than the cabin; therefore, there is no likelihood of lung damage.','checkbox','Operator'),(1560,'cabin-events','Distracted Flight Crew','','When an event prevents a crewmember from focusing on the job at hand with the required attention. When they are thinking about something else other than the duty at hand. Example: being rushed to get the flight out onetime and actually forgetting crucial steps or procedures.','checkbox','DNAA'),(1561,'cabin-events','Emergency Cabin Preparation','','','checkbox','Operator'),(1562,'cabin-events','Employee/Passenger Conflict','','Mutually inconsistent disagreements between airline employees and a passenger in interpreting information or in proposing courses of action.','checkbox','Operator'),(1563,'cabin-events','Escape Slide Deployment','http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFar.nsf/0/d4c161d3f3e1e68686256e9b0069abd7?OpenDocument','The utilization of the inflatable component which enables rapid evacuation from an aircraft cabin to ground level during emergencies on the ground categorized as: Deployed-- Activation of slide during the interval between the time the exit opening means is actuated from inside the airplane and the time the exit is fully opened; Failure--the intended deployment did not occur; or Other: additional issues/concerns. The operator of an aircraft shall immediately, and by the most expeditious means available, notify the nearest NTSB Field Office when an evacuation of aircraft in which an emergency egress system is utilized occurs. Refer to AIM Chapter 7-6-2. Aircraft Accident and Incident Reporting (http://www.faa.gov/airports_airtraffic/air_traffic/publications/atpubs/aim/Chap7/aim0706.html) and FAR Sec. 25.810: Emergency egress assist means and escape routes (http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFar.nsf/0/d4c161d3f3e1e68686256e9b0069abd7?OpenDocument).','combo-box','Operator'),(1564,'cabin-events','Problem Enforcing CFRs','http://www.opm.gov/glossary','Issues associated with obtaining compliance with the guidance or rules created by the company for employees, passengers, and other individuals relating to proper standards and practices and with federal regulations under which flight operations are conducted (as specified in the Code of Federal Regulations (CFR), particularly the Federal Aviation Regulations(FARs)).','checkbox','Operator'),(1565,'cabin-events','Fire, Smoke, Fumes, or Odor','','','checkbox','Operator'),(1566,'cabin-events','HAZMAT Exposure','http://rgl.faa.gov/Regulatory_and_Guidance_Library/rgAdvisoryCircular.nsf/1ab39b4ed563b08985256a35006d56af/e90c50d06627fb54862569ea00777bfe/$FILE/AC121-21B.pdf','Contact with any substance/material defined that pose a potential risk to life, health, or property by various Hazarous Material (HAZMAT) regulations administered by the US Environmental Protection Agency and the US Department of Transportation as specified in 49 CFR 172.101 Hazardous Materials Table (http://www.setonresourcecenter.com/transportation/49CFR/172_101tb.pdf). These include explosive, flammable, poisonous, corrosive, reactive, or radioactive, or any combination, and requires special care in handling because of the hazards it poses to public health and welfare, safety, and/or the environment. Refer to AC 121-21B: Information Guide for Training Programs and Manual Requirements in the Air Transportation of Hazardous Materials (http://rgl.faa.gov/Regulatory_and_Guidance_Library/rgAdvisoryCircular.nsf/1ab39b4ed563b08985256a35006d56af/e90c50d06627fb54862569ea00777bfe/$FILE/AC121-21B.pdf)','checkbox','Operator'),(1567,'cabin-events','Lap Child','','','checkbox','Operator'),(1568,'cabin-events','Main Door Closed Prior to Securing Overhead Bins','','','checkbox','Operator'),(1569,'cabin-events','Other Cabin Events','','Description of additional factor(s), not listed, associated with cabin events.','text-field','Operator'),(1570,'cabin-events','Outside Lighting','','','combo-box','Operator'),(1571,'cabin-events','Contraband','','','checkbox','ASRS'),(1572,'cabin-events','Passenger Direct Involvement','','','checkbox','Operator'),(1573,'cabin-events','Electronic Device','http://rgl.faa.gov/Regulatory_and_Guidance_Library/rgAdvisoryCircular.nsf/0/b5c85ae8e38df676862571da00529da4/$FILE/AC%2091.21-1B.pdf','The use of personal electronic devices, such as laptop computers and palmtop computers, audio players/recorders, electronic games, cell phones, compact-disc players, electronic toys, and laser pointers. Refer to AC 91.21-1B: Use of Portable Electronic Devices Abroad Aircraft (http://rgl.faa.gov/Regulatory_and_Guidance_Library/rgAdvisoryCircular.nsf/0/b5c85ae8e38df676862571da00529da4/$FILE/AC%2091.21-1B.pdf). Further, passengers should be informed of permissible times, conditions, and limitations when various portable electronic devices may be used. Refer to AC 121-24C: Passenger Safety Information Briefing and Briefing Cards (http://rgl.faa.gov/Regulatory_and_Guidance_Library/rgAdvisoryCircular.nsf/0/2026259a7a7247f986256d7a00508ba7/$FILE/AC121-24C.pdf).','checkbox','ASRS'),(1574,'cabin-events','Passenger of Size','','','checkbox','UTRS'),(1575,'cabin-events','Patient Condition','','','checkbox','UTRS'),(1576,'cabin-events','Patient Safety','','','checkbox','UTRS'),(1577,'cabin-events','Passenger in Lav on Landing','','','checkbox','Operator'),(1578,'cabin-events','Potential Injury Hazard','http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgAdvisoryCircular.nsf/0/6485143d5ec81aae8625719b0055c9e5/$FILE/AC%20120-92.pdf','http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgAdvisoryCircular.nsf/0/6485143d5ec81aae8625719b0055c9e5/$FILE/AC%20120-92.pdf','checkbox','Operator'),(1579,'cabin-events','Seat Belt Issue','','','checkbox','Operator'),(1580,'cabin-events','Seating','','The process of seating passengers in the appropriate seats while considering seat criteria limitations','checkbox','ASRS'),(1581,'cabin-events','Smoke Detectors','http://www.airweb.faa.gov/Regulatory_and_Guidance_Library%5CrgFAR.nsf/0/19F361F192E8D87D852566EF006B91A3?OpenDocument','Indicates activation of the smoke detector system or equivalent that provides a warning light in the cockpit or provides a warning light or audio warning in the passenger cabin which would be readily detected by a flight attendant, taking into consideration the positioning of flight attendants throughout the passenger compartment during various phases of flight','checkbox','Operator'),(1582,'cabin-events','Sterile Cockpit Safety Related Interruption','http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/DD19266CEBDAC9DB852566EF006D346F?OpenDocument&Highlight=121.542','http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/DD19266CEBDAC9DB852566EF006D346F?OpenDocument&Highlight=121.542','checkbox','Operator'),(1583,'cabin-events','Traytables/Seatbacks','','','checkbox','Operator'),(1584,'cabin-events','Turbulence','http://www.faa.gov/airports_airtraffic/air_traffic/publications/atpubs/aim/Chap7/aim0701.html#7-1-24','The irregular and instantaneous motions of air which is made up of a number of small of eddies that travel in the general air current. Atmospheric turbulence is caused by random fluctuations in the wind flow. It can be caused by thermal or convective currents, differences in terrain and wind speed, along a frontal zone, or variation in temperature and pressure. Duration and classification of intensity are categorized as (AIM Table 7-1-9: Turbulence Reporting Criteria Table (http://www.faa.gov/airports_airtraffic/air_traffic/publications/atpubs/aim/Chap7/aim0701.html#7-1-24): (1) Light-Turbulence that momentarily causes slight, erratic changes in altitude and/or attitude (pitch, roll, yaw) (Reported as Light Turbulence or Turbulence) or that causes slight, rapid and somewhat rhythmic bumpiness without appreciable changes in altitude or attitude (Reported as Light Chop*); (2) Moderate-Turbulence that is similar to Light Turbulence but of greater intensity. Changes in altitude and/or attitude occur but the aircraft remains in positive control at all times. It usually causes variations in indicated airspeed (Reported as Moderate Turbulence) or Turbulence that is similar to Light Chop but of greater intensity. It causes rapid bumps or jolts without appreciable changes in aircraft altitude or attitude (Reported as Moderate Chop*); (3) Severe-Turbulence that causes large, abrupt changes in altitude and/or attitude. It usually causes large variations in indicated airspeed. Aircraft may be momentarily out of control (Report as Severe Turbulence)*; (4) Extreme: Turbulence in which the aircraft is violently tossed about and is practically impossible to control. It may cause structural damage (Reported as Extreme Turbulence). *High level turbulence (normally above 15,000 feet ASL) not associated with cumuliform cloudiness, including thunderstorms, should be reported as CAT (Clear Air Turbulence) preceded by the appropriate intensity, or light or moderate chop.','combo-box','Operator'),(1585,'cabin-events','Turbulence Occurred Sooner Than Expected','','','combo-box','Operator'),(1586,'cabin-events','Turbulence Warning Provided','','','combo-box','Operator'),(1587,'cabin-events','Unaccompanied Minor','','','checkbox','Operator'),(1588,'cabin-events','unaccompanied-minor-details','','','combo-box','Operator'),(1589,'cabin-events','Universal Precautions Kit','','','checkbox','Operator'),(1590,'cabin-events','Unsafe Activity','','','checkbox','Operator'),(1591,'cabin-phase-of-flight','Cabin Phase of Flight','','','combo-box','Operator'),(1592,'cargo-event','Animal','','','combo-box','Operator'),(1593,'cargo-event','Baggage','','','checkbox','Operator'),(1594,'cargo-event','Bar Codes','','','checkbox','Operator'),(1595,'cargo-event','Cargo','','','checkbox','Operator'),(1596,'cargo-event','Cargo and Baggage','','','checkbox','Operator'),(1597,'cargo-event','Cargo Locks','','','checkbox','Operator'