een-air-medical-crew-and-pilot','Patient Info Omitted','','','checkbox','Operator'),(1658,'communication-between-air-medical-crews','Crew Deviated From Planned Expectations','','','checkbox','Operator'),(1659,'communication-between-air-medical-crews','Crew Deviated From Procedures/Policy/Expectations','','','checkbox','Operator'),(1660,'communication-between-air-medical-crews','Other','','','text-field','Operator'),(1661,'communication-between-communication-center-and-gr','Ground Personnel Acted Different from Expectations/Directives','','','checkbox','Operator'),(1662,'communication-between-communication-center-and-gr','Other','','','text-field','Operator'),(1663,'communication-between-dispatch','Between Shifts (Turnover)','','Factors related to the interface between employees related to changeovers of personnel, particularly to ensure that all necessary information is communicated between the out-going and in-coming personnel.','checkbox','Operator'),(1664,'communication-between-dispatch','Between Staff','','','checkbox','Operator'),(1665,'communication-between-dispatch','Communication: Between Dispatchers','http://rgl.faa.gov/Regulatory_and_Guidance_Library/rgAdvisoryCircular.nsf/0/876cc3ef90dd8bac862570c00078c818/$FILE/AC%20121-32a.pdf','Includes internal and external influences on interpersonal communications. External factors include job title, corporate complexity, age, experience, gender, organizational culture, education, etc. Internal factors include speaking skills, listening skills, decisionmaking skills, conflict resolution techniques, and the use of appropriate assertiveness and advocacy. All training activities involving pilots, flight attendants, aircraft dispatchers, and aircraft mechanics should stress the importance of clear and unambiguous communication. Refer to AC 121-32A: Dispatch Resource Management Training (http://rgl.faa.gov/Regulatory_and_Guidance_Library/rgAdvisoryCircular.nsf/0/876cc3ef90dd8bac862570c00078c818/$FILE/AC%20121-32a.pdf)','checkbox','Operator'),(1666,'communication-between-dispatch','Communication Error','','The failure to send and receive a message with the intent of the sender during communication between dispatchers.','checkbox','Operator'),(1667,'communication-between-dispatch','Difficult/Lost Communication','http://www.faa.gov/airports_airtraffic/air_traffic/publications/atpubs/PCG/L.HTM','Loss of the ability to communicate.','checkbox','Operator'),(1668,'communication-between-dispatch','DRM','http://www.faa.gov/education_research/testing/airmen/test_standards/media/FAA-S-8081-10B.pd','Dispatch Resource Management (DRM) is the complement of Crew Resource Management (CRM) for dispatchers. DRM addresses the challenge of optimizing the person/machine interface and related interpersonal issues, including effective teambuilding and maintenance, information transfer, problem solving, decisionmaking, maintaining situational awareness, and dealing with automated systems. Two expected benefits to the dispatcher are (1) better handling of information that bears on safe flight operations and (2) a better interface with each pilot in command, consistent with the joint responsibility concept outlined in 14 CFR part 121. Refer to FAA-S-8081-10B: AIRCRAFT DISPATCHER Practical Test Standards (http://www.faa.gov/education_research/testing/airmen/test_standards/media/FAA-S-8081-10B.pdf).','checkbox','Operator'),(1669,'communication-between-dispatch','Lack of Communication','','Deficiencies in the verbal, written, or a combination of the two methods by which information is exchanged between individuals through a common system of symbols, signs, or behaviors.','checkbox','Operator'),(1670,'communication-between-dispatch','No/Incorrect Shift Turnover','','Lack of or improper changeovers of personnel, usually associated with inadequate communication between the two individuals or teams.','checkbox','Operator'),(1671,'communication-between-dispatch','Other Communication: Between Dispatchers','','Descri