ht Attendant and Pilots','http://rgl.faa.gov/Regulatory_and_Guidance_Library/rgAdvisoryCircular.nsf/0/ffeb9277f3866c5b862569f1005f7eb6/$FILE/AC120-48.pdf','Coordination of activities between flight crew members and flight attendants.','checkbox','Operator'),(1707,'communication-cabin-to-pilot','Communication Error','','The failure to send and receive a message with the intent of the sender during communication between flight crew and cabin crew.','checkbox','Operator'),(1708,'communication-cabin-to-pilot','Lack of Communication','http://www.caa.co.uk/docs/33/CAP716.PDF','Deficiencies in the verbal, written, or a combination of the two methods by which information is exchanged between the flight and cabin crews through a common system of symbols, signs, or behaviors.','checkbox','Operator'),(1709,'communication-cabin-to-pilot','No Descent Chime Given','','','checkbox','Operator'),(1710,'communication-cabin-to-pilot','Other Communication: Flight Attendant and Pilots','','between flight attendants and pilots.','text-field','Operator'),(1711,'communication-cabin-to-pilot','Sharing/Encouraging/Acknowledging Input','','','checkbox','Operator'),(1712,'communication-cabin-to-pilot','Sterile Cockpit Violation','http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/DD19266CEBDAC9DB852566EF006D346F?OpenDocument&Highlight=121.542','http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/DD19266CEBDAC9DB852566EF006D346F?OpenDocument&Highlight=121.542','checkbox','Operator'),(1713,'communication-clp-crew','Communication CLP to Dispatch','http://rgl.faa.gov/Regulatory_and_Guidance_Library/rgAdvisoryCircular.nsf/0/b173ba8a295764f086256cde006a44ad/$FILE/AC120-71A.pdf','SOPs should state who (PF, PM, FE/SO) handles the radios for each phase of flight, as follows: PF makes input to aircraft/autopilot and/or verbally states clearances while PM confirms input is what he/she read back to ATC. Any confusion in the flight deck is immediately cleared up by requesting ATC confirmation. If any crewmember is off the flight deck, all ATC instructions are briefed upon his/her return. Or if any crewmember is off the flight deck all ATC instructions are written down until his/her return and then passed to that crewmember upon return. Similarly, if a crewmember is off ATC frequency (e.g., when making a PA announcement or when talking on company frequency), all ATC instructions are briefed upon his/her return. Refer to AC 120-71A: Standard Operating Procedures for Flight Deck Crewmembers (http://rgl.faa.gov/Regulatory_and_Guidance_Library/rgAdvisoryCircular.nsf/0/b173ba8a295764f086256cde006a44ad/$FILE/AC120-71A.pdf).','checkbox','DNAA'),(1714,'communication-clp-crew','Confusing Instructions','','','checkbox','DNAA'),(1716,'communication-clp-crew','Interpretation of Instructions','','','checkbox','DNAA'),(1717,'communication-clp-crew','Lack of Communication','http://www.caa.co.uk/docs/33/CAP716.PDF','Deficiencies in the verbal, written, or a combination of the two methods by which information is exchanged between the flight crews and ATC through a common system of symbols, signs, or behaviors.','checkbox','Operator'),(1718,'communication-clp-crew','Language Difficulty','','Misunderstandings involving people who speak different languages (or even different dialects).','checkbox','DNAA'),(1719,'communication-clp-crew','Other CLP/Crew Communication','','Description of additional factor(s), not listed, associated with communicaitons between pilots and ATC.','text-field','DNAA'),(1720,'communication-clp-crew','Phraseology','http://www.faa.gov/ATpubs/ATC/Chp1/atc0102.html','Denotes the prescribed words and/or phrases to be used in communications and is standardized to reduce opportunities for confusion and misunderstanding between air traffic controllers and pilots.','checkbox','DNAA'),(1721,'communication-clp-departure-coordinator-operations','Communication CLP to Dispatch','http://rgl.faa.gov/Regulatory_and_Guidance_Library/rgAdvisoryC