checkbox','Operator'),(1985,'crm/tem-skills','Planning and Decision Making','','','checkbox','Operator'),(1986,'crm/tem-skills','Situation Awareness','','','checkbox','Operator'),(1987,'crm/tem-skills','Workload Management','','','checkbox','Operator'),(1988,'cross-verification/monitoring','Aircraft Settings','','','checkbox','DNAA'),(1990,'cross-verification/monitoring','Cross Verification/Monitoring','http://rgl.faa.gov/Regulatory_and_Guidance_Library/rgAdvisoryCircular.nsf/0/b173ba8a295764f086256cde006a44ad/$FILE/AC120-71A.pdf','Issues associated with confirmation of cross-checks between pilots relating to aircraft performance, clearances, dispatch releases, position, routing, and settings, To ensure the highest levels of safety each flight crewmember must carefully monitor the aircraft?s flight path and systems and actively cross-check the actions of other crew members. Effective monitoring and cross-checking can be the last barrier or line of defense against accidents because detecting an error or unsafe situation may break the chain of events leading to an accident. Conversely, when this layer of defense is absent, errors and unsafe situations may go undetected, leading to adverse safety consequences. It is difficult for humans to monitor for errors on a continuous basis when these errors rarely occur. Monitoring during high workload periods is important since these periods present situations in rapid flux and because high workload increases vulnerability to error. However, studies show that poor monitoring performance can be present during low workload periods, as well. Lapses in monitoring performance during lower workload periods is often associated with boredom and/or complacency. Crew monitoring performance can be significantly improved by developing and implementing effective SOPs to support monitoring and cross-checking functions, by training crews on monitoring strategies, and by pilots following those SOPs and strategies. Refer to AC 120-71A: Standard Operating Procedures for Flight Deck Crewmembers (http://rgl.faa.gov/Regulatory_and_Guidance_Library/rgAdvisoryCircular.nsf/0/b173ba8a295764f086256cde006a44ad/$FILE/AC120-71A.pdf).','checkbox','DNAA'),(1991,'cross-verification/monitoring','Cross Verification/Monitoring Flight Release','http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/71F65AFDE4568E12852566EF006DF4F3?OpenDocument&Highlight=121.689','Specifies the paperwork by which an air carrier ensures all activities required for safe dispatch and continuation of a flight to its destination. Refer to Sec. 121.689 (http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/71F65AFDE4568E12852566EF006DF4F3?OpenDocument&Highlight=121.687).','checkbox','DNAA'),(1992,'cross-verification/monitoring','Monitoring-Aircraft Performance or Position','','','checkbox','DNAA'),(1993,'cross-verification/monitoring','Monitoring-Crew Performance','','','checkbox','DNAA'),(1994,'cross-verification/monitoring','Other Cross Verification/Monitoring','','Description of additional factor(s), not listed, associated with cross verification and/or monitoring.','text-field','DNAA'),(1995,'customs-event','Aircraft Clearance to Land/Depart','','','checkbox','Operator'),(1996,'customs-event','Air Waybill','','','checkbox','Operator'),(1997,'customs-event','AMS - Insufficient Data','http://www.cbp.gov/xp/cgov/trade/automated/automated_systems/ams/','Automated Manifest System for international Cargo shipments','checkbox','Operator'),(1998,'customs-event','APIS (or Advance Passenger Information System)','','','checkbox','Operator'),(1999,'customs-event','Cargo In Bond','','','checkbox','Operator'),(2000,'customs-event','Cargo In Hold','','','checkbox','Operator'),(2001,'customs-event','Cargo Permit to Proceed','','','checkbox','Operator'),(2002,'customs-event','Clearing Customs','','','checkbox','Operator'),(2003,'customs-event','Customs Documentation Event','','','combo-box','Operator'),(2004,'customs-event','Cust