es nearly 600 VHF frequency locations throughout North and Central America, Hawaii, the Caribbean, and several U.S. territories. It relays Aircraft Operational Control (AOC), Airline Administrative Control (AAC), and Air Traffic Control (ATC) messages between ground-based organizations and the cockpit.','checkbox','DNAA'),(2027,'datalink-coordination/communication-event','Automatic Dependent Surveillance Broadcast','http://www.faa.gov/airports_airtraffic/air_traffic/publications/atpubs/PCG/A.HTM#AUTOMATIC%20DEPENDENT%20SURVEILLANCE-BROADCAST%20(ADS-B)','Automatic Dependent Surveillance-Broadcast (ADS-B)--A surveillance system in which an aircraft or vehicle to be detected is fitted with cooperative equipment in the form of a data link transmitter. The aircraft or vehicle periodically broadcasts its GPS-derived position and other information such as velocity over the data link, which is received by a ground-based transmitter/receiver (transceiver) for processing and display at an air traffic control facility.','checkbox','DNAA'),(2028,'datalink-coordination/communication-event','Controller-Pilot Datalink Communications','http://www.eurocontrol.int/communications/public/site_preferences/display_glossary_list.html','CPDLC-Sometimes referred to as Two-Way Pilot Data Link, is the means of communication between controller and Aircrew, using data link in conjunction with or instead of voice, for ATC.','checkbox','DNAA'),(2029,'datalink-coordination/communication-event','Datalink Coordination/Communication Event','http://virtualskies.arc.nasa.gov/glossary/D.html','The processing and continuous transmission of the most recent data to/from the airborne and ground systems.','checkbox','DNAA'),(2030,'datalink-coordination/communication-event','Other Datalink Coordination/Communication','','Description of additional factor(s), not listed, associated with datalink coordination and/or communication.','text-field','DNAA'),(2031,'datalink-coordination/communication-event','Pre-Departure Clearance','http://www.faa.gov/airports_airtraffic/air_traffic/publications/atpubs/PCG/P.htm#PRE-DEPARTURE%20CLEARANCE','Pre-Departure Clearance (PDC)-An authorization by ATC for an aircraft to proceed under specified traffic conditions within controlled airspace. An application with the Terminal Data Link System (TDLS) that provides clearance information to subscribers, through a service provider, in text to the cockpit or gate printer.','checkbox','DNAA'),(2032,'denied-boarding-report','Date Report Received ( Date field)','','','date-field','Operator'),(2033,'denied-boarding-report','Date Report Requested (Date field)','','','date-field','Operator'),(2034,'denied-boarding-report','Denied Boarding Report Required (checkbox)','','','checkbox','Operator'),(2036,'departure-event','Departure Event','','Occurrences during aircraft taking off from an airport.','checkbox','DNAA'),(2037,'departure-event','Flew Wrong Departure/SID','','','checkbox','DNAA'),(2038,'departure-event','Incorrect Departure from Airport','','','checkbox','DNAA'),(2039,'departure-event','Other Departure Event','','Description of additional factor(s), not listed, associated with departure events.','text-field','DNAA'),(2040,'departure-location','Departure Location','combo-box','','combo-box','Operator'),(2041,'dispatch-employee-information','Consecutive Days on Duty','','','integer-field','UTRS'),(2042,'dispatch-employee-information','Duty Off Time','','','date-time-field','Operator'),(2043,'dispatch-employee-information','Duty On Time','','','date-time-field','Operator'),(2044,'dispatch-employee-information','Experience (Total Years)','','Specifies the total number of years of experience for the dispatch employee in years.','real-field','UTRS'),(2045,'dispatch-employee-information','Primary Duties During Time of Event','','','combo-box','DAWG'),(2046,'dispatch-employee-information','Submitter\'s Department','','','combo-box','UTRS'),(2047,'dispatch-operations-complications/errors','Adverse Weather','','','combo-box','Operator'),(2048,'dispatch-operations-complications/errors','Adverse Weather Encountered','','','checkbox','Operator'),(2049,'dispatch-operations-complications/errors','Aircraft Routing','','','checkbox','Operator'),(2050,'dispatch-operations-complications/errors','Aircraft Routing-Amendment','','','checkbox','UTRS'),(2051,'dispatch-operations-complications/errors','Alternate Airports','http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/82CA551664A00A35852566EF006DC9CD?OpenDocument&Highlight=121.641','Alternate airport means an airport at which an aircraft may land if a landing at the intended airport becomes inadvisable. No person may dispatch an airplane under IFR or over-the-top unless he lists at least one alternate airport for each destination airport in the dispatch release. Refer to Sec. 121.621: Alternate airport for destination: Flag operations (http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/82CA551664A00A35852566EF006DC9CD?OpenDocument&Highlight=121.641) and Sec. 121.197: Airplanes: Turbine engine powered: Landing limitations: Alternate airports (http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/870542FDF6B7DFD4852566EF006B2804?OpenDocument&Highlight=121.617).','checkbox','UTRS'),(2052,'dispatch-operations-complications/errors','Amended Release Time','','','checkbox','Operator'),(2053,'dispatch-operations-complications/errors','CAT II/III Requirements Not Met','http://www.airweb.faa.gov/Regulatory_and_Guidance_Library%5CrgFAR.nsf/0/4FE900DD20977EB186256E1A00533CB0?OpenDocument','Refer to FAR Sec. 121.651 - Takeoff and landing weather minimums: IFR: All certificate holders (http://www.airweb.faa.gov/Regulatory_and_Guidance_Library%5CrgFAR.nsf/0/4FE900DD20977EB186256E1A00533CB0?OpenDocument) and Sec. 121.652 - Landing weather minimums: IFR: All certificate holders (http://www.airweb.faa.gov/Regulatory_and_Guidance_Library%5CrgFAR.nsf/0/FCA2DE3BA845CC06852566EF006DE236?OpenDocument).\n\nCategory II operationsmeans a straight-in ILS approach to the runway of an airport under a Category II ILS instrument approach procedure issued by the Administrator or other appropriate authority. Category III operationsmeans an ILS approach to, and landing on, the runway of an airport using a Category III ILS instrument approach procedure issued by the Administrator or other appropriate authority. Category IIIa operations, an ILS approach and landing with no decision height (DH), or a DH below 100 feet (30 meters), and controlling runway visual range not less than 700 feet (200 meters). Category IIIb operations, an ILS approach and landing with no DH, or with a DH below 50 feet (15 meters), and controlling runway visual range less than 700 feet (200 meters), but not less than 150 feet (50 meters). Category IIIc operations, an ILS approach and landing with no DH and no runway visual range limitation. As specified in FAR Sec. 1.1 - General definitions (http://www.airweb.faa.gov/Regulatory_and_Guidance_Library%5CrgFAR.nsf/0/BD73C51E9C7C3FE2862572960077077A?OpenDocument).','checkbox','Operator'),(2054,'dispatch-operations-complications/errors','Company Guidance FOM/DOM, Bulletins, Read File','','','checkbox','Operator'),(2055,'dispatch-operations-complications/errors','Computer Systems','','','checkbox','Operator'),(2056,'dispatch-operations-complications/errors','Deferred Items-MEL/CDL','http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/75BFE28E8D694F43852566EF006DCF65?OpenDocument&Highlight=121.628','Minimum Equipment List (MEL)/Configuration Deviation List (CDL) faults or defects found on an aircraft which do not need immediate action and can be deferred for repair at a later date. This deferred defect status is only given for a strictly limited period of time and rectification must take place before that time has elapsed. Refer to FAR 121.628: Inoperable instruments and equipment (http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/75BFE28E8D694F43852566EF006DCF65?OpenDocument&Highlight=121.628).','checkbox','DNAA'),(2057,'dispatch-operations-complications/errors','Destination Alternate','','','checkbox','Operator'),(2058,'dispatch-operations-complications/errors','Difficult/Lost Communications','http://www.faa.gov/airports_airtraffic/air_traffic/publications/atpubs/PCG/L.HTM','Loss of the ability to communicate by radio.','checkbox','DNAA'),(2059,'dispatch-operations-complications/errors','Dispatch/Operations Center Operations','','Issues associated with airline operations center that provides dispatch, System Operations Control (SOC), weather, maintenance, scheduling, and other support and control services for aircraft operations.','checkbox','Operator'),(2060,'dispatch-operations-complications/errors','Dispatch Operations Complications/Errors','http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/251824597D3AB384852566EF006D2C10?OpenDocument&Highlight=121.533','Issues associated with a human action (or human behavior) that unintentionally deviates from the expected action (or behavior) or fails to achieve what should be done related to the authority over initiating, conducting, or terminating a flight. Refer to FAR 121.533: Responsibility for operational control: Domestic operations. (http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/251824597D3AB384852566EF006D2C10?OpenDocument&Highlight=121.533).','checkbox','DNAA'),(2061,'dispatch-operations-complications/errors','Duty Time','http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/50C6D4A9F91D95C5852566EF006D0703?OpenDocument&Highlight=121.465','Each certificate holder conducting domestic or flag operations shall establish the daily duty period for a dispatcher so that it begins at a time that allows him or her to become thoroughly familiar with existing and anticipated weather conditions along the route before he or she dispatches any airplane. He or she shall remain on duty until each airplane dispatched by him or her has completed its flight, or has gone beyond his or her jurisdiction, or until he or she is relieved by another qualified dispatcher. Refer to Sec. 121.465: Aircraft dispatcher duty time limitations: Domestic and flag operations (http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/50C6D4A9F91D95C5852566EF006D0703?OpenDocument&Highlight=121.465)','checkbox','Operator'),(2062,'dispatch-operations-complications/errors','Emergency','http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/204EAF3B675364C7852566EF006E1C76?OpenDocument&Highlight=121.557','In an emergency situation arising during flight that requires immediate decision and action by an aircraft dispatcher, and that is known to him, the aircraft dispatcher shall advise the pilot in command of the emergency. If the aircraft dispatcher cannot communicate with the pilot, he shall declare an emergency and take any action that he considers necessary under the circumstances. Whenever a pilot in command or dispatcher exercises emergency authority, he shall keep the appropriate ATC facility and dispatch centers fully informed of the progress of the flight.Refer to FAR Sec. 121.557 0 Emergencies: Domestic and flag operations (http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/204EAF3B675364C7852566EF006E1C76?OpenDocument&Highlight=121.557).','checkbox','Operator'),(2063,'dispatch-operations-complications/errors','EOW Requirements Not Met','http://www.airweb.faa.gov/regulatory_and_guidance_library/rgfar.nsf/0/45E6161C46A16FAB852566EF006C47F2?OpenDocument&Highlight=extended%20over-water','http://www.airweb.faa.gov/regulatory_and_guidance_library/rgfar.nsf/0/45E6161C46A16FAB852566EF006C47F2?OpenDocument&Highlight=extended%20over-water','checkbox','Operator'),(2064,'dispatch-operations-complications/errors','ETOPS Requirements Not Met','http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/ABDF70915124A50486257299006B22D6?OpenDocument&Highlight=121.7','Extended-Range Twin-Engine Operations (ETOPS)-refers to the portion of a flight by a twin-engine airplane usually over an ocean that is more than one hour from an airport. ETOPS certification means that a twin-engine airplane model has reliably demonstrated the ability to fly safely from one to three hours from the nearest airport even if one engine fails. Refer to FAR Sec. 121.7 ? Definitions (http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/ABDF70915124A50486257299006B22D6?OpenDocument&Highlight=121.7); Appendix P to Part 121 - Requirements for ETOPS and Polar Operations (http://www.airweb.faa.gov/Regulatory_and_Guidance_Library%5CrgFAR.nsf/0/5ADCCB0071E031DE86257299006B2551?OpenDocument); Sec. 121.624 - ETOPS Alternate Airports (http://www.airweb.faa.gov/Regulatory_and_Guidance_Library%5CrgFAR.nsf/0/E699825B09FC60D586257299006B244A?OpenDocument); Sec. 121.633 - Considering time-limited systems in planning ETOPS alternates (http://www.airweb.faa.gov/Regulatory_and_Guidance_Library%5CrgFAR.nsf/0/C7A1FEB5A0A1DF0986257299006B2497?OpenDocument).','checkbox','Operator'),(2065,'dispatch-operations-complications/errors','Field Conditions','','','checkbox','Operator'),(2066,'dispatch-operations-complications/errors','Flight Altitude','http://www.airweb.faa.gov/Regulatory_and_Guidance_Library%5CrgFAR.nsf/0/F31E7E13F726ABD6852566EF006DE68D?OpenDocument','Rules related to altitude minimums set forth in paragraphs (Day VFR operations) and (Night VFR, IFR, and over-the-top operations) of this section, except when necessary for takeoff or landing, or except when, after considering the character of the terrain, the quality and quantity of meteorological services, the navigational facilities available, and other flight conditions, the Administrator prescribes other minimums for any route or part of a route where he finds that the safe conduct of the flight requires other altitudes. Outside of the United States the minimums prescribed in this section are controlling unless higher minimums are prescribed in the certificate holder\'s operations specifications or by the foreign country over which the aircraft is operating. Refer to Sec. 121.657: Flight altitude rules (http://www.airweb.faa.gov/Regulatory_and_Guidance_Library%5CrgFAR.nsf/0/F31E7E13F726ABD6852566EF006DE68D?OpenDocument).','checkbox','Operator'),(2067,'dispatch-operations-complications/errors','Flight Delay Due to Duty Time','','','checkbox','Operator'),(2068,'dispatch-operations-complications/errors','Flight Following','http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/56D0745CB0A9B2D9852566EF006ADD4B?OpenDocument&Highlight=121.125','The knowledge of the aircraft location and condition with a reasonable degree of certainty such that, in the event of mishap, those on board may be rescued When conducting supplemental operations, requirements for a flight following system for proper monitoring of each flight and flight following centers, located at those points necessary--(i) To ensure the proper monitoring of the progress of each flight with respect to its departure at the point of origin and arrival at its destination, including intermediate stops and diversions therefrom, and maintenance or mechanical delays encountered at those points or stops; and (ii) To ensure that the pilot in command is provided with all information necessary for the safety of the flight. Refer to Sec. 121.125: Flight following system(http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/56D0745CB0A9B2D9852566EF006ADD4B?OpenDocument&Highlight=121.125).','checkbox','DNAA'),(2069,'dispatch-operations-complications/errors','Flight Planning/Load','www.faa.gov/safety/programs_initiatives/oversight/iasa/model_aviation/media/PART08.doc','Specified information provided to air traffic services units, relative to an intended flight or portion of a flight of an aircraft.  The term \"flight plan is used to mean variously, full information on all items comprised in the flight plan description, covering the whole route of a flight, or limited information required when the purpose is to obtain a clearance for a minor portion of a flight such as to cross an airway, to take off from, or to land at a controlled aerodrome.','checkbox','DNAA'),(2070,'dispatch-operations-complications/errors','Flight Release','http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/71F65AFDE4568E12852566EF006DF4F3?OpenDocument&Highlight=121.687','Specifies the paperwork by which an air carrier ensures all activities required for safe dispatch and continuation of a flight to its destination. Refer to Sec. 121.689 (http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/71F65AFDE4568E12852566EF006DF4F3?OpenDocument&Highlight=121.687).','checkbox','Operator'),(2071,'dispatch-operations-complications/errors','Flight Release-Amendment','http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/53B827A8900F3F8D852566EF006DD22D?OpenDocument&Highlight=121.631','As delineated in FAR Sec. 121.631: Original dispatch or flight release, redispatch or amendment of dispatch or flight release (http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/53B827A8900F3F8D852566EF006DD22D?OpenDocument&Highlight=121.631): (a) The dispatch or flight release may be amended en route to include any alternate airport that is within the fuel range of the aircraft as specified in Secs. 121.639 through 121.647. (c) No person may change an original destination or alternate airport that is specified in the original dispatch or flight release to another airport while the aircraft is en route unless the other airport is authorized for that type of aircraft and the appropriate requirements of Secs. 121.593 through 121.661 and 121.173 are met at the time of redispatch or amendment of the flight release. (d) Each person who amends a dispatch or flight release en route shall record that amendment.','checkbox','Operator'),(2072,'dispatch-operations-complications/errors','Flight Release-Other','http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/71F65AFDE4568E12852566EF006DF4F3?OpenDocument&Highlight=121.689','Specifies additional issues, not listed, that are associated with the system by which an air carrier ensures all activities required for safe dispatch and continuation of a flight to its destination. Refer to Sec. 121.689 (http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/71F65AFDE4568E12852566EF006DF4F3?OpenDocument&Highlight=121.687).','checkbox','Operator'),(2073,'dispatch-operations-complications/errors','Flight Release-Re-release','','','checkbox','Operator'),(2074,'dispatch-operations-complications/errors','Foreign Flight Permits','','A permit that allows US operators/carriers to flyover another countries airspace.','checkbox','Operator'),(2075,'dispatch-operations-complications/errors','Foreign Permit Other','','Details pertaining to foreign permit issues.','text-field','Operator'),(2076,'dispatch-operations-complications/errors','Fuel Planning','http://www.airweb.faa.gov/Regulatory_and_Guidance_Library%5CrgFAR.nsf/0/1CC5B5DAD63E4806852566EF006DD813?OpenDocument','No person may dispatch or take off an airplane unless it has enough fuel--(a) To fly to the airport to which it is dispatched; (b) Thereafter, to fly to and land at the most distant alternate airport (where required) for the airport to which dispatched; and (c) Thereafter, to fly for 45 minutes at normal cruising fuel consumption or, for certificate holders who are authorized to conduct day VFR operations in their operations specifications and who are operating nontransport category airplanes type certificated after December 31, 1964, to fly for 30 minutes at normal cruising fuel consumption for day VFR operations. Refer to Sec. 121.639: Fuel supply: All domestic operations (http://www.airweb.faa.gov/Regulatory_and_Guidance_Library%5CrgFAR.nsf/0/1CC5B5DAD63E4806852566EF006DD813?OpenDocument).','checkbox','Operator'),(2077,'dispatch-operations-complications/errors','Load Manifest','http://www.airweb.faa.gov/Regulatory_and_Guidance_Library%5CrgFAR.nsf/0/E26142F09B8723AA852566EF006DEC4D?OpenDocument','Each certificate holder is responsible for the preparation and accuracy of a load manifest form before each takeoff. The form must be prepared and signed for each flight by employees of the certificate holder who have the duty of supervising the loading of aircraft and preparing the load manifest forms or by other qualified persons authorized by the certificate holder. Refer to Sec. 121.665: Load manifest (http://www.airweb.faa.gov/Regulatory_and_Guidance_Library%5CrgFAR.nsf/0/E26142F09B8723AA852566EF006DEC4D?OpenDocument)','checkbox','Operator'),(2078,'dispatch-operations-complications/errors','MEL/CDL Reference','','Specification of where to find specific information related to the Minimum Equipment List (MEL)/Configuration Deviation List (CDL).','text-field','Operator'),(2079,'dispatch-operations-complications/errors','MEL/CDL Reported Late','','','checkbox','Operator'),(2080,'dispatch-operations-complications/errors','Minimum Flight Weight','','','checkbox','Operator'),(2081,'dispatch-operations-complications/errors','Minimum Fuel Declaration','http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/1CC5B5DAD63E4806852566EF006DD813?OpenDocument&Highlight=121.639','No person may dispatch or take off an airplane unless it has enough fuel-to fly for 45 minutes at normal cruising fuel consumption or, for certificate holders who are authorized to conduct day VFR operations in their operations specifications and who are operating nontransport category airplanes type certificated after December 31, 1964, to fly for 30 minutes at normal cruising fuel consumption for day VFR operations. Refer to Sec. 121.639 - Fuel supply: All domestic operations (http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/1CC5B5DAD63E4806852566EF006DD813?OpenDocument&Highlight=121.639).','checkbox','Operator'),(2082,'dispatch-operations-complications/errors','Navigation Facilities','','','checkbox','Operator'),(2083,'dispatch-operations-complications/errors','NOTAMs','http://www.faa.gov/airports_airtraffic/airports/resources/advisory_circulars/media/150-5200-28C/150_5200_28c.pdf','Notices to Airmen (NOTAM) ? a notice containing information (not known sufficiently in advance to publicize by other means) concerning the establishment, condition, or change in any component (facility, service, or procedure) of, or hazard in, the National Airspace System (NAS); the timely knowledge of which is essential to personnel concerned with flight operations.Refer to AC 150/5200-28C: Notices to Airmen (NOTAMS (http://www.faa.gov/airports_airtraffic/airports/resources/advisory_circulars/media/150-5200-28C/150_5200_28c.pdf).','checkbox','UTRS'),(2085,'dispatch-operations-complications/errors','Other Dispatch Operations Complications/Errors','','Description of additional factor(s), not listed, associated with dispatch operations complications and/or errors.','text-field','DNAA'),(2086,'dispatch-operations-complications/errors','Pilot Deferral - GOC Comm','','','checkbox','Operator'),(2087,'dispatch-operations-complications/errors','Position Reporting Event','','','checkbox','Operator'),(2088,'dispatch-operations-complications/errors','RSVM','http://www.faa.gov/ats/ato/rvsm1.htm','Reduced Vertical Separation Minimums (RVSM) is the airspace where Air Traffic Control separates aircraft by a minimum of 1,000 feet vertically between flight level (FL) 290 and FL 410 inclusive. RVSM airspace is special qualification airspace; the operator and the aircraft used by the operator must be approved by the Administrator. Air traffic control notifies operators of RVSM by providing route planning information. Refer to AIM Section 6. Operational Policy/Procedures for Reduced Vertical Separation Minimum (RVSM) in the Domestic U.S., Alaska, Offshore Airspace and the San Juan FIR (http://www.faa.gov/airports_airtraffic/air_traffic/publications/atpubs/aim/Chap4/aim0406.html).','checkbox','Operator'),(2089,'dispatch-operations-complications/errors','Security','','Actual or potential breaches of regulations or security practices caused by airport personnel and/or passengers. Failure of company employees to ensure the highest level of security surrounding a flight (example: leaving the jetway door open and unattended during boarding).','checkbox','Operator'),(2090,'dispatch-operations-complications/errors','Takeoff Alternate','','','checkbox','Operator'),(2091,'dispatch-operations-complications/errors','Weather Forecast/Observation','','','checkbox','Operator'),(2092,'dispatch-operations-complications/errors','Weather Observations','','','combo-box','Operator'),(2093,'dispatch-operations/station-planning/errors','Deferred Items-MEL/CDL','','Minimum Equipment List (MEL)/Configuration Deviation List (CDL) faults or defects found on an aircraft which do not need immediate action and can be deferred for repair at a later date. This deferred defect status is only given for a strictly limited period of time and rectification must take place before that time has elapsed. Refer to FAR 121.628: Inoperable instruments and equipment (http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/75BFE28E8D694F43852566EF006DCF65?OpenDocument&Highlight=121.628).','checkbox','Operator'),(2094,'dispatch-operations/station-planning/errors','Incorrect Cargo Information','','','checkbox','Operator'),(2095,'dispatch-operations/station-planning/errors','Incorrect Passenger Information','','Issues associated with a human action (or human behavior) that unintentionally deviates from the expected action (or behavior) or fails to achieve what should be done related to the authority over initiating, conducting, or terminating a flight. Refer to FAR 121.533: Responsibility for operatio