(2792,'fault-isolation/test/inspection-error','Equipment/Tooling Not Available','','','checkbox','Operator'),(2793,'fault-isolation/test/inspection-error','Fault Isolation/Test/Inspection Error','http://www.hf.faa.gov/opsmanual/assets/pdfs/MEDA_guide.pdf','Issues associated with evaluating the condition of a system, component, equipment, or tool to correct the cause of the malfunction, including accessibility, deactivation/reactivation, inability to detect fault, and not found factors.','checkbox','MEDA Rev g.'),(2794,'fault-isolation/test/inspection-error','Inadequate Troubleshooting','','No guidance and/or rules were available regarding the activities, tasks, steps, decisions, calculations and processes associated with evaluating the condition of a system, component, equipment, or tool to isolate the source of a problem and correct the cause of the malfunction, including accessibility, deactivation/reactivation, inability to detect fault, and not found factors.','checkbox','M-DNAA V7.0 B2.5'),(2795,'fault-isolation/test/inspection-error','Incorrect Procedure','','Inaccurate or erroneous activities, tasks, steps, decisions, calculations and processes associated with evaluating the condition of a system, component, equipment, or tool to isolate the source of a problem and correct the cause of the malfunction, including accessibility, deactivation/reactivation, inability to detect fault, and not found factors.','checkbox','M-DNAA V7.0 B2.5'),(2796,'fault-isolation/test/inspection-error','Inspection Not Accomplished/RII','','','checkbox','Operator'),(2797,'fault-isolation/test/inspection-error','Lack of Experience/Training','','','checkbox','M-DNAA V7.0 B2.5'),(2798,'fault-isolation/test/inspection-error','Not Found by Fault Isolation','','Indicates that the source of the malfunction was not identified by evaluating the condition of a system, component, equipment, or tool, including accessibility, deactivation/reactivation, inability to detect fault, and not found factors.','checkbox','MEDA Rev g.'),(2799,'fault-isolation/test/inspection-error','Not Found by Inspection','','Indicates that the source of the malfunction was not determined by examining by sight and/or touch (with or without inspection enhancing tools/equipment).','checkbox','MEDA Rev g.'),(2800,'fault-isolation/test/inspection-error','Not Found by Operational/Functional Test','http://www.faa.gov/library/manuals/aviation/risk_management/ss_handbook/media/app_a_1200.PDF','System malfunctions or failures were unable to be determined through the process of operating a system under specified conditions, observing or recording the results, and making an evaluation of some aspect of the system.','checkbox','MEDA Rev g.'),(2801,'fault-isolation/test/inspection-error','Not Found by Part Inspection','','','checkbox','MEDA'),(2802,'fault-isolation/test/inspection-error','Not Found by Task Inspection','','','checkbox','MEDA'),(2803,'fault-isolation/test/inspection-error','Not Found by Visual Inspection','','','checkbox','MEDA'),(2804,'fault-isolation/test/inspection-error','Other Fault Isolation/Test/Inspection Error','http://www.hf.faa.gov/opsmanual/assets/pdfs/MEDA_guide.pdf','Description of additional factors, not listed, associated with fault isolation, test, and inspection errors.','text-field','MEDA Rev g.'),(2805,'fault-isolation/test/inspection-error','Personnel Not Available','','','checkbox','Operator'),(2806,'fault-isolation/test/inspection-error','Procedure Not Followed','','Non-adherence to the available guidance and/or rules regarding the activities, tasks, steps, decisions, calculations and processes associated with evaluating the condition of a system, component, equipment, or tool to isolate the source of a problem and correct the cause of the malfunction, including accessibility, deactivation/reactivation, inability to detect fault, and not found factors','checkbox','M-DNAA V7.0 B2.5'),(2807,'fault-isolation/test/inspection-error','System/Equipment Not Deactivated/Reactivated','','','checkbox','MEDA'),(2808,'fault-isolation/test/inspection-error','Technical Log Oversight','','','checkbox','MEDA'),(2809,'finding-processing','Analysis Results','','large memo field that documents all analysis actions taken and summarizes results','memo-field','UTRS'),(2810,'finding-processing','Final Approver Comments','','large memo field that documents all analysis actions taken and summarizes results','memo-field','UTRS'),(2811,'finding-processing','Final Approver','','select from list of approvers; if approver req\'d = checked then mandatory','user-name-field','UTRS'),(2812,'finding-processing','Assigned Date','','Date finding is assigned','date-field','UTRS'),(2813,'finding-processing','Awaiting Approval Date','','Date finding starts waiting for approval','date-field','UTRS'),(2814,'finding-processing','Classification','','User defined field that classifies finding','combo-box','UTRS'),(2815,'finding-processing','Completed Date','','Date finding is completed','date-field','UTRS'),(2816,'finding-processing','Department','','','combo-box','UTRS'),(2817,'finding-processing','ID','','unique record number of finding','bigint-field','UTRS'),(2818,'finding-processing','Immediate Action required','','if checked then due date <24 hours','checkbox','UTRS'),(2819,'finding-processing','Immedidate Action Taken','','allows auditor to record immediate action taken when finding was recorded','memo-field','UTRS'),(2820,'finding-processing','Notes','','A brief record that provides additional information in an unstructured format, especially those written down to aid the memory.','memo-field','UTRS'),(2821,'finding-processing','Date Opened','','Date finding is opened','date-field','UTRS'),(2822,'finding-processing','Pending Release Date','','Date finding ready to be assigned','date-field','UTRS'),(2823,'finding-processing','Policy Violation','','Yes/No user enters specific reference to company policy','editable-combo-box','UTRS'),(2824,'finding-processing','Regulatory Violation','','Yes/No user enters specific reference to regulation or search CFR\'s','editable-combo-box','UTRS'),(2825,'finding-processing','Rejected by Date','','Date finding is opened','date-field','UTRS'),(2826,'finding-processing','Repeat Finding','','Indicates that the non conformance is repetative','checkbox','UTRS'),(2827,'finding-processing','Reference or Requirement','','reference to requirement i.e. audit checklist or regulation','memo-field','UTRS'),(2828,'finding-processing','Responsible User Name','','person responsible for determining analyzing finding and determining probable cause','user-name-field','UTRS'),(2829,'finding-processing','Safety Hazard','','identifies finding as a hazard. Used to transfer hazard to Hazard Register (Safety Risk Management)','checkbox','UTRS'),(2830,'finding-processing','Scheduled Completion Date','','Date finding must be completed','date-field','UTRS'),(2831,'finding-processing','Status','','Open = valid new finding form submitted; Assigned = released to responsible person; Awaiting Approval = submitted to approver (only if approval required is selected); Rejected by Final Approver = same as assigned;  Complete = finding is complete','combo-box','UTRS'),(2832,'finding-processing','Title','','short descriptor use on processing page','editable-combo-box','UTRS'),(2833,'finding-processing','Validity','','Used to identify if the finding was valid.','combo-box','UTRS'),(2834,'fire-smoke-fumes-or-odor','APU-Fire/Overheat','','','checkbox','DNAA'),(2835,'fire-smoke-fumes-or-odor','Batteries-Personal Electronic Devices','','','checkbox','UTRS'),(2836,'fire-smoke-fumes-or-odor','Cabin','http://www.faa.gov/library/manuals/aircraft/airplane_handbook/media/faa-h-8083-3a-7of7.pdf','Cabin fires generally result from one of three sources: (1) careless smoking on the part of the pilot and/or passengers; (2) electrical system malfunctions; (3) heating system malfunctions. A fire in the cabin presents the pilot with two immediate demands: attacking the fire, and getting the airplane safely on the ground as quickly as possible. A fire or smoke in the cabin should be controlled by identifying and shutting down the faulty system.','checkbox','DNAA'),(2837,'fire-smoke-fumes-or-odor','Cargo','http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/69DC92EEBB541439852566730048E95D?OpenDocument&Highlight=25.857','Fire protection requirements based on cargo compartment classification.','checkbox','DNAA'),(2838,'fire-smoke-fumes-or-odor','Discharged Fire Bottle','http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/A1C92A8F1393638D85256673004D3CB1?OpenDocument&Highlight=25.1199','Fire extinguishing containers as described in FAR Sec. 25.1199 Extinguishing agent containers (http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/A1C92A8F1393638D85256673004D3CB1?OpenDocument&Highlight=25.1199).','checkbox','Operator'),(2839,'fire-smoke-fumes-or-odor','Electrical Smell','','Smell associated with electrical burning','checkbox','UTRS'),(2840,'fire-smoke-fumes-or-odor','Engines','http://www.faa.gov/library/manuals/aircraft/airplane_handbook/media/faa-h-8083-3a-7of7.pdf','An in-flight engine compartment fire is usually caused by a failure that allows a flammable substance such as\n\nfuel, oil or hydraulic fluid to come in contact with a hot surface. This may be caused by a mechanical failure of the engine itself, an engine-driven accessory, a defective induction or exhaust system, or a broken\n\nline. Engine compartment fires may also result from maintenance errors, such as improperly installed/fastened lines and/or fittings resulting in leaks. Engine compartment fires can be indicated by smoke and/or flames coming from the engine cowling area. They can also be indicated by discoloration, bubbling, and/or melting of the engine cowling skin in cases where flames and/or smoke is not visible to the pilot.','checkbox','DNAA'),(2841,'fire-smoke-fumes-or-odor','Explosion','','','checkbox','NTSB 6120-1'),(2842,'fire-smoke-fumes-or-odor','Fire','','The process of combustion of inflammable materials producing heat and light and (often) smoke.','checkbox','Operator'),(2843,'fire-smoke-fumes-or-odor','Fire/Smoke Detector Activated','http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/6FEEDA1FE296DDD2852566720051A398?OpenDocument&Highlight=25.854','Smoke detector system or equivalent that provides a warning light in the cockpit or provides a warning light or audio warning in the passenger cabin which would be readily detected by a flight attendant, taking into consideration the positioning of flight attendants throughout the passenger compartment during various phases of flight. Refer to FAR Sec. 25.854: Lavatory fire protection (http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/6FEEDA1FE296DDD2852566720051A398?OpenDocument&Highlight=25.854).','checkbox','Operator'),(2844,'fire-smoke-fumes-or-odor','Fire, Smoke, Fumes, or Odor','http://intlaviationstandards.org/Glossary.html','Occurrences and issues associated with fire, fumes, smoke, or odors in or on the aircraft, in flight or on the ground, including combustion of flammable material caused by an improper combination of heat, fuel, and oxygen; smoke or fumes detected in or outside the aircraft due to passenger smoking or undeclared combustible item in cargo; operational error (deicing crew spaying into APU inlet); or mechanical malfunction (engine failure or high oil temperature). Fire precautions are specified in FAR Sec. 121.221 (http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/A2AE7C6BE0B63517852566EF006B3907?OpenDocument&Highlight=121.221)','checkbox','DNAA'),(2845,'fire-smoke-fumes-or-odor','Fire/Smoke Warning','http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/6FEEDA1FE296DDD2852566720051A398?OpenDocument&Highlight=25.854','Indicates activation of the smoke detector system or equivalent that provides a warning light in the cockpit or provides a warning light or audio warning in the passenger cabin which would be readily detected by a flight attendant, taking into consideration the positioning of flight attendants throughout the passenger compartment during various phases of flight','checkbox','Operator'),(2846,'fire-smoke-fumes-or-odor','Flight Deck','http://members.airlines.org/about/d.aspx?nid=7949','Also called the cockpit, it the compartment in the front of the airplane where the flight crew performs their job of flying the aircraft. It is the most forward part of the fuselage and contains all the instruments needed to fly the plane. The flight deck has seats for the pilot and co-pilot; a flight engineer, on some planes; and seats for one or two observers that could be from the airline itself, or from FAA. The flight deck is off limits to passengers during flight and to flight attendants during takeoffs and landings.','checkbox','DNAA'),(2847,'fire-smoke-fumes-or-odor','Fumes','http://www.nfpa.org/itemDetail.asp?categoryID=1334&itemID=30728&URL=Press%20Room/A%20Reporter\'s%20Guide%20to%20Fire%20and%20the%20NFPA/Glossary#o','The concentration of flammable constituents in air that exceed 25 percent of their flammability limit.','checkbox','Operator'),(2848,'fire-smoke-fumes-or-odor','Galley','','Occurrences and issues associated with fire, fumes, smoke, or odors in the galley compartment of an aircraft where on-board meal service equipment is used to cook and prepare food.','checkbox','ASRS'),(2849,'fire-smoke-fumes-or-odor','Ground Support Equipment Power','','','combo-box','Operator'),(2850,'fire-smoke-fumes-or-odor','Lavatory-Fire/Smoke/Fumes','','Indicates the spot or position where the fire, fumes, smoke, or odors is detected is the lavatory ? either on the ground or in the air.','checkbox','M-DNAA V7.0 B4.1'),(2851,'fire-smoke-fumes-or-odor','Location','','Indicates the spot or position where the fire, fumes, smoke, or odors is detected.','combo-box','Operator'),(2852,'fire-smoke-fumes-or-odor','Odor','','Types of gases, vapors, or particles that stimulate the olfactory organs; typically in an unpleasant or objectionable manner.','checkbox','Operator'),(2853,'fire-smoke-fumes-or-odor','Odor Description','','','combo-box','Operator'),(2854,'fire-smoke-fumes-or-odor','Odor Intensity','','','combo-box','Operator'),(2855,'fire-smoke-fumes-or-odor','Other Fire, Smoke, Fumes, or Odor Event','','Description of additional factor(s), not listed, associated with fire, smoke, fumes, or odor incidents or events.','text-field','DNAA'),(2856,'fire-smoke-fumes-or-odor','Reaction of Crew','','','combo-box','Operator'),(2857,'fire-smoke-fumes-or-odor','Reaction of Passengers','','','combo-box','Operator'),(2858,'fire-smoke-fumes-or-odor','Smoke','http://rgl.faa.gov/Regulatory_and_Guidance_Library/rgAdvisoryCircular.nsf/0/4fd449e79eaca87e862569b20075232a/$FILE/ac25-9a.pdf','The airborne solid and liquid particulates and gases evolved when a material undergoes pyrolysis or combustion, together with the quantity of air that is entrained or otherwise mixed into the mass.','checkbox','Operator'),(2859,'fire-smoke-fumes-or-odor','Taxi Close to Preceeding Aircraft','','','checkbox','Operator'),(2860,'fire-smoke-fumes-or-odor','Wheel Well/Landing Gear','http://virtualskies.arc.nasa.gov/glossary/L.html','Landing Gear-The collection of devices including wheels, skis, and floats that enable a flight vehicle to land and move about on land, water or other surfaces and supports the weight of the aircraft when it lands. The landing gear is often retractable - it can be pulled into the fuselage of the aircraft to reduce drag during flight. Another word for undercarriage','checkbox','DNAA'),(2861,'flight-attendant-manual','Incorrect LEP','','','checkbox','Operator'),(2862,'flight-attendant-manual','Missing Alert Bulletin(s)','','','checkbox','Operator'),(2863,'flight-attendant-manual','Missing FAM Revision(s)','','','checkbox','Operator'),