e trouble.','checkbox','ASRS'),(2907,'flight-crew','Regained Aircraft Control','','','checkbox','ASRS'),(2908,'flight-crew','Rejected Landing (Less than 50 ft. AGL)','','A planned landing that is discontinued for reasons such as conflicting traffic, weather, or landing surface obstacles.','checkbox','DNAA'),(2909,'flight-crew','Requested Emergency Equipment','http://www.faa.gov/airports_airtraffic/air_traffic/publications/atpubs/aim/Chap6/aim0603.html','Actions undertaken to obtain assistance. Refer to AIM Chapter 6-3-2: Emergency Procedures: Obtaining Emergency Assistance (http://www.faa.gov/airports_airtraffic/air_traffic/publications/atpubs/aim/Chap6/aim0603.html).','checkbox','Operator'),(2910,'flight-crew','Requested Priority with ATC','','','checkbox','UTRS'),(2911,'flight-crew','Required Inspection Performed','','','checkbox','Operator'),(2912,'flight-crew','Reset Circuit Breakers','','ndicates that the Circuit Breakers (CBs) designed to open an electrical circuit automatically at a predetermined overload of current were returned to its original state.','combo-box','Operator'),(2913,'flight-crew','Returned to Assigned Airspace','','','checkbox','ASRS'),(2914,'flight-crew','Returned to Assigned Altitude','http://www.faa.gov/airports_airtraffic/air_traffic/publications/atpubs/aim/Chap4/aim0404.html','When possible, if the altitude assigned is different from the altitude requested by the pilot, ATC will inform the pilot when to expect climb or descent clearance or to request altitude change from another facility. If this has not been received prior to crossing the boundary of the ATC facility\'s area and assignment at a different altitude is still desired, the pilot should reinitiate the request with the next facility. Refer to AIM Section 4-4-3d: Altitude Data (http://www.faa.gov/airports_airtraffic/air_traffic/publications/atpubs/aim/Chap4/aim0404.html).','checkbox','ASRS'),(2915,'flight-crew','Returned to Assigned Speed','http://www.faa.gov/airports_airtraffic/air_traffic/publications/atpubs/aim/Chap4/aim0404.html','If ATC determines (before an approach clearance is issued) that it is no longer necessary to apply speed adjustment procedures, they will inform the pilot to resume normal speed. Approach clearances supersede any prior speed adjustment assignments, and pilots are expected to make their own speed adjustments, as necessary, to complete the approach. Refer to AIM Section 4-4-11: Speed Adjustments (http://www.faa.gov/airports_airtraffic/air_traffic/publications/atpubs/aim/Chap4/aim0404.html).','checkbox','Operator'),(2916,'flight-crew','Returned to Departure Airport','','When an aircraft has taken off and experiences a situation requiring it to return to the departure airport','checkbox','Operator'),(2917,'flight-crew','Returned to Assigned Course/Heading','','To turn back to the specified direction of flight in the horizontal plane, measured in degrees from north.','checkbox','ASRS'),(2919,'flight-crew','Through Flight Not Completed','','','checkbox','UTRS'),(2920,'flight-crew','Took Evasive Action','','','checkbox','ASRS'),(2921,'flight-crew','Took Precautionary Avoidance Action','','','checkbox','ASRS'),(2922,'flight-crew','Wrong Taxiway','','Flight Crew taxiied onto taxiway other than assigned.','checkbox','UTRS'),(2923,'flight-crew-coordination','Altitude Planning/Awareness','','','checkbox','Operator'),(2924,'flight-crew-coordination','Attention to/Distraction from Flight Duties','http://rgl.faa.gov/Regulatory_and_Guidance_Library/rgAdvisoryCircular.nsf/0/80038cf51aace53686256e24005cbb23/$FILE/AC120-51e.pdf','Issues involve proper allocation of tasks to individuals, avoidance of work overloads in self and in others, prioritization of tasks during periods of high workload, and preventing nonessential factors from distracting attention from adherence to SOPs, particularly those relating to critical tasks. Refer to AC 120-51E: Crew Resource Management Training (http://rgl.faa.gov/Regulatory_and_Guidance_Library/rgAdvisoryCircular.nsf/0/80038cf51aace53686256e24005cbb23/$FILE/AC120-51e.pdf).','checkbox','DNAA'),(2925,'flight-crew-coordination','Decisionmaking','http://rgl.faa.gov/Regulatory_and_Guidance_Library/rgAdvisoryCircular.nsf/0/80038cf51aace53686256e24005cbb23/$FILE/AC120-51e.pdf','Decision-making is a systematic approach to the mental process used by pilots to consistently determine the best course of action in response to a given set of circumstances.','checkbox','DNAA'),(2926,'flight-crew-coordination','Flight Crew Coordination','','Factors associated with interface between flight crewmembers such as awareness, collaboration, decision making, planning, workload management.','checkbox','DNAA'),(2927,'flight-crew-coordination','Judgment or Assessment of Risk','http://www.faa.gov/library/manuals/aviation/pilot_handbook/media/faa-h-8083-25-4of4.pdf','Mental process of recognizing and analyzing all pertinent information in a particular situation , a rational evaluation of alternative actions in response to it, and a timely decision on which action to take.','checkbox','DNAA'),(2928,'flight-crew-coordination','Flight Crew Coordination: Other','','Indicates additional factors, not listed, associated with interface between flight crewmembers such as awareness, collaboration, decision making, planning, workload management.','text-field','DNAA'),(2929,'flight-crew-coordination','Planning','http://rgl.faa.gov/Regulatory_and_Guidance_Library/rgAdvisoryCircular.nsf/0/80038cf51aace53686256e24005cbb23/$FILE/AC120-51e.pdf','Issues include methods to improve monitoring and accomplishing required tasks, asking for and responding to new information, and preparing in advance for required activities. Refer to AC 120-51E: Crew Resource Management Training (http://rgl.faa.gov/Regulatory_and_Guidance_Library/rgAdvisoryCircular.nsf/0/80038cf51aace53686256e24005cbb23/$FILE/AC120-51e.pdf).','checkbox','DNAA'),(2930,'flight-crew-coordination','Statement or Clarification of Plans','','','checkbox','DNAA'),(2931,'flight-crew-coordination','Timing of Flight Duties/Workload Distribution','http://rgl.faa.gov/Regulatory_and_Guidance_Library/rgAdvisoryCircular.nsf/0/80038cf51aace53686256e24005cbb23/$FILE/AC120-51e.pdf','Stressing the importance of maintaining awareness of the operational environment and anticipating contingencies. Instruction may address practices (e.g., vigilance, planning and time management, prioritizing tasks, and avoiding distractions) that result in higher levels of situation awareness, including: Preparation/Planning/Vigilance and Workload Distribution/Distraction Avoidance, Refer to AC 120-51E: Crew Resource Management Training (http://rgl.faa.gov/Regulatory_and_Guidance_Library/rgAdvisoryCircular.nsf/0/80038cf51aace53686256e24005cbb23/$FILE/AC120-51e.pdf).','checkbox','DNAA'),(2932,'flight-crew-employee-information','Change in Reserve/PT Assignment','','','combo-box','Operator'),(2933,'flight-crew-employee-information','Consecutive Days on Duty/Flown','','','combo-box','UTRS'),(2934,'flight-crew-employee-information','Consecutive Days on Duty','','','integer-field','UTRS'),(2935,'flight-crew-employee-information','Duty Off Time','','','date-time-field','Operator'),(2936,'flight-crew-employee-information','Duty On Time','','','date-time-field','Operator'),(2937,'flight-crew-employee-information','Age','','','combo-box','UTRS'),(2938,'flight-crew-employee-information','Flight Leg of Event','','','combo-box','UTRS'),(2939,'flight-crew-employee-information','Experience (Total Years)','','Specifies the total number of years of experience for the flight crew employee in years.','real-field','UTRS'),(2940,'flight-crew-employee-information','Familiarity with Other Pilot','','','combo-box','DAWG'),(2941,'flight-crew-employee-information','Fit for Duty','','','checkbox','Operator'),(2942,'flight-crew-employee-information','Date/Time Fit For Duty','','','date-time-field','Operator'),(2943,'flight-crew-employee-information','Gender','','','co