w.faa.gov/library/manuals/aircraft/airplane_handbook/media/faa-h-8083-3a-7of7.pdf','Environmental systems include the supplemental oxygen systems, air condition systems, heaters, and pressurization systems, which make it possible for an occupant to function at high altitude.','checkbox','UTRS'),(3404,'h-aircraft-area-affected','External Equipment','','','checkbox','UTRS'),(3405,'h-aircraft-area-affected','Fairing','','','checkbox','UTRS'),(3406,'h-aircraft-area-affected','Fire suppression system','','This includes liquid or gas systems','checkbox','UTRS'),(3407,'h-aircraft-area-affected','Flap','http://www.faa.gov/library/manuals/aircraft/airplane_handbook/media/faa-h-8083-3a-7of7.pdf','Flaps: Control surfaces installed on the trailing edge of a wing and used to increase the amount of lift generated by the wing at slow speeds used during takeoffs and landings. Flaps also have the effect of slowing an aircraft during its landing approach. Flaps also are commonly deployed during final approach to increase lift, which provides control and stability at slower speeds. Flap and slat settings are controlled by the pilots, although automatic extension/retraction systems are sometimes provided to protect flight and structural integrity. Flaps/Slats-Leading Edge are the control surface on the wing?s leading edge used to increase the slow speed lifting efficiency of the wing and decrease stall speed [Refer to ATA code 57-54 (Slat Surface) and 27-8* (Slat Control System)]. Flaps-Trailing Edge are the control surface on the wing?s trailing edge used to increase the slow speed lifting efficiency of the wing and decrease stall speed [Refer to ATA code 57-53 (Trailing Edge Flap Surface) and 27-5* (Trailing Edge Control System)].','checkbox','UTRS'),(3408,'h-aircraft-area-affected','Flight Controls','','Aircraft flight control systems consist of flight control surfaces, the respective cockpit controls, connecting linkages, and the necessary operating mechanisms to control an aircraft\'s direction in flight. Aircraft engine controls are also considered as flight controls as they change speed.','checkbox','UTRS'),(3409,'h-aircraft-area-affected','Flight Deck','http://members.airlines.org/about/d.aspx?nid=7949','Also called the cockpit, it the compartment in the front of the airplane where the flight crew performs their job of flying the aircraft. It is the most forward part of the fuselage and contains all the instruments needed to fly the plane. The flight deck has seats for the pilot and co-pilot; a flight engineer, on some planes; and seats for one or two observers that could be from the airline itself, or from FAA. The flight deck is off limits to passengers during flight and to flight attendants during takeoffs and landings.','checkbox','UTRS'),(3410,'h-aircraft-area-affected','Fly by Cable System','','Mechanical or manually-operated flight control systems','checkbox','UTRS'),(3411,'h-aircraft-area-affected','Fly by Wire System','','Computer-configured controls, where a computer system is interposed between the operator and the final control actuators or surfaces','checkbox','UTRS'),(3412,'h-aircraft-area-affected','Forward','','In, near, or toward the  nose of aircraft.','checkbox','UTRS'),(3413,'h-aircraft-area-affected','Fuel','','','checkbox','UTRS'),(3414,'h-aircraft-area-affected','Fuselage','http://www.faa.gov/library/manuals/aircraft/airplane_handbook/media/faa-h-8083-3a-7of7.pdf','The main body of an aircraft, cylindrical in shape. It contains the cockpit, main cabin and cargo compartments.','checkbox','UTRS'),(3415,'h-aircraft-area-affected','Galley','','Compartment of a aircraft where on-board meal service equipment is used to cook and prepare food.','checkbox','UTRS'),(3416,'h-aircraft-area-affected','Horizontal Stabilizer','','','checkbox','UTRS'),(3417,'h-aircraft-area-affected','Hydraulics','http://www.faa.gov/library/manuals/aircraft/airplane_handbook/media/faa-h-8083-3a-7of7.pdf','Issues associated with the transmission of 