regulations under which flight operations are conducted (as specified in the Code of Federal Regulations (CFR), particularly the Federal Aviation Regulations(FARs) are followed.','checkbox','Operator'),(3996,'how-event-detected','Safety','','','checkbox','Operator'),(3997,'how-event-detected','Self Awareness/Scan','','','checkbox','Operator'),(3998,'how-event-detected','Sole Source/Individual','','','checkbox','Operator'),(3999,'how-event-detected','Supervisor','','','checkbox','Operator'),(4000,'how-event-detected','Training/Standards','','','checkbox','Operator'),(4001,'how-event-detected','TSA','','Transportation Security Administration / TSA Representative','checkbox','UTRS'),(4002,'how-event-detected','Unknown','','','checkbox','Operator'),(4003,'human-error','Altitude Planning/Awareness','','','checkbox','Operator'),(4004,'human-error','Disregard for Polices/Procedures','','','checkbox','Operator'),(4005,'human-error','Human Error','http://www.faa.gov/library/manuals/aviation/risk_management/ss_handbook/media/app_a_1200.PDF','Issues associated with a human action (or human behavior) that unintentionally deviates from the expected action (or behavior) or fails to achieve what should be done. Errors can be predictable and random. Errors can also be categorized as primary or contributory. Primary errors are those committed by personnel immediately and directly involved with the accident. Contributory errors result from actions on the part of personnel whose duties preceded and affected the situation during which the results of the error became apparent. The difference between a computed, observed, or measured value or condition and true, specified, or theoretically correct value or condition. A mistake in engineering, requirement specification, or design, implementation, or operation which could result in a failure, and /or contributory hazard. There are four types of Human Errors: 1) Omission 2) Commission 3) Sequence 4) Timing.','checkbox','Operator'),(4007,'human-error','Maintenance Error (MEL, Oversight, MOC, Non-Compliance)','','Issues associated with maintenance actions that unintentionally deviates from the expected action (or behavior) or fails to achieve what should be done associated with maintenance actions including the Minimum Equipment List (MEL), overseeing maintenance tasking, Maintenance Operational Control (MOC), and failure to follow the regulations and requirements.','checkbox','Operator'),(4008,'human-error','Misapplication of Flight Controls','','','checkbox','Operator'),(4009,'human-error','Misapplication of Polices/Procedures','','','checkbox','Operator'),(4010,'human-error','Misapplication of System Knowledge','','','checkbox','Operator'),(4011,'human-error','Other Human Error','','Description of additional factor(s), not listed, associated with human error.','text-field','Operator'),(4012,'human-error','Poor Performance Planning','','Deficiencies in the accomplishment of a task in accordance with a set standard of completeness and accuracy.','checkbox','Operator'),(4013,'human-error','Weight and Balance Error','http://www.faa.gov/library/manuals/aviation/pilot_handbook/media/faa-h-8083-25-1of4.pdf','Issues associated with employee action that unintentionally deviates from the expected action or fails to achieve what should be done related to the proper distribution of the load according to policies and procedures.','checkbox','Operator'),(4015,'human-factors','CRM','http://rgl.faa.gov/Regulatory_and_Guidance_Library/rgAdvisoryCircular.nsf/0/80038cf51aace53686256e24005cbb23/$FILE/AC120-51e.pdf','Crew Resource Management (CRM) refers to the effective use of all available resources: human resources, hardware, and information. Other groups routinely working with the cockpit crew, who are involved in decisions required to operate a flight safely, are also essential participants in an effective CRM process. These groups include but are not limited to: (a) Aircraft dispatchers; (b) Flight attendants; (c) Maintenance personnel; (d) Air traffic controllers. Refer to AC 120-51E: Crew Resource Management Training (http://rgl.faa.gov/Regulatory_and_Guidance_Library/rgAdvisoryCircular.nsf/0/80038cf51aace53686256e24005cbb23/$FILE/AC120-51e.pdf).','combo-box','Operator'),(4016,'human-factors','DRM','','','combo-box','Operator'),(4017,'human-factors','Equipment Limitation','','Equipment is planned, built, and/or installed in such a way that it is difficult to use or which could lead to failures or errors.','checkbox','Operator'),(4018,'human-factors','Equipment Placement','','','checkbox','Operator'),(4019,'human-factors','Ergonomics','http://www.iea.cc/ergonomics/','Issues due to incompatibilities in system design. Ergonomics (or human factors) is the scientific discipline concerned with the understanding of interactions among humans and other elements of a system, and the profession that applies theory, principles, data and methods to design in order to optimize human well-being and overall system performance. Ergonomists contribute to the design and evaluation of tasks, jobs, products, environments and systems in order to make them compatible with the needs, abilities and limitations of people.','checkbox','Operator'),(4020,'human-factors','Expectation Bias','','','checkbox','UTRS'),(4021,'human-factors','Human Factors','http://www.hf.faa.gov/Portal/ShowProduct.aspx?ToolType=True&ProductID=147','A multidisciplinary effort to generate and compile information about human capabilities and limitations; and apply that information to equipment, systems, facilities, procedures, jobs, environments, training, staffing, and personnel management for safe, comfortable, effective human performance.','checkbox','Operator'),(4022,'human-factors','Lack of Alertness','','','checkbox','Operator'),(4023,'human-factors','Other Human Factors','','Description of additional factor(s), not listed, associated with human factors.','text-field','Operator'),(4024,'human-factors','Pilot Handling-Judg