t was detected.','text-field','UTRS'),(4046,'h-when-event-detected','Paperwork Audit','http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgOrders.nsf/0/6aae93ff516cd6fd862571fb00661605/$FILE/VS%208000.1.pdf','Scheduled, formal reviews and verifications to evaluate compliance with policy, standards, and/or contractual requirements. The starting point for an audit is the management and operations of the organization, and it moves outward to the organization\'s activities and products/service. Refer to AC 120-92: Introduction to Safety Management Systems for Air Operators) (http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgAdvisoryCircular.nsf/0/6485143d5ec81aae8625719b0055c9e5/$FILE/AC%20120-92.pdf).','checkbox','UTRS'),(4047,'h-when-event-detected','Patrol','','','checkbox','UTRS'),(4048,'h-when-event-detected','Platform/Linework','','','checkbox','UTRS'),(4049,'h-when-event-detected','PostFlight','http://www.faa.gov/library/manuals/aircraft/airplane_handbook/media/faa-h-8083-3a-2of7.pdf','Activities after a flight is completed when the engine is shut down and the airplane is secured.','checkbox','UTRS'),(4050,'h-when-event-detected','PreFlight','http://virtualskies.arc.nasa.gov/glossary/P.html','Indicates occurrence was detected during the check and preparation of the aircraft before takeoff.','checkbox','UTRS'),(4051,'h-when-event-detected','When Event Detected','','Specifies the activity that identified the occurrence of the event.','checkbox','UTRS'),(4052,'h-when-event-detected','Pushback/Tow','http://intlaviationstandards.org/Glossary.html','Indicates occurrence was detected while aircraft was moving in the gate, ramp, or parking area, assisted by a tow vehicle [tug].','checkbox','UTRS'),(4053,'h-when-event-detected','Ramp','http://members.airlines.org/about/d.aspx?nid=7954','Indicates occurrence was detected while the aircraft was located in the parking area at an airport, usually adjacent to a terminal.','checkbox','UTRS'),(4054,'h-when-even