UTRS'),(4141,'incompatible-aircraft-patient-issues','Medical Equipment Configuration Did Not Meet Needs','','','checkbox','Operator'),(4142,'incompatible-aircraft-patient-issues','Medical Equipment Failure','','','checkbox','Operator'),(4143,'incompatible-aircraft-patient-issues','Other','','','text-field','Operator'),(4144,'incompatible-aircraft-patient-issues','Patient Too Large For Transport','','','checkbox','Operator'),(4145,'incompatible-aircraft-patient-issues','Patient Transfer Delayed For Fuelburn','','','checkbox','Operator'),(4146,'incursion-event','Incursion Event','http://intlaviationstandards.org/Glossary.html','Occurrences on or near an airport runway associated with the collision with, risk of collision, or evasive action taken by an aircraft to avoid, a vehicle, person, object on the ground, or other aircraft on an active ramp, runway, or taxiway by an aircraft or ground vehicle other than the vehicle cleared for operation on that surface.','checkbox','DNAA'),(4147,'incursion-event','Other Incursion Event','','Description of additional factor(s), not listed, associated with incursion incidents or events.','text-field','DNAA'),(4148,'incursion-event','Ramp Incursion','http://intlaviationstandards.org/Documents/CICTTOccurrenceCategoryDefinitions.pdf','Occurrences on or near an airport runway associated with the collision with, risk of collision, or evasive action taken by an aircraft to avoid, a vehicle, person, object on the ground, or other aircraft on an active ramp by an aircraft or ground vehicle other than the vehicle cleared for operation on that surface that creates a collision hazard or loss of separation while an aircraft taking off, intending to takeoff, landing, or intending to land.','checkbox','DNAA'),(4149,'incursion-event','Runway Incursion','http://web.nbaa.org/public/ops/safety/icao_pri07.pdf','http://web.nbaa.org/public/ops/safety/icao_pri07.pdf','checkbox','DNAA'),(4150,'incursion-event','Runway Incursion Error Type','www.faa.gov/runwaysafety/pdf/report5.pdf','Runway Incursion Error Type defined as: (1) Operational Error/Deviation-an action by an air traffic controller that results in less than the required minimum separation between two or more aircraft, or between an aircraft and obstacle (e.g., vehicles, equipment, personnel on runways/an occurrence attributable to an element of the air traffic system in which applicable separation minima were maintained, but an aircraft, vehicle, equipment, or personnel encroached upon a landing area that was delegated to another position of operation without prior coordination and approval; (2) Pilot Deviation-an action of a pilot that violates any FARs; or (3) Vehicle/Pedestrian Deviation-Vehicles or pedestrians moving on the runway movement area without authorization from air traffic control that interferes with aircraft operations.','combo-box','Operator'),(4151,'incursion-event','Runway Incursion Severity','www.faa.gov/runwaysafety/pdf/report5.pdf','Runway Incursion severity classified as: A-separation decreases and participants take extreme action to narrowly avoid a collision, or the event results in a collision; B-separation decreases and there is a significant potential for collision; C-Separation decreases but there is ample time and distance to avoid a potential collision; D-Little or no chance of collision but meets the definition of a runway incursion.','combo-box','Operator'),(4152,'incursion-event','Taxiway Incursion','http://intlaviationstandards.org/Glossary.html','Occurrences on or near an airport runway associated with the collision with, risk of collision, or evasive action taken by an aircraft to avoid, a vehicle, person, object on the ground, or other aircraft on an active taxiway by an aircraft or ground vehicle other than the vehicle cleared for operation on that surface.','checkbox','DNAA'),(4153,'individual-factors','Alcohol Detected','http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/8BF3EC7863F023AD862571960066BF2A?OpenDocument&Highlight=alcohol','Occurrences associated with the identification of the consumption of any beverage, mixture, or preparation, including any medication, containing alcohol. Alcohol means the intoxicating agent in beverage alcohol, ethyl alcohol, or other low molecular weight alcohols, including methyl or isopropyl alcohol','checkbox','M-DNAA V7.0 C1.9'),(4154,'individual-factors','Body Size/Strength','','','checkbox','MEDA Rev g.'),(4155,'individual-factors','Circadian Cycle','scitech.dot.gov/research/human/docs/fatigue/fmr07-03.doc','scitech.dot.gov/research/human/docs/fatigue/fmr07-03.doc','checkbox','Operator'),(4156,'individual-factors','Complacency','','Lack of awareness of actual dangers or deficiencies','checkbox','Operator'),(4157,'individual-factors','Crew Qualifications','http://www.airweb.faa.gov/Regulatory_and_Guidance_Library%5CrgFAR.nsf/0/DA3AFA148A58E1E586256EE00064173C?OpenDocumen','The requirements for issuing pilot, flight instructor, and ground instructor certificates and ratings; the conditions under which those certificates and ratings are necessary; and the privileges and limitations of those certificates and ratings are specified in FAR Part 61.1: Certification: Pilots, Flight Instructors, and Ground Instructors (http://www.airweb.faa.gov/Regulatory_and_Guidance_Library%5CrgFAR.nsf/0/DA3AFA148A58E1E586256EE00064173C?OpenDocument)','checkbox','Operator'),(4158,'individual-factors','Drug Detected','http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/980F28FF18C8C1A2862571960066BEF4?OpenDocument&Highlight=drug','Issues associated with the detection of prohibited drugs by employees who perform safety-sensitive functions.','checkbox','UTRS'),(4159,'individual-factors','Environmental Stressors','scitech.dot.gov/research/human/docs/fatigue/fmr07-03.doc','Environmental factors that can adversely affect employee?s level of alertness, including heat, humidity, cold, altitude, vibration, and noise.','checkbox','Operator'),(4160,'individual-factors','Experience Level','','Employee has too little/too much experience in this area and this had a negative impact on the situation','checkbox','M-DNAA V7.0 C1.9'),(4161,'individual-factors','Extended Duty/Commuting Periods','scitech.dot.gov/research/human/docs/fatigue/fmr07-03.doc','Combination of long work periods and other non-duty factors contribute to on-the-job fatigue, by limiting the available time for recreation, rest, and sleep. Over extended working periods, repeated inadequate sleep periods can result in accumulated sleep debt and associated operator fatigue. Among the primary aspects of extended work and/or commuting periods are: (1) long commutes to or from work on a daily basis; (2) long waits after reporting for work before duty begins, (3) forced interruptions in work that extend the duty day; (4) long commutes from home to report for work prior to beginning a multi-day work period.','checkbox','Operator'),(4162,'individual-factors','Fatigue','','','checkbox','Operator'),(4163,'individual-factors','Fatigue/Lack of Alertness','scitech.dot.gov/research/human/docs/fatigue/fmr07-03.doc','scitech.dot.gov/research/human/docs/fatigue/fmr07-03.doc','checkbox','M-DNAA V7.0 C1.9'),(4164,'individual-factors','Fear/Panic','','Crewmember afraid or suddenly frightened','checkbox','Operator'),(4165,'individual-factors','High Workload/Task Saturation','','Excessive amount of work to be performed in a given time period.','checkbox','M-DNAA V7.0 C1.9'),(4166,'individual-factors','Illness or Injury','','Issues associated with a non-fatal medical condition occurring on the aircraft to passengers or crew that significantly degrades their ability to function or a non-fatal injury requiring medical attention or absence from duty.','checkbox','Operator'),(4167,'individual-factors','Inadequate Training','','','checkbox','M-DNAA V7.0 C1.9'),(4168,'individual-factors','Individual Factors','http://www.hf.faa.gov/opsmanual/assets/pdfs/MEDA_guide.pdf','Issues associated with the individual characteristics that can influence employee effectiveness that vary from person to person and may lead to a person making errors or mistakes. These factors include body size/strength, health, and personal events and the way that an person responds to things such as physical fitness, peer pressure, time constraints, stressors, noise, distraction, and fatigue caused by the job itself.','checkbox','MEDA Rev g.'),(4169,'individual-factors','Insufficient Attention to Detail','','Lack of effort towards discovering the small elements of the situation','checkbox','Operator'),(4170,'individual-factors','Interruption/Distraction','http://rgl.faa.gov/Regulatory_and_Guidance_Library/rgAdvisoryCircular.nsf/0/80038cf51aace53686256e24005cbb23/$FILE/AC120-51e.pdf','Interruption caused focus of attention to be shifted or diverted away from task. Issues involve proper allocation of tasks to individuals, avoidance of work overloads in self and in others, prioritization of tasks during periods of high workload, and preventing nonessential factors from distracting attention from adherence to SOPs, particularly those relating to critical tasks. Refer to AC 120-51E: Crew Resource Management Training (http://rgl.faa.gov/Regulatory_and_Guidance_Library/rgAdvisoryCircular.nsf/0/80038cf51aace53686256e24005cbb23/$FILE/AC120-51e.pdf).','checkbox','Operator'),(4171,'individual-factors','Lack of Alertness','','','checkbox','Operator'),(4172,'individual-factors','Lack of Assertiveness','','','checkbox','M-DNAA V7.0 C1.9'),(4173,'individual-factors','Lack of Motivation','','Drive or influence that is internally or externally generated','checkbox','Operator'),(4174,'individual-factors','Lack of Procedural Knowledge','','','checkbox','Operator'),(4175,'individual-factors','Lack of Rest Periods','scitech.dot.gov/research/human/docs/fatigue/fmr07-03.doc','Impact on fatigue due to unavailability of planned rest period to supplement sleep and to temporarily restore alertness on the job. Rest periods are free of all restraint or duty for an employee and free of all responsibility for work or duty should the occasion arise. Refer to FAR Sec. 121.471: Flight time limitations and rest requirements-All flight crewmembers (http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/0CD035F7648A95F8852566EF006D0B3D?OpenDocument&Highlight=121.471); Sec. 121.481: Flight time limitations-One or two pilot crews (http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/0CD035F7648A95F8852566EF006D0B3D?OpenDocument&Highlight=121.481); Sec. 121.505: Flight time limitations-Two pilot crews: airplanes (http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/0CD035F7648A95F8852566EF006D0B3D?OpenDocument&Highlight=121.505); and Sec. 121.467: Flight attendant duty period limitations and rest requirements (http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/0CD035F7648A95F8852566EF006D0B3D?OpenDocument&Highlight=121.467).','checkbox','Operator'),(4176,'individual-factors','Lack of Situational Awareness','http://www.faa.gov/library/manuals/aviation/pilot_handbook/media/faa-h-8083-25-4of4.pdf','Not having accurate perception and understanding of all the factors and conditions going around you within the four fundamental risk elements that affect safety before, during, and after the flight or knowing which parameters are important.','checkbox','Operator'),(4177,'individual-factors','Medication Side Effect','','Physical, emotional, or cognitive reaction to medication','checkbox','Operator'),(4178,'individual-factors','Memory Lapse (Forgot)','','A planned action was unintentionally omitted.','checkbox','MEDA Rev g.'),(4179,'individual-factors','Mental Health','','Including stress, depression, etc.','checkbox','MEDA Rev g.'),(4180,'individual-factors','Nutrition','','','checkbox','Operator'),(4181,'individual-factors','On Time Performance Pressure','','Issues associated with airline-induced/generated pressure to ensure that the aircraft leaves the gate and arrives at its destination on time.','checkbox','Operator'),(4182,'individual-factors','Operational Time Pressure, Delays, Push for On Time Performance','','','checkbox','DNAA'),(4183,'individual-factors','Other Individual Factors','','Description of additional factor(s), not listed, associated with individual factors.','text-field','MEDA Rev g.'),(4184,'individual-factors','Peer Pressure','','Constraints or burdens generated by one\'s friends or coworkers','checkbox','M-DNAA V7.0 C1.9'),(4185,'individual-factors','Perceptual Illusion/Spatial Disorientation','','Misinterpretation of visual or spatial cues due to illusions of motion and disorientation, stimuli difficult to perceive.','checkbox','Operator'),(4186,'individual-factors','Personal Attitudes Toward Safety','','Individual beliefs and feelings about safety','checkbox','Operator'),(4187,'individual-factors','Personal Event','','Includes family problem, car accident, etc.','checkbox','MEDA Rev g.'),(4188,'individual-factors','Stress','http://www.faa.gov/airports_airtraffic/air_traffic/publications/atpubs/aim/Chap8/aim0801.html','Individual mental or physical tension from the pressures of everyday living that can impair performance. Difficulties, particularly at work, can occupy thought processes enough to markedly decrease alertness. Distraction can so interfere with judgment that unwarranted risks are taken, such as flying into deteriorating weather conditions to keep on schedule. Stress and fatigue can be an extremely hazardous combination. Refer to AIM Chapter 8-1-1f: Fitness For Flight Stress (http://www.faa.gov/airports_airtraffic/air_traffic/publications/atpubs/aim/Chap8/aim0801.html).','checkbox','M-DNAA V7.0 C1.9'),(4189,'individual-factors','Physical Health','http://www.caa.co.uk/docs/33/CAP716.PDF','Factors related to general health/fitness/lifestyle (including hearing and sight) which may affect work performance and safety, as opposed to specific illness or incapacitation.','checkbox','MEDA Rev g.'),(4190,'individual-factors','Procedural-Checklists/Flows/Crosschecking','','','checkbox','M-DNAA V7.0 C1.9'),(4191,'individual-factors','Proficiency/Over Reliance On Automation','','Excessive dependence on mechanical aids to flight','checkbox','Operator'),(4192,'individual-factors','Rotating Work Schedule','scitech.dot.gov/research/human/docs/fatigue/fmr07-03.doc','scitech.dot.gov/research/human/docs/fatigue/fmr07-03.doc','checkbox','UTRS'),(4193,'individual-factors','Self-Induced Time Pressure','','Individual personal desire to depart the gate/arrive at the destination at the scheduled time','checkbox','M-DNAA V7.0 C1.9'),(4194,'individual-factors','Sleep Disruption','scitech.dot.gov/research/human/docs/fatigue/fmr07-03.doc','Impact of fatigue due to sleep interruptions or disturbances sleep that can make returning to sleep more difficult.  It has been shown that both the number and timing of disruptions can affect daytime sleepiness and fatigue.','checkbox','Operator'),(4195,'individual-factors','Sleep/Work Periods Conflict with Circadian Rhythms','scitech.dot.gov/research/human/docs/fatigue/fmr07-03.doc','When work schedules require employees to obtain their sleep during times that are normally awake periods, the quality and quantity of sleep suffers. Work during ?low? periods of the circadian rhythm (approximately 0100-0400 hours and 1300-1600 hours) can be associated with drowsiness and a low level of alertness.','checkbox','Operator'),(4196,'individual-factors','Split-Shift','scitech.dot.gov/research/human/docs/fatigue/fmr07-03.doc','scitech.dot.gov/research/human/docs/fatigue/fmr07-03.doc','checkbox','UTRS'),(4197,'individual-factors','Syllabus/Schedule Pressure','','','checkbox','UTRS'),(4198,'individual-factors','Time Constraints','','','checkbox','MEDA Rev g.'),(4199,'individual-factors','Unpredictable Work Schedules','scitech.dot.gov/research/human/docs/fatigue/fmr07-03.doc','The amount of ad