ervicing','1210-Fuel Servicing','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports indicating a problem relating to any type of aviation fuel. The general instructions are not applicable to any particular system.','combo-box','Operator'),(4276,'jasc.12-servicing','1220-Oil Servicing','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports indicating a problem relating to aviation lubricating oil. The general instructions are not applicable to any particular system.','combo-box','Operator'),(4277,'jasc.12-servicing','1230-Hydraulic Fluid Servicing','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports which indicate a problem with any type of hydraulic fluid. The general instructions are not applicable to any particular system.','combo-box','Operator'),(4278,'jasc.12-servicing','1240-Coolant Servicing','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports indicating a problem with any type of engine coolant used in aircraft. The general instructions are not applicable to any particular system.','combo-box','Operator'),(4279,'jasc.12-servicing','12-Servicing','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports indicating a problem relating to specific fluids on the aircraft. The general instructions are not applicable to any particular system.','combo-box','Operator'),(4280,'jasc.14-hardware','1400-Miscellaneous Hardware','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For miscellaneous parts that are not associated with an installed aircraft component or system. Use this code when there is insufficient information to file in a more specific ATA/JASC 1400 series code.','combo-box','Operator'),(4281,'jasc.14-hardware','1410-Hoses and Tubes','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports indicating a problem with any aircraft or engine hose or that are not associated a specific aircraft system.','combo-box','Operator'),(4282,'jasc.14-hardware','1420-Electrical Connectors','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports indicating a problem with any aircraft or engine electrical connector that is not associated a specific aircraft system.','combo-box','Operator'),(4283,'jasc.14-hardware','1430-Fasteners','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports indicating a problem with any aircraft or engine fastener that are not associated a specific aircraft system. Typical parts are generic AN bolts, nuts, rivets. etc.','combo-box','Operator'),(4284,'jasc.14-hardware','1497-Miscellaneous Wiring','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports indicating a problem with any aircraft or engine wiring that is not associated a specific aircraft system.','combo-box','Operator'),(4285,'jasc.14-hardware','14-Hardware','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For miscellaneous parts that are not associated with an installed aircraft component or system. Use this code when there is insufficient information to file in a more specific JASC 1400 series code.','combo-box','Operator'),(4286,'jasc.18-helicopter-vibration','1800-Helicopter Vibration/Noise Analysis','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The units and components enabling operators to monitor and diagnose vibration and noise levels in order to identify imbalance, damage, or misalignment in helicopter components.','combo-box','Operator'),(4287,'jasc.18-helicopter-vibration','1810-Helicopter Vibration Analysis','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports of equipment necessary to monitor, measure, diagnose, and locate sources of vibration in dynamic and structural components.','combo-box','Operator'),(4288,'jasc.18-helicopter-vibration','1820-Helicopter Noise Vibration','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports of equipment necessary to monitor, measure, diagnose and locate sources of noise in dynamic and structural components.','combo-box','Operator'),(4289,'jasc.18-helicopter-vibration','1897-Helicopter Vibration System Wiring','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports indicating a problem with wiring used on equipment necessary to monitor, measure, diagnose and locate sources of noise in dynamic and structural components.','combo-box','Operator'),(4290,'jasc.18-helicopter-vibration','18-Helicopter Vibration','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The units and components enabling operators to monitor and diagnose vibration and noise levels in order to identify imbalance, damage, or misalignment in helicopter components.','combo-box','Operator'),(4291,'jasc.21-air-conditioning','2100-Air Conditioning System','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For miscellaneous parts that cannot be associated with specific air conditioning, pressurization, or distribution codes. Examples are lines, hoses, etc., with no reference to the specific using system on the incoming report. Also, for those units and components furnishing a means of pressurizing, heating, cooling, moisture controlling, filtering, and treating the air used to ventilate areas of the fuselage within the pressure vessel.','combo-box','Operator'),(4292,'jasc.21-air-conditioning','2110-Cabin Compressor System','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The system and its controls supplying compressed air to the cabin. For reported problems with the compressor unit and not the associated system. Related entries should include the component manufacturer\'s make, model, and the specific defective part by name and part number. Typical parts are controls and indicating systems related to the compressors, wiring, etc.','combo-box','Operator'),(4293,'jasc.21-air-conditioning','2120-Air Distribution System','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The system used to induct and distribute air. Does not include valves that are a part of the temperature control, pressurization, or the distribution fan. Typical parts are equipment rack cooling systems, ozone converters, scoops, ducting, inlets, check valves, wiring, etc.','combo-box','Operator'),(4294,'jasc.21-air-conditioning','2121-Air Distribution Fan','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports pertaining to the fan/blower including associated motor which distributes air within the confine for comfort or equipment cooling. Typical parts are bearing, bushing, motor, etc.','combo-box','Operator'),(4295,'jasc.21-air-conditioning','2130-Cabin Pressure Control System','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports of miscellaneous system components or parts other than the controller, indicator, sensor, regulator, or outflow valves. Typical parts are amplifier, switch, electrical connector, etc.','combo-box','Operator'),(4296,'jasc.21-air-conditioning','2131-Cabin Pressure Controller','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For the reports pertaining to the controller units only and not for the system. The defective part should be identified by the part name and part number whenever possible.','combo-box','Operator'),(4297,'jasc.21-air-conditioning','2132-Cabin Pressure Indicator','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports of the cabin pressurization system, pressure indicators, and associated system parts.','combo-box','Operator'),(4298,'jasc.21-air-conditioning','2133-Pressure Regulator/Outflow Valve','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports of outflow/dump valves and associated parts such as linkage, filter, diaphragm, etc.','combo-box','Operator'),(4299,'jasc.21-air-conditioning','2134-Cabin Pressure Sensor','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The units and systems, which measure differential, pressure and transmit a signal. Typical parts are pressure switch, transducer, etc.','combo-box','Operator'),(4300,'jasc.21-air-conditioning','2140-Heating System','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The units and systems supplying heated air to the cockpit or cabin. Includes the heat source (heater), controlling aspects, and temperature sensors/indicators. Typical parts are fuel pump, filter, plumbing, circuitry, relay, heat exchanger, igniter, etc.','combo-box','Operator'),(4301,'jasc.21-air-conditioning','2150-Cabin Cooling System','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The units and systems supplying cooled air to the cockpit or cabin. Does not include the temperature control and indicating system. Typical parts are flow valve, relay, condenser, ram air sensor, heat exchanger, cooling turbine, air cycle machine, etc.','combo-box','Operator'),(4302,'jasc.21-air-conditioning','2160-Cabin Temperature Control System','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The units and circuitry other than the control unit which are used for controlling the temperature of the air in the cockpit and cabin. Typical parts are control valves, thermal sensing devices, switches, amplifiers, and wiring.','combo-box','Operator'),(4304,'jasc.21-air-conditioning','2162-Cabin Temperature Indicator','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports of the indicators, lamps and associated circuitry which indicates the air temperature in the cabin.','combo-box','Operator'),(4305,'jasc.21-air-conditioning','2163-Cabin Temperature Sensor','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports of the sensors and associated circuitry sensing the temperature of the air in the cabin and relays a signal to the indicator.','combo-box','Operator'),(4306,'jasc.21-air-conditioning','2170-Humidity Control System','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports of system parts that control humidity. Typical parts are bag, sock, filter, moisture separator, etc.','combo-box','Operator'),(4307,'jasc.21-air-conditioning','2197-Air Conditioning System Wiring','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports indicating a problem with wiring specific to the Air Conditioning System.','combo-box','Operator'),(4308,'jasc.21-air-conditioning','21-Air Conditioning','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For miscellaneous parts that cannot be associated with specific air conditioning, pressurization, or distribution codes. Examples are lines, hoses, etc., with no reference to the specific using system on the incoming report. Also, for those units and components furnishing a means of pressurizing, heating, cooling, moisture controlling, filtering, and treating the air used to ventilate areas of the fuselage within the pressure vessel.','combo-box','Operator'),(4309,'jasc.22-auto-flight','2200-Auto Flight System','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The units and components that furnish a means of automatically controlling flight of the aircraft. Includes those units and components controlling direction, heading, attitude, altitude, and speed. Use this code when there is insufficient information to file in a more specific JASC 2200 series code.','combo-box','Operator'),(4310,'jasc.22-auto-flight','2210-Autopilot System','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports of miscellaneous parts associated with the autopilot system used for controlling attitude and direction. Typical parts are yaw damper, cable, switch, sensor, relay, etc. The major components such as computer, servo, and controller are to be filed in the specific JASC 2200 series code.','combo-box','Operator'),(4311,'jasc.22-auto-flight','2211-Autopilot Computer','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports pertaining to the autopilot computer only. Typical parts are resistor, circuit board, capacitor, or power supply, etc.','combo-box','Operator'),(4312,'jasc.22-auto-flight','2212-Altitude Controller','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The units transmitting output information signals to automatically maintain a predetermined altitude, rate of climb, or descent. Does not include the connecting system parts such as the sensor switch. The controller make and model should be included.','combo-box','Operator'),(4313,'jasc.22-auto-flight','2213-Flight Controller','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The command unit of an autopilot system. It is manually operated to generate signals which cause the aircraft to climb, dive, or perform coordinated turns. The controller make and model should be included.','combo-box','Operator'),(4314,'jasc.22-auto-flight','2214-Autopilot Trim Indicator','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The instrument and associated circuitry that indicates the trim position selected by the pilot.','combo-box','Operator'),(4315,'jasc.22-auto-flight','2215-Autopilot Main Servo','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The unit mechanically connected to primary flight control actuating mechanisms, which is used to mechanically reposition control surfaces in accordance with electrical or pneumatic signals from a controller.','combo-box','Operator'),(4316,'jasc.22-auto-flight','2216-Autopilot Trim Servo','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The units mechanically connected to flight control cables, etc., for making minor corrections in aircraft attitude or direction.','combo-box','Operator'),(4317,'jasc.22-auto-flight','2220-Speed-Attitude Correction System','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The system which automatically maintains safe flight conditions by correcting for effects of speed and out-of-trim conditions by such means as automatic trim, mach trim, or speed stability and mach feel. This includes sensing, computing, actuating, indicating, internal monitoring, warning devices, etc.','combo-box','Operator'),(4318,'jasc.22-auto-flight','2230-Auto Throttle System','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The system that automatically controls the position of the throttles to properly manage engine power during all phases of flight/attitude. This includes engaging, sensing, computing, amplifying, controlling, actuating and warning devices. Typical parts are amplifiers, computers, servos, limit switches, clutches, gearboxes, warning lights, etc.','combo-box','Operator'),(4319,'jasc.22-auto-flight','2250-Aerodynamic Load Alleviating','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The system that automatically corrects and provides for gust loading/upset, aerodynamic augmentation, alleviation, suppression, ride control, etc. This includes sensing, computing, actuating, indicating, internal monitoring, warning devices, etc.','combo-box','Operator'),(4320,'jasc.22-auto-flight','2297-Auto Flight System Wiring','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports indicating a problem with wiring specific to the Autoflight/Auto Pilot System.','combo-box','Operator'),(4321,'jasc.22-auto-flight','22-Auto Flight','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The units and components that furnish a means of automatically controlling flight of the aircraft. Includes those units and components controlling direction, heading, attitude, altitude, and speed. Use this code when there is insufficient information to file in a more specific JASC 2200 series code.','combo-box','Operator'),(4322,'jasc.23-communications','2300-Communications System','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The units and components furnishing a means of communicating from one part of the aircraft to another and between the aircraft or ground stations, includes voice, data, continuous wave (C-W) communicating components, passenger announcement systems, intercom, inflight telephones, and tape reproducers-record player. Use this code when insufficient information is reported to file in a more specific JASC 2300 series code. Also for reports of units or parts common to more than one communication system.','combo-box','Operator'),(4323,'jasc.23-communications','2310-HF Communications System','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The system parts and circuitry including the receiver, transmitter, and antenna used exclusively in the high frequency (HF) communications.','combo-box','Operator'),(4324,'jasc.23-communications','2311-UHF Communications System','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The system parts and circuitry including the receiver, transmitter, and antenna used exclusively for ultra high frequency (UHF) communications.','combo-box','Operator'),(4325,'jasc.23-communications','2312-VHF Communications System','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The system parts and circuitry including the receiver, transmitter, and antenna used exclusively for very high frequency (VHF) communications.','combo-box','Operator'),(4327,'jasc.23-communications','2330-Entertainment System','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports on passenger entertainment system or components such as amplifier, cassette recorder player, control panel, speaker, video equipment, etc.','combo-box','Operator'),(4328,'jasc.23-communications','2340-Interphone/Passenger Announcement (PA) System','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports on the interphone/passenger announcement (PA) system, including the amplifier used for communication by flight and ground personnel to communicate between areas on the aircraft.','combo-box','Operator'),(4329,'jasc.23-communications','2350-Audio Integrating System','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports of the system components and parts including the control panel and amplifier which controls output of communications and navigation receivers into flight crew headphones and speakers. Also includes output from microphones into communications transmitters. Typical parts are microphones, cockpit speakers, and headphones, etc.','combo-box','Operator'),(4330,'jasc.23-communications','2360-Static Discharge System','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The parts dissipating static electricity. Does not include bonding straps on engine or airframe used to assure paths for DC current, which are filed in ATA/JASC code 2430. Typical parts are wick, bonding strap, etc.','combo-box','Operator'),(4331,'jasc.23-communications','2370-Audio/Video Monitoring','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports on installations that record or monitor crew or passenger conversation or movement for security or safety purposes. Includes voice recorder, television, monitor, etc.','combo-box','Operator'),(4332,'jasc.23-communications','2380-Integrated Automatic Tuning','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','That portion of the system which maintains integrated control of the operating frequencies of communication and navigation transmitter/receivers after either a manually inserted command or a pre-programmed integrated flight system command. Includes such items as integrated frequency selector panels, digital frequency control computers and integrated frequency display panels.','combo-box','Operator'),(4333,'jasc.23-communications','2397-Communications System Wiring','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports indicating a problem with wiring specific to the Communications Systems.','combo-box','Operator'),(4334,'jasc.23-communications','23-Communications','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The units and components furnishing a means of communicating from one part of the aircraft to another and between the aircraft or ground stations, includes voice, data, continuous wave (C-W) communicating components, passenger announcement systems, intercom, inflight telephones, and tape reproducers-record player. Use this code when insufficient information is reported to file in a more specific JASC 2300 series code. Also for reports of units or parts common to more than one communication system.','combo-box','Operator'),(4335,'jasc.24-electrical-power','2400-Electrical Power System','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The electrical units and components that generate, control, and supply AC/DC electrical power for other systems through the secondary busses. For reports on electric power generating system parts and circuitry other than major components reported with insufficient information to file in a specific JASC 2400 series code. Typical parts are circuit breaker, relay, connector, resistor, wire bundles, switches, etc.','combo-box','Operator'),(4337,'jasc.24-electrical-power','2420-AC Generation System','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports of system parts other than the alternator, regulator, AC inverter or phase adapter generating an alternating current for aircraft which incorporate an alternating current electrical system. Used primarily with large, turbine engine powered aircraft. Does not include the using systems.','combo-box','Operator'),(4338,'jasc.24-electrical-power','2421-AC Generator-Alternator','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The engine driven component that generates alternating current (AC) for aircraft with AC electrical systems. Does not include AC alternators on light piston-engine power aircraft with direct current (DC) electrical systems. Does not include single units used for both engine starting and electric power generating. Typical parts are bearing, shaft, housing, and integrated drive generator (IDG) which contains both AC and DC generators.','combo-box','Operator'),(4339,'jasc.24-electrical-power','2422-AC Inverter','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The component which converts direct current to alternating current.','combo-box','Operator'),(4340,'jasc.24-electrical-power','2423-Phase Adapter','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The component used to change the alternating current (AC) phase of output for specific using equipment.','combo-box','Operator'),(4341,'jasc.24-electrical-power','2424-AC Regulator','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The component that regulates the AC voltage from the alternator-generator to maintain a set voltage output for the using systems (i.e., generator control unit).','combo-box','Operator'),(4342,'jasc.24-electrical-power','2425-AC Indicating System','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The equipment indicating, voltage, current flow, and system faults in the AC power systems.','combo-box','Operator'),(4343,'jasc.24-electrical-power','2430-DC Generating System','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The system parts and circuitry other than the generator/alternator and DC generation system regulator used to generate a direct current (DC); or from an alternator, the output of which is rectified to DC. Typical parts are relay, switch, connector, terminal, sensor, reverse current relay, etc. Such systems are more prevalent on light single and twin-engine aircraft.','combo-box','Operator'),(4344,'jasc.24-electrical-power','2431-Battery Overheat Warning System','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The system parts that sense and warn/indicate of a battery overtemperature condition. Typical parts are sensor, lamp, gauge, etc.','combo-box','Operator'),(4345,'jasc.24-electrical-power','2432-Battery/Charger System','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The component providing a source of DC voltage and current flow independent of rotating generators and alternators. Typical parts are battery charger, cell, case, post, etc.','combo-box','Operator'),(4346,'jasc.24-electrical-power','2433-DC Rectifier/Converter','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The component which converts AC current for the using systems.','combo-box','Operator'),(4347,'jasc.24-electrical-power','2434-DC Generator-Alternator','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The engine driven component generating a direct current (DC) or a rectified alternating current for aircraft with DC electrical systems. For reports of alternators on light aircraft with piston engines. Does not include mounting brackets, drive belts and pulleys external to the unit. Typical parts are bearing, housing, coupling, fan, capacitor, drive, brush, seal, clutch, armature and bell, shaft, field winding, case bolt, ground stud, etc.','combo-box','Operator'),(4348,'jasc.24-electrical-power','2435-Starter-Generator','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The single component used for both engine starting and direct current generation on turbine engines. Typical parts are bearing, shaft, brush, fan, retainer ring, armature, brush, housing, end bell, terminal, etc.','combo-box','Operator'),(4349,'jasc.24-electrical-power','2436-DC Regulator','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The component that regulates direct current voltage from a generator or alternator.','combo-box','Operator'),(4350,'jasc.24-electrical-power','2437-DC Indicating System','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The equipment indicating voltage, current flow, and system faults in the DC power systems.','combo-box','Operator'),(4351,'jasc.24-electrical-power','2440-External Power System','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The electrical system within the aircraft which is used to connect external power to the aircraft\'s electrical system. Does not include the external power supply units. Typical parts are receptacle, switch, indicator lamp, etc.','combo-box','Operator'),(4352,'jasc.24-electrical-power','2450-AC Power Distribution System','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The electrical system providing for connection of AC power to using systems. Does not include the using system. Typical parts are main and secondary system buss, circuit breaker, limiter, jumper, load meter switch, etc.','combo-box','Operator'),(4353,'jasc.24-electrical-power','2460-DC Power Distribution System','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The electrical system which provides for connection of DC power to using systems. Does not include using system. Typical parts are main and secondary system buss, circuit breaker, buss tie breaker, limiter, jumper, load motor switch, etc.','combo-box','Operator'),(4354,'jasc.24-electrical-power','2497-Electrical Power System Wiring','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports indicating a problem with wiring specific to the Electrical Power Systems not reportable in the Power Distribution Systems.','combo-box','Operator'),(4355,'jasc.24-electrical-power','24-Electrical Power','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The electrical units and components that generate, control, and supply AC/DC electrical power for other systems through the secondary busses. For reports on electric power generating system parts and circuitry other than major components reported with insufficient information to file in a specific JASC 2400 series code. Typical parts are circuit breaker, relay, connector, resistor, wire bundles, switches, etc.','combo-box','Operator'),(4356,'jasc.25-equipment/furnishings','2500-Cabin Equipment/Furnishings','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The removable items of equipment and furnishings mounted or contained in the flight, passenger, cargo, accessory compartments, and areas described in other JASC 2500 series codes shown below. Does not include structure or equipment assigned specifically to other JASC codes.','combo-box','Operator'),(4357,'jasc.25-equipment/furnishings','2510-Flight Compartment Equipment','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The removable equipment and furnishings within the cockpit or crew station of a general nature and not specifically covered in other JASC 2500 series codes. Typical parts are seats, shoulder harnesses, take-up harness reels, seat belts, sun visors, panels, map case, attach brackets and hardware, etc.','combo-box','Operator'),(4358,'jasc.25-equipment/furnishings','2520-Passenger Compartment Equipment','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The removable equipment and furnishings within the cabin of a general nature and not specifically covered in other JASC codes. Typical parts are seats, seat belts, hat rack, coat closet, panel, including passenger comfort items such as personal blankets, pillows, etc.','combo-box','Operator'),(4359,'jasc.25-equipment/furnishings','2530-Buffet/Galleys','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports pertaining to any of the galley equipment. Typical parts are hot plate, coffeepot, food carts, ovens, tray, pad, relay, switch, connector, dispenser, etc.','combo-box','Operator'),(4360,'jasc.25-equipment/furnishings','2540-Lavatories','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The units and associated systems and parts located in lavatories. Does not include wash basins and other waste disposal items in ATA/JASC code 3830. Typical parts are trash containers, dispensers, etc.','combo-box','Operator'),(4361,'jasc.25-equipment/furnishings','2550-Cargo Compartments','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The compartments for the storage of baggage and cargo including external mounted pods. Does not include the exterior door, hinges and latches which are filed in JASC code 5230. Typical parts are tie downs, restraint nets, and equipment for loading and unloading cargo (includes external load handling equipment).','combo-box','Operator'),(4362,'jasc.25-equipment/furnishings','2551-Agricultural Spray System','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports of aerial application equipment such as hopper, tank, spray nozzle, boom, pump, bracket, valve.','combo-box','Operator'),(4363,'jasc.25-equipment/furnishings','2560-Emergency Equipment','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The components, parts, and systems carried for emergency use other than those specifically referenced in other JASC 2500 series codes. Does not include fire extinguishes, oxygen equipment, and flashlight. Flashlights are filed under JASC code 3350. Escape slide girt bars are filed under this code.','combo-box','Operator'),(4364,'jasc.25-equipment/furnishings','2561-Life Jacket','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports of defective parts of life jackets used for flotation of individual persons. Include the life jacket make and model in the report if available.','combo-box','Operator'),(4365,'jasc.25-equipment/furnishings','2562-Emergency Locator Beacon','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The components transmitting an electronic signal on an emergency frequency to assist in locating a crashed aircraft. Typical parts are impact switch, antenna, battery pack, etc.','combo-box','Operator'),(4366,'jasc.25-equipment/furnishings','2563-Parachute','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For the reporting of defective parts of parachutes used for reducing landing roll distance as well as forpersonnel jumping. The parachute make and model is beneficial if available.','combo-box','Operator'),(4367,'jasc.25-equipment/furnishings','2564-Life Raft','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The inflatable component which provides emergency flotation for two or more persons in event of ditching in water. Typical parts are bottle, valve, oral pump, etc.','combo-box','Operator'),(4368,'jasc.25-equipment/furnishings','2565-Escape Slide','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The inflatable component which enables rapid evacuation from an aircraft cabin to ground level during emergencies on the ground. The slide should be identified by make and model if possible and should include location. Typical parts are valve, bottle, inflation handle, mount brackets, door, latch, etc.','combo-box','Operator'),(4369,'jasc.25-equipment/furnishings','2570-Accessory Compartment','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The compartments for the housing of various components or accessories with insufficient information to file in a more specific ATA/JASC 2500 series code.','combo-box','Operator'),(4370,'jasc.25-equipment/furnishings','2571-Battery Box Structure','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The structure supporting, vents, and provides overboard draining for aircraft batteries. Typical parts are vent cap, drain tube, insulator, cover, etc.','combo-box','Operator'),(4371,'jasc.25-equipment/furnishings','2572-Electronic Shelf Section','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The shelves and attaching parts supporting the electronic equipment within the fuselage. Does not include the equipment used for equipment cooling such as fans, and blower motors.','combo-box','Operator'),(4372,'jasc.25-equipment/furnishings','2597-Equipment/Furnishings Wiring','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports indicating a problem with wiring specific to the Equipment/Furnishing Systems.','combo-box','Operator'),(4373,'jasc.25-equipment/furnishings','25-Equipment/Furnishings','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The removable items of equipment and furnishings mounted or contained in the flight, passenger, cargo, accessory compartments, and areas described in other JASC 2500 series codes shown below. Does not include structure or equipment assigned specifically to other JASC codes.','combo-box','Operator'),(4374,'jasc.26-fire-protection','2600-Fire Protection System','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The fixed and portable units and components which detect and indicate fire or smoke, and store and distribute fire extinguishing agent to all protected areas of the aircraft. For reports of a general nature with insufficient information to file in a more specific JASC 2600 series code.','combo-box','Operator'),(4375,'jasc.26-fire-protection','2610-Detection System','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The system used to sense and indicate the presence of overheat or fire in all protected areas. Reporting the specific location of the defective part is essential. Use this code when there is insufficient information to file in a more specific JASC 2610 series code.','combo-box','Operator'),(4376,'jasc.26-fire-protection','2611-Smoke Detection','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The system used to sense and indicate the presence of smoke in all protected areas of the aircraft. Reporting the specific location of a defective part is essential. Typical parts are detector, sensor, wiring, relay, amplifier, test circuit, etc.','combo-box','Operator'),(4377,'jasc.26-fire-protection','2612-Fire Detection','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The system used to sense and indicate the presence of fire in all protected areas of the aircraft. Typical parts are detector, sensor, wiring, relay, amplifier, test circuit, etc. Reporting the specific location of a defective part is essential.','combo-box','Operator'),(4378,'jasc.26-fire-protection','2613-Overheat Detection','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The system used to sense and indicate the presence of an overheat condition in all protected areas of the aircraft. Reporting the specific location of a defective part is essential. Typical parts are detector, sensor, wiring, relay, amplifier, test circuit, etc.','combo-box','Operator'),(4379,'jasc.26-fire-protection','2620-Extinguishing System','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports of the components and parts other than the fixed or portable bottles used to extinguish fire. Typical parts are valve, squib, control module, switch, tubing, etc.','combo-box','Operator'),(4380,'jasc.26-fire-protection','2621-Fire Bottle, Fixed','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The fixed fire bottle and associated parts that store extinguishing agent under pressure. Typical parts are bottle, cartridge, and bracket.','combo-box','Operator'),(4381,'jasc.26-fire-protection','2622-Fire Bottle, Portable','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The portable fire extinguishes mounted within the flight compartment and cabin.','combo-box','Operator'),(4382,'jasc.26-fire-protection','2697-Fire Protection System Wiring','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports indicating a problem with wiring specific to the Fire Protection System.','combo-box','Operator'),(4383,'jasc.26-fire-protection','26-Fire Protection','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The fixed and portable units and components which detect and indicate fire or smoke, and store and distribute fire extinguishing agent to all protected areas of the aircraft. For reports of a general nature with insufficient information to file in a more specific JASC 2600 series code.','combo-box','Operator'),(4384,'jasc.27-flight-controls','2700-Flight Control System','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The units and components furnishing a means of manually controlling the flight attitude characteristics of the aircraft. Also includes the functioning and maintenance aspects of the flaps, spoilers and other control surfaces, but does not include the structure, which is covered in the Structures JASC Chapters 55 or 57. Use this code for reports of flight control problems of a general nature involving two or more systems, or that contain insufficient information to file in a more specific JASC 2700 series code. An example would be a cable defect reported without reference to the using system or an interconnect between two systems. Does not include rotorcraft flight controls, which are covered in the JASC Rotor Chapter 67. Typical parts are hydraulic boost system, controls, mounting brackets, etc.','combo-box','Operator'),(4385,'jasc.27-flight-controls','2701-Control Column Section','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The component and associated parts mounted onto the control wheel, which transmits motion from the cockpit to connecting cables, pushrods, etc., to actuate the aileron and elevator, stabilator, ruddervator control surfaces. Includes control sticks in aircraft not equipped with control wheels. Typical parts are bearing, socket, guide, bushing, pulley bracket, sprocket, chain, stops, etc.','combo-box','Operator'),(4386,'jasc.27-flight-controls','2710-Aileron Control System','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The system components and parts from the control column to the aileron surface that cause actuation (deflection). Includes manual and power assisted systems but does not include the autopilot actuation mechanism which is filed in JASC Chapter 22. Also includes brackets for the support or attachment of pulleys, pushrods, and bellcranks. Does not include control surface hinges or structure filed in JASC code 5700. Typical parts are actuator, valve, rod end, pulley, cable, bellcrank, turnbuckle, stops, etc.','combo-box','Operator'),(4387,'jasc.27-flight-controls','2711-Aileron Tab Control System','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The system components and parts controlling movement and position of the trim tab on the aileron. Includes the cockpit control. Typical parts are jackscrew, cable, pulley, turnbuckle, stops, etc.','combo-box','Operator'),(4388,'jasc.27-flight-controls','2720-Rudder Control System','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The system components and parts from the cockpit pedals to the rudder surface which cause movement. Includes manual and power assisted systems other than the actuator and autopilot actuating mechanism. Also includes brackets for the support or attachment of pulleys, pushrods, and bellcranks. Does not include control surface hinges or structure (filed in JASC code 5540) or the yaw dampers (filed in JASC code 2210). Typical parts are cable, rod end, turnbuckle, bolt, pedal, spring, torque tube, control valve, stops, etc.','combo-box','Operator'),(4389,'jasc.27-flight-controls','2721-Rudder Tab Control System','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The system components and parts of the rudder trim control system, from the cockpit control to the rudder that causes deflection. Does not include hinges or structure, which are filed in JASC code 5543, or the yaw dampers, which are filed in JASC code 2210. Typical parts are actuator, actuator bracket, cable, pulley, chain, rod end, bellcrank, etc.','combo-box','Operator'),(4390,'jasc.27-flight-controls','2722-Rudder Actuator','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The system components and parts which actuate the rudder. Typical parts are motor, actuator, actuator bracket, jackscrew, rod-end, seals, etc.','combo-box','Operator'),(4392,'jasc.27-flight-controls','2731-Elevator Tab Control System','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The system components and parts from the cockpit trim control to the elevator, ruddervator or stabilator tab, which controls position and movement. Includes the manual and electrical trim system parts. Does not include the hinges or structure, which are filed in JASC code 5520, the balance weights in JASC code 5520, or the autopilot servo in JASC code 2216. Typical parts are jackscrew, cable, actuator, sensor, motor, chain, sprocket, indicator, etc.','combo-box','Operator'),(4393,'jasc.27-flight-controls','2740-Stabilizer Control System','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The system components and parts from the cockpit control to the stabilizer, except the actuator which controls position of the horizontal stabilizer for pitch trim (usually found on high performance turbine powered aircraft). Also for stabilator control systems on aircraft utilizing a single horizontal tail surface for both the stabilizer and elevator. Does not include structure in JASC code 5511. Typical parts are cable, bellcrank, pulley, control valve, indicator, etc.','combo-box','Operator'),(4394,'jasc.27-flight-controls','2741-Stabilizer Position Indicating','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The system components and parts that sense, transmit, and indicate relative position of movable stabilizers for purpose of pitch trim. Typical parts are indicators, transmitters, etc.','combo-box','Operator'),(4395,'jasc.27-flight-controls','2742-Stabilizer Actuator','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The component which actuates the horizontal stabilizer to infinite angles of incidence to provide pitch trim. Includes both manual and power assist types. Typical parts are actuator, actuator bracket, clutch, motor, seal, etc.','combo-box','Operator'),(4396,'jasc.27-flight-controls','2750-Trailing Edge Flap Control System','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The system components and parts, except the actuator and position indicator which controls position and movement of wing trailing edge flaps. Does not include the structure, carriage, fittings, tracks and rollers which are filed in JASC code 5753; or the motor or actuator which causes movement of the flaps and are filed in JASC code 2752. Typical parts are control valve, switch, flow limiter, cable, torque tube, transmission, jackscrew, bypass valve, limit switch, return spring, buss cable, etc.','combo-box','Operator'),(4397,'jasc.27-flight-controls','2751-Trailing Flap Position Indicating System','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The system components and parts that sense, transmit and indicate trailing edge flap position relative to the wing surface. Typical parts are indicator, transmitter, position module, asymmetry switch, and comparator, etc.','combo-box','Operator'),(4398,'jasc.27-flight-controls','2752-Trailing Edge Flap Actuator','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The component which actuates the trailing edge flaps. Typical parts are motor, actuator, seal, jackscrew, rod end, actuator support fittings, etc.','combo-box','Operator'),(4399,'jasc.27-flight-controls','2760-Drag Control System','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The system components and parts other than actuator which controls position, movement, and indicate relative position of drag device and variable aerodynamic surfaces on the wing includes speed brake systems. Does not include structure and hinges filed in JASC code 5755. Typical parts are valve, hose, push rod, line, cable, indicator.','combo-box','Operator'),(4400,'jasc.27-flight-controls','2761-Drag Control Actuator','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The components that actuates spoiler and speed brake surfaces on the wing for speed and lift reducing purposes. Typical parts are seal, rod end bearing, rod end, etc.','combo-box','Operator'),(4401,'jasc.27-flight-controls','2770-Gust Lock Damper System','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The system and components protecting flight control surfaces from movement and damage by wind gusts while the aircraft is on the ground. Includes cockpit controlled surface locks common in light aircraft and independent hydraulic gust damper units mounted at each flight control surface on large jet powered aircraft. Does not include the dampening feature of the flight control power boost systems, which are filed with the specific control system (i.e., rudder damper). Typical parts are damper, cylinder, seal, rod end, lock pin cable, etc.','combo-box','Operator'),(4402,'jasc.27-flight-controls','2780-Leading Edge Slat Control System','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The system components and parts except the actuator and position indicating system that controls the position and movement of the wing leading edge devices used for lift augmenting. Does not include the structure, hinges, and parts that do not cause movement of the surface filed in JASC code 5754. Typical parts are leading edge flaps, variable opening wing slots, priority valve, switch, cable, pulley, actuator bracket, torque shaft, regulator, etc.','combo-box','Operator'),(4403,'jasc.27-flight-controls','2781-Leading Edge Slat Position Indicating System','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The transmitter, indicator, warning lamps, and associated circuitry providing relative position information of wing leading edge devices to the flight crew.','combo-box','Operator'),(4404,'jasc.27-flight-controls','2782-Leading Edge Slat Actuator','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The component causing movement of the wing leading edge device control surfaces. Does not include related system or position indicating. Typical parts are actuator, actuator bracket, seal, etc.','combo-box','Operator'),(4405,'jasc.27-flight-controls','2797-Flight Control System Wiring','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports indicating a problem with wiring specific to the Flight Control Systems.','combo-box','Operator'),(4406,'jasc.27-flight-controls','27-Flight Controls','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The units and components furnishing a means of manually controlling the flight attitude characteristics of the aircraft. Also includes the functioning and maintenance aspects of the flaps, spoilers and other control surfaces, but does not include the structure, which is covered in the Structures JASC Chapters 55 or 57. Use this code for reports of flight control problems of a general nature involving two or more systems, or that contain insufficient information to file in a more specific JASC 2700 series code. An example would be a cable defect reported without reference to the using system or an interconnect between two systems. Does not include rotorcraft flight controls, which are covered in the JASC Rotor Chapter 67. Typical parts are hydraulic boost system, controls, mounting brackets, etc.','combo-box','Operator'),(4407,'jasc.28-fuel','2800-Aircraft Fuel System','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The units and components storing and delivering fuel to the engine. Includes the integral tank leak detection and sealing. Does not include the structure of integral, tip fuel tanks, fuel cell backing boards covered in the structures JASC Chapters 53 and 57, or the fuel flow rate sensing, transmitting, or indicating systems which are covered in JASC Chapter 73. Use this code for fuel system reports with insufficient information to file in a more specific JASC 2800 series code. This code is also used to report problems involving two or more aircraft fuel system JASC codes.','combo-box','Operator'),(4408,'jasc.28-fuel','2810-Fuel Storage','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The portion of the fuel system used for the storage of fuel. Does not include defects in the wing primary structure of integral tanks. Typical parts are removable metal tank, tip tank, header tank, bladder fuel cell, tank interconnect lines, vent line, vent valve, drain valve, filler cap, filler neck, check valve, vent tube, cap seal, filler adapter, outlet fitting, screen, fueling panel, tank strap, sealant, etc.','combo-box','Operator'),(4409,'jasc.28-fuel','2820-Aircraft Fuel Distribution System','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The portion of the aircraft fuel system other than selector valves, transfer valves, electric motor driven pumps used to distribute fuel from the tank outlet to the powerplant quick disconnect or up to the strainer unit. Includes the engine primer equipment, the switch that senses failure of a system pump, and the switch that automatically activates the boost pump. Typical parts are line, fitting, primer, nozzle, primer pump, actuating linkage for the fuel selector/shutoff valve, etc.','combo-box','Operator'),(4410,'jasc.28-fuel','2821-Aircraft Fuel Filter/Strainer','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The component that filters unmetered fuel upstream of the engine fuel control/carburetor. Does not include the engine fuel metered control system filters (filed in ATA/JASC code 7300). Typical parts are screen, housing, bowl, gasket, plunger, stand pipe, etc.','combo-box','Operator'),(4411,'jasc.28-fuel','2822-Fuel Boost Pump','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The electric motor/engine driven pumps providing fuel under pressure to the engine fuel control/carburetor for starting and emergency use. Includes parts of the pump, associated motor, and electrical circuitry/switch. Does not include pressure switch indicating system. Typical parts are housing, seal, motor, brush, bearing, connector, and fuel transfer pump, etc.','combo-box','Operator'),(4412,'jasc.28-fuel','2823-Fuel Selector/Shut-Off Valve','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The component and associated controls and position indication units which provides for specific tank selection or shutting off flow to the engine. Typical parts are housing, rotor, handle, guard, seat, seal, selector valve, shutoff valve, spring, etc.','combo-box','Operator'),(4413,'jasc.28-fuel','2824-Fuel Transfer Valve','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The component and associated control linkage which provides for the transfer of fuel between tanks for crossfeeding to alternate engine fuel systems. Typical parts are, seal, housing, rotor, handle, transfer valve, etc.','combo-box','Operator'),(4414,'jasc.28-fuel','2830-Fuel Dump System','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The system and components that provide for the jettison of fuel overboard during flight. Typical parts are valve, switch, dump chute, etc.','combo-box','Operator'),(4415,'jasc.28-fuel','2840-Fuel Indicating System','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For general reports pertaining to the aircraft fuel indicating systems, but with no specific reference to the transmitter (tank unit) or indicator. Does not include engine fuel pressure reports, which are filed in JASC code 7332, or flow indication system in JASC code 7331. Typical parts are circuit breaker, connector, pressure switch, indicator lights, dripstick, etc.','combo-box','Operator'),(4416,'jasc.28-fuel','2841-Fuel Quantity Indicator','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The indicator and low level warning system used to indicate the quantity of fuel in the tanks. Typical parts are indicator, lamp, bulb, etc.','combo-box','Operator'),(4417,'jasc.28-fuel','2842-Fuel Quantity Sensor','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The tank unit which measures and transmits a quantity level signal to the cockpit indicator. Typical parts are transmitter, float switch, probe, sensor, totalizer, tank unit float, gasket, etc.','combo-box','Operator'),(4418,'jasc.28-fuel','2843-Fuel Temperature Indicator','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The tank unit which measures the temperature of fuel in the tanks.','combo-box','Operator'),(4419,'jasc.28-fuel','2844-Fuel Pressure Indicator','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The tank unit which measures the pressure of fuel in the tanks. Typical parts are the pressure switch and indicator lights, etc.','combo-box','Operator'),(4420,'jasc.28-fuel','2897-Fuel System Wiring','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports indicating a problem with wiring specific to the Fuel System.','combo-box','Operator'),(4421,'jasc.28-fuel','28-Fuel','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The units and components storing and delivering fuel to the engine. Includes the integral tank leak detection and sealing. Does not include the structure of integral, tip fuel tanks, fuel cell backing boards covered in the structures JASC Chapters 53 and 57, or the fuel flow rate sensing, transmitting, or indicating systems which are covered in JASC Chapter 73. Use this code for fuel system reports with insufficient information to file in a more specific JASC 2800 series code. This code is also used to report problems involving two or more aircraft fuel system JASC codes.','combo-box','Operator'),(4422,'jasc.29-hydraulic-power','2900-Hydraulic Power System','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The units and components that furnish hydraulic fluid under pressure to a common point (manifold) for re-distribution to other defined systems. For miscellaneous system parts other than components listed under other specific JASC Chapter 29 codes. Also, for reports of units or parts common to two or more components.','combo-box','Operator'),(4423,'jasc.29-hydraulic-power','2910-Hydraulic System, Main','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The portion of the main system which is used to store and deliver hydraulic fluid to the using system. Includes all hydraulic systems other than those designated emergency or standby. Does not include the supply valves to the using systems. Typical parts are tanks, accumulators, valves, pumps, levers, cables, line, hose, relief, shutoff vales, check valves, wiring, switches, external connectors, etc.','combo-box','Operator'),(4424,'jasc.29-hydraulic-power','2911-Hydraulic Power Accumulator, Main','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The component that provides for pressure surges to maintain a constant pressure in the system. Typical parts are accumulator, seal, end cap, air valve, etc.','combo-box','Operator'),(4425,'jasc.29-hydraulic-power','2912-Hydraulic Filter, Main','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The component which filters sediment from the hydraulic fluid in the main system. Typical parts are seal, gasket, housing, element, packing, etc.','combo-box','Operator'),(4426,'jasc.29-hydraulic-power','2913-Hydraulic Pump (Electric/Engine), Main','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The component that provides hydraulic fluid pressure to using systems but does not include the using systems. Includes power packs incorporating integral pumps, electric motors, and solenoids used in certain light aircraft models. Also includes pumps such as those used in flight control systems on large aircraft. Typical parts are pump, motor, shaft, brush, solenoid, case, power pack, seal, switch, etc.','combo-box','Operator'),(4427,'jasc.29-hydraulic-power','2914-Hydraulic Handpump, Main','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The manually actuated pump for emergency system pressure. Typical parts are handle, lever, seal, etc.','combo-box','Operator'),(4428,'jasc.29-hydraulic-power','2915-Hydraulic Pressure Relief Valve, Main','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The unit which relieves system relief pressure at a preset pressure. Typical parts are seal, spring, housing, relief valve, etc.','combo-box','Operator'),(4429,'jasc.29-hydraulic-power','2916-Hydraulic Reservoir, Main','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The component which stores hydraulic fluid. Typical parts are reservoir, filler cap, filler neck, sight gauge, seal, etc.','combo-box','Operator'),(4430,'jasc.29-hydraulic-power','2917-Hydraulic Pressure Regulator, Main','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The unit that maintains a preset operating system pressure to the using systems. Typical parts are regulator, seal, case, etc.','combo-box','Operator'),(4431,'jasc.29-hydraulic-power','2920-Hydraulic System, Auxiliary','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The portion of the main system which is classified as auxiliary, emergency, or standby, and which is used to supplement or take the place of the main hydraulic fluid to the using system. Does not include the supply valves to the using systems. Typical par','combo-box','Operator'),(4432,'jasc.29-hydraulic-power','2921-Hydraulic Accumulator, Auxiliary','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The component which provides for pressure surge to maintain a constant pressure in the auxiliary system. Typical parts are accumulator, seal, end cap and air valve, etc.','combo-box','Operator'),(4433,'jasc.29-hydraulic-power','2922-Hydraulic Filter, Auxiliary','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The component which filters sediment from the hydraulic fluid in the auxiliary system. Typical parts are seal, gasket, housing, element, and packing, etc.','combo-box','Operator'),(4434,'jasc.29-hydraulic-power','2923-Hydraulic Pump, Auxiliary','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The component which provides hydraulic fluid pressure to the using auxiliary system. Typical parts are pump, motor, shaft, brushes, case, seal, switches, etc.','combo-box','Operator'),(4435,'jasc.29-hydraulic-power','2925-Hydraulic Pressure Relief, Auxiliary','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The unit which relieves auxiliary system pressure. Typical parts are seal, spring, housing, relief valve, etc.','combo-box','Operator'),(4436,'jasc.29-hydraulic-power','2926-Hydraulic Reservoir, Auxiliary','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The unit which stores auxiliary hydraulic fluid. Typical parts are reservoir, filler cap, filler neck, sight gauge, etc.','combo-box','Operator'),(4437,'jasc.29-hydraulic-power','2927-Hydraulic Pressure Regulator, Auxiliary','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The unit that maintains a preset operating system pressure to the using auxiliary hydraulic system. Typical parts are regulator, seal, case, etc.','combo-box','Operator'),(4438,'jasc.29-hydraulic-power','2930-Hydraulic Indicating System','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports of hydraulic pressure and quantity indicating system parts other than the indicator or sensor or for parts common to both pressure and quantity systems.','combo-box','Operator'),(4439,'jasc.29-hydraulic-power','2931-Hydraulic Pressure Indicator','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The instrument and associated low pressure warning system that registers system pressure. Typical parts are indicator, warn lamp, bulb, etc.','combo-box','Operator'),(4440,'jasc.29-hydraulic-power','2932-Hydraulic Pressure Sensor','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The components that sense system pressure and transmit a signal to the cockpit indicator or low pressure warning lamp. Typical parts are transmitter, pressure switch, sensor, etc.','combo-box','Operator'),(4441,'jasc.29-hydraulic-power','2933-Hydraulic Quantity Indicator','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The instrument and associated low level warning system which registers reservoir fluid quantity. Typical parts are indicator, lamp, bulb, sight gage, etc.','combo-box','Operator'),(4442,'jasc.29-hydraulic-power','2934-Hydraulic Quantity Sensor','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The components that sense the fluid level and low level warning and transmit a signal to the quantity indicator. Typical parts are transmitter, sensor, float switch, etc.','combo-box','Operator'),(4443,'jasc.29-hydraulic-power','2997-Hydraulic Power System Wiring','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports indicating a problem with wiring specific to the Hydraulic Power System.','combo-box','Operator'),(4444,'jasc.29-hydraulic-power','29-Hydraulic Power','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The units and components that furnish hydraulic fluid under pressure to a common point (manifold) for re-distribution to other defined systems. For miscellaneous system parts other than components listed under other specific JASC Chapter 29 codes. Also, for reports of units or parts common to two or more components.','combo-box','Operator'),(4445,'jasc.30-ice-and-rain-protection','3000-Ice/Rain Protection System','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The units and components which provide a means of preventing or disposing of formation of ice and rain on various parts of the aircraft. Includes miscellaneous items with insufficient information to file in a specific JASC 3000 series code. Does not include the basic windshield panel.','combo-box','Operator'),(4446,'jasc.30-ice-and-rain-protection','3010-Airfoil Anti/De-ice System','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The system components and parts including the boots, which provide for wing and empennage leading edge ice prevention or removal. Does not include ducts upstream of the airfoil control/selector valves. Typical parts are timer, valve, switch, hose, flow valve, duct, duct coupling, thermostat, etc.','combo-box','Operator'),(4447,'jasc.30-ice-and-rain-protection','3020-Air Intake Anti/De-Ice System','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The system and components that eliminate or prevent the formation of ice in or around air intakes such as turbine engine cowling. Does not include engine anti-icing reports filed in JASC code 7510. Includes the electrically heated boot at the air intake lips.','combo-box','Operator'),(4448,'jasc.30-ice-and-rain-protection','3030-Pitot/Static Anti-Ice System','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The heating elements in the pitot-static pick up heads to eliminate or prevent the formation of ice. Does not include defects with the pitot or static systems. Typical parts are element, switch, wiring, etc.','combo-box','Operator'),(4449,'jasc.30-ice-and-rain-protection','3040-Windshield/Door Rain/Ice Removal','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The system and components which is used to clear, eliminate or prevent the formation of rain, ice or Typical parts are motor, actuator, wiper blade, hydraulic converter, shaft, line, switch, the electrical heating portion of heated glass panels, control units, alcohol deice system lines, tanks, pumps, valves, etc.','combo-box','Operator'),(4450,'jasc.30-ice-and-rain-protection','3050-Antenna/Radome Anti-Ice/De-Ice System','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The system which is used to eliminate or prevent the formation of ice on antennas and radomes.','combo-box','Operator'),(4451,'jasc.30-ice-and-rain-protection','3060-Propeller/Rotor Anti-Ice/De-Ice System','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The system components and parts which are used to eliminate or prevent the formation of ice on propellers and rotors. Includes electrically heated systems, and alcohol spray systems. Does not include the system parts on the rotating portion of the propeller which are filed in JASC code 6112 or the heating mats on the rotating portion of the rotor in JASC code 6210 or code 6410. Typical parts are brush block, timer, switch, relay, harness, terminal block, etc.','combo-box','Operator'),(4452,'jasc.30-ice-and-rain-protection','3070-Water Line Anti-Ice System','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The system that is used for prevention of ice in water supply and drain lines.','combo-box','Operator'),(4453,'jasc.30-ice-and-rain-protection','3080-Ice Detection','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The system which is used to detect and indicate the formation of ice. Typical parts are panel, detector, etc.','combo-box','Operator'),(4454,'jasc.30-ice-and-rain-protection','3097-Ice/Rain Protection System Wiring','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports indicating a problem with wiring specific to the Ice/Rain Protection System.','combo-box','Operator'),(4455,'jasc.30-ice-and-rain-protection','30-Ice and Rain Protection','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The units and components which provide a means of preventing or disposing of formation of ice and rain on various parts of the aircraft. Includes miscellaneous items with insufficient information to file in a specific JASC 3000 series code. Does not include the basic windshield panel.','combo-box','Operator'),(4456,'jasc.31-instruments','3100-Indicating/Recording System','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The pictorial coverage of all instrument panels and controls. Procedural coverage of those systems, which give visual or aural warning of conditions in systems which record, store, or compute data from unrelated systems. Includes the system or units which integrate indicating instruments into a central display system not related to any specific system.','combo-box','Operator'),(4457,'jasc.31-instruments','3110-Instrument Panel','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The removable cockpit instrument and control panels. Includes the mounting hardware and shock absorbing devices.','combo-box','Operator'),(4458,'jasc.31-instruments','3120-Independent Instruments','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The units which measures time, logs elapsed time of operation, or measures acceleration/deceleration forces. Typical parts are hour meter, pressure switch, line, etc.','combo-box','Operator'),(4459,'jasc.31-instruments','3130-Data Recorders (Flight/Maintenance)','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The unit which continuously records critical flight, aircraft and powerplant system data, such as attitude, air speed, altitude, engine power, etc., to be used in the event of a crash. Includes the system and parts that provide a source of power and inputs, from various sources critical to flight, to flight data recorder. Typical parts are spool rod, magazine, etc.','combo-box','Operator'),(4461,'jasc.31-instruments','3150-Central Warning','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The panels and associated circuitry which warn of potential problems in two or more independent or related systems. Warnings can be either audible or visual. Typical parts are annunciator panel, relay, lamp, PC board, diode, throttle microswitch, etc.','combo-box','Operator'),(4462,'jasc.31-instruments','3160-Central Display','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The systems and components which give visual display of conditions in unrelated systems.','combo-box','Operator'),(4464,'jasc.31-instruments','3197-Instrument System Wiring','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports indicating a problem with wiring specific to the Instrument Systems.','combo-box','Operator'),(4465,'jasc.31-instruments','31-Instruments','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The pictorial coverage of all instrument panels and controls. Procedural coverage of those systems, which give visual or aural warning of conditions in systems which record, store, or compute data from unrelated systems. Includes the system or units which integrate indicating instruments into a central display system not related to any specific system.','combo-box','Operator'),(4466,'jasc.32-landing-gear','3200-Landing Gear System','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The units and components which furnish a means of supporting and steering the aircraft on the ground or water, and make it possible to retract and store the landing gear in flight. Includes the functioning and maintenance aspects of the landing gear doors, but does not include the door structure, which is covered in JASC Chapter 52. Use this code for general landing gear reports with insufficient information for filing in a more specific JASC 3200 series code.','combo-box','Operator'),(4470,'jasc.32-landing-gear','3212-Emergency Flotation Section','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The helicopter inflatable floats and attaching parts which permit emergency landings on water. The float make and model, as well as the aircraft make and model should be included in the report. Typical parts are float valve, hose, bracket, cylinder, etc.','combo-box','Operator'),(4471,'jasc.32-landing-gear','3213-Main Landing Gear Strut/Axle/Truck','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The main landing gear components and parts such as struts, axles, trucks which support the aircraft on the ground or water. Typical parts are shock device, torque link, beam and skid/shock device on rotorcraft.','combo-box','Operator'),(4472,'jasc.32-landing-gear','3220-Nose/Tail Landing Gear','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The miscellaneous parts of the nose or tail gear system which cannot be directly associated with a specific nose/tail gear code such as attachment, struts, axles, etc. This code is not to be used for extension/retraction mechanism, steering/dampening system, or doors.','combo-box','Operator'),(4473,'jasc.32-landing-gear','3221-Nose/Tail Landing Gear Attach Section','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The parts and assemblies that attach the nose/tail gear to the airframe structure. Applicable to fixed or retractable type landing gear.','combo-box','Operator'),(4474,'jasc.32-landing-gear','3222-Nose/Tail Landing Gear Strut/Axle','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The nose gear component parts such as shock struts and axles, which support the aircraft on the ground. Torque links are included but steering/shimmy dampening systems and units are excluded.','combo-box','Operator'),(4476,'jasc.32-landing-gear','3231-Landing Gear Door Retract Section','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The nose and main landing gear door actuating system parts other than the actuator. Excludes door structure and hinges, which are to be filed in ATA/JASC code 5280. Typical parts are bellcrank, rod, sequence valve, latch, lines, hoses, etc.','combo-box','Operator'),(4479,'jasc.32-landing-gear','3234-Landing Gear Selector','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The selector valves, switches, or control levers used to direct a power source to actuators for gear retraction and extension.','combo-box','Operator'),(4480,'jasc.32-landing-gear','3240-Landing Gear Brake System','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The brake system miscellaneous parts other than the brake assembly, master cylinder, power valve and anti-skid system. Includes the pressure source and associated system for emergency brake actuation, and brake anti-ice system. Typical parts are line, hose, fitting, park brake valve, gauge, etc.','combo-box','Operator'),(4481,'jasc.32-landing-gear','3241-Brake Anti-Skid Section','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The system units and parts that automatically control brake pressure during landing roll to prevent tire skidding. Typical parts are transducer, control box, valve, etc.','combo-box','Operator'),(4483,'jasc.32-landing-gear','3243-Master Cylinder/Brake Valve','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The units that provide a power source for cylinder-power brake actuation. Does not include connecting lines to brake units, which are filed in ATA/JASC code 3240. Typical parts are seal, piston, housing, etc.','combo-box','Operator'),(4485,'jasc.32-landing-gear','3245-Tire Tube','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports of defective wheel tire tubes. Include the manufacturer name, tube type and size.','combo-box','Operator'),(4487,'jasc.32-landing-gear','3250-Landing Gear Steering System','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The miscellaneous system parts other than the actuator, which provide for aircraft directional control on the ground. Includes main gear steering systems. Does not include wheel-braking systems. Typical parts are, cable, rod end, collar, line, valve, accumulator, etc.','combo-box','Operator'),(4488,'jasc.32-landing-gear','3251-Steering Unit','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The actuator which turn the wheel(s) by a power source for controlling direction of movement on the ground. Typical parts are cylinder, seal, etc.','combo-box','Operator'),(4489,'jasc.32-landing-gear','3252-Shimmy Damper','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The devices mounted on steerable wheel forks to reduce shimmy. Typical parts are seal, spring, housing, etc.','combo-box','Operator'),(4490,'jasc.32-landing-gear','3260-Landing Gear Position and Warning','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The system parts which provide indication and warning of the landing gear position. Includes gear safety switches which prevent inadvertent actuation such as squat or air/ground sensor. Typical parts are relay, switch bracket, lamp, horn, uplock switch, downlock switch, in transit switch, etc.','combo-box','Operator'),(4491,'jasc.32-landing-gear','3270-Auxiliary Gear (Tail Skid)','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The devices such as tail skids on tricycle gear aircraft used to stabilize the aircraft on the ground and to prevent ground contact damage. This code is also used for supplementary wheels on rotorcraft, skids for ground handling but not for skids or amphibian/seaplane floats, hull or associated retractable landing gear. This code is not for auxiliary or emergency landing gear extension systems which are filed in JASC code 3230.','combo-box','Operator'),(4492,'jasc.32-landing-gear','3297-Landing Gear System Wiring','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports indicating a problem with wiring specific to the Landing Gear System.','combo-box','Operator'),(4493,'jasc.32-landing-gear','32-Landing Gear','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The units and components which furnish a means of supporting and steering the aircraft on the ground or water, and make it possible to retract and store the landing gear in flight. Includes the functioning and maintenance aspects of the landing gear doors, but does not include the door structure, which is covered in JASC Chapter 52. Use this code for general landing gear reports with insufficient information for filing in a more specific JASC 3200 series code.','combo-box','Operator'),(4494,'jasc.33-lights','3300-Lighting System','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The units and components which provide for external and internal illumination. Includes light fixtures, switches and wiring. Does not include warning lights for individual systems. Use this code for reports of a general nature or for miscellaneous external and internal lamps, circuitry, switches, etc., with insufficient information to file in a specific JASC 3300 series code. Warning lights are filed in the individual JASC Chapter 33 code.','combo-box','Operator'),(4495,'jasc.33-lights','3310-Flight Compartment Lighting','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The lighting systems and equipment including panel illumination other than inside individual instruments, master warning light systems such as annunciator panels, and associated dimming systems located in the flight compartment only. Typical parts are bulb, socket, switch, lamp, lens, relay, rheostat, resistor, ballast, etc.','combo-box','Operator'),(4496,'jasc.33-lights','3320-Passenger Compartment Lighting','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The lighting systems in the passenger seating compartment, lavatories, buffet/galley compartments and cabin carry-on baggage/coat areas. Includes lamps for illumination of cabin, reading lamps, seat belt/no-smoking signs and passenger call systems. Does not include emergency lighting which is to be filed in JASC code 3350. Typical parts are ballast, switch, transformer, lamp, etc.','combo-box','Operator'),(4497,'jasc.33-lights','3330-Cargo Compartment Lighting','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The lighting systems in the compartments used for storage of cargo, baggage, or aircraft system components which require servicing. Does not include electrical systems fire or smoke sensing. Typical parts are circuit breaker, lamp, lens, switch, etc.','combo-box','Operator'),(4498,'jasc.33-lights','3340-Exterior Lighting','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The lighting systems for illumination outside the aircraft such as landing, taxi, position, wing illumination including the rotating beacon and strobe. Typical parts are switch, lamp, power supply, lens, circuit breaker, flasher unit, relay, motor, wheel well lights, brackets, etc.','combo-box','Operator'),(4499,'jasc.33-lights','3350-Emergency Lighting','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The cabin, flight compartment, and exterior emergency lighting systems, which furnish illumination in event of electrical power failure. This includes batteries, lamps, and associated circuitry and parts for emergency exit lighting.','combo-box','Operator'),(4500,'jasc.33-lights','3397-Light System Wiring','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports indicating a problem with wiring specific to the Lighting Systems.','combo-box','Operator'),(4501,'jasc.33-lights','33-Lights','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The units and components which provide for external and internal illumination. Includes light fixtures, switches and wiring. Does not include warning lights for individual systems. Use this code for reports of a general nature or for miscellaneous external and internal lamps, circuitry, switches, etc., with insufficient information to file in a specific JASC 3300 series code. Warning lights are filed in the individual JASC Chapter 33 code.','combo-box','Operator'),(4502,'jasc.34-navigation','3400-Navigation System','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The units and components which provide aircraft navigational information. For reports which are of a general nature relating to the navigation systems. Also, for reports on equipment utilized in the flight inspection of airways systems (excluding avionics equipment normally used for flight operations of the aircraft). Use this code for reports with insufficient information to file in a more specific JASC 3400 series code. Typical flight inspection equipment would be computers, recorders, nav comms, guidance equipment, etc.','combo-box','Operator'),(4503,'jasc.34-navigation','3410-Flight Environment Data','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The system which senses environmental conditions and uses the data to influence navigation.','combo-box','Operator'),(4504,'jasc.34-navigation','3411-Pitot/Static System','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The system which provides a source of ram or static air for distribution to using instruments and pressure differential units such as automatic landing gear extender, altimeter, airspeed and rate of climb. Does not include the using units, instruments, the anti-ice heating elements, or the associated circuitry and switches which are filed in JASC code 3030. Typical parts are air pick up heads, lines, fittings, drain valves, static port, selector valve, etc.','combo-box','Operator'),(4505,'jasc.34-navigation','3412-Outside Air Temperature Indicator/Sensor','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The unit mounted in the engine induction air intake to sense and transmit temperature to the cockpit indicator. Also for the sensors and instruments which measure and indicate the temperature of ambient air outside the aircraft. Includes associated circuitry and related parts. Typical parts are sensor, indicator, case, etc.','combo-box','Operator'),(4506,'jasc.34-navigation','3413-Rate of Climb Indicator','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The instrument which senses and indicates the rate of climb or descent of an aircraft. Does not include the associated static system. Includes the instantaneous vertical speed indicator (IVSI).','combo-box','Operator'),(4507,'jasc.34-navigation','3414-Airspeed/Mach Indicator','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The instrument which measures and indicates speed of the aircraft. Does not include the Doppler indicator which are filed in ATA/JASC code 3443.','combo-box','Operator'),(4508,'jasc.34-navigation','3415-High Speed Warning','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The system components and parts, including the computer which sense, transmit and provide warning when operating air speed limits are exceeded. Typical parts are transducer, stall warning detector, switch, vane, horn, lamp, warning unit computer, module, etc.','combo-box','Operator'),(4509,'jasc.34-navigation','3416-Altimeter, Barometric/Encoder','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','Altimeters and barometric encoders used to measure and indicate altitude. Also includes the unit which senses and alerts to a change in a preselected altitude. Does not include the Ground Proximity Systems and radio/radar altimeters which are filed in JASC codes 3444. Typical parts are dial, case, pointer, spring, etc.','combo-box','Operator'),(4510,'jasc.34-navigation','3417-Air Data Computer','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The computer and its integral parts which receives data from various environmental sensing systems, computes this data, and makes it available to the various navigation systems. Does not include external hardware such as cables, mounting racks, remote switches, etc., which are filed in JASC code 3410.','combo-box','Operator'),(4511,'jasc.34-navigation','3418-Stall Warning System','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The system components and parts, including the computer which sense, transmit and provide aural, visual and stick shaker warning of an aircraft in an impending flight stall condition. Typical parts are transducer, stall warning detector, switch, vane, horn, lamp, stick shaker, heater element, warning unit computer, module, etc.','combo-box','Operator'),(4512,'jasc.34-navigation','3420-Attitude and Direction Data System','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The system components and parts which use magnetic, gyroscopic, and inertia forces to indicate an aircraft attitude and direction. Use this code for reports with insufficient information to file in JASC codes 3421 through 3425. Includes such items as the inertial reference system (IRS), etc.','combo-box','Operator'),(4513,'jasc.34-navigation','3421-Attitude Gyro and Indicating System','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The gyroscopic unit which supplies attitude information to the necessary systems; for instance, vertical reference outputs for use as roll and pitch data to the autopilot computer. Includes the instruments operating by the gyroscopic principle, driven by air flow or an electric motor. Typical parts are vertical gyro and the gyro horizon.','combo-box','Operator'),(4514,'jasc.34-navigation','3422-Directional Gyro and Indicating System','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The unit operating by gyroscopic principle and driven by airflow or an electric motor, which provides heading (direction) references relative to a preset heading in degrees of the compass. Also for the flux unit detector which senses the earth\'s magnetic field and uses this data to correct for gyro drift. Typical parts are gyro, rotor, bearing, etc.','combo-box','Operator'),(4515,'jasc.34-navigation','3423-Magnetic Compass','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The instrument which indicates the magnetic heading of an aircraft by self contained magnetized needles. Typical parts are compensator, adjusting screw, gasket, float, case, etc.','combo-box','Operator'),(4516,'jasc.34-navigation','3424-Turn and Bank/Rate of Turn Indicator','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The instrument actuated by gyroscopic forces and driven by air flow or electric motor to indicate both rate of turn and angle of bank.','combo-box','Operator'),(4517,'jasc.34-navigation','3425-Integrated Flight System','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The system which computes, interrogates, and continuously displays basic attitude, position, and steering information in order to maintain a particular course, heading, or attitude. Does not include flight management system components, which should be assigned to JASC code 3460. Typical parts are integrated flight annunciator, integrated flight comparator, integrated flight computer/amplifier, integrated flight control and integrated flight indicators (i.e., horizontal situation indicator (HSI), attitude and direction indicator (ADI), attitude direction unit (ADU), heading and direction indicator (HDI), radio direction indicator (RDI), course direction indicator (CDI), flight director indicator (FDI), pictorial navigation indicator, flight command indicator, steering computer utilized in the integrated flight instrument systems, and other components such as cables, connectors, etc.','combo-box','Operator'),(4518,'jasc.34-navigation','3430-Landing and Taxi Aids','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The system providing guidance during approach, landing and taxiing. Includes such items as, ILS, paravisual director, ground guidance systems, markers, etc.','combo-box','Operator'),(4519,'jasc.34-navigation','3431-Localizer/VOR System','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The electronic portion of an instrument landing system (ILS) that indicates the centerline of the runway to the pilot. For reports on localizer/very high frequency omni range (VOR) systems. Typical parts are receiver, antenna, indicator, circuit breaker, switch, antenna coax, etc.','combo-box','Operator'),(4520,'jasc.34-navigation','3432-Glide Slope System','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The system which provides an instrument needle reference from an electronic signal radiated from a ground transmitter to enable the pilot to fly the proper glide path for landing under instrument meteorological conditions. Typical parts are circuit breaker, switch, receiver, antenna, indicator, etc.','combo-box','Operator'),(4521,'jasc.34-navigation','3433-Microwave Landing System','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The instrumental landing system operating in the microwave spectrum which provides lateral and vertical guidance to aircraft having compatible avionics equipment. Typical parts are receiver, antenna, control panel, etc.','combo-box','Operator'),(4522,'jasc.34-navigation','3434-Marker Beacon System','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The system which provides an aural and visual indication of passage over specified points on the glide path for landing under instrument meteorological conditions. NOTE: In instances where the control panel is an integral portion of the audio control panel, it would be filed in JASC code 2350. Typical parts are marker beacon antenna, receivers, visual/aural indication units, marker light, control panel, etc.','combo-box','Operator'),(4523,'jasc.34-navigation','3435-Heads Up Display System','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The flight instrument system that allows the pilot of an aircraft to watch the flight instruments while looking ahead of the aircraft. Includes the display screen which allows information to be visually presented to the pilot while looking through the windscreen or at the control panel.','combo-box','Operator'),(4524,'jasc.34-navigation','3436-Wind Shear Detection System','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The flight instrument system that allows the pilot to detect strong horizontal or vertical wind shift that acts at right angles to the direction the wind is blowing. Includes the outboard sensors, indicators, and the warning system which notifies the pilot of the appropriate corrective action maneuver to take.','combo-box','Operator'),(4525,'jasc.34-navigation','3440-Independent Position Determining System','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The system which provides information to determine position and is primarily independent of ground installations. Use this code for reports of a general nature or for reports containing insufficient information to file in a more specific code identified in JASC codes 3441 through 3446. Typical parts are star tracker, sextants/octants, etc.','combo-box','Operator'),(4526,'jasc.34-navigation','3441-Inertial Guidance System','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The navigation system which relies upon gyro platforms and accelerometers for its operation. Includes the control panel for the inertial navigation system; the instruments which receives their signal from the Inertial Navigation Unit (INU); and the unit containing the inertial platform and digital computer portion of the system. Use this JASC code for hardware components which do not have specific JASC codes assigned to them or when a system malfunction or failure occurs but the exact cause is not known. Typical parts are mode selector unit (MSU), control display unit (CDU), remote display unit (RDU), etc.','combo-box','Operator'),(4527,'jasc.34-navigation','3442-Weather Radar System','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The navigation system which relies upon gyro platforms and accelerometers for its operation. Includes the control panel for the inertial navigation system; the instruments which receives their signal from the Inertial Navigation Unit (INU); and the unit containing the inertial platform and digital computer portion of the system. Use this JASC code for hardware components which do not have specific JASC codes assigned to them or when a system malfunction or failure occurs but the exact cause is not known. Typical parts are mode selector unit (MSU), control display unit (CDU), remote display unit (RDU), etc.','combo-box','Operator'),(4528,'jasc.34-navigation','3443-Doppler System','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The airborne radar system which utilizes the Doppler effect to measure and display ground speed, drift angle, cross track, etc.','combo-box','Operator'),(4529,'jasc.34-navigation','3444-Ground Proximity System','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The system which detects and alerts flight crew to potential terrain hazards. Includes the antenna which transmits and receives an electronic signal for the radio altimeter equipment used for terrain-to-aircraft distance. Also includes the component which interprets a radio signal reflected back to a receiver to determine distance from the nearest terrain; and the component which process the warning computer input signals from various sources in order to determine if and when the crew should be alerted of a terrain hazard.','combo-box','Operator'),(4530,'jasc.34-navigation','3445-Air Collision Avoidance System','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The system which provides information to determine aircraft position and is primarily independent of ground installations (i.e., traffic alert and collision avoidance system - TCAS). Use this code only if the specific system creating the problem cannot be established. Typical parts are collision avoidance monitoring units, etc.','combo-box','Operator'),(4532,'jasc.34-navigation','3450-Dependent Position Determining System','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The system which provides information to determine position and is mainly dependent on ground installations. Use this code for reports of a general nature or for those with insufficient information to file in a more specific JASC code identified in JASC codes 3451 through 3457.','combo-box','Operator'),(4533,'jasc.34-navigation','3451-DME/TACAN System','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The systems which measures time-to-station, ground speed, and distance to a known transmitter location by transmitting and receiving electronic pulse signals (i.e., distance measuring equipment - DME; ultra high frequency tactical air navigational aid - TACAN). Typical parts are antenna, control unit, transceiver, coaxial cables, etc.','combo-box','Operator'),(4534,'jasc.34-navigation','3452-ATC Transponder System','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The air traffic control (ATC) system which receives coded signals from a ground station and transmits a coded reply for altitude reporting and identification purposes. Typical parts are transponder, antenna, control unit, transceiver, coaxial connecting cables, etc.','combo-box','Operator'),(4535,'jasc.34-navigation','3453-Long-Range Navigation (LORAN) System','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The radio navigation system and associated components and parts which provides for long range navigation (LORAN) enroute when operating on signals from ground based master and slave transmitting stations. Typical parts are antenna, coupler, CPU, receiver, indicator, etc.','combo-box','Operator'),(4536,'jasc.34-navigation','3454-Visual Omnirange (VOR) System','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The radio navigation system in the very high frequency (VHF) band used for determining position relative to a ground transmitter and permits selection of an infinite number of magnetic courses for navigation to a transmitter (i.e., visual omnirange - VOR system). Typical parts are receiver, antenna, control panel, etc.','combo-box','Operator'),(4537,'jasc.34-navigation','3455-Automatic Direction Finder (ADF) System','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The low frequency band system which receives a signal from a non-directional radio beacon to determine relative position from the beacon location (i.e., automatic direction finder - ADF system). Typical parts are antenna, control unit, receiver, coaxial cables, etc.','combo-box','Operator'),(4538,'jasc.34-navigation','3456-Omega Navigation System','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The low frequency navigation system which provides for system geographical location of the aircraft on a worldwide basis when operating on signals from ground-based OMEGA and VHF transmitting stations. Typical parts are antenna, control unit or receiver, coaxial connecting cable, remote switches, connectors, etc.','combo-box','Operator'),(4539,'jasc.34-navigation','3457-Global Positioning System','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The systems which are mainly dependent upon signals from ground transmitters or orbital satellites for their operations; systems such as VOR, ADF, DME, etc. Use this JASC code when there is insufficient information to assign one of the specific using system codes. Typical parts are antenna, control unit or receiver, coaxial connecting cable, remote switches, connectors, etc.','combo-box','Operator'),(4540,'jasc.34-navigation','3460-Flight Management Computing Hardware System','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The hardware systems which combines navigational data to compute or manage the aircraft\'s geographical position or theoretical flight path. Typical parts are course computers, flight management computers, performance data computers, and associated control display units, warning annunciators, etc.','combo-box','Operator'),(4541,'jasc.34-navigation','3461-Flight Management Computing Software System','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The software system which combines navigational data to compute or manage the aircraft\'s geographical position or theoretical flight path.','combo-box','Operator'),(4542,'jasc.34-navigation','3497-Navigation System Wiring','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports indicating a problem with wiring specific to the Navigation Systems.','combo-box','Operator'),(4543,'jasc.34-navigation','34-Navigation','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The units and components which provide aircraft navigational information. For reports which are of a general nature relating to the navigation systems. Also, for reports on equipment utilized in the flight inspection of airways systems (excluding avionics equipment normally used for flight operations of the aircraft). Use this code for reports with insufficient information to file in a more specific JASC 3400 series code. Typical flight inspection equipment would be computers, recorders, nav comms, guidance equipment, etc.','combo-box','Operator'),(4544,'jasc.35-oxygen','3500-Oxygen System','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The units and components which store, regulate, and deliver breathing oxygen to the passengers and crew. Typical parts are bottles, relief valves, shut-off valves, outlets, regulators, masks, walk-around bottles, etc.','combo-box','Operator'),(4545,'jasc.35-oxygen','3510-Crew Oxygen System','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The portion of the main system which furnishes oxygen to the crew.','combo-box','Operator'),(4546,'jasc.35-oxygen','3520-Passenger Oxygen System','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The portion of the main system which furnishes oxygen to the passengers.','combo-box','Operator'),(4547,'jasc.35-oxygen','3530-Portable Oxygen System','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The equipment attached to the portable bottle to regulate and dispense breathing oxygen, including the storage bottle for the portable oxygen system.','combo-box','Operator'),(4548,'jasc.35-oxygen','3597-Oxygen System Wiring','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports indicating a problem with wiring specific to the Oxygen System.','combo-box','Operator'),(4549,'jasc.35-oxygen','35-Oxygen','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The units and components which store, regulate, and deliver breathing oxygen to the passengers and crew. Typical parts are bottles, relief valves, shut-off valves, outlets, regulators, masks, walk-around bottles, etc.','combo-box','Operator'),(4550,'jasc.36-pneumatic','3600-Pneumatic System','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The units and components which deliver large volumes of compressed air from a power source to connecting points for other systems such as air conditioning, pressurization, deicing, etc.','combo-box','Operator'),(4551,'jasc.36-pneumatic','3610-Pneumatic Distribution System','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','Components and parts other than the regulator and shutoff valves delivering large volumes of compressed air from a power source to the control valves of using systems such as conditioning, pressurization. Doesn\'t include engine and airfoil anti-icing/deicing systems. Typical parts are regulator valve, actuator, duct, ducts valves, manifold, clamp, flow venturi, bellows, wye duct, check valve.','combo-box','Operator'),(4552,'jasc.36-pneumatic','3620-Pneumatic Indicating System','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The system components and parts which sense, transmit, and indicate the temperature and pressure of air in the distribution system other than the pressure indicator or sensor. Includes the instrument which indicates air pressure in the pneumatic distributing systems. Does not include the using systems.','combo-box','Operator'),(4553,'jasc.36-pneumatic','3697-Pneumatic System Wiring','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports indicating a problem with wiring specific to the Pneumatic System.','combo-box','Operator'),(4554,'jasc.36-pneumatic','36-Pneumatic','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The units and components which deliver large volumes of compressed air from a power source to connecting points for other systems such as air conditioning, pressurization, deicing, etc.','combo-box','Operator'),(4555,'jasc.37-vacuum','3700-Vacuum System','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The units and components used to generate, deliver, and regulate negative air pressure. Use this code for general reports of the pressure/vacuum system with insufficient information to file in a more specific ATA/JASC 3700 series code.','combo-box','Operator'),(4556,'jasc.37-vacuum','3710-Vacuum Distribution System','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The system components and parts, including the pump, regulator, oil separator or indication system, which are used to distribute low volume, negative pressure air (suction) to systems such as gyroscopic flight instruments, cabin rate controller, etc.; and to distribute low volume, positive pressure air to systems such as air foil deicer boots. Does not include the using systems. Typical parts are pump, filter, regulator, lines, manifold, check valves, element, etc.','combo-box','Operator'),(4557,'jasc.37-vacuum','3720-Vacuum Indicating System','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The system components and parts including which indicates negative air pressure in the vacuum lines. Includes the indicator and warning systems. Typical parts are the vacuum indicator and associated lines.','combo-box','Operator'),(4558,'jasc.37-vacuum','3797-Vacuum System Wiring','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports indicating a problem with wiring specific to the Vacuum System.','combo-box','Operator'),(4559,'jasc.37-vacuum','37-Vacuum','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The units and components used to generate, deliver, and regulate negative air pressure. Use this code for general reports of the pressure/vacuum system with insufficient information to file in a more specific JASC 3700 series code.','combo-box','Operator'),(4560,'jasc.38-water/waste','3800-Water and Waste System','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The fixed units and components which store and deliver fresh water. Also includes those fixed components which store and furnish a means of removal of water and waste. Use this code for reports with insufficient information to file in a more specific JASC 3800 series code. This code is also used for reports common to two or more systems.','combo-box','Operator'),(4561,'jasc.38-water/waste','3810-Potable Water System','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The system which is used to store and deliver fresh drinking water.','combo-box','Operator'),(4562,'jasc.38-water/waste','3820-Wash Water System','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The system which is used to store and deliver wash water.','combo-box','Operator'),(4563,'jasc.38-water/waste','3830-Waste Disposal System','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The system and components used for the disposal of water and waste. Includes wash basins, water closets, flush systems and collection tanks. Typical parts are valve, flush motor, lines, timer, etc.','combo-box','Operator'),(4564,'jasc.38-water/waste','3840-Air Supply (Water Pressure System)','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The system which provides the pressure to distribute potable water to the lavatories, etc. Typical parts are pump, motor, lines, etc.','combo-box','Operator'),(4565,'jasc.38-water/waste','3897-Water/Waste System Wiring','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports indicating a problem with wiring specific to the Water/Waste System.','combo-box','Operator'),(4566,'jasc.38-water/waste','38-Water/Waste','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The fixed units and components which store and deliver fresh water. Also includes those fixed components which store and furnish a means of removal of water and waste. Use this code for reports with insufficient information to file in a more specific JASC 3800 series code. This code is also used for reports common to two or more systems.','combo-box','Operator'),(4567,'jasc.45-central-maintenance-system-(cms)','4500-Central Maintenance Computer','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The unit, components and associated systems which interface with other airplane systems and provides a convenient way of communicating system problems to aircraft maintenance personnel. The system contains checkout and fault isolation procedures using a central computer to locate a single system or component malfunction. Typical parts are computer, storage devices, controls, display, etc.','combo-box','Operator'),(4568,'jasc.45-central-maintenance-system-(cms)','4597-Central Maintenance System Wiring','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports indicating a problem with wiring specific to the Central Maintenance System.','combo-box','Operator'),(4569,'jasc.45-central-maintenance-system-(cms)','45-Central Maintenance System (CMS)','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The unit, components and associated systems which interface with other airplane systems and provides a convenient way of communicating system problems to aircraft maintenance personnel. The system contains checkout and fault isolation procedures using a central computer to locate a single system or component malfunction. Typical parts are computer, storage devices, controls, display, etc.','combo-box','Operator'),(4570,'jasc.46-information-systems','4610-Airplane General Information Systems','','','combo-box','Operator'),(4571,'jasc.46-information-systems','4620-Flight Deck Information Systems','','','combo-box','Operator'),(4572,'jasc.46-information-systems','4630-Maintenance Information Systems','','','combo-box','Operator'),(4573,'jasc.46-information-systems','4640-Passenger Cabin Information Systems','','','combo-box','Operator'),(4574,'jasc.46-information-systems','4650-Miscellaneous Information Systems','','','combo-box','Operator'),(4575,'jasc.46-information-systems','46-Information ','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The fixed units and components which store and deliver fresh water. Also includes those fixed components which store and furnish a means of removal of water and waste. Use this code for reports with insufficient information to file in a more specific JASC 3800 series code. This code is also used for reports common to two or more systems.','combo-box','Operator'),(4577,'jasc.49-airborne-auxiliary-power','4910-APU Cowling/Containment','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The system of cowling and other components used to cover the auxiliary power unit, and contain any broken parts in the event of an external failure.','combo-box','Operator'),(4578,'jasc.49-airborne-auxiliary-power','4920-APU Core Engine','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports of basic engine defects such as compressor, turbine, cases other than specific systems shown in other APU sub-systems such as fuel, ignition, exhaust, starting and controls. The APU make and model should be included if available. Typical parts are turbine, bearing, seal, impeller, blade, case, burner can, etc.','combo-box','Operator'),(4579,'jasc.49-airborne-auxiliary-power','4930-APU Engine Fuel and Control','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The system and components which furnishes fuel from the aircraft tanks to the APU fuel control and associated injector nozzles. Including the unit which provides fuel at the proper pressure for fuel control operation; and the unit controlling and injecting metered fuel to the engine burner can section. Typical parts are shutoff valve, line, fitting, etc.','combo-box','Operator'),(4580,'jasc.49-airborne-auxiliary-power','4940-APU Start/Ignition System','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The system units used to start the APU engine. Including the unit which provides a power source to the igniter during the starting cycle. Typical parts are ignition unit, magneto, igniter, starter, etc.','combo-box','Operator'),(4581,'jasc.49-airborne-auxiliary-power','4950-APU Bleed Air System','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The system and components which provide and control a source of pressure and high volume of air for aircraft using systems such as engine starting, cabin air conditioning prior to starting engines. Typical parts are duct, bleed valve, clamp, seal, etc.','combo-box','Operator'),(4582,'jasc.49-airborne-auxiliary-power','4960-APU Controls','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The system components which electrically and manually control operation of the APU engine. Typical parts are relay, control box, etc.','combo-box','Operator'),(4583,'jasc.49-airborne-auxiliary-power','4970-APU Indicating System','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For general reports of APU operation indicating including the temperature indicator, tachometer generator or indicator (engine speed). Includes the instrument and associated warning system which sense, transmits, and indicates APU engine speed and temperatures to the flight crew.','combo-box','Operator'),(4584,'jasc.49-airborne-auxiliary-power','4980-APU Exhaust System','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The components and parts which collect and direct exhaust gasses from the APU turbine to the aircraft exterior. Includes the movable door fairing. Typical parts are nozzle, door, actuator, seal, clamp, and shield.','combo-box','Operator'),(4585,'jasc.49-airborne-auxiliary-power','4990-APU Oil System','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The system and components used for APU engine lubrication. Typical parts are filter, pump, relief valve, hose, line, etc.','combo-box','Operator'),(4586,'jasc.49-airborne-auxiliary-power','4997-APU System Wiring','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports indicating a problem with wiring specific to the APU System.','combo-box','Operator'),(4588,'jasc.51-standard-practices/structures','5100-Standard Practices/Structures','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The standard practices and general procedures for typical repairs applicable to more than one chapter that are not specifically covered under ATA/JASC Chapters 52 through 57.','combo-box','Operator'),(4589,'jasc.51-standard-practices/structures','5101-Aircraft Structures','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports of aircraft structural problems of a general nature which affects two or more areas. Includes reports of lightning strikes which cannot be associated with a specific ATA/JASC code.','combo-box','Operator'),(4590,'jasc.51-standard-practices/structures','5102-Balloon Reports','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For all balloon reports irrespective of location or component involved. Includes all airship reports irrespective of location or component involved. Also includes reports for water ballast. Typical parts are stitching, seam, fabric, burner, valve, handle, valve seat, manifold and burner fuel tank, etc.','combo-box','Operator'),(4591,'jasc.51-standard-practices/structures','51-Standard Practices/Structures','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The standard practices and general procedures for typical repairs applicable to more than one chapter that are not specifically covered under JASC Chapters 52 through 57.','combo-box','Operator'),(4592,'jasc.52-doors','5200-Doors','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The removable units used for entrance or exit, and for enclosing other structure contained within the fuselage. Includes passenger and crew doors, cargo doors, emergency exits, etc. Electrical and hydraulic systems associated with door control are included as appropriate. Use this code for door reports of a general nature which affect two or more specific type of doors or are reported with insufficient information to file in a more specific JASC 5200 series code.','combo-box','Operator'),(4593,'jasc.52-doors','5210-Passenger/Crew Doors','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports of cabin entrance doors. Does not include door frames, warning systems, or cabin emergency exit doors/hatches. Typical parts are hinges, actuators, latches, handle, seals, structure, spring, cable, bellcrank, skin, etc.','combo-box','Operator'),(4594,'jasc.52-doors','5220-Emergency Exits','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports of emergency exit doors, windows and hatches. Typical parts are pan, hinge, latch, hook, etc.','combo-box','Operator'),(4595,'jasc.52-doors','5230-Cargo/Baggage Doors','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For exterior doors used to gain access to cargo or baggage storage areas. Does not include door frames on fuselage, door warning or compartment interior furnishings. Typical parts are door structure, seal, hinge, latch, latch pin, handle, skin, etc.','combo-box','Operator'),(4596,'jasc.52-doors','5240-Service Doors','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports pertaining to exterior doors used to gain access for servicing aircraft systems and equipment. Does not include the fluid service doors which are covered in ATA/JASC 5246.','combo-box','Operator'),(4597,'jasc.52-doors','5241-Galley Doors','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports pertaining to the galley door. Typical parts are hinges, structure, and the latch mechanism.','combo-box','Operator'),(4598,'jasc.52-doors','5242-Electrical/Electronic Compartment Doors','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports pertaining to the electrical/electronic compartment doors. Typical parts are hinges, structure, and the latch mechanism.','combo-box','Operator'),(4599,'jasc.52-doors','5243-Hydraulic Compartment Doors','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports pertaining to the hydraulic compartment doors. Typical parts are hinges, structure, and the latch mechanism.','combo-box','Operator'),(4600,'jasc.52-doors','5244-Accessory Compartment Doors','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports pertaining to the accessory compartment doors. Typical parts are hinges, structure, and the latch mechanism.','combo-box','Operator'),(4601,'jasc.52-doors','5245-Air Conditioning Doors','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports pertaining to doors used to gain access to the air conditioning compartment system and components. Typical parts are hinges, structure, and the latch mechanism.','combo-box','Operator'),(4602,'jasc.52-doors','5246-Fluid Service Doors','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports of service doors used to gain access to fluid service areas, excluding compartment doors which are filed in ATA/JASC code 5243. Typical parts are hinges, structure, and the latch mechanism.','combo-box','Operator'),(4603,'jasc.52-doors','5247-Auxiliary Power Unit (APU) Doors','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports of doors used to gain access for servicing the APU and components. Typical parts are hinges, structure, and the latch mechanism.','combo-box','Operator'),(4604,'jasc.52-doors','5248-Tail Cone Doors','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports pertaining to the tail cone door. Typical parts are hinges, structure, and the latch mechanism.','combo-box','Operator'),(4605,'jasc.52-doors','5250-Fixed Inner Doors','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports of doors within the fuselage in fixed partitions. Typical parts are structure, hinges, latches, lining but does not include doors in movable partitions.','combo-box','Operator'),(4606,'jasc.52-doors','5260-Entrance Stairs','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports of cabin entrance stairs which operate in conjunction with but are not an integral part of entrance doors. Typical parts are structure, actuator, controls and handrails, step, cable, bungee, latch hook, latch, bracket, bellcrank, etc.','combo-box','Operator'),(4607,'jasc.52-doors','5270-Door Warning System','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The system which is used to indicate to flight crews whether the exterior doors are closed and properly latched. Does not include the landing gear position warning indications which are covered in JASC code 3260. Typical parts are switch, lamp, horn, relay, etc. The suspect door should be identified if known.','combo-box','Operator'),(4608,'jasc.52-doors','5280-Landing Gear Doors','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports pertaining to the structural aspects of landing gear doors including hinges and seals on the wing, landing gear, and fuselage mounted doors. The door position on the aircraft or landing gear (i.e., nose, right main outboard, etc.) should be shown in the part location field. Does not include the operating mechanism or position indicating or warning system which is filed in JASC codes 3231 or 3260.','combo-box','Operator'),(4609,'jasc.52-doors','5297-Door System Wiring','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports indicating a problem with wiring specific to the Door Systems.','combo-box','Operator'),(4610,'jasc.52-doors','52-Doors','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The removable units used for entrance or exit, and for enclosing other structure contained within the fuselage. Includes passenger and crew doors, cargo doors, emergency exits, etc. Electrical and hydraulic systems associated with door control are included as appropriate. Use this code for door reports of a general nature which affect two or more specific type of doors or are reported with insufficient information to file in a more specific JASC 5200 series code.','combo-box','Operator'),(4611,'jasc.53-fuselage','5300-Fuselage Structure (General)','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports of structural units and associated components and members which make up the compartments for crew, passengers, equipment, cargo, plus the structure of the envelope and gondola of airships.','combo-box','Operator'),(4612,'jasc.53-fuselage','5301-Aerial Tow Equipment','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports of defective aerial tow equipment including the attachments on fuselage and release mechanism.','combo-box','Operator'),(4613,'jasc.53-fuselage','5302-Rotorcraft Tail Boom','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports of the structure including exterior skin and truss framework of tail booms on rotorcraft. Includes attach fittings, etc., for tail boom and stabilizer surfaces. Typical parts are bulkhead, bracket, frame, frame tube, plate, etc.','combo-box','Operator'),(4614,'jasc.53-fuselage','5310-Fuselage Main, Structure','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For general reports of fuselage structure defects which affect two or more related parts or are reported with insufficient information to file in a more specific ATA/JASC 5300 series code. Use of this code should be avoided if possible.','combo-box','Operator'),(4615,'jasc.53-fuselage','5311-Fuselage Main, Frame','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports of the main fuselage frames. The associated attach fittings are covered in ATA/JASC code 5320.','combo-box','Operator'),(4616,'jasc.53-fuselage','5312-Fuselage Main, Bulkhead','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports of the main fuselage bulkheads and the associated attach fittings.','combo-box','Operator'),(4617,'jasc.53-fuselage','5313-Fuselage Main, Longeron/Stringer','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports of the main fuselage longerons/stringers.','combo-box','Operator'),(4618,'jasc.53-fuselage','5314-Fuselage Main, Keel','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports of the main fuselage keel beams.','combo-box','Operator'),(4619,'jasc.53-fuselage','5315-Fuselage Main, Floor Beam','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports of the main fuselage floor beams.','combo-box','Operator'),(4620,'jasc.53-fuselage','5320-Fuselage Miscellaneous Structure','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports of miscellaneous structure on the main fuselage structure which aids in the support of the primary structure. Includes such items as brackets, channels, stiffeners, clips, doublers, etc. Does not include movable partitions which are covered in JASC Chapter 25.','combo-box','Operator'),(4621,'jasc.53-fuselage','5321-Fuselage Floor Panel','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports of the interior floor panels within the main fuselage structure.','combo-box','Operator'),(4622,'jasc.53-fuselage','5322-Fuselage Internal Mounting Structure','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports of the internal mounting structure which aids in the support of the fuselage structure.','combo-box','Operator'),(4623,'jasc.53-fuselage','5323-Fuselage Internal Stairs','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports of the internal stairs which are part of the fuselage structure.','combo-box','Operator'),(4624,'jasc.53-fuselage','5324-Fuselage Fixed Partitions','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports of the fixed partitions which are part of the fuselage structure.','combo-box','Operator'),(4625,'jasc.53-fuselage','5330-Fuselage Main, Plate/Skin','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports of the exterior covering of the fuselage including access covers.','combo-box','Operator'),(4626,'jasc.53-fuselage','5340-Fuselage Main, Attach Fittings','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports of the fittings on the fuselage used for the attachment of doors, wings, stabilizers, landing gear, engine and rotor pylons, and the support of equipment within the fuselage. For reports of fuselage attach fittings that can not be specifically identified in JASC codes 5341 through 5347.','combo-box','Operator'),(4627,'jasc.53-fuselage','5341-Fuselage, Wing Attach Fittings','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports of the fittings on the fuselage used for the attachment of the wings.','combo-box','Operator'),(4628,'jasc.53-fuselage','5342-Fuselage, Stabilizer Attach Fittings','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports of the fittings on the fuselage used for the attachment of the stabilizers','combo-box','Operator'),(4629,'jasc.53-fuselage','5343-Fuselage, Landing Gear Attach Fittings','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports of the fittings on the fuselage used for the attachment of the landing gear.','combo-box','Operator'),(4630,'jasc.53-fuselage','5344-Fuselage, Door Hinge','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports of the fittings on the fuselage used for the attachment of the doors.','combo-box','Operator'),(4631,'jasc.53-fuselage','5345-Fuselage, Equipment Attach Fittings','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports of the fittings on the fuselage used for the attachment of equipment.','combo-box','Operator'),(4632,'jasc.53-fuselage','5346-Fuselage, Powerplant Attach Fittings','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports of the fittings on the fuselage used for the attachment of the powerplant. (i.e., the center engine on tri-engine airplanes).','combo-box','Operator'),(4633,'jasc.53-fuselage','5347-Fuselage, Seat/Cargo Attach Fittings','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports of the fittings on the fuselage used for the attachment of seats and cargo restraint mechanisms.','combo-box','Operator'),(4634,'jasc.53-fuselage','5350-Aerodynamic Fairings','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports of all fixed and removable aerodynamic fairings between the fuselage and wing/flap/empennage/pylon/nacelle attach points, tail cones and radomes. Also includes the fairings on rotorcraft tail cones. Typical parts are tail, radome, fairing, stiffener, skin, screw, fillet, etc.','combo-box','Operator'),(4635,'jasc.53-fuselage','5397-Fuselage wiring','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports indicating a problem with wiring specific to the Fuselage System.??????','combo-box','Operator'),(4636,'jasc.53-fuselage','53-Fuselage','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports of structural units and associated components and members which make up the compartments for crew, passengers, equipment, cargo, plus the structure of the envelope and gondola of airships.','combo-box','Operator'),(4637,'jasc.54-nacelles/pylons','5400-Nacelle/Pylon Structure','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports of structural units and associated components and members which furnish a means of mounting and housing the powerplant or rotor assembly. Includes the structure of powerplant cowling inclusive of the structural portion of the inlet whether or not integral with the aircraft. Structural portions of the exhaust system are excluded where they are not integral with the airframe. Use this code when there is insufficient information to file in a more specific JASC 5400 series code. NOTE: The use of this code should be avoided if possible as a reported defect is not likely to involve both pylon and nacelle.','combo-box','Operator'),(4638,'jasc.54-nacelles/pylons','5410-Nacelle/Pylon, Main Frame','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports of the structure which houses and supports powerplants. Includes the firewall and all structure aft on multi-engine aircraft and firewalls on single engine aircraft. Does not include engine mounting or cowling.','combo-box','Operator'),(4639,'jasc.54-nacelles/pylons','5411-Nacelle/Pylon, Frame/Spar/Rib','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports pertaining to the main frame, spar, or rib structure on the nacelles or pylons.','combo-box','Operator'),(4640,'jasc.54-nacelles/pylons','5412-Nacelle/Pylon, Bulkhead/Firewall','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports pertaining to the bulkhead or firewall structure on the nacelles or pylons which houses and supports the powerplants. Does not include the engine mounting or cowling. Typical parts are firewall, bulkhead, skin, stringer, beam, splice plate, etc.','combo-box','Operator'),(4641,'jasc.54-nacelles/pylons','5413-Nacelle/Pylon, Longeron/Stringer','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports pertaining to the longeron or stringer structure on the nacelles or pylons.','combo-box','Operator'),(4642,'jasc.54-nacelles/pylons','5414-Nacelle/Pylon, Plate/Skin','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports pertaining to the plates or skins on the nacelles or pylons.','combo-box','Operator'),(4643,'jasc.54-nacelles/pylons','5415-Nacelle/Pylon, Attach Fittings','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports on the fittings on the nacelles/pylons used for the attachment to its connecting structure, powerplant, thrust reverser, and for the support of equipment within the nacelle/pylon.','combo-box','Operator'),(4644,'jasc.54-nacelles/pylons','5420-Nacelle/Pylon Miscellaneous Structure','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports of miscellaneous structure on the nacelle/pylon structure which aids in the support of the primary structure. Includes such items as brackets, channels, stiffeners, doublers, clips, etc.','combo-box','Operator'),(4645,'jasc.54-nacelles/pylons','5497-Nacelle/Pylon System Wiring','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports indicating a problem with wiring specific to the Nacelle/Pylon System.','combo-box','Operator'),(4646,'jasc.54-nacelles/pylons','54-Nacelles/Pylons','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports of structural units and associated components and members which furnish a means of mounting and housing the powerplant or rotor assembly. Includes the structure of powerplant cowling inclusive of the structural portion of the inlet whether or not integral with the aircraft. Structural portions of the exhaust system are excluded where they are not integral with the airframe. Use this code when there is insufficient information to file in a more specific JASC 5400 series code. NOTE: The use of this code should be avoided if possible as a reported defect is not likely to involve both pylon and nacelle.','combo-box','Operator'),(4647,'jasc.55-stabilizers','5500-Empennage Structure','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The horizontal and vertical stabilizers include the structure of the elevator and rudder. For general reports of empennage structure which affect two or more surfaces or are reported with insufficient information to file in a more specific JASC 5500 series code. This code is also used for reports that pertain to flying wires.','combo-box','Operator'),(4648,'jasc.55-stabilizers','5510-Horizontal Stabilizer Structure','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports pertaining to the structural aspects of horizontal stabilizer and stabilators or canard. Includes fuselage and boom-to-surface attach fittings. Does not include actuating mechanism filed in ATA/JASC code 2742.','combo-box','Operator'),(4649,'jasc.55-stabilizers','5511-Horizontal Stabilizer, Spar/Rib','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For specific reports of spars/ribs on the horizontal stabilizer.','combo-box','Operator'),(4650,'jasc.55-stabilizers','5512-Horizontal Stabilizer, Plate/Skin','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For specific reports of plates/skins on the horizontal stabilizer.','combo-box','Operator'),(4651,'jasc.55-stabilizers','5513-Horizontal Stabilizer, Tab Structure','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports pertaining to the structure and attachment of the tab surface mounted on movable stabilizers and stabilators. Includes hinge brackets and bearings/bushings. Does not include the actuating mechanism filed in JASC code 2740. Typical parts are hinge, skin, rib, spar, etc.','combo-box','Operator'),(4652,'jasc.55-stabilizers','5514-Horizontal Stabilizer Miscellaneous Structure','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports of miscellaneous structure on the horizontal stabilizer structure which aids in the support of the primary structure. Includes such items as brackets, channels, stiffeners, doublers, clips, etc.','combo-box','Operator'),(4654,'jasc.55-stabilizers','5521-Elevator, Spar/Rib','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For specific reports of spars/ribs on the elevator.','combo-box','Operator'),(4655,'jasc.55-stabilizers','5522-Elevator, Plate/Skin','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For specific reports of plates/skins on the elevator.','combo-box','Operator'),(4657,'jasc.55-stabilizers','5524-Elevator Miscellaneous Structure','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports of miscellaneous structure on the elevator structure which aids in the support of the primary structure. Includes such items as brackets, channels, stiffeners, doublers, clips, etc.','combo-box','Operator'),(4658,'jasc.55-stabilizers','5530-Vertical Stabilizer','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The structural aspects of the fixed vertical surface attached to the fuselage including the dorsal fin.','combo-box','Operator'),(4659,'jasc.55-stabilizers','5531-Vertical Stabilizer, Spar/Rib','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For specific reports of spars or ribs on the vertical stabilizer.','combo-box','Operator'),(4660,'jasc.55-stabilizers','5532-Vertical Stabilizer, Plate/Skin','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For specific reports of plates or skins on the vertical stabilizer.','combo-box','Operator'),(4661,'jasc.55-stabilizers','5533-Ventral Structure','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports pertaining to the ventral structure and skin of the ventral fin mounted on the lower, aft fuselage for added directional stability. Typical parts are skin, rib, rivet, and miscellaneous parts, etc.','combo-box','Operator'),(4662,'jasc.55-stabilizers','5534-Vertical Stabilizer Miscellaneous Structure','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports of miscellaneous structure on the vertical stabilizer structure which aids in the support of the primary structure. Includes such items as brackets, channels, stiffeners, doublers, clips, etc.','combo-box','Operator'),(4663,'jasc.55-stabilizers','5540-Rudder Structure','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports pertaining to the structural aspects of the vertical airfoil hinged to the vertical stabilizer. Does not include the actuators, actuator mechanism or mounting which are filed in JASC code 2720. Typical parts are hinge, hinge fittings, bearing, bolt, miscellaneous structure, etc.','combo-box','Operator'),(4664,'jasc.55-stabilizers','5541-Rudder, Spar/Rib','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For specific reports pertaining to spars or ribs on the rudder structure.','combo-box','Operator'),(4665,'jasc.55-stabilizers','5542-Rudder, Plate/Skin','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For specific reports pertaining to plates or skins on the rudder structure.','combo-box','Operator'),(4666,'jasc.55-stabilizers','5543-Rudder, Tab Structure','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports pertaining to the structure of the movable surface hinged to the rudder surface for directional trim. Typical parts are skin, hinge fitting, spar, rib. The actuating mechanism is filed in ATA/JASC code 2720.','combo-box','Operator'),(4667,'jasc.55-stabilizers','5544-Rudder Miscellaneous Structure','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports of miscellaneous structure on the rudder structure which aids in the support of the primary structure. Includes such items as brackets, channels, stiffeners, doublers, clips, etc.','combo-box','Operator'),(4668,'jasc.55-stabilizers','5550-Empennage Flight Control Surfaces, Attach Fittings','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For miscellaneous reports of fittings on the empennage structure which are used for the support of the flight control, but are not specifically addressed in ATA/JASC codes 5551 through 5554.','combo-box','Operator'),(4669,'jasc.55-stabilizers','5551-Horizontal Stabilizer, Attach Fittings','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For specific reports pertaining to the fittings on the horizontal stabilizer which are used to support equipment within the structure.','combo-box','Operator'),(4670,'jasc.55-stabilizers','5552-Elevator Tab, Attach Fittings','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For specific reports pertaining to the fittings on the elevator or elevator tab which are used to support equipment within the structure.','combo-box','Operator'),(4671,'jasc.55-stabilizers','5553-Vertical Stabilizer, Attach Fittings','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For specific reports pertaining to the fittings on the vertical stabilizer which are used to support equipment within the structure.','combo-box','Operator'),(4672,'jasc.55-stabilizers','5554-Rudder/Tab, Attach Fittings','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For specific reports pertaining to the fittings on the rudder or rudder tab, which are used to support equipment within the structure.','combo-box','Operator'),(4673,'jasc.55-stabilizers','5597-Stabilizer System Wiring','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports indicating a problem with wiring specific to the Stabilizer Systems.','combo-box','Operator'),(4674,'jasc.55-stabilizers','55-Stabilizers','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The horizontal and vertical stabilizers include the structure of the elevator and rudder. For general reports of empennage structure which affect two or more surfaces or are reported with insufficient information to file in a more specific JASC 5500 series code. This code is also used for reports that pertain to flying wires.','combo-box','Operator'),(4675,'jasc.56-windows','5600-Window/Windshield System','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports pertaining to the fuselage and crew compartment windows inclusive of windshields. For reports of cockpit and cabin window or windshield defects reported with insufficient information to file in a specific ATA/JASC 5600 series code.','combo-box','Operator'),(4676,'jasc.56-windows','5610-Flight Compartment Windows','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports of all cockpit windows, cockpit overhead canopies, observation windows, and windshield panels in the flight compartment. Includes attachment and sliding feature of sliding windows. For cockpit windows including the breakage of electrically heated windshield panels regardless of cause. Does not include the heating aspects associated circuitry of heated windshields, which is filed in JASC code 3040. Typical parts are windshield, sliding window, seal, frame, panel, latch, hinge, chin bubbles, etc.','combo-box','Operator'),(4677,'jasc.56-windows','5620-Passenger Compartment Windows','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports of cabin mounted windows in the passenger compartments. Includes the inner and outer windows, frame attaching hardware, picture windows. Does not include the windows in the escape hatches which are filed in ATA/JASC code 5220.','combo-box','Operator'),(4678,'jasc.56-windows','5630-Door Windows','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports of windows mounted in doors. Does not include emergency exit windows which are filed in ATA/JASC code 5220.','combo-box','Operator'),(4679,'jasc.56-windows','5640-Inspection Windows','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For windows used for examining compartments and equipment in and about the aircraft such as door latches, and cargo bays.','combo-box','Operator'),(4680,'jasc.56-windows','5697-Window System Wiring','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports indicating a problem with wiring specific to the Window System.','combo-box','Operator'),(4681,'jasc.56-windows','56-Windows','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports pertaining to the fuselage and crew compartment windows inclusive of windshields. For reports of cockpit and cabin window or windshield defects reported with insufficient information to file in a specific JASC 5600 series code.','combo-box','Operator'),(4682,'jasc.57-wings','5700-Wing Structure','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports pertaining to the center wing and outer wing structural units and associated components and members which support the aircraft in flight. This code should be used for general reports of the primary wing structure.','combo-box','Operator'),(4683,'jasc.57-wings','5710-Wing Main, Frame Structure','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For general reports of wing structure defects which affect two or more related parts or are reported with insufficient information to file in a more specific 5700 JASC code. Does not include reports pertaining to fuel tank sealing which are filed in JASC code 2810. Excessive use of this code should be avoided if possible.','combo-box','Operator'),(4684,'jasc.57-wings','5711-Wing Spar','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports pertaining to the spar in the wing structure.','combo-box','Operator'),(4685,'jasc.57-wings','5712-Wing, Rib/Bulkhead','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports pertaining to the ribs/bulkhead in the wing structure.','combo-box','Operator'),(4686,'jasc.57-wings','5713-Wing, Longeron/Stringer','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports pertaining to the longerons or stringers in the wing structure.','combo-box','Operator'),(4687,'jasc.57-wings','5714-Wing, Center Box','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports pertaining to the center wing box structure.','combo-box','Operator'),(4688,'jasc.57-wings','5720-Wing Miscellaneous Structure','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports of the auxiliary or miscellaneous wing structure. Includes the secondary items used for attachment. Does not include reports for plates or skins. Typical parts are wing tip, clips, brackets, channels, angles, stiffeners, doublers, etc.','combo-box','Operator'),(4689,'jasc.57-wings','5730-Wing, Plate/Skin','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports of the exterior covering of the wing including the access covers, tip tank fillets, or fairings. Includes the leading edge and trailing edge skin and wing mounted fuel compartment panels.','combo-box','Operator'),(4690,'jasc.57-wings','5740-Wing, Attach Fittings','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The structure on the wing used for the attachment of fuselage, nacelle or pylon, and landing gear to the wing and for the support of equipment within the wing. Use this code for reports of wing attachments that can not be specifically identified in JASC codes 5741 through 5744. Does not include flight control or landing gear actuator support fittings which should be coded in the appropriate JASC 2700 or 3200 series code.','combo-box','Operator'),(4691,'jasc.57-wings','5741-Wing, Fuselage Attach Fittings','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The fittings on the wing used for attachment to the fuselage structure.','combo-box','Operator'),(4692,'jasc.57-wings','5742-Wing, Landing Gear Attach Fittings','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The fittings on the wing used for attachment to the landing gear.','combo-box','Operator'),(4693,'jasc.57-wings','5742-Wing, Nacelle/Pylon Attach Fittings','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The fittings on the wing used for attachment to the nacelle/pylon.','combo-box','Operator'),(4694,'jasc.57-wings','5743-Wing, Control Surface Attach Fittings','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The fittings on the wing used for attachment to the control surface.','combo-box','Operator'),(4695,'jasc.57-wings','5750-Wing, Control Surfaces','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports of a general nature involving the control surfaces which are attached to the wing.','combo-box','Operator'),(4696,'jasc.57-wings','5751-Ailerons','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports pertaining to the structural aspects of the aileron mounted on the trailing edge of wing. Includes hinges, balance weights. Does not include operating mechanism which causes the surface to move which is filed in JASC code 2510. Typical parts are skin, rib, spar, hinge, bracket, bolt, bearing, bushing, balance weight, etc.','combo-box','Operator'),(4697,'jasc.57-wings','5752-Aileron Tabs','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports pertaining to the structural aspects of the surface mounted at the trailing edge of the aileron for lateral trim. Does not include the operating mechanism filed in JASC code 2511. Typical parts are spar, skin, hinge, bracket, bolt, bearing, bushing.','combo-box','Operator'),(4698,'jasc.57-wings','5753-Trailing Edge Flaps','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports pertaining to the structural aspects of the flap surface mounted on the trailing edge of the wing (includes fore, mid, and aft segments). Does not include the operating mechanism such as the actuators, brackets, hydraulic or electric motors. Typical parts are skin, rib, spar, flap track, roller, flap carriage, bearing, bolt, rivet, etc.','combo-box','Operator'),(4699,'jasc.57-wings','5754-Leading Edge Devices','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports pertaining to the structural aspects of the wing leading edge device control surface. Includes hinge, brackets, bolts but does not include actuators or actuator mounting brackets which are filed in JASC code 2782. Typical parts are skin, rib, track, roller, bearing, carriage, etc.','combo-box','Operator'),(4700,'jasc.57-wings','5755-Spoilers','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports pertaining to the structural aspects of the movable surface on the upper surface of the wing for drag and lift reducing functions. Does not include operating mechanism such as actuators, hoses, lines which are filed in JASC codes 2760 and 2761. Typical parts are skin, rib, gusset plate, spoiler and actuator support fittings.','combo-box','Operator'),(4701,'jasc.57-wings','5797-Wing System Wiring','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports indicating a problem with wiring specific to the Wing Systems.','combo-box','Operator'),(4702,'jasc.57-wings','57-Wings','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports pertaining to the center wing and outer wing structural units and associated components and members which support the aircraft in flight. This code should be used for general reports of the primary wing structure.','combo-box','Operator'),(4703,'jasc.61-propeller/propulsors','6100-Propeller System','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The complete mechanical or electrical propeller, governor, alternators, pumps, motors those units and components external to or integral with the engine used to control the propeller blade angle. Includes the propulsor duct assemblies, aerodynamic fairing of mechanical components, stators, vectoring systems, etc. Use this code for reports with insufficient information to file in a more specific JASC 6100 series code.','combo-box','Operator'),(4704,'jasc.61-propeller/propulsors','6110-Propeller Assembly','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports of propeller assembly malfunctions excluding controlling aspects, with insufficient information to file in a more specific JASC 6100 series code, or for conditions which affect two or more parts of the propeller such as hub and blades. Includes the propeller retaining nut, etc.','combo-box','Operator'),(4705,'jasc.61-propeller/propulsors','6111-Propeller Blade Section','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports of blade defects other than deice boots. Includes retaining clamps and blade pitch change actuating mechanism which rotates with the propeller. Typical parts are blade, clamp, link, motor, counterweight, bearing, etc.','combo-box','Operator'),(4706,'jasc.61-propeller/propulsors','6112-Propeller Deice Boot Section','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports of defective deice/anti-ice system parts on the rotating parts of the propeller such as blades or spinner. Does not include the power source, controls or other non-rotating system parts in JASC code 3060. Typical parts are boot, cuff, heat element, slip ring, etc.','combo-box','Operator'),(4707,'jasc.61-propeller/propulsors','6113-Propeller Spinner Section','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports of defective propeller spinner assemblies. Typical parts are shell, backplate, bulkhead, rivets, screw, nut plate, brackets, etc.','combo-box','Operator'),(4708,'jasc.61-propeller/propulsors','6114-Propeller Hub Section','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports of defective hubs which house and support the rotating blades. Includes the dome, but not the blade actuating mechanism filed in ATA/JASC code 6111 or the attachment to engine flange in ATA/JASC code 6110.','combo-box','Operator'),(4709,'jasc.61-propeller/propulsors','6120-Propeller Controlling System','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For general reports of propeller speed controlling other than the governor unit or the synchronizer. Includes the controlling systems of propellers regardless of the propeller type. (Includes propeller regulator, negative torque switch, and the rigging mechanism). Also includes governor control linkage, levers, cable, and associated brackets from the cockpit to the governor; and the feather and unfeathering systems except the pump and accumulator. Typical parts are cable, bellcrank, lever, rod end, pressure switch, solenoid valve, beta switch, etc.','combo-box','Operator'),(4710,'jasc.61-propeller/propulsors','6121-Propeller Synchronizer Section','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The unit which controls the synchronization of propellers on multi engine aircraft. Typical parts are synchronizer actuator, computer, synchrophaser, control unit, etc.','combo-box','Operator'),(4711,'jasc.61-propeller/propulsors','6122-Propeller Governor','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The unit which controls the propeller blade angle, but is limited to parts in and on the governor. Does not include airframe furnished control linkage from the cockpit which is filed in JASC code 6120. The component make and model should be included in the report as well as the number of the defective part. Typical parts are shaft, flyweight, governor, spring, arm, seal, beta valve, pilot valve, head, etc.','combo-box','Operator'),(4712,'jasc.61-propeller/propulsors','6123-Propeller Feathering/Reversing','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The component and parts which store and deliver an energy charge for propeller feathering and unfeathering. Includes the pump and associated motor, switch, circuitry and plumbing which provides the force for feathering the propeller blades for stopping the engine\'s rotation. Does not include propeller feathering system components which are coded in JASC code 6120, such as lever rod end, adjustment screw, solenoid, valves, etc. Typical parts are pump, motor, switch, accumulator, air valve, seal, etc.','combo-box','Operator'),(4713,'jasc.61-propeller/propulsors','6130-Propeller Braking','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The system components and parts which decrease run-down time or stop propeller rotation during engine power off conditions. This code is applicable to turboprop engines.','combo-box','Operator'),(4714,'jasc.61-propeller/propulsors','6140-Propeller Indication System','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The system components and parts which indicates the operation or activation of propeller systems. Typical parts are switch, lamp, connector, harness, indicator, etc.','combo-box','Operator'),(4715,'jasc.61-propeller/propulsors','6197-Propeller/Propulsor System Wiring','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports indicating a problem with wiring specific to the Propeller/Propulsor Systems.','combo-box','Operator'),(4716,'jasc.61-propeller/propulsors','61-Propeller/Propulsors','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The complete mechanical or electrical propeller, governor, alternators, pumps, motors those units and components external to or integral with the engine used to control the propeller blade angle. Includes the propulsor duct assemblies, aerodynamic fairing of mechanical components, stators, vectoring systems, etc. Use this code for reports with insufficient information to file in a more specific JASC 6100 series code.','combo-box','Operator'),(4717,'jasc.62-main-rotor','6200-Main Rotor System','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For general reports of rotorcraft main rotor systems with insufficient information to file in a more specific ATA/JASC 6200 series code. Excessive use of this code should be avoided if possible.','combo-box','Operator'),(4718,'jasc.62-main-rotor','6210-Main Rotor Blades','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports of defective blades including attachment to the rotor head and heating mats on the blades for anti-icing. Also includes tilt rotor blades. Does not include the anti-icing system which is filed in JASC code 3060, or the rotor head which is filed in JASC code 6220. Typical parts are blade, attach bolt, bushing, etc.','combo-box','Operator'),(4719,'jasc.62-main-rotor','6220-Main Rotor Head','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The rotating assembly which supports the main rotor blades including blade folding system. Includes the swashplate if it is an integral part of the mast head assembly. Also includes the head mechanism on tilt rotor aircraft. Typical parts are sleeve, spindle, damper, fairing. Does not include the controlling aspects in JASC code 6710.','combo-box','Operator'),(4720,'jasc.62-main-rotor','6230-Main Rotor Mast/Swashplate','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The vertical shaft which supports the main rotor head. Typical parts are shaft, bearing, guide, mast, seal, swashplate, etc.','combo-box','Operator'),(4721,'jasc.62-main-rotor','6240-Main Rotor Indicating System','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The system used to indicate the operation or activation of the main rotor. Includes lights, gauges, switches, wiring, etc.','combo-box','Operator'),(4722,'jasc.62-main-rotor','6297-Main Rotor System Wiring','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports indicating a problem with wiring specific to the Main Rotor System.','combo-box','Operator'),(4723,'jasc.62-main-rotor','62-Main Rotor','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For general reports of rotorcraft main rotor systems with insufficient information to file in a more specific JASC 6200 series code. Excessive use of this code should be avoided if possible.','combo-box','Operator'),(4724,'jasc.63-main-rotor-drive','6300-Main Rotor Drive System','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For general reports of main rotor drive system with insufficient information to file in a more specific ATA/JASC sub-system code. Excessive use of this code should be avoided if possible.','combo-box','Operator'),(4725,'jasc.63-main-rotor-drive','6310-Engine/Transmission Coupling','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The drive shaft between the engine and the main gearbox including the clutch and freewheel units (if applicable), and tilt rotor interconnect system. Typical parts are clutch, shaft, coupling, bearing, boot, seal, sync shaft, pulley, pulley bracket, belt, etc.','combo-box','Operator'),(4726,'jasc.63-main-rotor-drive','6320-Main Rotor Gearbox','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The component which transmits engine power to rotary motion in the main rotor mast. Includes mechanical power take-off and accessory drives but does not include the accessories such as hydraulic pumps and alternators. Includes gearbox lubricating system. Typical parts are gearbox, case, shaft, gear, pump, seal, sun gear, etc.','combo-box','Operator'),(4727,'jasc.63-main-rotor-drive','6321-Main Rotor Brake','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The system which reduces rundown time or stops rotor rotation during engine power off conditions. Typical parts are brake, caliper, lining, seal, check valve, etc.','combo-box','Operator'),(4728,'jasc.63-main-rotor-drive','6322-Rotorcraft Cooling Fan System','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The component which provides a cooling air flow to the rotorcraft piston engine cylinders, oil coolers, etc. Typical parts are fan, shroud, blade, impeller, duct, drive belt, stator, etc.','combo-box','Operator'),(4729,'jasc.63-main-rotor-drive','6330-Main Rotor Transmission Mount','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The suspension system for the transmission mounting in airframe. Typical parts are suspension bars, isolation mount, etc.','combo-box','Operator'),(4730,'jasc.63-main-rotor-drive','6340-Rotor Drive Indicating System','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The indicators, sensors/transmitters and associated systems which indicate operation or activation of rotor systems. Typical parts are tachometer, transmitter, circuit breaker, wiring harness, light, switch, indicator, needle, etc.','combo-box','Operator'),(4731,'jasc.63-main-rotor-drive','6397-Main Rotor Drive System Wiring','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports indicating a problem with wiring specific to the Main Rotor Drive System.','combo-box','Operator'),(4732,'jasc.63-main-rotor-drive','63-Main Rotor Drive','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For general reports of main rotor drive system with insufficient information to file in a more specific JASC sub-system code. Excessive use of this code should be avoided if possible.','combo-box','Operator'),(4733,'jasc.64-tail-rotor','6400-Tail Rotor System','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For general reports of the rotorcraft tail rotor system reported with insufficient information to file in a more specific tail rotor system. Avoid excessive use of this code if possible.','combo-box','Operator'),(4734,'jasc.64-tail-rotor','6410-Tail Rotor Blades','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports of defective tail rotor blades including heating mats for anti-icing but not the anti-icing system in ATA/JASC code 3060. Also includes attachment to rotor head. Typical parts are blade, attach bolt, etc.','combo-box','Operator'),(4735,'jasc.64-tail-rotor','6420-Tail Rotor Head','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The rotating assembly which supports the tail rotor blades. Does not include the controlling aspects which are filed in ATA/JASC code 6720. Typical parts are trunnion, fairing, damper plate, shaft, hub, etc.','combo-box','Operator'),(4736,'jasc.64-tail-rotor','6440-Tail Rotor Indicating System','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The indicators, sensors, transmitters, and associated systems which indicates operation or activation of the tail rotor system.','combo-box','Operator'),(4737,'jasc.64-tail-rotor','6497-Tail Rotor System Wiring','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports indicating a problem with wiring specific to the Tail Rotor System.','combo-box','Operator'),(4738,'jasc.64-tail-rotor','64-Tail Rotor','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For general reports of the rotorcraft tail rotor system reported with insufficient information to file in a more specific tail rotor system. Avoid excessive use of this code if possible.','combo-box','Operator'),(4739,'jasc.65-tail-rotor-drive','6500-Tail Rotor Drive System','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For general reports of the tail rotor drive system reported with insufficient information to file in a more specific tail rotor drive system. Avoid excessive use of this code if possible.','combo-box','Operator'),(4740,'jasc.65-tail-rotor-drive','6510-Tail Rotor Drive Shaft','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The shafts, flexible couplings and bearings, etc., from the main rotor transmission to the tail rotor assembly. Typical parts shaft, coupling, bearing, hanger, etc.','combo-box','Operator'),(4741,'jasc.65-tail-rotor-drive','6520-Tail Rotor Gearbox','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The gearboxes which transmit engine power to the tail rotor. Includes intermediate gearboxes. Typical parts are case, seal, box, gear, spider gear, gearbox cowling and fairing, etc.','combo-box','Operator'),(4742,'jasc.65-tail-rotor-drive','6540-Tail Rotor Drive Indicating System','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The indicators, sensors, transmitters, and associated systems which indicates operation or activation of the tail rotor drive system.','combo-box','Operator'),(4743,'jasc.65-tail-rotor-drive','6597-Tail Rotor Drive System Wiring','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports indicating a problem with wiring specific to the Tail Rotor Drive System.','combo-box','Operator'),(4744,'jasc.65-tail-rotor-drive','65-Tail Rotor Drive','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For general reports of the tail rotor drive system reported with insufficient information to file in a more specific tail rotor drive system. Avoid excessive use of this code if possible.','combo-box','Operator'),(4745,'jasc.67-rotors-flight-control','6700-Rotorcraft Flight Control','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For general reports of rotorcraft control systems with insufficient information to file in a more specific 6700 ATA/JASC series code; or for reports which affect both main and tail rotor control systems. Avoid excessive use of this code if possible.','combo-box','Operator'),(4746,'jasc.67-rotors-flight-control','6710-Main Rotor Control','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The system components and parts other than the servo control system which control and indicates the attitude or the angle of attack of the main rotor blades. Typical parts are collective pitch lever, cyclic pitch stick, coupling and mixing units, and position indicators, etc.','combo-box','Operator'),(4747,'jasc.67-rotors-flight-control','6711-Tilt Rotor Flight Control','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The system components and parts of the tilt rotor control system which controls the attitude of the aircraft by rotating the dual main rotor assembly through a 90-degree position. The zero or vertical position allows vertical takeoff and landing of the aircraft.','combo-box','Operator'),(4748,'jasc.67-rotors-flight-control','6720-Tail Rotor Control System','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The components and system parts which control movement about the vertical axis. The directional control may be accomplished by changing the tail rotor blade angle, or by directed compressed air (i.e., NOTAR systems). Includes tail rotor control pedals, cables, rods, bellcranks, associated support brackets, compressed air ducts, valves, etc.','combo-box','Operator'),(4749,'jasc.67-rotors-flight-control','6730-Rotorcraft Servo System','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The system which ensures distribution of mechanical or electrical power to the rotor servo-control system. Includes systems used to monitor and indicate operation of the servo control system. Typical parts are pressure relief valves, electro valves, check valves, accumulators, etc.','combo-box','Operator'),(4750,'jasc.67-rotors-flight-control','6797-Rotors Flight Control System Wiring','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports indicating a problem with wiring specific to the Rotors Flight Control System.','combo-box','Operator'),(4751,'jasc.67-rotors-flight-control','67-Rotors Flight Control','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For general reports of rotorcraft control systems with insufficient information to file in a more specific 6700 JASC series code; or for reports which affect both main and tail rotor control systems. Avoid excessive use of this code if possible.','combo-box','Operator'),(4752,'jasc.71-powerplant','7100-Powerplant System','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For general reports concerning the powerplant framework-package. Avoid the use of this code if enough information is provided to file in a more specific ATA/JASC 7100 series code.','combo-box','Operator'),(4753,'jasc.71-powerplant','7110-Engine Cowling System','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The enclosure which houses engines for drag reducing and cooling. Includes attachment, structure and access doors. Does not include engine cylinder baffles of fire seals. Typical parts are latch, fastener, lockpin, hook, skin, nose cap, stud, access door, hinge, hinge pin, rivet, bracket, stiffener, etc.','combo-box','Operator'),(4754,'jasc.71-powerplant','7111-Engine Cowl Flaps','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The flaps mounted in engine cowling for increased cooling air flow. Also includes the component which electrically or hydraulically actuates the cowl flaps. Typical parts are actuator, piston, seal, hinge bracket, skin, doubler, rod, rod end, lever, rivet, bolt, and flap, etc.','combo-box','Operator'),(4755,'jasc.71-powerplant','7112-Engine Air Baffle Section','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports of baffles which direct cooling air flow to the engine cylinders and accessories. Does not include cylinder baffles certificated with the engine which are filed in JASC code 8530. Typical parts are baffle, shield, bracket, shroud, cooling ducts for starters, and generators, etc.','combo-box','Operator'),(4756,'jasc.71-powerplant','7120-Engine Mount Section','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The structural framework which supports the engine on the nacelle, firewall or pylon. Typical parts are mount, bracket, fitting, shock mount, bolt, isolator, hanger, etc.','combo-box','Operator'),(4757,'jasc.71-powerplant','7130-Engine Fireseals','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The fire-resistant partitions and seals mounted on or about the power framework-package to isolate areas subject to fire. Does not include firewalls which are filed in ATA/JASC code 5412. Typical parts are shroud, bracket, etc.','combo-box','Operator'),(4758,'jasc.71-powerplant','7160-Engine Air Intake System','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The portion of the powerplant system which directs airflow to the engine. Does not include integral structure with the airframe, which shall be included in the applicable structures JASC chapter. Typical parts are carburetor air heat doors, alternate air doors, linkages, controls, filter element, ducts, hose, air box, latch, seals, nose ring cowls, scoops, compressor fan cowls, compressor fan case, buried engine ducts, vortex generators, actuators, control handles, cables, wiring, plumbing, doors, warning systems, position indicators, etc.','combo-box','Operator'),(4759,'jasc.71-powerplant','7170-Engine Drains','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The components and manifold assemblies which are used to drain off excess fluids from the powerplant and its accessories. Includes components that are integral parts of, or fitted to the powerplant cowling. Typical parts are drain line, manifold, flame arrestors, support brackets, etc.','combo-box','Operator'),(4760,'jasc.71-powerplant','7197-Powerplant System Wiring','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports indicating a problem with wiring specific to the Powerplant System.','combo-box','Operator'),(4761,'jasc.71-powerplant','71-Powerplant','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For general reports concerning the powerplant framework-package. Avoid the use of this code if enough information is provided to file in a more specific JASC 7100 series code.','combo-box','Operator'),(4762,'jasc.72-turbine/turboprop-engine','7200-Engine (Turbine/Turboprop)','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The units and components which are used to induce and convert fuel-air mixture into power, and transmit power to the propeller shaft (if any) and accessory drives. Full identification of the powerplant is required in all reports in JASC series codes 7200 through 8300 to increase the usability of the reports. Use this code for general reports concerning engine problems reported with insufficient information to file in a more specific JASC code. Includes reports pertaining to bird strikes to engines/cowling.','combo-box','Operator'),(4763,'jasc.72-turbine/turboprop-engine','7210-Turbine Engine Reduction Gear','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports pertaining to reduction gears, combining gearboxes, propeller drive shafts, and helicopter rotor shafts, which are used to transfer power from turboprop and turboshaft engines, to the propeller or helicopter rotor. Do not use this code for accessory devices attached to reduction gearboxes. Typical parts are shaft, gear, bearing, case, torque piston, transfer tube, chip detector, etc.','combo-box','Operator'),(4764,'jasc.72-turbine/turboprop-engine','7220-Turbine Engine Air Inlet Section','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The engine section through which air enters the compressor section. Typical parts are inlet case, inlet cone, inlet screen, guide vane, inlet scroll, etc.','combo-box','Operator'),(4765,'jasc.72-turbine/turboprop-engine','7230-Turbine Engine Compressor Section','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The engine section where incoming air is compressed. Includes the operation of variable stator blades, linkage to the various valves and sense lines. Typical parts are case, the rotating portion of the compressor, lines, fan blades, disc, bearing, seal, mount, carbon seal, disc tie bolts, shaft, static and variable stator blades, linkage, actuator, etc.','combo-box','Operator'),(4766,'jasc.72-turbine/turboprop-engine','7240-Turbine Engine Combustion Section','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The engine section in which fuel and air are mixed and burned. Typical parts are case, burner can, liner, vane ring, etc.','combo-box','Operator'),(4767,'jasc.72-turbine/turboprop-engine','7250-Turbine Section','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The engine section which contains the turbine disc and associated nozzles and cases. Typical parts are case, disc, blade, nozzle, bearing, bearing cover, power turbine, shaft, tie bolts, seals, etc.','combo-box','Operator'),(4768,'jasc.72-turbine/turboprop-engine','7260-Turbine Engine Accessory Drive','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The engine mounted gearbox which provides mechanical power takeoffs to drive accessories such as pumps, generators, chip detectors. Does not include the remote gearboxes which are filed in ATA/JASC code 8300.','combo-box','Operator'),(4769,'jasc.72-turbine/turboprop-engine','7261-Turbine Engine Oil System','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The system components and parts which provide lubricating oil pressure, circulation and scavenging throughout the engine. Does not include externally mounted storage tanks filed in JASC code 7910, coolers in JASC code 7921, or connecting lines in JASC code 7920. Typical parts are relief valve, fitting, seal, pump, screen, filter, seal, check valve, element, etc.','combo-box','Operator'),(4770,'jasc.72-turbine/turboprop-engine','7270-Turbine Engine Bypass Section','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For the non-rotating portion of engine air flow ducting for the prime purpose of adding to engine thrust of turbo-jet engines. Does not include the rotating components such as blades. Typical parts are duct, skin, duct segment, etc.','combo-box','Operator'),(4771,'jasc.72-turbine/turboprop-engine','7297-Turbine Engine System Wiring','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports indicating a problem with wiring specific to the Turbine Engine System.','combo-box','Operator'),(4772,'jasc.72-turbine/turboprop-engine','72-Turbine/Turboprop Engine','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The units and components which are used to induce and convert fuel-air mixture into power, and transmit power to the propeller shaft (if any) and accessory drives. Full identification of the powerplant is required in all reports in JASC series codes 7200 through 8300 to increase the usability of the reports. Use this code for general reports concerning engine problems reported with insufficient information to file in a more specific JASC code. Includes reports pertaining to bird strikes to engines/cowling.','combo-box','Operator'),(4773,'jasc.73-engine-fuel-and-control','7300-Engine Fuel and Control','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For general reports of turbine or reciprocating engine fuel systems with insufficient information to file in a more specific ATA/JASC 7300 series code.','combo-box','Operator'),(4774,'jasc.73-engine-fuel-and-control','7310-Engine Fuel Distribution','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For components and parts of the engine fuel system from the main quick disconnect fitting or airframe fuel system strainer to the fuel control unit. Does not include the controlling or metering aspects filed in JASC code 7322, or the primer systems in JASC code 2820 on reciprocating engines, or the engine fuel pumps, fuel heater, cooler, divider, or injector nozzle (turbine and piston engines). Typical parts are supply lines, hoses, fuel, filters on turbine engines, shutoff and solenoid valves, etc.','combo-box','Operator'),(4775,'jasc.73-engine-fuel-and-control','7311-Engine Fuel/Oil Cooler','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The unit in which aircraft fuel flows to cool the turbine engine lubricating oil. Does not include the connecting lines.','combo-box','Operator'),(4776,'jasc.73-engine-fuel-and-control','7312-Fuel Heater','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The unit which heats fuel flowing to the engine to prevent freezing of entrapped water. Does not include connecting lines or the heat source.','combo-box','Operator'),(4777,'jasc.73-engine-fuel-and-control','7313-Fuel Injector Nozzle','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The unit which injects metered fuel into piston engine cylinders and burner cans in turbine engines.','combo-box','Operator'),(4778,'jasc.73-engine-fuel-and-control','7314-Engine Fuel Pump','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports pertaining to engine fuel pumps. Typical parts are housing, spring, rocker, pump, diaphragm, shaft, seal, relief valve, regulator, coupling, etc.','combo-box','Operator'),(4779,'jasc.73-engine-fuel-and-control','7320-Fuel Controlling System','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The system components or parts other than the fuel control, amplifier, computer, carburetor and indication systems which control and deliver metered fuel/air to engine cylinders or turbine engine burner cans. Typical parts are sense line, power and drain valve (P & D valve), drain valve, carburetor inlet temperature sensor, etc.','combo-box','Operator'),(4780,'jasc.73-engine-fuel-and-control','7321-Fuel Control/Turbine Engines','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The components which electronically control metered fuel flow under infinite temperature, altitude, and barometric pressure conditions. This code is also to be used for turbine engines which utilize electronic and non-electronic fuel controls. Typical parts are computer, amplifier, sync box, CIT sensor, etc.','combo-box','Operator'),(4781,'jasc.73-engine-fuel-and-control','7322-Fuel Control/Reciprocating Engines','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The component which meters fuel/air mixture for engine combustion on reciprocating engines. This code is to be used for fuel injection systems, carburetor systems or other mechanical fuel metering devices reciprocating engine. The typical parts are carburetor, fuel injector, float, diaphragm, bellows, shaft, venturi, control arm, throttle body, servo, discharge tube, bushing, needle, seat, accelerator pump, pin, bearings, etc.','combo-box','Operator'),(4782,'jasc.73-engine-fuel-and-control','7323-Turbine Governor','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The component which controls the RPM of turbine engines. Typical parts are governor, shaft, overspeed limiter, topping governor, etc.','combo-box','Operator'),(4783,'jasc.73-engine-fuel-and-control','7324-Fuel Divider','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The unit in metered fuel lines which directs fuel to individual cylinders or burner cans.','combo-box','Operator'),(4784,'jasc.73-engine-fuel-and-control','7330-Engine Fuel Indicating System','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports of fuel temperature, flow rate, or pressure indicating and warning systems other than the indicators, sensors, and transmitters. Typical parts are line, hose, lamp, bulb, wiring harness, circuit breaker, etc.','combo-box','Operator'),(4785,'jasc.73-engine-fuel-and-control','7331-Fuel Flow Indicating','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The instrument which indicates the flow rate of metered fuel to the engine. Does not include the transmitter. Typical parts are indicator, power supply, needle, dial, etc.','combo-box','Operator'),(4786,'jasc.73-engine-fuel-and-control','7332-Fuel Pressure Indicating','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The instrument which indicates the pressure of fuel at the fuel control/carburetor as provided by the engine driven or motor driven pumps. Includes the pressure warning indicating lamps. Typical parts are indicator, bourdon tube, diaphragm, needle, case, etc.','combo-box','Operator'),(4787,'jasc.73-engine-fuel-and-control','7333-Fuel Flow Sensor','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The unit and associated circuitry and parts which senses and transmits the rate of fuel flow to the cockpit indicator. Typical parts are transmitter, sensor, fitting, connector, transducer, etc.','combo-box','Operator'),(4788,'jasc.73-engine-fuel-and-control','7334-Fuel Pressure Sensor','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The units which sense and transmit to the cockpit indicator or indicator lamps, the pressure of fuel available at the engine fuel control/carburetor. Includes pressure switch and circuitry for warning indication. Typical parts are transducer, transmitter, switch, etc.','combo-box','Operator'),(4789,'jasc.73-engine-fuel-and-control','7397-Engine Fuel System Wiring','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports indicating a problem with wiring specific to the Engine Fuel System.','combo-box','Operator'),(4790,'jasc.73-engine-fuel-and-control','73-Engine Fuel and Control','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For general reports of turbine or reciprocating engine fuel systems with insufficient information to file in a more specific JASC 7300 series code.','combo-box','Operator'),(4791,'jasc.74-ignition','7400-Ignition System','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For general reports of ignition problems with insufficient information to file in a more specific ATA/JASC 7400 series code.','combo-box','Operator'),(4792,'jasc.74-ignition','7410-Ignition Power Supply','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The units and components which generate, control, furnish or distribute an electrical current to ignite the fuel air mixture in cylinders of reciprocating engines or in the combustion chambers or thrust augmentors of turbine engines.','combo-box','Operator'),(4793,'jasc.74-ignition','7411-Low Tension Coil','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports of magneto coils used on select engines such as the Pratt & Whitney (PWA), Model R2800, to generate a low tension voltage to high tension voltage coil mounted at each engine cylinder. Not generally used on modern light aircraft reciprocating engines.','combo-box','Operator'),(4794,'jasc.74-ignition','7412-Exciter','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The unit used with turbine engine ignition systems for starting engines. Typical parts are exciter box, bracket, relay. The component make and model should be included.','combo-box','Operator'),(4795,'jasc.74-ignition','7413-Induction Vibrator','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The unit which provides a high tension spark to reciprocating engine spark plugs for starting.','combo-box','Operator'),(4796,'jasc.74-ignition','7414-Magneto/Distributor','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The components which generate and distribute a high voltage to spark plugs in reciprocating engines for fuel/air combustion. Typical parts are coil, breaker points, gear, bearing, contact finger, distributor block, frame, impulse coupling, condenser, rotor, cam, electrode, seal, etc.','combo-box','Operator'),(4797,'jasc.74-ignition','7420-Ignition Harness (Distribution)','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The high tension insulated wiring from the magneto to the spark plug in reciprocating engines which provides a spark for combustion. For turbine engine, the high tension leads to burner can igniters for used for starting. Typical parts are lead, shielding, sleeve, ignition cable, terminal, ferrule, etc.','combo-box','Operator'),(4798,'jasc.74-ignition','7421-Spark Plug/Igniter','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The part which provides the spark in the reciprocating engine cylinders or combustion chamber of turbine engines.','combo-box','Operator'),(4799,'jasc.74-ignition','7430-Ignition Switching','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The unit which provides a means of rendering the ignition power supply (magneto) inoperative. Also used to direct electrical current to the magneto switch. Does not include engine cranking which is covered in JASC code 8010. Typical parts are start button (only if associated with a ignition switching discrepancy), switch, back plate, contacts, etc.','combo-box','Operator'),(4800,'jasc.74-ignition','7497-Ignition System Wiring','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports indicating a problem with wiring specific to the Ignition System.','combo-box','Operator'),(4801,'jasc.74-ignition','74-Ignition','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For general reports of ignition problems with insufficient information to file in a more specific JASC 7400 series code.','combo-box','Operator'),(4802,'jasc.75-air','7500-Engine Bleed Air System','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For general reports of turbine engine compressor bleed air systems used to control the flow of air through the engine, cooling air systems, and heated air for engine anti-icing reported with insufficient information to file in a more specific JASC 7500 series code.','combo-box','Operator'),(4803,'jasc.75-air','7510-Engine Anti-Icing System','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The engine system components and parts used to eliminate and prevent the formation of ice. Includes the control valve and associated actuator, switch and circuitry which controls the flow of turbine engine compressor bleed air to the engine anti-icing system. Anti-icing reports pertaining to the powerplant cowling are filed in JASC code 3020. Typical parts are control valve, actuator, motor, switch, relay, circuit breaker, hose, manifold, coupling, fuel heat duct, fuel heat valve, etc.','combo-box','Operator'),(4804,'jasc.75-air','7520-Engine Cooling System','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The portion of the engine compressor bleed air system which is used to ventilate engine compartments and accessories. Does not include the engine bleed control valve which is filed in JASC code 7532. Typical parts are jet pumps, vortex generators, valve, actuator, and associated parts and circuitry used to control bleed air to engine accessory cooling systems.','combo-box','Operator'),(4805,'jasc.75-air','7530-Compressor Bleed Control','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The system except valve and governor which controls the flow of air through turbine engines. Typical parts are sense line, fittings, cables, sense line filter, speed sense valve, etc.','combo-box','Operator'),(4806,'jasc.75-air','7531-Compressor Bleed Governor','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The unit controlling relative position of the compressor bleed valve in turbine engines for air flow control.','combo-box','Operator'),(4807,'jasc.75-air','7532-Compressor Bleed Valve','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The component which releases air from turbine engine compressor sections for air flow control. Typical parts are bleed valve, actuator, check valve, etc.','combo-box','Operator'),(4808,'jasc.75-air','7540-Bleed Air Indicating System','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The systems which indicate temperature, pressure, control positions and warning indications of turbine engine compressor bleed air systems in turbine engines. Typical parts are transmitter, sensor, indicator, lamp, pressure switch, etc.','combo-box','Operator'),(4809,'jasc.75-air','7597-Engine Bleed Air System Wiring','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports indicating a problem with wiring specific to the Engine Bleed Air System.','combo-box','Operator'),(4810,'jasc.75-air','75-Air','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For general reports of turbine engine compressor bleed air systems used to control the flow of air through the engine, cooling air systems, and heated air for engine anti-icing reported with insufficient information to file in a more specific JASC 7500 series code.','combo-box','Operator'),(4811,'jasc.76-engine-controls','7600-Engine Controls','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The controls which govern the operation of the engine. Includes units and components which are interconnected for emergency shutdown. For turboprop engines, includes linkages and controls to the coordinator or equivalent to the propeller governor, fuel control unit or other units being controlled. For reciprocating engines, includes controls for blowers. Does not include units or components which are specifically included in other chapters. For general reports of engine control problems with insufficient information to file in a more specific JASC 7600 series code.','combo-box','Operator'),(4812,'jasc.76-engine-controls','7601-Engine Synchronizing','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The components providing for engine synchronization in multi-engine aircraft.','combo-box','Operator'),(4813,'jasc.76-engine-controls','7602-Mixture Control','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The control for adjusting fuel-air mixture in piston engines. Includes linkage from the cockpit lever to the carburetor or fuel injector servo but does not include the arm on mixture control shafts. Typical parts are cable, rod, bellcrank, rod end, housing, clamp and cockpit control lever/knob.','combo-box','Operator'),(4814,'jasc.76-engine-controls','7603-Power Lever','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The system which provides for control of carburetor or fuel injectors on piston engines; fuel controls or coordinator on turbine engines; and propeller regulator turboprop engines. Typical parts are cable, rod, rod end, bellcrank, bracket, clamp, actuator, shaft, shaft pin, knob, etc.','combo-box','Operator'),(4815,'jasc.76-engine-controls','7610-Power Control','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The system which provides for rapid, complete shutoff of combustible fluids to the engine compartments during emergency procedures. Typical parts are cable, actuator, switch, lever, etc.','combo-box','Operator'),(4816,'jasc.76-engine-controls','7620-Engine Emergency Shutdown System','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The system which provides for rapid, complete shutoff of combustible fluids to the engine compartments during emergency procedures. Typical parts are cable, actuator, switch, lever, etc.','combo-box','Operator'),(4817,'jasc.76-engine-controls','7697-Engine Control System Wiring','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports indicating a problem with wiring specific to the Engine Control System.','combo-box','Operator'),(4818,'jasc.76-engine-controls','76-Engine Controls','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The controls which govern the operation of the engine. Includes units and components which are interconnected for emergency shutdown. For turboprop engines, includes linkages and controls to the coordinator or equivalent to the propeller governor, fuel control unit or other units being controlled. For reciprocating engines, includes controls for blowers. Does not include units or components which are specifically included in other chapters. For general reports of engine control problems with insufficient information to file in a more specific JASC 7600 series code.','combo-box','Operator'),(4819,'jasc.77-engine-indicating','7700-Engine Indicating System','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For general reports of engine indicating system discrepancies with insufficient information to file in a more specific ATA/JASC 7700 series code. This code is also used for reports with multiple engine indications.','combo-box','Operator'),(4820,'jasc.77-engine-indicating','7710-Power Indicating System','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For power indicating systems which directly or indirectly indicates power or thrust (i.e., brake mean effective pressure {BMEP}, engine pressure ratio {EPR}, RPM, etc.) but is not covered in ATA/JASC codes 7711 through 7722.','combo-box','Operator'),(4821,'jasc.77-engine-indicating','7711-Engine Pressure Ratio (EPR)','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The system which sense, measures, and indicates the engine pressure ratio (EPR) of an turbine engine. The system measures the difference between the compressor inlet pressure and the turbine discharge pressure. Typical parts are sensor, transducer, transmitter, probe, etc.','combo-box','Operator'),(4822,'jasc.77-engine-indicating','7712-Engine BMEP/Torque Indicating','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The system that senses and measures brake mean effective pressure (BMEP) or engine torque in turboprop and piston engines. Does not include internal parts which are type certificated with the engine. Typical parts are indicator, line, sensor, transmitter, pressure switch, etc.','combo-box','Operator'),(4823,'jasc.77-engine-indicating','7713-Manifold Pressure (MP) Indicating','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The reciprocating engine manifold pressure (MP) indicating system including the indicator and sensor. Typical parts are lines, hoses and fittings.','combo-box','Operator'),(4824,'jasc.77-engine-indicating','7714-Engine RPM Indicating System','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The system including the indicator and sensor which indicates engine speed in revolutions per minute (RPM). Typical parts are, cable, connector, tachometer, tachometer generator, N1 indicator.','combo-box','Operator'),(4825,'jasc.77-engine-indicating','7720-Engine Temperature Indicating System','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For general reports of the system components and parts which indicate engine temperature with insufficient information to file in a more specific ATA/JASC 7700 series code.','combo-box','Operator'),(4826,'jasc.77-engine-indicating','7721-Cylinder Head Temperature (CHT) Indicating System','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The instruments which indicates temperature measured at reciprocating engine cylinder heads. Typical parts are indicator, case, dial, needle, thermocouple lead, sensor, and connector, etc.','combo-box','Operator'),(4827,'jasc.77-engine-indicating','7722-Engine EGT/TIT Indicating System','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports of exhaust gas temperature (EGT) or turbine inlet temperature (TIT) temperature sensing and indicating. Includes the EGT indicators for both reciprocating and turbine engines; and the TIT for turbine engines. Typical parts are wiring, turbine outlet temperature (TOT) indicator, EGT indicator, probe, harness, terminal, connector, indicator, sensor, transducer, transmitter, etc.','combo-box','Operator'),(4828,'jasc.77-engine-indicating','7730-Engine Ignition Analyzer System','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For general reports of reciprocating engine ignition analyzer system problems. Typical parts are the amplifier, wiring harness, and sensor, etc.','combo-box','Operator'),(4829,'jasc.77-engine-indicating','7731-Engine Ignition Analyzer','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The unit which interprets and indicates by oscilloscope the condition of ignition systems on reciprocating engines.','combo-box','Operator'),(4830,'jasc.77-engine-indicating','7732-Engine Vibration Analyzer','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For general reports of the engine vibration analyzer system indicating to the flight crew unusual engine vibration conditions. Typical parts are connector, harness, indicator, monitor, sensor, amplifier, etc.','combo-box','Operator'),(4831,'jasc.77-engine-indicating','7740-Engine Integrated Instrument System','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports of exhaust gas temperature (EGT) or turbine inlet temperature (TIT) temperature sensing and indicating. Includes the EGT indicators for both reciprocating and turbine engines; and the TIT for turbine engines. Typical parts are wiring, turbine outlet temperature (TOT) indicator, EGT indicator, probe, harness, terminal, connector, indicator, sensor, transducer, transmitter, etc.','combo-box','Operator'),(4832,'jasc.77-engine-indicating','7797-Engine Indicating System Wiring','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports indicating a problem with wiring specific to the Engine Indication System.','combo-box','Operator'),(4833,'jasc.77-engine-indicating','77-Engine Indicating','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For general reports of engine indicating system discrepancies with insufficient information to file in a more specific JASC 7700 series code. This code is also used for reports with multiple engine indications.','combo-box','Operator'),(4834,'jasc.78-engine-exhaust','7800-Engine Exhaust System','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For general reports of engine exhaust system defects with insufficient information to file in a more specific ATA/JASC 7800 series code.','combo-box','Operator'),(4835,'jasc.78-engine-exhaust','7810-Engine Collector/Tailpipe/Nozzle','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','That portion of the system which collects the exhaust gases from the cylinders, turbines, or turbochargers and conducts them overboard. Includes variable vanes, or nacelle tailpipes used on turboprop powered aircraft and turbo-shaft powered rotorcraft. Typical parts are tailpipe, cone, nozzel, clamp eyebolt, duct, ejector, etc.','combo-box','Operator'),(4836,'jasc.78-engine-exhaust','7820-Engine Noise Suppressor','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For general reports of muffler system defects. The component used on reciprocating engines to reduce engine exhaust noise. Does not include the shroud over the muffler used to collect heated fresh air for cabin and carburetor heat filed in JASC code 2140. Includes the clover leaf shaped unit mounted on turbo-jet engine exhaust tailpipes for sound suppression. Typical parts are baffle, and flame tube, etc.','combo-box','Operator'),(4837,'jasc.78-engine-exhaust','7830-Engine Thrust Reverser','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The airframe furnished system and components mounted at turbo-jet engine exhaust tailpipes, or turbofan engine variable fan reverser components used to direct engine thrust forward for deceleration. Does not include the engine tailpipe. Typical parts are door, flex drive, relay, solenoid, switch, switch arm, bolt, valve, line, deploy line, rail, cable, actuator, actuator rod, connector plug, seal, support, fitting, shaft, link, nozzle, hose, etc.','combo-box','Operator'),(4838,'jasc.78-engine-exhaust','7897-Engine Exhaust System Wiring','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports indicating a problem with wiring specific to the Engine Exhaust System','combo-box','Operator'),(4839,'jasc.78-engine-exhaust','78-Engine Exhaust','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For general reports of engine exhaust system defects with insufficient information to file in a more specific JASC 7800 series code.','combo-box','Operator'),(4840,'jasc.79-engine-oil','7900-Engine Oil System (Airframe Furnished)','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For general reports of system units external to the engine which store and deliver engine lubricating oil to and from both turbine and reciprocating engines with insufficient information to file in a more specific ATA/JASC 7900 series code.','combo-box','Operator'),(4841,'jasc.79-engine-oil','7910-Engine Oil Storage (Airframe Furnished)','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The engine oil storage tank furnished by the airframe manufacturer. Includes attached parts such as filler caps, mount brackets, but excludes engine manufacturer furnished tanks, quantity indication systems, and distribution lines. Typical parts are tank, cap, seal, bracket, drain valve, etc.','combo-box','Operator'),(4842,'jasc.79-engine-oil','7920-Engine Oil Distribution (Airframe Furnished)','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The external oil system which distributes engine lubricating oil from the storage tanks to and from the engine. Does not include externally mounted units such as oil coolers, oil filters, shutoff valves. Typical parts are line, hose, coupling, fitting, clamp, etc.','combo-box','Operator'),(4843,'jasc.79-engine-oil','7921-Engine Oil Cooler','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The component and associated parts that cools engine lubricating oil. Includes brackets, outlet doors, scoops, ducts and louvers, but excludes the temperature regulator. Typical parts are cooler, duct, scoop, door, door actuator, etc.','combo-box','Operator'),(4844,'jasc.79-engine-oil','7922-Engine Oil Temperature Regulator','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The unit which is mounted on the airframe oil cooler or the engine for controlling engine lubricating oil temperature. Typical parts are thermostat, thermal valve, regulator, etc.','combo-box','Operator'),(4845,'jasc.79-engine-oil','7923-Engine Oil Shutoff Valve','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The component and associated controls which stop the flow of lubricating oil to the engine for emergency purposes.','combo-box','Operator'),(4846,'jasc.79-engine-oil','7930-Engine Oil Indicating System','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For general reports of engine oil pressure, temperature and quantity and those reports with insufficient information to file in a more specific ATA/JASC 7900 series code. Includes oil filter bypass switch, chip detector light, indicators, etc.','combo-box','Operator'),(4847,'jasc.79-engine-oil','7931-Engine Oil Pressure','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The instrument or warning lamp which indicates, senses, or transmits the pressure of engine lubricating oil available at the engine or when the pressure is improper for the conditions. This code is also used for discrepancies invloving oil pressure regulation. Typical parts are transducer, pressure switch, transmitter, pressure regulator, indicator, case, dial, needle, lamp, etc.','combo-box','Operator'),(4848,'jasc.79-engine-oil','7932-Engine Oil Quantity','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The instrument or warning lamp which senses or indicates the quantity of oil in supply tanks or warns of an insufficient quantity. Typical parts are transmitter, indicator, case, lamp, etc.','combo-box','Operator'),(4849,'jasc.79-engine-oil','7933-Engine Oil Temperature','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The instrument which senses and indicates temperature of engine oil. Typical parts are sensor, temperature bulb, case, indicator, needle, dial, etc.','combo-box','Operator'),(4850,'jasc.79-engine-oil','7997-Engine Oil System Wiring','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports indicating a problem with wiring specific to the Engine Oil System.','combo-box','Operator'),(4851,'jasc.79-engine-oil','79-Engine Oil','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For general reports of system units external to the engine which store and deliver engine lubricating oil to and from both turbine and reciprocating engines with insufficient information to file in a more specific JASC 7900 series code.','combo-box','Operator'),(4852,'jasc.80-starting','8000-Engine Starting System','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The units, components and associated systems used for starting the engine. Includes electrical, inertia air or other starter systems. Does not include ignition systems which are covered in ATA/JASC Chapter 74, IGNITION.','combo-box','Operator'),(4853,'jasc.80-starting','8010-Engine Cranking','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The portion of the system which is used to perform the cranking functions of the starting operation. Typical parts are plumbing, valve, wiring, start switch, relay, etc.','combo-box','Operator'),(4854,'jasc.80-starting','8011-Engine Starter','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The component used for starting the engines. Includes parts which are separated from the engine during starter removals, but does not include parts within the engine. Does not include the startergenerator which is filed in JASC code 2435. Typical parts are brush, bearing, shaft, clutch, adaptor, backplate, housing, winding, terminal post, etc.','combo-box','Operator'),(4855,'jasc.80-starting','8012-Engine Start Valves/Controls','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The valves and controls used for starting engines.','combo-box','Operator'),(4856,'jasc.80-starting','8097-Engine Starting System Wiring','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports indicating a problem with wiring specific to the Engine Starting System.','combo-box','Operator'),(4857,'jasc.80-starting','80-Starting','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The units, components and associated systems used for starting the engine. Includes electrical, inertia air or other starter systems. Does not include ignition systems which are covered in JASC Chapter 74, IGNITION.','combo-box','Operator'),(4858,'jasc.81-turbocharging','8100-Exhaust Turbine System (Reciprocating)','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports of exhaust turbine systems for reciprocating engines. Includes power recovery turbine assemblies and turbocharger units when external to the engine.','combo-box','Operator'),(4859,'jasc.81-turbocharging','8110-Power Recovery Turbine','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The turbines which extract energy from the exhaust gases and are coupled to the crankshaft on reciprocating engines. Includes the power recovery turbine unit when external to the engine. The drive shaft, coupling, and gears are filed in ATA/JASC code 8540.','combo-box','Operator'),(4860,'jasc.81-turbocharging','8120-Exhaust Turbocharger','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports of airframe or engine manufacturer furnished exhaust driven turbocharger systems including the turbocharger unit, density controller and waste gate valve. Does not include the tailpipe. Typical parts are clamp, coupling, rod end, bracket, hose, scroll, bearing, impeller, shaft, etc.','combo-box','Operator'),(4861,'jasc.81-turbocharging','8197-Turbocharger System Wiring','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports indicating a problem with wiring specific to the Turbocharger System.','combo-box','Operator'),(4862,'jasc.81-turbocharging','81-Turbocharging','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports of exhaust turbine systems for reciprocating engines. Includes power recovery turbine assemblies and turbocharger units when external to the engine.','combo-box','Operator'),(4863,'jasc.82-water-injection','8200-Water Injection System','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The system components and parts which inject a water mixture into induction system of turbine and reciprocating engines. Typical parts are pump, switch, tank, valve, etc.','combo-box','Operator'),(4864,'jasc.82-water-injection','8297-Water Injection System Wiring','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports indicating a problem with wiring specific to the Water Injection System.','combo-box','Operator'),(4865,'jasc.82-water-injection','82-Water Injection','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The system components and parts which inject a water mixture into induction system of turbine and reciprocating engines. Typical parts are pump, switch, tank, valve, etc.','combo-box','Operator'),(4866,'jasc.83-accessory-gearboxes','8300-Accessory Gearboxes','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The units and components which are remotely installed and connected to the engine by a drive shaft and which does not include those accessory drives which are bolted to and are immediately adjacent to the engine. The latter item should be filed in JASC code 7200. Does not include accessory drives bolted to and adjacent to engine which are normally filed in JASC code 7260.','combo-box','Operator'),(4867,'jasc.83-accessory-gearboxes','8397-Accessory Gearbox System Wiring','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports indicating a problem with wiring specific to the Accessory Gearbox.','combo-box','Operator'),(4868,'jasc.83-accessory-gearboxes','83-Accessory Gearboxes','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The units and components which are remotely installed and connected to the engine by a drive shaft and which does not include those accessory drives which are bolted to and are immediately adjacent to the engine. The latter item should be filed in JASC code 7200. Does not include accessory drives bolted to and adjacent to engine which are normally filed in JASC code 7260.','combo-box','Operator'),(4869,'jasc.85-reciprocating-engine','8500-Engine (Reciprocating)','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For general reports concerning reciprocating engine problems reported with insufficient information to file in a more specific JASC 8500 series code. Also for reports without reference to the applicable engine section or system. Typical reports would pertain to overtemperature, metal contamination, vibration, etc.','combo-box','Operator'),(4870,'jasc.85-reciprocating-engine','8510-Reciprocating Engine Front Section','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports of the piston engine front cases which contain the propeller shaft, reduction gears, and accessory drive. Typical parts are propeller shaft, gear, bearing, bushing, case, seal, pinion gear.','combo-box','Operator'),(4871,'jasc.85-reciprocating-engine','8520-Reciprocating Engine Power Section','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The section which contains the crankshaft, cam shaft, tappet guides, valve lifters, connecting rods, drive gears, etc. Does not include the push rods which are filed in the cylinder section in JASC code 8530 or rear case accessory drives. Typical parts are crankcase, crankshaft, cam ring, lifter, camshaft, cylinder stud, connecting rod, bolt, through bolt, cap, rod bolt, main bearing, rod bearing, etc.','combo-box','Operator'),(4872,'jasc.85-reciprocating-engine','8530-Reciprocating Engine Cylinder Section','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports of engine cylinders and associated parts including the intake pipes and valve push rods/housing. Also includes the cylinder baffles furnished by the engine manufacturer for engine cooling. Does not include the connecting rods or cylinder flange hold down bolts/studs which are in filed JASC code 8520. Typical parts are piston, piston pin, exhaust valve, intake valve, valve guide, rocker arm, valve cover, cylinder, pushrod housing, intake pipe, piston pin plug, valve spring, rocker shaft, piston ring, oil drain lines, clamp, baffles, etc.','combo-box','Operator'),(4873,'jasc.85-reciprocating-engine','8540-Reciprocating Engine Rear Section','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The case or section where accessories and associated engine drives are located. Includes the accessory pads, drives and drive seals but not the accessories. Does not include oil pump, filter or internal lubricating system which are filed in JASC code 8550. Typical parts are seal, gear, drive shaft, case, bearing, spacer. The power recovery turbine (PRT) drive shaft, coupling, and gears are also filed in this code.','combo-box','Operator'),(4874,'jasc.85-reciprocating-engine','8550-Reciprocating Engine Oil System','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The components and parts that provide oil pressure and distribute lubricating oil within the engine. Includes the plumbing leading to and from the using external systems and components which utilize engine system oil for operation. Does not include the externally mounted oil system storage tanks and connecting lines which are filed in JASC code 7910, or the oil cooler lines, hoses, and drain valves in JASC code 7920. Typical parts are pressure and scavenge pump, impeller, housing, filter, air-oil separator, crankcase breather, screen, element, relief valve, drive gear, adapter, pan, dipstick, cap, propeller governor oil lines, etc.','combo-box','Operator'),(4875,'jasc.85-reciprocating-engine','8560-Reciprocating Engine Supercharger','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The components and parts of the Supercharger system. Typical parts are case, impeller, rotors, bearings, seals, belts, pulleys or sprockets. Does not include gears in engine rear section.','combo-box','Operator'),(4876,'jasc.85-reciprocating-engine','8570-Reciprocating Engine Liquid Cooling','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','The components and parts that provide cooling liquid to the engine. Includes the plumbing leading to and from the engine. Typical parts are radiator, hoses, pump, drive belt, pulleys, bearings, seals, overflow line, overflow tank, pressure cap, thermostat.','combo-box','Operator'),(4877,'jasc.85-reciprocating-engine','8597-Reciprocating Engine System Wiring','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For reports indicating a problem with wiring specific to the Reciprocating Engine System.','combo-box','Operator'),(4878,'jasc.85-reciprocating-engine','85-Reciprocating Engine','http://av-info.faa.gov/isdr/documents/JASC_Code.pdf','For general reports concerning reciprocating engine problems reported with insufficient information to file in a more specific JASC 8500 series code. Also for reports without reference to the applicable engine section or system. Typical reports would pertain to overtemperature, metal contamination, vibration, etc.','combo-box','Operator'),(4879,'jepp-chart','Airfield Pages (10-x, 20-7)','','','text-field','Operator'),(4880,'jepp-chart','Airport/Approach Restriction','','','checkbox','Operator'),(4881,'jepp-chart','Airport Diagram','http://www.faa.gov/airports_airtraffic/air_traffic/publications/ATpubs/AIM/Chap9/aim0901.html#9-1-1','Full page airport diagrams are designed to assist in the movement of ground traffic at locations with complex runway/taxiway configurations and provide information for updating geodetic position navigational systems aboard aircraft. Additional details include taxiway identifiers, airport latitude and longitude, and building identification. Airport diagrams are located in the U.S. Terminal Procedures booklet following the instrument approach charts for a particular airport.','checkbox','Operator'),(4882,'jepp-chart','Airspace','','','checkbox','Operator'),(4883,'jepp-chart','Airway','http://www.faa.gov/airports_airtraffic/air_traffic/publications/atpubs/PCG/A.HTM','Occurrences and issues associated with the charts for a Class E airspace area established in the form of a corridor, the centerline of which is defined by radio navigational aids.','checkbox','Operator'),(4884,'jepp-chart','AWA Chart','','','checkbox','Operator'),(4885,'jepp-chart','Chart High Altitude','http://www.faa.gov/airports_airtraffic/air_traffic/publications/atpubs/PCG/A.HTM','Provide aeronautical information for en route instrument navigation (IFR) in the high altitude stratum. Information includes the portrayal of jet routes, identification and frequencies of radio aids, selected airports, distances, time zones, special use airspace, and related information.','checkbox','Operator'),(4886,'jepp-chart','Chart Low Altitude','http://www.faa.gov/airports_airtraffic/air_traffic/publications/atpubs/PCG/A.HTM','Provide aeronautical information for en route instrument navigation (IFR) in the low altitude stratum. Information includes the portrayal of airways, limits of controlled airspace, position identification and frequencies of radio aids, selected airports, minimum en route and minimum obstruction clearance altitudes, airway distances, reporting points, restricted areas, and related data. Area charts, which are a part of this series, furnish terminal data at a larger scale in congested areas.','checkbox','Operator'),(4887,'jepp-chart','Frequency ATC/AWA','','','checkbox','Operator'),(4888,'jepp-chart','IAP','http://www.faa.gov/airports_airtraffic/air_traffic/publications/atpubs/PCG/A.HTM','Instrument Approach Procedures (IAP) Charts- Portray the aeronautical data which is required to execute an instrument approach to an airport. These charts depict the procedures, including all related data, and the airport diagram. Each procedure is designated for use with a specific type of electronic navigation system including NDB, TACAN, VOR, ILS/MLS, and RNAV. These charts are identified by the type of navigational aid(s) which provide final approach guidance.','checkbox','Operator'),(4889,'jepp-chart','Jepp Chart','http://www.faa.gov/airports_airtraffic/air_traffic/publications/atpubs/PCG/A.HTM','Occurrences and issues associated with charts used in air navigation containing all or part of the following: topographic features, hazards and obstructions, navigation aids, navigation routes, designated airspace, and airports.','checkbox','Operator'),(4890,'jepp-chart','Other Jepp Chart','','Description of additional factor(s), not listed, associated with Jepp charts.','text-field','Operator'),(4891,'jepp-chart','SID','http://www.faa.gov/airports_airtraffic/air_traffic/publications/atpubs/PCG/S.HTM#STANDARD%20INSTRUMENT%20DEPARTURE%20(SID)','Standard Instrument Departure (SID) is a preplanned instrument flight rule (IFR) air traffic control (ATC) departure procedure printed for pilot/controller use in graphic form to provide obstacle clearance and a transition from the terminal area to the appropriate en route structure. SIDs are primarily designed for system enhancement to expedite traffic flow, reduce pilot/controller workload, and reduce environmental impact through noise abatement procedures. ATC clearance must always be received prior to flying a SID.','checkbox','Operator'),(4892,'jepp-chart','STAR','http://www.faa.gov/airports_airtraffic/air_traffic/publications/atpubs/PCG/S.HTM#STANDARD%20TERMINAL%20ARRIVAL','Standard Terminal Arrival (STAR) is a preplanned instrument flight rule (IFR) Air Traffic Control arrival procedure published for pilot use in graphic and/or textual form to simplify clearance delivery procedures. STARs provide transition from the en route structure to an outer fix or an instrument approach fix or arrival waypoint in the terminal area, and they usually terminate with an instrument or visual approach procedure.','checkbox','Operator'),(4893,'jepp-chart','Terminal Area','http://www.faa.gov/airports_airtraffic/air_traffic/publications/atpubs/PCG/A.HTM','Designed to expedite the efficient and safe flow of ground traffic at an airport','checkbox','ASRS'),(4894,'jepp-chart','WAC','http://www.faa.gov/airports_airtraffic/air_traffic/publications/atpubs/PCG/A.HTM','World Aeronautical Charts (WAC) (1:1,000,000) provide a standard series of aeronautical charts covering land areas of the world at a size and scale convenient for navigation by moderate speed aircraft. Topographic information includes cities and towns, principal roads, railroads, distinctive landmarks, drainage, and relief. Aeronautical information includes visual and radio aids to navigation, airports, airways, restricted areas, obstructions, and other pertinent data. Because of a smaller scale, WACs do not show as much detail as sectional or Terminal Area Charts (TACs), and; therefore, are not recommended for exclusive use by pilots of low speed, low altitude aircraft. Scale 1 inch = 13.7nm/1:1,000,000. 60 x 20 inches folded to 5 x 10 inches. WACs are revised annually, except for a few in Alaska and the Caribbean, which are revised biennially.','checkbox','ASRS'),(4895,'job-aid-expectation-method-of-compliance','Correspondance','','','checkbox','UTRS'),(4896,'job-aid-expectation-method-of-compliance','Interviews','','','checkbox','UTRS'),(4897,'job-aid-expectation-method-of-compliance','Manuals','','','checkbox','UTRS'),(4898,'job-aid-expectation-method-of-compliance','Meeting Minutes','','','checkbox','UTRS'),(4899,'job-aid-expectation-method-of-compliance','Observations','','','checkbox','UTRS'),(4900,'job-aid-expectation-method-of-compliance','Organizational Charts','','','checkbox','UTRS'),(4901,'job-aid-expectation-method-of-compliance','Other','','','text-field','UTRS'),(4902,'job-aid-expectation-method-of-compliance','Policies','','','checkbox','UTRS'),(4903,'job-aid-expectation-method-of-compliance','Procedures','','','checkbox','UTRS'),(4904,'job-aid-expectation-method-of-compliance','Records','','','checkbox','UTRS'),(4905,'job-aid-expectation-method-of-compliance','Training Materials','','','checkbox','UTRS'),(4906,'job-aid-expectation-processing','Evaluator Comments','','','memo-field','UTRS'),(4907,'job-aid-expectation-processing','Date Completed','','Date requirement is set completed','date-field','UTRS'),(4908,'job-aid-expectation-processing','Created By','','imported from checklist file','user-name-field','UTRS'),(4909,'job-aid-expectation-processing','Department','','imported from checklist file - non editable','combo-box','UTRS'),(4910,'job-aid-expectation-processing','ID','','unique record number of requirement','bigint-field','UTRS'),(4911,'job-aid-expectation-processing','Instructions','','imported from checklist file - editable','memo-field','UTRS'),(4912,'job-aid-expectation-processing','Notes','','A brief record that provides additional information in an