der this part. Refer to FAR 121.367: Maintenance, preventive maintenance, and alterations programs (http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/5183ACB231932B8B852566EF006C65A3?OpenDocument&Highlight=121.367).','checkbox','ASRS'),(5325,'maintenance-reaction-after-event','Aircraft Removed from Service','','','checkbox','Operator'),(5326,'maintenance-reaction-after-event','Could Not Duplicate','','Equipment fails to operate correctly when in service but maintenance personnel cannot recreate the failure.','checkbox','DNAA'),(5327,'maintenance-reaction-after-event','First Time or Repeated','','Indicates where malfunction is the first known failure of equipment to operate correctly or equipment fails again and again to operate correctly, despite check by maintenance personnel.','combo-box','DNAA'),(5328,'maintenance-reaction-after-event','Maintenance Deferred','','','checkbox','ASRS'),(5329,'maintenance-reaction-after-event','No Defect/Could Not Duplicate','','Could not Duplicate (CND)','checkbox','Operator'),(5330,'maintenance-reaction-after-event','Other Maintenance Reaction After Event','','Description of additional factor(s), not listed, associated with maintenance reactions after an incident or event.','text-field','ASRS'),(5331,'maintenance-reaction-after-event','Records Completed','http://rgl.faa.gov/Regulatory_and_Guidance_Library/rgAdvisoryCircular.nsf/0/2896cfc43ee12c22862572900053ce05/$FILE/150_5200_37.pdf','Indicates that the nothing has been omitted from the maintenance records and the tax_attributes stated are essential and appropriate to the level of detail. Refer to AC 120-92: Introduction to Safety Management Systems for Air Operators) (http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgAdvisoryCircular.nsf/0/6485143d5ec81aae8625719b0055c9e5/$FILE/AC%20120-92.pdf).','checkbox','ASRS'),(5332,'maintenance-reaction-after-event','Repaired/Delay','','Indicates that maintenance has restored an airframe, aircraft engine, propeller, assembly, appliance, accessory, component or part to a serviceable condition in conformity with data acceptable to the FAA in such a manner that requires the flight to be rescheduled at a later time.','checkbox','Operator'),(5333,'maintenance-reaction-after-event','Repaired/No Delay','','Indicates that maintenance has restored an airframe, aircraft engine, propeller, assembly, appliance, accessory, component or part to a serviceable condition in conformity with data acceptable to the FAA in such a manner that the flight is able to proceed as scheduled.','checkbox','Operator'),(5334,'maintenance-reaction-after-event','Rework','','','checkbox','MEDA Rev g.'),(5335,'maintenance-reaction-after-event','Submitted MMIR','','Indicates that an MMIR Maintenance Malfunction Information Report was submitted','checkbox','Operator'),(5336,'maintenance-reaction-after-event','Submitted SDIR','','Indicates that a SDIR Service Differential Interruption Report was submitted','checkbox','Operator'),(5337,'maintenance-reaction-after-event','Unknown','','','checkbox','ASRS'),(5338,'maintenance-reference-material','Cabin Maintenance Log','','','checkbox','Operator'),(5339,'maintenance-reference-material','CDL No','','Configuration Deviation List (CDL) number.','text-field','Operator'),(5340,'maintenance-reference-material','Maintenance Reference Material','','Occurrences and issues associated with manuals or guidance that is not current, available, or which contains inaccurate information.','checkbox','Operator'),(5341,'maintenance-reference-material','MEL No','','Identifier of Minimum Equipment List (MEL) items.','text-field','Operator'),(5342,'maintenance-reference-material','Notes','','','checkbox','Operator'),(5343,'maintenance-reference-material','Other Maintenance Reference Material','','Description of additional factor(s), not listed, associated with maintenance reference material.','text-field','Operator'),(5344,'maintenance-reference-material','Procedures','','Standard Operating Procedures (SOPs) delineated in reference materials that ensure that maintenance operations are performed in accordance with FAA and airline regulations.','checkbox','Operator'),(5345,'maintenance-reference-material','Verbiage','','','checkbox','Operator'),(5346,'maintenance-reference-material','Work Card','','Document that provides the details of the required maintenance steps for repairing an aircraft system or component.','checkbox','Operator'),(5347,'masap-abnormal-weapon-event','Actual Release (includes inert weapons)','','','checkbox','USAF'),(5348,'masap-abnormal-weapon-event','External','','','checkbox','USAF'),(5349,'masap-abnormal-weapon-event','Gravity Weapon','','','checkbox','USAF'),(5350,'masap-abnormal-weapon-event','Gravity Weapon Details','','','text-field','USAF'),(5351,'masap-abnormal-weapon-event','Hung Ordnance','','','checkbox','USAF'),(5352,'masap-abnormal-weapon-event','Inadvertent/ Uncommanded Release','','','checkbox','USAF'),(5353,'masap-abnormal-weapon-event','Internal','','','checkbox','USAF'),(5354,'masap-abnormal-weapon-event','Other Abnormal Weapon Event','','','text-field','USAF'),(5355,'masap-abnormal-weapon-event','Released Without Clearance','','','checkbox','USAF'),(5356,'masap-abnormal-weapon-event','Retained Ordnance','','','checkbox','USAF'),(5357,'masap-abnormal-weapon-event','Simulated Release','','','checkbox','USAF'),(5358,'masap-abnormal-weapon-event','Stand Off Weapon','','','checkbox','USAF'),(5359,'masap-abnormal-weapon-event','Stand Off Weapon Details','','','text-field','USAF'),(5360,'masap-abnormal-weapon-event','Struck Wrong Target','','','checkbox','USAF'),(5361,'masap-action-taken','Accepted','','','checkbox','ASRS'),(5362,'masap-action-taken','Action Taken','','Specify the reason the action taken in response to the particular event.','checkbox','UTRS'),(5363,'masap-action-taken','After-the-Fact','','','checkbox','ASRS'),(5364,'masap-action-taken','Insufficient Time to Take Action','','','checkbox','ASRS'),(5365,'masap-action-taken','Notified Supervisor','','','checkbox','Operator'),(5366,'masap-action-taken','Other Action Taken','','Description of additional factor(s), not listed, associated with the action taken in response to an incident or event.','text-field','ASRS'),(5367,'masap-action-taken','Unable to Take Action','','','checkbox','ASRS'),(5368,'masap-aircraft-area-affected','Access Panel','','','checkbox','USAF'),(5369,'masap-aircraft-area-affected','Aft','','At or near or toward the tail of an airplane.','checkbox','USAF'),(5370,'masap-aircraft-area-affected','Aircraft Area Affected','','Specifies the component and location associated with event.','checkbox','USAF'),(5371,'masap-aircraft-area-affected','Antenna','','An arrangement of wire, metal rods, etc. used in sending or receiving electromagnetic waves.','checkbox','USAF'),(5372,'masap-aircraft-area-affected','Avionics','','The computers and other electronic systems that monitor and control an aircraft\'s electrical and mechanical systems such as communications, autopilots, and navigation, including the various computers themselves, plus items such as interfaces, display generators, sensors, signal distributors, etc.','checkbox','USAF'),(5373,'masap-aircraft-area-affected','Bottom','','','checkbox','USAF'),(5374,'masap-aircraft-area-affected','Cargo Bay','','This is the area of the fuselage below the passenger deck where cargo and baggage are carried. It is basically the lower half of the fuselage cylinder. It is pressurized, along with the rest of the fuselage, and has heating systems for areas designated for the carriage of live animals. Aircraft also have ventilation systems that force air into these areas. Access to the cargo holds is through doors in the belly of the aircraft. There is no access from the cabin area.','checkbox','USAF'),(5375,'masap-aircraft-area-affected','Center','','','checkbox','USAF'),(5376,'masap-aircraft-area-affected','Cowling','','Issues associated with the skin covering the engine and components (ATA code 71-10) and specifications in FAR Sec. 121.249.','checkbox','USAF'),(5377,'masap-aircraft-area-affected','Electrical','','','checkbox','USAF'),(5378,'masap-aircraft-area-affected','EEC','','Electronic Engine Controls','checkbox','USAF'),(5379,'masap-aircraft-area-affected','Elevator','','The horizontal, movable primary control surface in the tail section, or empennage, of an airplane. The elevator is hinged to the trailing edge of the fixed horizontal stabilizer. Movement of the elevator will force the nose of an aircraft up or down.','checkbox','USAF'),(5380,'masap-aircraft-area-affected','Emergency Equipment','','Emergency and flotation equipment as specified in FAR Sec. 121.309: Emergency equipment (http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/65020F664E8C966786256A6500582F36?OpenDocument&Highlight=sec.,121.309)','checkbox','USAF'),(5382,'masap-aircraft-area-affected','Engine','','An engine that is used or intended to be used for propelling aircraft. It includes turbosuperchargers, appurtenances, and accessories necessary for its functioning, but does not include propellers.','combo-box','USAF'),(5383,'masap-aircraft-area-affected','Entry','','','checkbox','USAF'),(5384,'masap-aircraft-area-affected','Environmental','','Environmental systems include the supplemental oxygen systems, air condition systems, heaters, and pressurization systems, which make it possible for an occupant to function at high altitude.','checkbox','USAF'),(5385,'masap-aircraft-area-affected','Fairing','','','checkbox','USAF'),(5386,'masap-aircraft-area-affected','Fire suppression system','','This includes liquid or gas systems','checkbox','USAF'),(5387,'masap-aircraft-area-affected','Flap','','Flaps: Control surfaces installed on the trailing edge of a wing and used to increase the amount of lift generated by the wing at slow speeds used during takeoffs and landings. Flaps also have the effect of slowing an aircraft during its landing approach. Flaps also are commonly deployed during final approach to increase lift, which provides control and stability at slower speeds. Flap and slat settings are controlled by the pilots, although automatic extension/retraction systems are sometimes provided to protect flight and structural integrity. Flaps/Slats-Leading Edge are the control surface on the wing?s leading edge used to increase the slow speed lifting efficiency of the wing and decrease stall speed [Refer to ATA code 57-54 (Slat Surface) and 27-8* (Slat Control System)]. Flaps-Trailing Edge are the control surface on the wing?s trailing edge used to increase the slow speed lifting efficiency of the wing and decrease stall speed [Refer to ATA code 57-53 (Trailing Edge Flap Surface) and 27-5* (Trailing Edge Control System)].','checkbox','USAF'),(5388,'masap-aircraft-area-affected','flight controls','','Aircraft flight control systems consist of flight control surfaces, the respective cockpit controls, connecting linkages, and the necessary operating mechanisms to control an aircraft\'s direction in flight. Aircraft engine controls are also considered as flight controls as they change speed.','checkbox','USAF'),(5389,'masap-aircraft-area-affected','Flight Deck','','Also called the cockpit, it the compartment in the front of the airplane where the flight crew performs their job of flying the aircraft. It is the most forward part of the fuselage and contains all the instruments needed to fly the plane. The flight deck has seats for the pilot and co-pilot; a flight engineer, on some planes; and seats for one or two observers that could be from the airline itself, or from FAA. The flight deck is off limits to passengers during flight and to flight attendants during takeoffs and landings.','checkbox','USAF'),(5390,'masap-aircraft-area-affected','Fly by Cable System','','Mechanical or manually-operated flight control systems','checkbox','USAF'),(5391,'masap-aircraft-area-affected','Fly by Wire System','','Computer-configured controls, where a computer system is interposed between the operator and the final control actuators or surfaces','checkbox','USAF'),(5392,'masap-aircraft-area-affected','Forward','','In, near, or toward the  nose of aircraft.','checkbox','USAF'),(5393,'masap-aircraft-area-affected','Fuel','','','checkbox','USAF'),(5394,'masap-aircraft-area-affected','Fuselage','','The main body of an aircraft, cylindrical in shape. It contains the cockpit, main cabin and cargo compartments.','checkbox','USAF'),(5395,'masap-aircraft-area-affected','Galley','','Compartment of a aircraft where on-board meal service equipment is used to cook and prepare food.','checkbox','USAF'),(5396,'masap-aircraft-area-affected','Hydraulics','','Issues associated with the transmission of power by incompressible fluids under pressure and hydraulic system components (ATA code 29-**). Also Refer to FAR Sec. 25.1435: Hydraulic Systems (http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/BED86D5AD36A22B786256A6B0057CE4B?OpenDocument&Highlight=25.1541).','checkbox','USAF'),(5397,'masap-aircraft-area-affected','Integral Jacking System','','A system that allow a mechanic to jack a portion of the aircraft using the aircrafts own utilities','checkbox','USAF'),(5398,'masap-aircraft-area-affected','Interior','','','checkbox','USAF'),(5399,'masap-aircraft-area-affected','Kneeling System','','','checkbox','USAF'),(5400,'masap-aircraft-area-affected','Lavatory','','All events occurring within the toilet area including the triggering of smoke warnings either genuine or nuisance. ATA code 25-40 (failure of lavatory-related components).','checkbox','USAF'),(5401,'masap-aircraft-area-affected','Left','','','checkbox','USAF'),(5402,'masap-aircraft-area-affected','Main Gear','','Issues associated with the wheels of an aircraft\'s landing gear that supports the major part of the aircraft\'s weight.','checkbox','USAF'),(5403,'masap-aircraft-area-affected','Nose Gear','','The landing gear nearest the nose of the aircraft; usually under the cockpit.','checkbox','USAF'),(5405,'masap-aircraft-area-affected','Other Area Affected','','Description of additional factor(s), not listed, associated with other aircraft areas affected.','text-field','USAF'),(5406,'masap-aircraft-area-affected','Oxygen','','Failures of aircraft fixed or portable oxygen supply/equipment. ATA code 35-** Example: Oxygen used by passenger during a medical event. Employee err. Example: passenger oxygen was not properly boarded. Pilot deployed oxygen masks accidentally. Employee prevented accessibility to oxygen by stacking bags a top).','checkbox','USAF'),(5407,'masap-aircraft-area-affected','Radome','','A detachable nose cone made of plastic-type material, used to cover and protect an airplane\'s radar antenna.','checkbox','USAF'),(5408,'masap-aircraft-area-affected','Right','','','checkbox','USAF'),(5409,'masap-aircraft-area-affected','Rotor','','','checkbox','USAF'),(5411,'masap-aircraft-area-affected','Structural','','','checkbox','USAF'),(5412,'masap-aircraft-area-affected','Tail Rotor','','','checkbox','USAF'),(5413,'masap-aircraft-area-affected','Tail Rotor Shaft','','','checkbox','USAF'),(5414,'masap-aircraft-area-affected','Top','','','checkbox','USAF'),(5415,'masap-aircraft-area-affected','Wing','','The wings are the airfoil that generates the lift necessary to get and keep, an aircraft off the ground. Like the fuselage to which they are attached, they are made of aluminum alloy panels riveted together. The point of attachment is the aircraft\'s center of gravity, or balance point. ATA Code 57-**','checkbox','USAF'),(5416,'masap-aircraft-cargo-issues','Aircraft Cargo Base Issue','','','text-field','USAF'),(5417,'masap-aircraft-cargo-issues','Hazmat-Issues','','','checkbox','USAF'),(5418,'masap-aircraft-cargo-issues','Hot-Cargo','','','checkbox','USAF'),(5419,'masap-aircraft-cargo-issues','Late-Arrival','','','checkbox','USAF'),(5420,'masap-aircraft-cargo-issues','Load-Config.','','','checkbox','USAF'),(5421,'masap-aircraft-cargo-issues','Other Aircraft Cargo Issue','','','text-field','USAF'),(5422,'masap-aircraft-cargo-issues','Proper-Documentation','','','checkbox','USAF'),(5423,'masap-aircraft-cargo-issues','Safety-Aisle','','','checkbox','USAF'),(5424,'masap-aircraft-cargo-issues','Weight-and-Balance','','','checkbox','USAF'),(5425,'masap-aircraft-configuration','Aircraft Type','','Specifies the aircraft manufacturer and model (e.g., EMB-145, B757-200, A320-200) from a drop-down list.','combo-box','USAF'),(5426,'masap-aircraft-configuration','Altitude (Ft) MSL','','Specification of the height of a level, point, or object measured in feet from Mean Sea Level (MSL) at which the event occurred.','real-field','USAF'),(5427,'masap-aircraft-configuration','Auto-Flight Status','','Indicates whether the pilots are controlling flight control movements through manual control or use of the auto pilot systems.','combo-box','USAF'),(5428,'masap-aircraft-configuration','Autopilot','','Specifies whether the autopilot was on or off at the time of the occurrence. Autopilot is the automation system that controls aircraft attitude, altitude and heading and keeps an aircraft in level flight or on a set course. Automatic pilots can be directed by the pilot, or they may be coupled to a radio navigation signal. Refer to ATA Code 2210) and FAR Part 23.1329: Autopilot (http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/BDEC6530B3BFFE6F8525668700724671?OpenDocument&Highlight=23.1329).','combo-box','USAF'),(5429,'masap-aircraft-configuration','Auto Throttle','','Specifies whether the auto throttle [the automation system that controls airspeed by adjusting engine thrust (ATA Code 22-30)] was on or off at the time of the occurrence.','combo-box','USAF'),(5430,'masap-aircraft-configuration','Engine Type','','Manufacturer and model (e.g., PW4000, RB211-524, CF6-80A, etc.)','text-field','USAF'),(5431,'masap-aircraft-configuration','Flap Setting','','Aircraft flap setting','text-field','USAF'),(5432,'masap-aircraft-configuration','Fleet Number','','Letter or number designator','text-field','USAF'),(5433,'masap-aircraft-configuration','Landing Gear','','Specifies whether the landing gear was up or down at the time of the occurrence. Landing Gear is the system that supports aircraft maneuvering on land or water and supports the weight of the aircraft when it lands.','combo-box','USAF'),(5434,'masap-aircraft-configuration','Tail Number','','The registration number of an aircraft specified as a group of letters or figures, or a combination thereof, that is either identical to, or the coded equivalent of the aircraft call sign to be used in air-ground communication and that is used to identify the aircraft in ground-ground ATS communications.','text-field','USAF'),(5435,'masap-aircraft-configuration','Number of Floor Level Exits','','','integer-field','USAF'),(5436,'masap-aircraft-configuration','Number of Seats','','','integer-field','USAF'),(5437,'masap-aircraft-configuration','Number of Window Exits','','','integer-field','USAF'),(5438,'masap-aircraft-configuration','Other','','','text-field','USAF'),(5439,'masap-aircraft-configuration','RPA Aircraft Type','http://intlaviationstandards.org/Documents/AircraftMakeModelSeriesBusinessRules1.pdf','Specifies the aircraft manufacturer and model (e.g., EMB-145, B757-200, A320-200) from a drop-down list.','combo-box','Operator'),(5440,'masap-aircraft-configuration','RPA Autopilot','','','combo-box','USAF'),(5442,'masap-aircraft-configuration','Speed IAS (Knots)','','Specification of the Indicated Air Speed (IAS) at the time of the occurrence. IAS is defined as the speed, expressed in knots, an aircraft is moving through the air as is shown on the aircraft pitot static airspeed indicator calibrated to reflect standard atmosphere adiabatic compressible flow at sea level, uncorrected for variations in atmospheric density, installation error, or instrument error. Manufacturers use this airspeed as the basis for determining airplane performance. Takeoff, landing, and stall speeds listed in the AFM or POH are indicated airspeeds and do not normally vary with altitude or temperature. This is the speed used in pilot/controller communications. Refer to 14 CFR Part 1 (http://www.airweb.faa.gov/Regulatory_and_Guidance_Library%5CrgFAR.nsf/0/7B29C0FFCE0C430A86256EDF00478339?OpenDocument).','integer-field','USAF'),(5443,'masap-aircraft-configuration','Speed (Mach Number)','','Specification of the speed, expressed as Mach Number, at the time of occurrence. Mach number is defined as the ratio of true airspeed to the speed of sound.','real-field','USAF'),(5444,'masap-aircraft-configuration','Spoilers','','Specifies whether the spoilers were extended or retracted at the time of the occurrence.','combo-box','USAF'),(5445,'masap-aircraft-configuration','Sterile Cockpit','','http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/DD19266CEBDAC9DB852566EF006D346F?OpenDocument&Highlight=121.542','checkbox','USAF'),(5446,'masap-aircraft-configuration','Tailcone Exits','','Indicated the number of exits through the tailcone which are aft exits from the passenger compartment through the pressure shell and through an openable cone of the fuselage aft of the pressure shell. The means of opening the tailcone must be simple and obvious and must employ a single operation.','checkbox','USAF'),(5447,'masap-aircraft-configuration','Was Aircraft on Ground?','','','combo-box','USAF'),(5448,'masap-aircraft-configuration','Weight at Time of Event (Lb)','','Specifies the aircraft weight, including the fuel, oil, crew, passengers, and cargo, in pounds at the time of the occurrence.','real-field','USAF'),(5449,'masap-aircraft-damage/encounter','Aircraft Damage','','Occurrences associated with damage to an aircraft from a company employee, contract vendor, or an external source (non-company employee, animal, etc). Damage is the severity of injury, and / or the physical, and/ or functional, and /or monetary loss that could result if hazard control is less then adequate.','combo-box','USAF'),(5450,'masap-aircraft-damage/encounter','Aircraft Damage/Encounter','','Physical deterioration of the aircraft caused by a company employee, contract vendor, or any external source (non-company employee, animal, etc) during the operation of the aircraft, ground, or maintenance practices. Damage is the severity of injury, and/or the physical, and/or functional, and/or monetary loss that could result if hazard control is less then adequate. Should include ATA code of damage (example: bag cart hits an engine include ATA 72-00).','checkbox','USAF'),(5451,'masap-aircraft-damage/encounter','Birds','','An aircraft-wildlife strike is deemed to have occurred when: 1. a pilot reports that an aircraft struck 1 or more birds or other wildlife; 2. aircraft maintenance personnel identify aircraft damage as having been caused by an aircraft-wildlife strike; 3. personnel on the ground report seeing an aircraft strike 1 or more birds or other wildlife; 4. bird or other wildlife remains, whether in whole or in part, are found within 200 feet of a runway centerline, unless another reason for the animal\'s death is identified; or 5. the animal\'s presence on the airport had a significant, negative effect on a flight (i.e., aborted takeoff, aborted landing, high-speed emergency stop, aircraft left pavement area to avoid collision with animal). In AC: 150/1500-32A: Reporting Wildlife Aircraft Stirkes (http://www.faa.gov/airports_airtraffic/airports/resources/advisory_circulars/media/150-5200-32a/150_5200_32a.pdf), the FAA requests that bird and other wildlife strikes be reported using FAA Form 5200-7 (http://forms.faa.gov/info_new.asp?form_number=5200-7&open_doc=N). http://www.birdstrike.us/guidances).','combo-box','USAF'),(5452,'masap-aircraft-damage/encounter','Blown Tire','','','checkbox','USAF'),(5453,'masap-aircraft-damage/encounter','Cargo','','Refers to everything carried in the cargo compartments of the aircraft. This includes bags, mail, freight, express, and company material. It also includes live animals, dangerous goods, and hazardous materials.','checkbox','USAF'),(5454,'masap-aircraft-damage/encounter','Cargo Door','','','checkbox','USAF'),(5455,'masap-aircraft-damage/encounter','Estimated Repair Cost','','','real-field','USAF'),(5456,'masap-aircraft-damage/encounter','Fixed Object','','','checkbox','USAF'),(5457,'masap-aircraft-damage/encounter','FOD','','Foreign Object Debris. Debris on the ramp, taxiway or runway that may cause damage to the aircraft.','checkbox','USAF'),(5458,'masap-aircraft-damage/encounter','In-Flight VFR in IMC','','','checkbox','USAF'),(5459,'masap-aircraft-damage/encounter','Jetbridge','','A registered trademark for a certain kind of aircraft loading bridge which allows passengers direct, protected access to an aircraft from the terminal.','checkbox','USAF'),(5460,'masap-aircraft-damage/encounter','Landing Gear/Doors','','Landing Gear is the system that supports aircraft maneuvering on land or water and supports the weight of the aircraft when it lands.','checkbox','USAF'),(5461,'masap-aircraft-damage/encounter','Nose/Radome','','','checkbox','USAF'),(5462,'masap-aircraft-damage/encounter','Other Aircraft','','Description of additional factor(s), not listed, associated with the aircraft damage of encounter incident or event.','text-field','USAF'),(5463,'masap-aircraft-damage/encounter','Other Aircraft Damage/Encounter: Ground','','Description of additional factor(s), not listed, associated with the aircraft damage of encounter incident or event on the ground.','text-field','USAF'),(5464,'masap-aircraft-damage/encounter','Other Aircraft Damage/Encounter: In-Flight','','Description of additional factor(s), not listed, associated with the aircraft damage of encounter incident or event that occurred in-flight.','text-field','USAF'),(5465,'masap-aircraft-damage/encounter','Passenger Door','','','checkbox','USAF'),(5466,'masap-aircraft-damage/encounter','Person','','An individual, firm, partnership, corporation, company, association, joint-stock association, or governmental entity. It includes a trustee, receiver, assignee, or similar representative of any of them.','checkbox','USAF'),(5467,'masap-aircraft-damage/encounter','Repair Required to Maintain Airworthiness','','','checkbox','USAF'),(5468,'masap-aircraft-damage/encounter','Parachutists','','A person who intends to exit an aircraft while in flight using a single-harness, dual parachute system to descend to the surface. Refer to FAR Sec. 105.3: Parachute Operations (http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFar.nsf/0/e19a6716704c949f86256eec00667df3?OpenDocument) and AIM Chapter 3-5-4. Parachute Jump Aircraft Operations (http://www.faa.gov/airports_airtraffic/air_traffic/publications/atpubs/aim/Chap3/aim0305.html#3-5-4).','checkbox','USAF'),(5469,'masap-aircraft-damage/encounter','Tail','','','checkbox','USAF'),(5470,'masap-aircraft-damage/encounter','Vehicle','','Conveyances, except aircraft, used on the ground to transport persons, cargo, fuel, or equipment','checkbox','USAF'),(5471,'masap-aircraft-damage/encounter','Wild Life','','Includes feral animals and domestic animals while out of their owner\'s control','combo-box','USAF'),(5472,'masap-aircraft-damage/encounter','Engine/Cowl','','','checkbox','USAF'),(5473,'masap-aircraft-damage/encounter','Wing/Flaps/Slats/Ailerons','','Wing - A part of an airplane that is attached to the fuselage. Wings are shaped like airfoils and are used to provide lift for the airplane. There are four basic types of wings: straight, sweep, delta and variable sweep. Flaps - Moveable parts of the trailing edge of a wing that are used to increase lift at slower air speeds. Flaps increase lift by changing the shape of the airfoil. A pilot will extend the flaps when the airplane is landing. By extending the flaps, the pilot is increasing the camber of the wing, the size of the wing and the wing\'s angle of attack. All of these actions will cause lift to decrease so the airplane can land more slowly. Slats-Auxiliary curved or mini-aerofoil surface designed to prevent flow breakaway from a wing or tail. On a tail leading-edge it may be fixed, leaving a narrow slot. On a wing it is almost always retractable, normally flush with the wing profile but extended (under power or by aerodynamic lift) to leave a narrow slot for take-off, low-speed loiter or landing. Ailerons - Control surfaces on the trailing edge of each wing that are used to make the aircraft roll. When flying straight and level, moving the control stick to the right will raise the aileron on the right wing and lower the aileron on the left wing. This will cause the aircraft to roll to the right.','checkbox','USAF'),(5474,'masap-aircraft-design/configuration/parts','Aircraft Configuration Variability','','','checkbox','MEDA Rev g.'),(5475,'masap-aircraft-design/configuration/parts','Aircraft Design/Configuration/Parts','','Issues associated with the design of the aircraft for accessibility of parts and systems, configuration variability between models and aircraft that require ground personnel or maintenance tasks to be carried out differently or require slightly different parts, and aircraft parts that are to be replaced, including labeling and availability.','checkbox','MEDA Rev g.'),(5476,'masap-aircraft-design/configuration/parts','Bad from Stock','','','checkbox','Operator'),(5477,'masap-aircraft-design/configuration/parts','Complex','','Involved or intricate in structure and consisting of interconnected parts','checkbox','MEDA Rev g.'),(5478,'masap-aircraft-design/configuration/parts','Easy to Install Incorrectly','','Indicates that that the tasks associated with connection, setting-in position, and/or preparing for use of equipment or part, including not closing access, causing damage, improper deactivation/reactivation, incorrect installation, use of wrong equipment or part are complicated and can readily be misinterpreted.','checkbox','MEDA Rev g.'),(5479,'masap-aircraft-design/configuration/parts','Inaccessible','','Capable of being reached only with great difficulty or not at all.','checkbox','MEDA Rev g.'),(5480,'masap-aircraft-design/configuration/parts','Other Aircraft Design/Configuration/Parts','','Description of additional factor(s), not listed,  are associated with the design of the aircraft for accessibility of parts and systems, configuration variability between models and aircraft that require ground personnel or maintenance tasks to be carried out differently or require slightly different parts, and aircraft parts that are to be replaced, including labeling and availability.','text-field','MEDA Rev g.'),(5481,'masap-aircraft-design/configuration/parts','Parts Hard to See','','Including antenna, masts, etc.','checkbox','REDA'),(5482,'masap-aircraft-design/configuration/parts','Parts Incorrectly Labeled','','Errors associated with the alphanumeric information (label) or nonverbal information, such as colors or symbols (markings) that identifies or describes an object. Labels on equipment can be used to (a) identify the equipment, (b) state warnings or cautions, (c) supply useful information, such as instructions, the weight of the equipment, or calibration information, and (d) record and supply historical data, such as periodic readings or the date of servicing or replacement. (Refer to Sect. 4.3.5 Labeling and Marking).','checkbox','MEDA Rev g.'),(5483,'masap-aircraft-design/configuration/parts','Parts Not Available','','Indicates that the required parts are not available, accessible, or at hand.','checkbox','MEDA Rev g.'),(5484,'masap-aircraft-design/configuration/parts','Poorly Marked','','','checkbox','REDA'),(5485,'masap-aircraft-design/configuration/parts','Wrong Effectivity Code','','','checkbox','Operator'),(5486,'masap-aircraft-equipment','Aircraft Equipment','','Specific equipment on the aircraft, such as GPWS and TCAS.','checkbox','USAF'),(5487,'masap-aircraft-equipment','Aircraft Warning/Message System','','','checkbox','USAF'),(5488,'masap-aircraft-equipment','Altitude Alert','','','checkbox','USAF'),(5489,'masap-aircraft-equipment','EGPWS','','','checkbox','USAF'),(5490,'masap-aircraft-equipment','GPWS','','Ground Proximity Warning System (GPWS) is a system on board the aircraft that provided warnings of: excessive descent rate; excessive terrain closure rate; excessive altitude loss after take-off or go-around; unsafe terrain clearance while not in landing configuration, i.e., gear not locked down or flaps not in a landing position; and excessive descent below the instrument glide path. (warns of inadequate separation from ground and excessive sink rate close to ground). Refer to FAR 121.360: Ground proximity warning-glide slope deviation alerting system (http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/C45DB475D77EFC1B862568C80064DDF6?OpenDocument&Highlight=121.360).','checkbox','USAF'),(5491,'masap-aircraft-equipment','Other Aircraft Equipment','','Description of additional factor(s), not listed, associated with the specific equipment on the aircraft, such as GPWS and TCAS.','text-field','USAF'),(5492,'masap-aircraft-equipment','Other Aircraft Equipment Specifics','','Description of additional factor(s), not listed, on the specific equipment on the aircraft.','text-field','USAF'),(5493,'masap-aircraft-equipment','TCAS','','Traffic Alert And Collision Avoidance System (TCAS)-An airborne collision avoidance system based on radar beacon signals which operates independent of ground-based equipment. TCAS-I generates traffic advisories only. TCAS-II generates traffic advisories, and resolution (collision avoidance) advisories in the vertical plane.','checkbox','USAF'),(5494,'masap-aircraft-equipment-damage','Aircraft/Equipment Damage','','','checkbox','USAF'),(5495,'masap-aircraft-equipment-damage','Battle Damage','','','checkbox','USAF'),(5496,'masap-aircraft-equipment-damage','Defective Tools/Equipment Used','','','checkbox','USAF'),(5497,'masap-aircraft-equipment-damage','Dropped Object','','','checkbox','USAF'),(5498,'masap-aircraft-equipment-damage','Incorrect Pressure','','Includes hydraulics, pneumatics, and pneudraulics','checkbox','USAF'),(5499,'masap-aircraft-equipment-damage','Incorrect Voltage','','Includes over, under, and unstable voltages','checkbox','USAF'),(5500,'masap-aircraft-equipment-damage','Other Aircraft/Equipment Damage','','Description of additional factor(s), not listed, associated with the aircraft or equipment damage incident or event.','text-field','USAF'),(5501,'masap-aircraft-equipment-damage','Pulled/Pushed/Drove Into','','','checkbox','USAF'),(5502,'masap-aircraft-equipment-damage','Struck By/Against','','','checkbox','USAF'),(5503,'masap-aircraft-equipment-damage','Tools/Equipment Used Improperly','','','checkbox','USAF'),(5504,'masap-aircraft-events','Aircraft Events','','Occurrences and issues related to the aircraft as a whole including dimensions, inspection, movement, maintenance, placards, servicing, and towing.','checkbox','USAF'),(5505,'masap-aircraft-events','Dimensions and Areas','','Includes charts, diagrams, and text which show the area, dimensions, stations, access doors / zoning and physical locations, of the major structural members of the aircraft, including an explanation of the system of zoning and measurement used. Refer to ATA 100 (now ATA iSpec 2200) Chapter 6: Dimensions and Areas (http://www.s-techent.com/ATA100.htm#[08]).','checkbox','USAF'),(5506,'masap-aircraft-events','Jet Blast','','Jet engine exhaust or propeller wash (thrust stream turbulence).','checkbox','USAF'),(5507,'masap-aircraft-events','Laser Beam Exposure','','Unauthorized illumination of aircraft by lasers. Pilots are also encouraged to complete the Laser Beam Exposure Questionnaire (http://www.faa.gov/airports_airtraffic/air_traffic/publications/atpubs/aim/Appendices/aimapd3.html#Appendix3), and fax it to the Washington Operations Center Complex (WOCC) as soon as possible after landing.','checkbox','USAF'),(5508,'masap-aircraft-events','Leveling and Weighing','','Includes activities to properly level the aircraft for any of the various maintenance, overhaul or major repairs which might become necessary during the life of the aircraft. It shall also include those units or components which are specifically dedicated to record, store or compute weight and balance data. Includes those maintenance practices necessary to prepare the aircraft for weighing. Refer to FAR Part 25 Sec. H.23 and ATA 100 (now ATA iSpec 2200) Chapter 8: Leveling and Weighing (http://www.s-techent.com/ATA100.htm#[08])).','checkbox','USAF'),(5509,'masap-aircraft-events','Lifting and Shoring','','','checkbox','USAF'),(5510,'masap-aircraft-events','Other Aircraft Events','','Description of additional factor(s), not listed, associated with the aircraft incident or event.','text-field','USAF'),(5511,'masap-aircraft-events','Parking, Mooring, Storage and Return to Service','','Includes maintenance practices necessary to prepare the aircraft for parking, mooring, or storage for service in any of the conditions to which it may be subjected. Includes charts showing location of landing gear and control surface locks, blanking plugs and covers, mooring points, etc. Parking: practices necessary to park or store the aircraft in normal or abnormal conditions such as with engines removed, or aircraft damaged for short or long terms, including equipment and materials required such as landing gear and control surface locks, wheel chocks, blanking plugs and covers, cocooning materials, etc; procedures such as periodic engine running, control or drainage of fluid systems, static grounding, etc; precautions and limitations, such as landing gear strut pressures and wheel rotation, control of lifted equipment, etc. Mooring: Practices necessary to moor or picket the aircraft in normal or abnormal conditions or with engines removed, etc.; for short or long terms in extremes of weather condition, including equipment and materials required such as wheel chocks, mooring blocks, mooring cables, etc.; procedures such as ballasting, etc.; precautions and limitations such as control in high wind conditions, etc Return To Service: practices for preparing the aircraft for operation following mooring, parking, or a period of storage. Refer to FAR Part 25 Sec. H.23 and ATA 100 (now ATA iSpec 2200) Chapter 10: Parking, Mooring, Storage and Return to Service (http://www.s-techent.com/ATA100.htm#[08]).','checkbox','USAF'),(5512,'masap-aircraft-events','Periodic Inspections','','Procedures for complying with manufacturers\' recommended time limits for inspections, maintenance checks, overhaul, and inspections (both scheduled and unscheduled) of the aircraft, its systems and units, and life of parts. Refer to FAR 135.425: Maintenance, preventive maintenance, and alteration programs (http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/26CD1335E9C5D5388625694A00712282?OpenDocument&Highlight=135.425). For engine manufacturers this will include the flight cycle lives of major rotating components and other items designated critical. Refer to FAR Part 25 Sec. H.23 and ATA 100 (now ATA iSpec 2200) Chapter 5: Periodic Inspections (http://www.s-techent.com/ATA100.htm#[08]).','checkbox','USAF'),(5513,'masap-aircraft-events','Placards and Markings','','Required signs, label, markings, self-illuminating signs, etc. required for safety information, maintenance significant information or by government regulations. Interior placards and markings provide general and emergency information, instructions, cautions, warnings, etc. to crew or passengers. Exterior placards and markings provide ground servicing instructions, inspections, cautions, warnings, etc. Those required by government regulations must be so identified. Refer to ATA 100 (now ATA iSpec 2200) Chapter 11: Placards and Markings (http://www.s-techent.com/ATA100.htm#[08]).','checkbox','USAF'),(5516,'masap-aircraft-events','Vibration and Noise Analysis','','Procedures to monitor, measure, diagnose and locate sources of vibration and noise in dynamic and structural components. Refer to ATA 100 (now ATA iSpec 2200) Chapter 18: Vibration And Noise Analysis (http://www.s-techent.com/ATA100.htm#[08]).','checkbox','USAF'),(5517,'masap-aircraft-handling/config/performance-contr','Aircraft Handling/Configuration/Performance Control','','Occurrences and issues associated with the handling, configuration, and performance of the aircraft, including flaps, flight controls, Spoilers/Speed Brakes, and Power Settings/Speed.','checkbox','USAF'),(5518,'masap-aircraft-handling/config/performance-contr','Automation Overrode Flight Crew','','','checkbox','USAF'),(5519,'masap-aircraft-handling/config/performance-contr','Configuration Warning','','','checkbox','USAF'),(5520,'masap-aircraft-handling/config/performance-contr','Flap Setting','','Aircraft flap setting','checkbox','USAF'),(5521,'masap-aircraft-handling/config/performance-contr','Loss of Aircraft Control','','Indicates occurrences and issues associated with loss of aircraft control while the aircraft is on the ground or while inflight.','checkbox','USAF'),(5522,'masap-aircraft-handling/config/performance-contr','Other Aircraft Handling/Configuration/Performance Control','','Description of additional factor(s), not listed, associated with the aircraft handling, configuration, and/or performance control incident or event.','text-field','USAF'),(5523,'masap-aircraft-handling/config/performance-contr','Power Settings/Speed Control-Thrust Reversers, Auto-Throttle','','','checkbox','USAF'),(5525,'masap-aircraft-handling/config/performance-contr','Trim','','Secondary flight control surface or control used to fine tune the position of a primary flight control surface (ATA code 27-**). Refer to 14 CFR 25.161 Trim (http://ecfr.gpoaccess.gov/cgi/t/text/text-idx?c=ecfr;sid=6d92d5a00b5d947ba62916750fc66814;rgn=div5;view=text;node=14%3A1.0.1.3.11;idno=14;cc=ecfr#14:1.0.1.3.11.2.157.25).','checkbox','USAF'),(5526,'masap-aircraft-handling/config/performance-contr','Use of Primary/Manual Flight Controls (Airborne)-Aileron, Rudder, or Elevator','','','checkbox','USAF'),(5527,'masap-aircraft-handling/config/performance-contr','Use of Flight Controls (On Ground)','','Uses of the devices which allow the pilot to direct the movements of an aircraft. Examples of controls are: rudder pedals that control the rudders and cause the airplane to yaw; throttles that control the engines which generate thrust for the airplane; and the control stick that controls the ailerons and elevators which cause the airplane to roll and pitch while the aircraft is not in the air.','checkbox','USAF'),(5528,'masap-aircraft-information','Company/Manufacturer Part No','','','text-field','M-DNAA V7.0 A4.7'),(5529,'masap-aircraft-information','Component Name','','Name of a rotable or repairable part (re-usable). Aircraft components whose maintenance intervals are individually scheduled separately to the maintenance intervals of the aircraft itself.','text-field','M-DNAA V7.0 A4.6'),(5530,'masap-aircraft-information','Condition','','The actual appearance or status of a part or component.','combo-box','M-DNAA V7.0 A4.9'),(5531,'masap-aircraft-information','Engine Model (Manufacturer)','','','combo-box','M-DNAA V7.0 A4.5'),(5532,'masap-aircraft-information','Maintenance Record Information: Log Page No','','','checkbox','M-DNAA V7.0 A4.12'),(5533,'masap-aircraft-information','Maintenance Record Information: Placards No','','','checkbox','M-DNAA V7.0 A4.12'),(5534,'masap-aircraft-information','Maintenance Record Information: Work Card(s) No','','Number specified on the instructions included on the document that provides the details of the required maintenance steps for repairing an aircraft system or component that leads to failure to correctly perform a task','checkbox','M-DNAA V7.0 A4.12'),(5535,'masap-aircraft-information','Serial No','','Internal number, for the use of the manufacturer to identify a particular aircraft within the same model.','text-field','M-DNAA V7.0 A4.8'),(5536,'masap-aircraft-system/equipment-malfunction','Abnormal Engine Indications','','','checkbox','USAF'),(5537,'masap-aircraft-system/equipment-malfunction','Air Conditioning/Pressurization','','Indicates an occurrence associated with the Air Conditioning or Pressurization System (ATA/JASC code 21-**).','combo-box','USAF'),(5538,'masap-aircraft-system/equipment-malfunction','Aircraft System/Equipment Malfunction','','Issue associated with the inability of an aircraft system, subsystem, component, or part to perform its required function within specified limits, under specified conditions for a specified duration. A failure may result in an unsafe condition and / or act, i.e. a hazard; the termination of the ability of a system element to perform a required function; the lack of correct performance.','checkbox','USAF'),(5539,'masap-aircraft-system/equipment-malfunction','Aircraft Vibration','','','checkbox','USAF'),(5540,'masap-aircraft-system/equipment-malfunction','APU Operations','','The Auxiliary Power Unit provides power for engine-starting and other systems while on the ground (ATA code 49-**)','combo-box','USAF'),(5541,'masap-aircraft-system/equipment-malfunction','Communication Equipment','','Failure of communications equipment, which includes ATC, Ground, PAX. Not restricted to flight deck communications. ATA code 23-**:','combo-box','USAF'),(5542,'masap-aircraft-system/equipment-malfunction','Compressor Stall','','Issues associated with a condition in gas turbine engines in an axial-flow compressor in which one or more stages of rotor blades fail to pass air smoothly to the succeeding stages. A stall condition is caused by a pressure ratio that is incompatible with the engine RPM. Compressor stall will be indicated by a rise in the exhaust temperature or RPM fluctuation, and if allowed to continue, may result in flameout and physical damage to the engine. (FAR Sec. 25.103 - Stall speed).','checkbox','USAF'),(5543,'masap-aircraft-system/equipment-malfunction','Configuration Warning','','','checkbox','USAF'),(5544,'masap-aircraft-system/equipment-malfunction','Deferred Items-MEL/CDL','','Minimum Equipment List (MEL)/Configuration Deviation List (CDL) faults or defects found on an aircraft which do not need immediate action and can be deferred for repair at a later date. This deferred defect status is only given for a strictly limited period of time and rectification must take place before that time has elapsed. Refer to FAR 125.201: Inoperable instruments and equipment (http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/58CF936FD6E2A36186256959004E132E?OpenDocument&Highlight=125.201).','checkbox','USAF'),(5545,'masap-aircraft-system/equipment-malfunction','Doors/Windows','','','combo-box','USAF'),(5546,'masap-aircraft-system/equipment-malfunction','Drive Train','','','checkbox','USAF'),(5547,'masap-aircraft-system/equipment-malfunction','ECM system Malfunction Expendables Malfunction','','Issues associated with the transmission of power by incompressible fluids under pressure and hydraulic System components. ATA code 29-**','combo-box','USAF'),(5548,'masap-aircraft-system/equipment-malfunction','Electrical','','','combo-box','USAF'),(5549,'masap-aircraft-system/equipment-malfunction','Electrical System Failure','','The operator of an aircraft shall immediately, and by the most expeditious means available, notify the nearest NTSB Field Office when an inflight failure of electrical systems which requires the sustained use of an emergency bus powered by a back-up source such as a battery, auxiliary power unit, or air-driven generator to retain flight control or essential instruments occurs. Refer to AIM Chapter 7-6-2. Aircraft Accident and Incident Reporting (http://www.faa.gov/airports_airtraffic/air_traffic/publications/atpubs/aim/Chap7/aim0706.html#7-6-2).','checkbox','USAF'),(5550,'masap-aircraft-system/equipment-malfunction','Electronic Display Malfunction','','','checkbox','USAF'),(5551,'masap-aircraft-system/equipment-malfunction','Engine','','','combo-box','USAF'),(5552,'masap-aircraft-system/equipment-malfunction','Engine EGT','','Exhaust Gas Temperature provides a cockpit readout of the EGT of an aircraft\'s (piston) engine(s), enabling the pilot to lean the mixture for maximum fuel efficiency.','combo-box','USAF'),(5553,'masap-aircraft-system/equipment-malfunction','Engine EPR/N1/N2','','Engine Pressure Ratio (EPR) is the ratio of turbine discharge pressure divided by the compressor inlet pressure that is used as an indication of the amount of thrust being developed by a turbine engine. N1 on a turboprop is the gas produced speed. N1 on a turbofan or turbojet engine is the fan speed or low pressure spool speed. N2 is the high pressure spool speed on engine with 2 spools and medium pressure spool on engines with 3 spools with N3 being the high pressure spool.','combo-box','USAF'),(5554,'masap-aircraft-system/equipment-malfunction','Engine Failure/Flameout','','The operator of an aircraft shall immediately, and by the most expeditious means available, notify the nearest NTSB Field Office when a failure of structural components of a turbine engine excluding compressor and turbine blades and vane occurs. Refer to AIM Chapter 7-6-2. Aircraft Accident and Incident Reporting (http://www.faa.gov/airports_airtraffic/air_traffic/publications/atpubs/aim/Chap7/aim0706.html#7-6-2).','combo-box','USAF'),(5555,'masap-aircraft-system/equipment-malfunction','Engine Fire/Overheat','','The operator of an aircraft shall immediately, and by the most expeditious means available, notify the nearest NTSB Field Office when an inflight fire occurs. Refer to AIM Chapter 7-6-2. Aircraft Accident and Incident Reporting (http://www.faa.gov/airports_airtraffic/air_traffic/publications/atpubs/aim/Chap7/aim0706.html#7-6-2).','combo-box','USAF'),(5556,'masap-aircraft-system/equipment-malfunction','Engine Oil/Pressure/Temperature/Quantity','','','combo-box','USAF'),(5557,'masap-aircraft-system/equipment-malfunction','Engine Shutdown','','http://66.89.54.147/Documents/PhaseofFlightDefinitions.pdf','combo-box','USAF'),(5558,'masap-aircraft-system/equipment-malfunction','Engine Vibration','','','combo-box','USAF'),(5559,'masap-aircraft-system/equipment-malfunction','Equipment Malfunction','','','text-field','USAF'),(5560,'masap-aircraft-system/equipment-malfunction','Equipment Malfunction Type','','','combo-box','USAF'),(5561,'masap-aircraft-system/equipment-malfunction','Equipment Problem Dissipated','','','checkbox','USAF'),(5562,'masap-aircraft-system/equipment-malfunction','Fire Warning System Alert/Malfunction','','','checkbox','USAF'),(5563,'masap-aircraft-system/equipment-malfunction','First Time or Repeated','','Indicates where malfunction is the first known failure of equipment to operate correctly or equipment fails again and again to operate correctly, despite check by maintenance personnel.','combo-box','USAF'),(5564,'masap-aircraft-system/equipment-malfunction','Flight Controls/Computers','','Failures of primary and secondary flight controls. ATA code 27-**. The aircraft operator shall immediately, and by the most expeditious means available, notify the nearest NTSB Field Office when a flight control system malfunction or failure occurs. Refer to AIM Chapter 7-6-2. Aircraft Accident and Incident Reporting (http://www.faa.gov/airports_airtraffic/air_traffic/publications/atpubs/aim/Chap7/aim0706.html#7-6-2).','combo-box','USAF'),(5565,'masap-aircraft-system/equipment-malfunction','Flight Controls/Computers','','','combo-box','USAF'),(5566,'masap-aircraft-system/equipment-malfunction','Flight Instruments-AS/ADI/HIS','','','combo-box','USAF'),(5567,'masap-aircraft-system/equipment-malfunction','Fuel System','','','combo-box','USAF'),(5568,'masap-aircraft-system/equipment-malfunction','Fuel System Malfuntion','','','checkbox','USAF'),(5569,'masap-aircraft-system/equipment-malfunction','Hydraulic Fluid-Quantity/PSI','','','checkbox','USAF'),(5570,'masap-aircraft-system/equipment-malfunction','Hydraulic System','','Issues associated with the transmission of power by incompressible fluids under pressure and hydraulic System components. ATA code 29-**','combo-box','USAF'),(5571,'masap-aircraft-system/equipment-malfunction','In-flight Air Refueling System Malfunction','','','checkbox','USAF'),(5572,'masap-aircraft-system/equipment-malfunction','In-flight Hoist Malfunction','','','checkbox','USAF'),(5573,'masap-aircraft-system/equipment-malfunction','Instrument','','','checkbox','USAF'),(5574,'masap-aircraft-system/equipment-malfunction','Landing Gear/Tires/Brakes','','Landing Gear-The collection of devices including wheels, skis, and floats that enable a flight vehicle to land and move about on land, water or other surfaces and supports the weight of the aircraft when it lands. The landing gear is often retractable - it can be pulled into the fuselage of the aircraft to reduce drag during flight. Another word for undercarriage.','combo-box','USAF'),(5575,'masap-aircraft-system/equipment-malfunction','Lighting','','','checkbox','USAF'),(5576,'masap-aircraft-system/equipment-malfunction','Loss of Power/Thrust','','The operator of an aircraft shall immediately, and by the most expeditious means available, notify the nearest NTSB Field Office when a sustained loss of the power or thrust produced by two or more engines occurs. Refer to AIM Chapter 7-6-2. Aircraft Accident and Incident Reporting (http://www.faa.gov/airports_airtraffic/air_traffic/publications/atpubs/aim/Chap7/aim0706.html#7-6-2).','checkbox','USAF'),(5577,'masap-aircraft-system/equipment-malfunction','Navigational System or Navaid Malfunction','','','checkbox','USAF'),(5578,'masap-aircraft-system/equipment-malfunction','Navigation Equipment/Radar','','Failure of any equipment on the aircraft used for navigation. ATA code 34-** Example: Inaccurate FMS Database due to due to lack of updates by company personnel.','combo-box','USAF'),(5579,'masap-aircraft-system/equipment-malfunction','Other Aircraft System/Equipment Malfunction','','Description of additional factor(s), not listed, associated with tbe failure of additional aircraft systems/equipment to operate in the normal or usual manner or any anomaly which results in system deviation.','text-field','USAF'),(5580,'masap-aircraft-system/equipment-malfunction','Oxygen/Safety Equipment','','','combo-box','USAF'),(5581,'masap-aircraft-system/equipment-malfunction','Pitch Instability','','','checkbox','USAF'),(5582,'masap-aircraft-system/equipment-malfunction','Rotor','','','checkbox','USAF'),(5583,'masap-aircraft-system/equipment-malfunction','Skid Malfunction','','','checkbox','USAF'),(5584,'masap-aircraft-system/equipment-malfunction','Uncommanded Control Inputs','','','checkbox','USAF'),(5585,'masap-aircraft-system/equipment-malfunction','Unresponsive Controls','','','checkbox','USAF'),(5586,'masap-aircraft-system/equipment-malfunction','Weapon Flight Profile Malfunction','','','checkbox','USAF'),(5587,'masap-aircraft-system/equipment-malfunction','Weapons Release Malfunction','','Issues associated with the transmission of power by incompressible fluids under pressure and hydraulic System components. ATA code 29-**','combo-box','USAF'),(5588,'masap-aircraft-system/equipment-malfunction','Windshield','','Issues associated with deficiencies in the windshield as: Cracked: Partial separation of material; Crazing: small fractures in aircraft windshields and windows caused from being exposed to the ultraviolet rays of the sun and temperature extremes; Failure: mechanical malfunction; Hazed: Milky appearance or fogged (not by moisture); overheated; Heat Damage: caused by environmental heat (summer); Leak: caused by the release of any substance as a result of a technical defect including fuel, oil, water, gas, hydraulic fluid or dangerous goods; Scratched: light narrow, shallow mark or marks caused by movement of a sharp object or particle across a surface, the material is displaced, not removed.; Shattered: splintered or fragmented condition.','combo-box','USAF'),(5589,'masap-air-crew-work-schedule-information','Alert Status','','','combo-box','USAF'),(5590,'masap-air-crew-work-schedule-information','Consecutive Days Flown','','','integer-field','USAF'),(5591,'masap-air-crew-work-schedule-information','Consecutive Days on Duty','','','integer-field','USAF'),(5592,'masap-air-crew-work-schedule-information','Date Time of Last Flight Duty Period Begin','','','date-time-field','USAF'),(5593,'masap-air-crew-work-schedule-information','Date Time of Last Flight Duty Period End','','','date-time-field','USAF'),(5594,'masap-air-crew-work-schedule-information','Flight Duty Period Begin','','','date-time-field','USAF'),(5595,'masap-air-crew-work-schedule-information','Flight Duty Period End','','','date-time-field','USAF'),(5596,'masap-air-crew-work-schedule-information','Flight Leg During Event','','','combo-box','USAF'),(5597,'masap-air-crew-work-schedule-information','Number of Alert Resets','','','combo-box','USAF'),(5598,'masap-air-crew-work-schedule-information','Total Hour Flown 24 Hours Before Last Crew Rest Start','','','combo-box','USAF'),(5599,'masap-airfield-mgr-employee-information','Augmented Crew','','','checkbox','USAF'),(5600,'masap-airfield-mgr-employee-information','Basic Crew','','','checkbox','USAF'),(5601,'masap-airfield-mgr-employee-information','Crew Duties At Time of Event','','','combo-box','USAF'),(5602,'masap-airfield-mgr-employee-information','Crew Position At Time of Event','','','combo-box','USAF'),(5603,'masap-airfield-mgr-employee-information','Experience (Total Years)','','Specifies the total number of years of experience for the flight crew employee in years.','real-field','USAF'),(5604,'masap-airfield-mgr-employee-information','Familiarity with Other Pilot','','','combo-box','USAF'),(5605,'masap-airfield-mgr-employee-information','Grade Code','','','combo-box','USAF'),(5606,'masap-airfield-mgr-employee-information','Hours Into Crew Duty Day','','','combo-box','USAF'),(5607,'masap-airfield-mgr-employee-information','Owning Wing','','','text-field','USAF'),(5608,'masap-airfield-mgr-employee-information','Pilot Duties At Time of Event','','','combo-box','USAF'),(5609,'masap-airfield-mgr-employee-information','RPA Crew Position At Time of Event','','','combo-box','Operator'),(5610,'masap-airfield-mgr-employee-information','Time in Type (Hours)','','','integer-field','USAF'),(5611,'masap-airfield-mgr-employee-information','Total Flight Time (Hours)','','The time that commences when an aircraft first moves under its own power for the purpose of flight and ends when the aircraft comes to rest after landing.','integer-field','USAF'),(5612,'masap-airfield-mgr-employee-information','Total Hours in Crew Position','','','combo-box','USAF'),(5613,'masap-airfield-mgr-employee-information','Total Hours in Last 90 days (Hours)','','','integer-field','USAF'),(5614,'masap-airfield-mgr-employee-information','Were You the PIC','','','combo-box','USAF'),(5615,'masap-airfield-mgr-employee-information','Wing Assigned To','','','combo-box','USAF'),(5616,'masap-airforce-instruction','AFI','','Occurrences and issues associated with any of the written material for the operation of the flight including the Flight Operations Manual (FOM), aircraft manuals, Minimum Equipment List (MEL), checklist placards, and the Quick Reference Handbook (QRH).?','checkbox','Operator'),(5617,'masap-airforce-instruction','Checklist','','Customer Service Manual','checkbox','Operator'),(5618,'masap-airforce-instruction','Flight Manual','','','checkbox','Operator'),(5619,'masap-airforce-instruction','Job Guide','','Dispatch Operations Manual (DOM)','checkbox','Operator'),(5620,'masap-airforce-instruction','MEL','','Information and instruction developed by the carrier that defines and governs Minimum Equipment List (MEL)/Configuration Deviation List (CDL) faults or defects found on an aircraft which do not need immediate action and can be deferred for repair at a later date. This deferred defect status is only given for a strictly limited period of time and rectification must take place before that time has elapsed. Refer to FAR 125.201: Inoperable instruments and equipment (http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/58CF936FD6E2A36186256959004E132E?OpenDocument&Highlight=125.201).','checkbox','Operator'),(5621,'masap-airforce-instruction','Technical Order','','Flight Crew Ops Manual/Aircraft Ops Manual','checkbox','Operator'),(5622,'masap-airport-facility-issues','Airport Complexity','','Wrong runway risk factor in which the complexity of an airport layout includes factors such as a high traffic volume, requiring an airplane to cross multiple runways to reach the departure runway, and complicated taxi instructions that involve the use of several taxiways.','checkbox','USAF'),(5623,'masap-airport-facility-issues','Airport Facility Issues','','Occurrences and issues involving airport design, service, or functionality issues.','checkbox','USAF'),(5624,'masap-airport-facility-issues','Airport/NAVAID Equipment Failure','','','checkbox','USAF'),(5625,'masap-airport-facility-issues','Approach/Landing System','','Ground equipment for visual and instrument approaches including automatic landings under All Weather Ops conditions. Example: Failure of the Approach or landing systems at the airport.','checkbox','USAF'),(5627,'masap-airport-facility-issues','Building/Structures/Surfaces Conditions','','','checkbox','USAF'),(5628,'masap-airport-facility-issues','Call for Release','','Call For Release (CFR)-Wherein the overlying Air Route Traffic Control Center (ARTCC) requires a terminal facility to initiate verbal coordination to secure ARTCC approval for release of a departure into the en route environment.','checkbox','USAF'),(5629,'masap-airport-facility-issues','Close Proximity of Multiple Runway Thresholds','','Wrong runway risk factor in which the analysis of the wrong runway events revealed that they usually took place in areas with multiple runway thresholds in close proximity. In some cases, multiple runway ends are in the same location.','checkbox','USAF'),(5630,'masap-airport-facility-issues','Construction','','','checkbox','USAF'),(5631,'masap-airport-facility-issues','Design','','','checkbox','USAF'),(5632,'masap-airport-facility-issues','Emergency Services','','Fixed and mobile equipment and services for operation under emergency situation.','checkbox','USAF'),(5633,'masap-airport-facility-issues','Groundskeeping','','','checkbox','USAF'),(5634,'masap-airport-facility-issues','Ground/Satellite Malfunction','','Failure of the ground/satellite at a facility to operate in the normal or usual manner or any anomaly which results in system deviation.','checkbox','USAF'),(5635,'masap-airport-facility-issues','High Terrain in Proximity to Airport','','','checkbox','USAF'),(5636,'masap-airport-facility-issues','Inaccurate/Confusing Airport Diagram','','Issues associated with airport diagrams being incorrect, not realistic with day-to-day operations, or provides information or guidance that is difficult to understand or follow.','checkbox','USAF'),(5637,'masap-airport-facility-issues','Inaccurate/Confusing Approach Plate','','Issues associated with approach plates being incorrect, not realistic with day-to-day operations, or provides information or guidance that is difficult to understand or follow.','checkbox','USAF'),(5638,'masap-airport-facility-issues','Inaccurate/Confusing Enroute Charts','','Issues associated with enroute charts being incorrect, not realistic with day-to-day operations, or provides information or guidance that is difficult to understand or follow.','checkbox','USAF'),(5639,'masap-airport-facility-issues','Joint Use Runway/Taxiway','','Wrong runway risk factor in which the wrong runway events, identified pilots. had a tendency to depart on the runway that they were taxiing on instead of turning onto the correct runway when a takeoff clearance was issued.','checkbox','USAF'),(5640,'masap-airport-facility-issues','Lighting/Illumination','','Various lighting aids that may be installed on an airport.','checkbox','USAF'),(5641,'masap-airport-facility-issues','Markings/Signage','','Structures, markings signs, and lights for aircraft guidance on the ground.','checkbox','USAF'),(5642,'masap-airport-facility-issues','More than 2 Taxiways Intersecting in One Area','','Wrong runway risk factor in which these areas often confuse pilots and present the opportunity to turn in an incorrect direction.','checkbox','USAF'),(5643,'masap-airport-facility-issues','Noise Abatement Issues','','Issues associated with the approach and take-off procedures to reduce the impact of ambient noise on persons on the ground or near an airport. Procedures developed by airport operators in cooperation with the FAA, and local community officials, to mitigate aircraft noise near airports.','checkbox','USAF'),(5644,'masap-airport-facility-issues','NOTAMs','','Notices to Airmen (NOTAM) ? a notice containing information (not known sufficiently in advance to publicize by other means) concerning the establishment, condition, or change in any component (facility, service, or procedure) of, or hazard in, the National Airspace System (NAS); the timely knowledge of which is essential to personnel concerned with flight operations.Refer to AC 150/5200-28C: Notices to Airmen (NOTAMS (http://www.faa.gov/airports_airtraffic/airports/resources/advisory_circulars/media/150-5200-28C/150_5200_28c.pdf).','checkbox','USAF'),(5645,'masap-airport-facility-issues','One Taxiway Leading to Multiple Runway Thresholds','','Wrong runway risk factor in which these areas present an opportunity for flight crew members to taxi the airplane onto the wrong runway. This is especially true when the airplane have to cross one or more runways on the same taxiway.','checkbox','USAF'),(5646,'masap-airport-facility-issues','Other Airport Facility Issues','','Description of additional factor(s), not listed, associated with issues associated with the airport facility.','text-field','USAF'),(5647,'masap-airport-facility-issues','Runway/Taxiway','','Runway-a defined rectangular area on a land airport prepared for the landing and takeoff run of aircraft along its length. Taxiway-the paved airport surfaces which allow aircraft to travel between runways and other airport locations such as the hangars or terminals.','combo-box','USAF'),(5648,'masap-airport-facility-issues','Short Runway (< 5,000 feet)','','Wrong runway risk factor in which wrong runway departures typically result in the airplane taking off without conflict because there is sufficient runway available. Part 139 Class I airports with runways less then 5,000 feet were identified to point out potential situations where the runway is too short for a large air carrier jet to safely takeoff.','checkbox','USAF'),(5649,'masap-airport-facility-issues','Short Taxi Distance','','Wrong runway risk factor in which a short distance between the terminal and the runway requires pilots to complete the same number of checklist items in a shorter time frame and can lead to flight crew rushing to complete their checklists or expedite their departure.','checkbox','USAF'),(5650,'masap-airport-facility-issues','Single Runway','','Wrong runway risk factor in which airports with a single runway layout present the opportunity for airplane to taking off in the wrong direction, especially when intersection departures are made.','checkbox','USAF'),(5651,'masap-airport-facility-issues','Snow Removal','','','checkbox','USAF'),(5652,'masap-airport-facility-issues','Special Airport Procedures','','','checkbox','USAF'),(5653,'masap-airport-facility-issues','Visual Illusions at Takeoff or Landing','','Various surface features and atmospheric conditions that can create illusions of incorrect height above and distance from the runway threshold. Refer to AIM Section 8-1-5b(3): Illusions Leading to Landing Errors (http://www.faa.gov/airports_airtraffic/air_traffic/publications/atpubs/aim/Chap8/aim0801.html).','checkbox','USAF'),(5655,'masap-airspace-deviation','Airspace Violation','','','combo-box','USAF'),(5656,'masap-airspace-deviation','Military Operations Area','','A military operations area (MOA) is airspace established outside Class A airspace to separate or segregate certain nonhazardous military activities from IFR Traffic and to identify for VFR traffic where these activities are conducted.','checkbox','USAF'),(5657,'masap-airspace-deviation','Other Airspace Deviation','','Description of additional factor(s), not listed, involving divergences from the provisions of a visual flight rules (VFR) or instrument flight rules (IFR) air traffic clearance.','text-field','USAF'),(5658,'masap-airspace-deviation','Restricted Airspace','','An airspace of defined dimensions, above the land areas or territorial waters of a State, within which the flight of aircraft is restricted in accordance with certain specified conditions.','checkbox','USAF'),(5659,'masap-airspace-deviation','RVSM','','Reduced Vertical Separation Minimums (RVSM) is the airspace where Air Traffic Control separates aircraft by a minimum of 1,000 feet vertically between flight level (FL) 290 and FL 410 inclusive. RVSM airspace is special qualification airspace; the operator and the aircraft used by the operator must be approved by the Administrator. Air traffic control notifies operators of RVSM by providing route planning information. Refer to AIM Section 6. Operational Policy/Procedures for Reduced Vertical Separation Minimum (RVSM) in the Domestic U.S., Alaska, Offshore Airspace and the San Juan FIR (http://www.faa.gov/airports_airtraffic/air_traffic/publications/atpubs/aim/Chap4/aim0406.html).','checkbox','USAF'),(5660,'masap-airspace-deviation','Warning Area','','A warning area is airspace of defined dimensions, extending from 3 nautical miles outward from the coast of the United States, that contains activity that may be hazardous to nonparticipating aircraft. The purpose of such warning areas is to warn nonparticipating pilots of the potential danger. A warning area may be located over domestic or international waters or both.','checkbox','USAF'),(5661,'masap-airworthiness/documentation-event','Aircraft Manuals/Checklists Missing','','Occurrences associated any of the written material for the operation of the flight including the FOM, aircraft manuals, MEL, checklist placards, and the Quick Reference Handbook (QRH) to fulfill the requirements specified in FAR Sec 121.137 (Distribution and Availability) and FAR Sec 121.141 (http://www.airweb.faa.gov/Regulatory_and_Guidance_Library%5CrgFAR.nsf/0/92C0A5E206F6E565852566EF006AE70A?OpenDocument) to carry the applicable aircraft manuals specified in FAR Sec 121.133 (http://www.airweb.faa.gov/Regulatory_and_Guidance_Library%5CrgFAR.nsf/0/179F1A91CC78182F852566EF006AE171?OpenDocument) that supply guidance of flight, ground operations, and management personnel in conducting its operations.','checkbox','USAF'),(5663,'masap-airworthiness/documentation-event','Airworthiness/Documentation Event','','Airworthiness/Documentation Event: Occurrences and issues involving the condition in which the aircraft conforms to its type certificated design including supplemental type certificates and field approved alterations. The aircraft must also be in a condition for safe flight as determined by annual, 100 hour, preflight, and any other required inspections. Also, issues associated official company paperwork or documents used to record flight specific information, e.g., Flight Release, Weather Package, Weight and Balance Form.','checkbox','USAF'),(5664,'masap-airworthiness/documentation-event','Departed without Logbook or Wrong Logbook','','','checkbox','USAF'),(5665,'masap-airworthiness/documentation-event','Departed with Wrong or Missing Dispatch/Flight Release','','The aircraft took off with incorrect or unavailable paperwork by which an air carrier ensures all activities required for safe dispatch and continuation of a flight to its destination. Refer to Sec. 121.689 (http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/71F65AFDE4568E12852566EF006DF4F3?OpenDocument&Highlight=121.687).','checkbox','USAF'),(5666,'masap-airworthiness/documentation-event','Departed with Wrong or Missing Maintenance Release','','','checkbox','USAF'),(5667,'masap-airworthiness/documentation-event','Incorrect/Missing Aircraft Documents','','','checkbox','USAF'),(5668,'masap-airworthiness/documentation-event','Logbook/CML-Entry Incomplete','','Official record used to document maintenance activity and airworthiness status on an aircraft. Example: Significant error by company personnel in the preparation, or the handling of the aircraft\'s maintenance logbook.','checkbox','USAF'),(5669,'masap-airworthiness/documentation-event','Logbook Item Open or Not Closed Correctly','','Significant error by company personnel in the preparation, or the handling of the aircraft\'s maintenance logbook.','checkbox','USAF'),(5670,'masap-airworthiness/documentation-event','Maintenance Inspection Not Completed','','','checkbox','USAF'),(5671,'masap-airworthiness/documentation-event','Maintenance Testing','','Issues associated with maintenance operating an aircraft system, subsystem, component, or part under specified conditions, observing or recording the results, and making an evaluation of some aspect of the system.','checkbox','USAF'),(5672,'masap-airworthiness/documentation-event','MEL','','Airworthiness issues associated official company paperwork or documents used to record flight specific information, e.g., Flight Release, Weather Package, Weight and Balance Form. Minimum Equipment List (MEL)/Configuration Deviation List (CDL) faults or defects found on an aircraft which do not need immediate action and can be deferred for repair at a later date. This deferred defect status is only given for a strictly limited period of time and rectification must take place before that time has elapsed. Refer to FAR 125.201: Inoperable instruments and equipment (http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/58CF936FD6E2A36186256959004E132E?OpenDocument&Highlight=125.201).','checkbox','USAF'),(5673,'masap-airworthiness/documentation-event','MEL/CDL-Incorrect Application','','Ambiguity, erroneous, or lack of written description for the use of policies, processes, procedures, objectives, requirements, authorities, responsibilities, or work instructions related t Minimum Equipment List (MEL)/Configuration Deviation List (CDL) Refer to FAR 125.201: Inoperable instruments and equipment (http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/58CF936FD6E2A36186256959004E132E?OpenDocument&Highlight=125.201).','checkbox','USAF'),(5674,'masap-airworthiness/documentation-event','MEL-Non Compliance','','Indicates non fulfillment of Minimum Equipment List (MEL) requirements, including noncompliance with Federal regulations, company requirements, operator developed risk controls, and/or operator specified policies and procedures. Refer to AC 120-92: Introduction to Safety Management Systems for Air Operators) (http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgAdvisoryCircular.nsf/0/6485143d5ec81aae8625719b0055c9e5/$FILE/AC%20120-92.pdf).','checkbox','USAF'),(5675,'masap-airworthiness/documentation-event','Other Airworthiness/Documentation Event','','Description of additional factor(s), not listed, involving the official company paperwork or documents used to record flight specific information, e.g., Flight Release, Weather Package, Weight and Balance Form.','text-field','USAF'),(5676,'masap-airworthiness/documentation-event','Preflight Not Completed or Incorrect','','','checkbox','USAF'),(5677,'masap-airworthiness/documentation-event','Preflight/Postflight Inspection Inadequate','','Deficiencies in the preflight or post flight inspection by which a pilot determines if the aircraft is airworthy and in condition for safe operation.','checkbox','USAF'),(5678,'masap-airworthiness/documentation-event','Weight and Balance Documentation Issue','','Issues associated with the form completed by pilots determining the weight and balance of the aircraft and its load.','checkbox','USAF'),(5679,'masap-altitude-deviation','Aircraft at Improper Altitude','','Except when necessary for takeoff or landing, no person may operate an aircraft below the following altitudes: (a) Anywhere. An altitude allowing, if a power unit fails, an emergency landing without undue hazard to persons or property on the surface; (b) Over congested areas. Over any congested area of a city, town, or settlement, or over any open air assembly of persons, an altitude of 1,000 feet above the highest obstacle within a horizontal radius of 2,000 feet of the aircraft; (c) Over other than congested areas. An altitude of 500 feet above the surface, except over open water or sparsely populated areas. In those cases, the aircraft may not be operated closer than 500 feet to any person, vessel, vehicle, or structure. Refer to FAR 91.119: Minimum Safe Altitudes (http://www.airweb.faa.gov/Regulatory_and_Guidance_Library%5CrgFAR.nsf/0/78096E016AFA36F8852566CF006150B1?OpenDocument).','checkbox','USAF'),(5680,'masap-altitude-deviation','Altitude (Ft) MSL','','Specification of the height of a level, point, or object measured in feet Above Ground Level (AGL) at which the deviation occurred.','integer-field','USAF'),(5681,'masap-altitude-deviation','Altitude Deviation','','Divergences of an aircraft from assigned flight level/altitude by 300 feet or more as observed on a verified (reading correctly) automatic altitude readout (Mode C).','checkbox','USAF'),(5682,'masap-altitude-deviation','Amount of Altitude Deviation (Ft)','','The amount of the divergence (in feet) of an aircraft from the assigned flight level/altitude by 300 feet or more as observed on a verified (reading correctly) automatic altitude readout (Mode C).','integer-field','USAF'),(5683,'masap-altitude-deviation','Assigned Flight Level (FL)','','The aircraft flight level at the time of the occurrence. A level of constant atmospheric pressure related to a reference datum of 29.92 inches of mercury. Each is stated in three digits that represent hundreds of feet. For example, flight level 250 represents a barometric altimeter indication of 25,000 feet; flight level 255, an indication of 25,500 feet.','integer-field','USAF'),(5684,'masap-altitude-deviation','Crossing Restriction Not Met','','Issues associated with compliancy with the point at which an aircraft should be at a certain lateral location and altitude','checkbox','USAF'),(5685,'masap-altitude-deviation','Excursion From Assigned Altitude','','An altitude deviation in which the aircraft levels off at the assigned altitude but later deviates from the assigned altitude without clearance.','checkbox','USAF'),(5686,'masap-altitude-deviation','Other Altitude Deviation','','Description of additional factor(s), not listed, associated with the altitude deviation incident or event.','text-field','USAF'),(5687,'masap-altitude-deviation','Overshoot','','An altitude deviation in which the aircraft levels off after reaching the assigned altitude. Normal bracketing corrections occasionally involve momentary overshoots made necessary by atmospheric conditions. Such overshoots are acceptable. Frequent or sustained overshoots caused by poor pilot technique are not normal bracketing corrections. Refer to AC 120-71A: Standard Operating Procedures for Flight Deck Crewmembers (http://rgl.faa.gov/Regulatory_and_Guidance_Library/rgAdvisoryCircular.nsf/0/b173ba8a295764f086256cde006a44ad/$FILE/AC120-71A.pdf).','checkbox','USAF'),(5688,'masap-altitude-deviation','Undershoot','','An altitude deviation in which the aircraft levels off before reaching the assigned altitude.','checkbox','USAF'),(5689,'masap-approach/landing-event','Approach/Landing Event','','For Instrument Flight Rules (IFR), occurrences during the period from the Initial Approach Fix (IAF) to the beginning of the landing flare. For Visual Flight Rules (VFR), occurrences during the period from the point of VFR pattern entry, or 1000 feet above the runway elevation, to the beginning of the landing flare.','checkbox','USAF'),(5691,'masap-approach/landing-event','Go Around','','','checkbox','USAF'),(5692,'masap-approach/landing-event','IMC Missed Approach','','','checkbox','USAF'),(5693,'masap-approach/landing-event','Incorrect Approach to Uncontrolled Airport','','','checkbox','USAF'),(5694,'masap-approach/landing-event','Misconfiguration','','','checkbox','USAF'),(5695,'masap-approach/landing-event','Nose First Landing','','','checkbox','Operator'),(5696,'masap-approach/landing-event','Other Approach/Arrival Events','','Description of additional factor(s), not listed, associated with approach and arrival incident or event.','text-field','USAF'),(5697,'masap-approach/landing-event','Overshoot','','An altitude deviation in which the aircraft levels off after reaching the assigned altitude.','checkbox','USAF'),(5698,'masap-approach/landing-event','Undershoot','','An altitude deviation in which the aircraft levels off before reaching the assigned altitude.','checkbox','USAF'),(5699,'masap-approach/landing-event','Unstable Approach','','','checkbox','USAF'),(5700,'masap-approach/landing-event','Wrong Airport','','Aircraft approaches and/or lands at the wrong airport.','checkbox','USAF'),(5701,'masap-approach/landing-event','Wrong Arrival/STAR','','','checkbox','USAF'),(5702,'masap-approach/landing-event','Wrong Runway','','Aircraft approaches and/or lands at the wrong runway at an airport.','checkbox','USAF'),(5703,'masap-approach-type','CAT II','','','checkbox','USAF'),(5704,'masap-approach-type','Circling','','','checkbox','USAF'),(5705,'masap-approach-type','Emergency Landing Pattern/SFO','','','checkbox','USAF'),(5706,'masap-approach-type','GPS Approach','','','checkbox','USAF'),(5707,'masap-approach-type','Non-Precision','','','checkbox','USAF'),(5708,'masap-approach-type','Other Approch Type','','','text-field','USAF'),(5709,'masap-approach-type','Overhead','','','checkbox','Operator'),(5710,'masap-approach-type','Precision','','','checkbox','USAF'),(5711,'masap-approach-type','Tactical','','','checkbox','Operator'),(5712,'masap-approach-type','Transition to Visual','','','checkbox','USAF'),(5713,'masap-atc-complications/errors','ATC Complications/Errors','','Issues associated with a human action (or human behavior) that unintentionally deviates from the expected action (or behavior) or fails to achieve what should be done related to interfaces with Air Traffic Control systems or ATC personnel duties/responsibilities, including clearances, communication, congestion, handling, wake turbulence.','checkbox','USAF'),(5714,'masap-atc-complications/errors','Handling Error','','Issues associated with a human action (or human behavior) that unintentionally deviates from the expected action (or behavior) or fails to achieve what should be done related to ATC management or communication, navigation, or surveillance service issues, including ATC facility/personnel failure/degradation.','checkbox','USAF'),(5715,'masap-atc-complications/errors','Air Traffic Congestion','','A condition that occurs when demand on air traffic exceeds the capacity of the system.','checkbox','USAF'),(5716,'masap-atc-complications/errors','Conflicting ATC Clearance','','The resolution of potential conflictions between aircraft that are radar identified and in communication with ATC by ensuring that radar targets do not touch. Pertinent traffic advisories shall be issued when this procedure is applied.','checkbox','USAF'),(5717,'masap-atc-complications/errors','Expected vs. Assigned ATC Clearance','','ATC clearance received was different than what was anticipated','checkbox','USAF'),(5718,'masap-atc-complications/errors','Frequency Change','','','checkbox','USAF'),(5719,'masap-atc-complications/errors','Frequency Congestion','','Heavy voice traffic on radio frequency','checkbox','USAF'),(5720,'masap-atc-complications/errors','Incorrect ATC Clearance','','Two or more ATC clearances that provided inaccurate guidance, instructions, or information regarding the same operation.','checkbox','USAF'),(5721,'masap-atc-complications/errors','Late ATC Clearance','','ATC did not provide guidance or information in a timely manner','checkbox','USAF'),(5722,'masap-atc-complications/errors','Lost Communication','','Loss of the ability to communicate by radio. Aircraft are sometimes referred to as NORDO (No Radio). Standard pilot procedures are specified in 14 CFR Part 91. Radar controllers issue procedures for pilots to follow in the event of lost communications during a radar approach when weather reports indicate that an aircraft will likely encounter IFR weather conditions during the approach.','checkbox','USAF'),(5723,'masap-atc-complications/errors','Other ATC Complications/Errors','','Description of additional factor(s), not listed, associated with ATC complications and errors.','text-field','USAF'),(5724,'masap-atc-complications/errors','Pre-Departure Clearance','','Pre-Departure Clearance (PDC)-An authorization by ATC for an aircraft to proceed under specified traffic conditions within controlled airspace. An application with the Terminal Data Link System (TDLS) that provides clearance information to subscribers, through a service provider, in text to the cockpit or gate printer.','checkbox','USAF'),(5725,'masap-atc-complications/errors','Radio Congestion','','','checkbox','USAF'),(5726,'masap-atc-complications/errors','Shift Change','','','checkbox','USAF'),(5727,'masap-atc-complications/errors','Similar Call Signs','','Events in which two or more call signs are confused because they sound very nearly alike when transmitted over a radio.','checkbox','USAF'),(5728,'masap-atc-complications/errors','TCAS RA/TA','','Indicates whether a TCAS Resolution Advisory (RA) or TCAS Traffic Advisory (TA) was generated. A RA is an aural voice and display information provided by TCAS II to a flight crew, advising that a particular maneuver should, or should not, be performed to attain or maintain minimum safe vertical separation from an intruder (AC 20-151). A TA is an aural voice and display information from TCAS II to a flight crew, identifying the location of nearby traffic meeting certain minimum separation criteria. Refer to FAAO 7110.65 Section 2: Vertical Separation (http://www.faa.gov/airports_airtraffic/air_traffic/publications/atpubs/ATC/Chp7/atc0702.html)','checkbox','USAF'),(5729,'masap-atc-complications/errors','Unclear ATC Clearance','','Ambiguous ATC clearances and instructions containing altitude assignments or vector.','checkbox','USAF'),(5730,'masap-atc-complications/errors','Wake Turbulence','','Wingtip vortices that are created when an airplane generates lift. When an airplane generates lift, air spills over the wingtips from the high pressure areas below the wings to the low pressure areas above them. This flow causes rapidly rotating whirlpools of air called wingtip vortices or wake turbulence. The term includes vortices, thrust stream turbulence, jet blast, jet wash, propeller wash, and rotor wash both on the ground and in the air.','checkbox','USAF'),(5731,'masap-atc-controller-employee-information','Augmented Crew','','','checkbox','USAF'),(5732,'masap-atc-controller-employee-information','Basic Crew','','','checkbox','USAF'),(5733,'masap-atc-controller-employee-information','Crew Duties At Time of Event','','','combo-box','USAF'),(5734,'masap-atc-controller-employee-information','Crew Position At Time of Event','','','combo-box','USAF'),(5735,'masap-atc-controller-employee-information','Experience (Total Years)','','Specifies the total number of years of experience for the flight crew employee in years.','real-field','USAF'),(5736,'masap-atc-controller-employee-information','Familiarity with Other Pilot','','','combo-box','USAF'),(5737,'masap-atc-controller-employee-information','Grade Code','','','combo-box','USAF'),(5738,'masap-atc-controller-employee-information','Hours Into Crew Duty Day','','','combo-box','USAF'),(5739,'masap-atc-controller-employee-information','Owning Wing','','','text-field','USAF'),(5740,'masap-atc-controller-employee-information','Pilot Duties At Time of Event','','','combo-box','USAF'),(5741,'masap-atc-controller-employee-information','RPA Crew Position At Time of Event','','','combo-box','Operator'),(5742,'masap-atc-controller-employee-information','Time in Type (Hours)','','','integer-field','USAF'),(5743,'masap-atc-controller-employee-information','Total Flight Time (Hours)','','The time that commences when an aircraft first moves under its own power for the purpose of flight and ends when the aircraft comes to rest after landing.','integer-field','USAF'),(5744,'masap-atc-controller-employee-information','Total Hours in Crew Position','','','combo-box','USAF'),(5745,'masap-atc-controller-employee-information','Total Hours in Last 90 days (Hours)','','','integer-field','USAF'),(5746,'masap-atc-controller-employee-information','Were You the PIC','','','combo-box','USAF'),(5747,'masap-atc-controller-employee-information','Wing Assigned To','','','combo-box','USAF'),(5748,'masap-atc-information','ATC','','Type of ATC facility','checkbox','USAF'),(5749,'masap-atc-information','ATC Control','','','combo-box','USAF'),(5750,'masap-atc-information','ATC Control Type','','','combo-box','Operator'),(5751,'masap-atc-information','Name of ATC Facility','','Name of ATC facility','text-field','USAF'),(5752,'masap-atc-information','Controlling Authority','','','combo-box','Operator'),(5753,'masap-automation-management/configuration','Automation Management/Configuration','','Issues associated with the use of onboard equipment designed to relieve the pilot of the constant need to manually control the aircraft attitude, altitude and heading and/or airspeed.','checkbox','USAF'),(5755,'masap-automation-management/configuration','FMC/CDU','','','checkbox','USAF'),(5756,'masap-automation-management/configuration','Improper Use or Confusion with Automation/Autoflight/Mode','','','checkbox','USAF'),(5757,'masap-automation-management/configuration','Monitoring','','','checkbox','USAF'),(5758,'masap-automation-management/configuration','Other Automation Management/Configuration','','Description of additional factor(s), not listed, associated with automation management/configuration.','text-field','USAF'),(5759,'masap-automation-management/configuration','Verification of Automation Settings','','','checkbox','USAF'),(5760,'masap-avionics','ACARS','','Aircraft Communications Addressing and Reporting System. ACARS is a VHF air/ground data link that uses nearly 600 VHF frequency locations throughout North and Central America, Hawaii, the Caribbean, and several U.S. territories. It relays Aircraft Operational Control (AOC), Airline Administrative Control (AAC), and Air Traffic Control (ATC) messages between ground-based organizations and the cockpit.','combo-box','Operator'),(5761,'masap-avionics','Autopilot','','Autopilot is the automation system that controls aircraft attitude, altitude and heading and keeps an aircraft in level flight or on a set course. Automatic pilots can be directed by the pilot, or they may be coupled to a radio navigation signal. (ATA Code 22-10), Part 23.1329: Autopilot (http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/BDEC6530B3BFFE6F8525668700724671?OpenDocument&Highlight=23.1329)','combo-box','Operator'),(5762,'masap-avionics','Avionics','','The computers and other electronic systems that monitor and control an aircraft\'s electrical and mechanical systems such as communications, autopilots, and navigation, including the various computers themselves, plus items such as interfaces, display generators, sensors, signal distributors, etc.','checkbox','Operator'),(5763,'masap-avionics','Company Radio Net','','Cactus net is basically the radio communication system used between pilots & dispatchers.','combo-box','Operator'),(5764,'masap-avionics','Communication Radio','','','combo-box','Operator'),(5765,'masap-avionics','FMS','','Flight Management System (FMS) is a navigation computer combining a navaid /airport database and integrating various navigation sensors (i.e., GPS, IRS, VOR, ILS, etc.). An aircraft area navigation (RNAV) system and associated displays and input/output devices(s) having complex multiwaypoint lateral (LNAV) and vertical (VNAV) capability (or equivalent), data entry capability, data base memory to store route and instrument flight procedure information, and display readout of NAV parameters. The flight management system (FMS) provides guidance commands to the FGS for the purpose of automatic navigation and speed control when the FGS is engaged in an appropriate mode or modes (for example, VNAV, LNAV, RNAV). Refer to ATA Codes 34-60 (Hardware) and 34-61 (Software) and AIM Chapter 1-2-1: Area Navigation (RNAV) (http://www.faa.gov/airports_airtraffic/air_traffic/publications/atpubs/aim/Chap2/aim0201.html#2-1-1).','combo-box','Operator'),(5766,'masap-avionics','GPWS','','Ground Proximity Warning System (GPWS) is a system on board the aircraft that provided warnings of: excessive descent rate; excessive terrain closure rate; excessive altitude loss after take-off or go-around; unsafe terrain clearance while not in landing configuration, i.e., gear not locked down or flaps not in a landing position; and excessive descent below the instrument glide path. (warns of inadequate separation from ground and excessive sink rate close to ground). Refer to FAR 121.360: Ground proximity warning-glide slope deviation alerting system (http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/C45DB475D77EFC1B862568C80064DDF6?OpenDocument&Highlight=121.360).','combo-box','Operator'),(5767,'masap-avionics','Inertial Reference System','','Navigational system that uses gyroscopes to provide attitude and heading information to the flight crew. ATA code 34-45.','combo-box','Operator'),(5768,'masap-avionics','Navigation Radio','','','combo-box','Operator'),(5769,'masap-avionics','Other Avionics','','Description of additional factor(s), not listed, associated with avionics.','text-field','Operator'),(5770,'masap-avionics','PFD/ND','','','combo-box','Operator'),(5771,'masap-avionics','Radar Altimeter','','Aircraft equipment which makes use of the reflection of radio waves from the ground to determine the height of the aircraft above the surface.','combo-box','Operator'),(5772,'masap-avionics','Switch Positions','','','combo-box','Operator'),(5773,'masap-avionics','TCAS','','Traffic Alert And Collision Avoidance System (TCAS)-An airborne collision avoidance system based on radar beacon signals which operates independent of ground-based equipment. TCAS-I generates traffic advisories only. TCAS-II generates traffic advisories, and resolution (collision avoidance) advisories in the vertical plane.','combo-box','Operator'),(5774,'masap-avionics','Weather Radar','','Flight deck located weather radar. ATA code 34-42','combo-box','Operator'),(5775,'masap-bomber-flight-crew-employee-information','Crew Position At Time of Event','','','combo-box','USAF'),(5776,'masap-bomber-flight-information','Bomber Phase of Flight','','','combo-box','USAF'),(5777,'masap-bomber-maintenance-employee-information','Primary Duties During Time of Event','','','combo-box','USAF'),(5778,'masap-command-and-control-issues','618th TACC Issues','','','checkbox','USAF'),(5779,'masap-command-and-control-issues','Aircrew Weapons Issues','','','checkbox','USAF'),(5780,'masap-command-and-control-issues','Command/Control Base Issues','','','text-field','USAF'),(5781,'masap-command-and-control-issues','Command-Post-Staff','','','checkbox','USAF'),(5782,'masap-command-and-control-issues','Flight Kitchen Issues','','','checkbox','USAF'),(5783,'masap-command-and-control-issues','Flight Plan Delays','','','checkbox','USAF'),(5784,'masap-command-and-control-issues','Inadequate Crew Rest','','','checkbox','USAF'),(5785,'masap-command-and-control-issues','Other Command Post Issues','','','text-field','USAF'),(5786,'masap-command-and-control-issues','Passenger Issues','','','checkbox','USAF'),(5787,'masap-command-and-control-issues','PAX-Service-Issues','','','checkbox','USAF'),(5788,'masap-command-and-control-issues','Required Ramp Fuel Load Issues','','','checkbox','USAF'),(5789,'masap-comm-between-aircrew-and-release-authority','Communication Error','','','checkbox','USAF'),(5790,'masap-comm-between-aircrew-and-release-authority','Ground Control','','','checkbox','USAF'),(5791,'masap-comm-between-aircrew-and-release-authority','Hearback/ Readback','','','checkbox','USAF'),(5792,'masap-comm-between-aircrew-and-release-authority','Language Difficulty','','','checkbox','USAF'),(5793,'masap-comm-between-aircrew-and-release-authority','Other Communication Between Aircrew and Release Authority','','','text-field','USAF'),(5794,'masap-comm-between-aircrew-and-release-authority','Phraseology','','','checkbox','USAF'),(5795,'masap-comm-between-aircrew-and-release-authority','Radio-Equipment','','','checkbox','USAF'),(5796,'masap-comm-between-aircrew-and-release-authority','Radio-Equipment Details','','','text-field','USAF'),(5797,'masap-comm-between-aircrew-and-release-authority','Range Control','','','checkbox','USAF'),(5798,'masap-comm-between-crews-during-changeover','Aircraft Malfunction','','','checkbox','Operator'),(5799,'masap-comm-between-crews-during-changeover','Clearances','','','checkbox','Operator'),(5800,'masap-comm-between-crews-during-changeover','Emergency Mission','','','checkbox','Operator'),(5801,'masap-comm-between-crews-during-changeover','Mission Changeover Brief','','','checkbox','Operator'),(5802,'masap-comm-between-crews-during-changeover','Omission','','','checkbox','Operator'),(5803,'masap-comm-between-crews-during-changeover','Other Comm Between Crews During Changeover','','','text-field','USAF'),(5804,'masap-comm-between-pilots-and-command-authority','Aircraft Routing','','','checkbox','USAF'),(5805,'masap-comm-between-pilots-and-command-authority','Amended Release Time','','','checkbox','USAF'),(5806,'masap-comm-between-pilots-and-command-authority','Application/Removal MEL/CDL','','Indicates discussions between dispatchers and pilots related to the inclusion/exclusion of Minimum Equipment List (MEL)/Configuration Deviation List (CDL) items.','checkbox','USAF'),(5807,'masap-comm-between-pilots-and-command-authority','Communications: Dispatch and Pilots','','Includes internal and external influences on interpersonal communications. External factors include job title, corporate complexity, age, experience, gender, organizational culture, education, etc. Internal factors include speaking skills, listening skills, decisionmaking skills, conflict resolution techniques, and the use of appropriate assertiveness and advocacy. All training activities involving pilots, flight attendants, aircraft dispatchers, and aircraft mechanics should stress the importance of clear and unambiguous communication. Refer to AC 121-32A: Dispatch Resource Management Training (http://rgl.faa.gov/Regulatory_and_Guidance_Library/rgAdvisoryCircular.nsf/0/876cc3ef90dd8bac862570c00078c818/$FILE/AC%20121-32a.pdf)','checkbox','USAF'),(5808,'masap-comm-between-pilots-and-command-authority','Difficult/Lost Communications','','Loss of the ability to communicate by radio.','checkbox','USAF'),(5809,'masap-comm-between-pilots-and-command-authority','Early Departure Coordination','','','checkbox','USAF'),(5810,'masap-comm-between-pilots-and-command-authority','Failed Communications','','','checkbox','USAF'),(5811,'masap-comm-between-pilots-and-command-authority','Field Conditions','','','checkbox','USAF'),(5812,'masap-comm-between-pilots-and-command-authority','Flight Plan','','','checkbox','USAF'),(5813,'masap-comm-between-pilots-and-command-authority','Fuel Supply','','The fuel load on board meets the requirements of the dispatch release and is adequate for the route of flight.','checkbox','USAF'),(5814,'masap-comm-between-pilots-and-command-authority','HF Radio','','','checkbox','USAF'),(5816,'masap-comm-between-pilots-and-command-authority','mIRC Chat','','','checkbox','Operator'),(5817,'masap-comm-between-pilots-and-command-authority','NOTAMs','','Notices to Airmen (NOTAM) ? a notice containing information (not known sufficiently in advance to publicize by other means) concerning the establishment, condition, or change in any component (facility, service, or procedure) of, or hazard in, the National Airspace System (NAS); the timely knowledge of which is essential to personnel concerned with flight operations.Refer to AC 150/5200-28C: Notices to Airmen (NOTAMS (http://www.faa.gov/airports_airtraffic/airports/resources/advisory_circulars/media/150-5200-28C/150_5200_28c.pdf).','checkbox','USAF'),(5818,'masap-comm-between-pilots-and-command-authority','Organizational Pressure on aircrew','','','checkbox','USAF'),(5819,'masap-comm-between-pilots-and-command-authority','Other Communication Dispatch to Pilots','','Description of additional factor(s), not listed, associated with communications between dispatch and pilots.','text-field','USAF'),(5820,'masap-comm-between-pilots-and-command-authority','SATCOM','','','checkbox','USAF'),(5821,'masap-comm-between-pilots-and-command-authority','SkyNet','','','checkbox','Operator'),(5822,'masap-comm-between-pilots-and-command-authority','SOF/ FDO','','','checkbox','Operator'),(5824,'masap-communication-between-aircrew','Communication Error','','The failure to send and receive a message with the intent of the sender during communication between pilots.','checkbox','USAF'),(5825,'masap-communication-between-aircrew','Communication Pilot-to-Pilot','','','checkbox','USAF'),(5826,'masap-communication-between-aircrew','CRM Breakdown','','','checkbox','USAF'),(5827,'masap-communication-between-aircrew','Failure to Verbalize, Verify and Monitor Automation Control Inputs','','','checkbox','USAF'),(5829,'masap-communication-between-aircrew','Lack of Communication','','Deficiencies in the verbal methods by which information is exchanged between flight crew members in the cockpit environment through a common system of symbols, signs, or behaviors.','checkbox','USAF'),(5830,'masap-communication-between-aircrew','Other Aircrew Communication','','Description of additional factor(s), not listed, associated with communications between pilots.','text-field','USAF'),(5831,'masap-communication-between-aircrew','Other Communication: Flight Attendant and Pilots','','between flight attendants and pilots.','text-field','USAF'),(5832,'masap-communication-between-aircrew','Other Communication Between Aircrew','','','text-field','USAF'),(5833,'masap-communication-between-aircrew','Sharing/Encouraging/Acknowledging Input','','','checkbox','USAF'),(5834,'masap-communication-between-aircrew','Sterile Cockpit Violation','','http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/DD19266CEBDAC9DB852566EF006D346F?OpenDocument&Highlight=121.542','checkbox','USAF'),(5835,'masap-communication-between-aircrew','VIP/Customer Pressure on Aircrew','','','checkbox','USAF'),(5836,'masap-communication-maintenance','Aircraft Communications','','This include radios and intercomm','checkbox','USAF'),(5837,'masap-communication-maintenance','Between Crew Chief/Lead Mechanic and Supervision','','Transfer of information (written, verbal, or non-verbal) between Crew Chief Mechanic, Lead Mechanic, and Supervisory maintenance personnel so that the meaning or information may be interpreted without error.','checkbox','MEDA Rev g.'),(5838,'masap-communication-maintenance','Between Departments','','Transfer of information (written, verbal, or non-verbal) between personnel in various departments so that the meaning or information may be interpreted without error.','checkbox','MEDA Rev g.'),(5839,'masap-communication-maintenance','Between Maintenance and Flight Crew','','','checkbox','USAF'),(5840,'masap-communication-maintenance','Between Maintencance and MOC','','','checkbox','USAF'),(5841,'masap-communication-maintenance','Between Maintenance and Ops','','','checkbox','USAF'),(5842,'masap-communication-maintenance','Between Maintenance Crew and Crew Chief','','Transfer of information (written, verbal, or non-verbal) between maintenance crew and Crew Chief so that the meaning or information may be interpreted without error.','checkbox','MEDA Rev g.'),(5843,'masap-communication-maintenance','Between Maintenance Crew and MCC/MOC','','Transfer of information (written, verbal, or non-verbal) between crew and MCC/MOC so that the meaning or information may be interpreted without error.','checkbox','MEDA Rev g.'),(5844,'masap-communication-maintenance','Between Maintenance and Ramp','','Transfer of information (written, verbal, or non-verbal) between maintenance and ramp personnel so that the meaning or information may be interpreted without error.','checkbox','MEDA Rev g.'),(5845,'masap-communication-maintenance','between Mechanic, Expeditor, Pro Super','','','checkbox','USAF'),(5846,'masap-communication-maintenance','Between Mechanics','','Transfer of information (written, verbal, or non-verbal) between mechanics so that the meaning or information may be interpreted without error.','checkbox','MEDA Rev g.'),(5847,'masap-communication-maintenance','Between Shifts (Turnover)','','Factors related to the interface between employees related to changeovers of personnel, particularly to ensure that all necessary information is communicated between the out-going and in-coming personnel.','checkbox','MEDA Rev g.'),(5848,'masap-communication-maintenance','Between Staff','','Transfer of information (written, verbal, or non-verbal) between staff members so that the meaning or information may be interpreted without error.','checkbox','REDA'),(5849,'masap-communication-maintenance','Briefings','','Maintenance employees should provide shift turnover briefings and operational briefings to coworkers. Briefings should be clear and concise, using standard terminology. Briefings should reaffirm established policies and procedures.','checkbox','ASRS'),(5850,'masap-communication-maintenance','Communication: Between Maintenance','','Transfer of information (written, verbal, or non-verbal) between personnel so that the meaning or information may be interpreted without error.','checkbox','MEDA Rev g.'),(5851,'masap-communication-maintenance','Communication Error','','The failure to send and receive a message with the intent of the sender during communication between maintenance employees.','checkbox','Operator'),(5852,'masap-communication-maintenance','Difficult/Lost Communication','','Loss of the ability to communicate.','checkbox','Operator'),(5853,'masap-communication-maintenance','Lack of Communication','','Deficiencies in the verbal, written, or a combination of the two methods by which information is exchanged between individuals through a common system of symbols, signs, or behaviors.','checkbox','Operator'),(5854,'masap-communication-maintenance','No/Incorrect Turnover-Flight Crews','','Lack of or improper changeovers of personnel, usually associated with inadequate communication between the two individuals or teams.','checkbox','Operator'),(5855,'masap-communication-maintenance','No/Incorrect Turnover-MCC','','Lack of or improper changeovers of personnel, usually associated with inadequate communication between the two individuals or teams,','checkbox','Operator'),(5856,'masap-communication-maintenance','No/Incorrect Turnover-Staff','','Lack of or improper changeovers of personnel, usually associated with inadequate communication between the two individuals or teams.','checkbox','Operator'),(5857,'masap-communication-maintenance','Non Aircraft Communication','','This would include any means of communication not supported by the aircraft ie hand held or truck radios','checkbox','USAF'),(5858,'masap-communication-maintenance','Other','','','text-field','USAF'),(5859,'masap-communication-maintenance','Other Communication: Between Maintenance','','between maintenance personnel.','text-field','MEDA Rev g.'),(5860,'masap-communication-maintenance-operations','Communication: Maintenance and Operations','','','checkbox','Operator'),(5861,'masap-communication-maintenance-operations','Company Operations','','','checkbox','REDA'),(5862,'masap-communication-maintenance-operations','Difficult/Lost Communications','','Loss of the ability to communicate.','checkbox','Operator'),(5863,'masap-communication-maintenance-operations','Ground Crew','','','checkbox','REDA'),(5864,'masap-communication-maintenance-operations','Lack of Communication','','Deficiencies in the verbal, written, or a combination of the two methods by which information is exchanged between individuals through a common system of symbols, signs, or behaviors.','checkbox','Operator'),(5865,'masap-communication-maintenance-operations','Other Communication: Maintenance and Operations','','Description of additional factor(s), not listed, associated with the incident or event.','text-field','REDA'),(5866,'masap-communication-maintenance-operations','Ramp Control','','','checkbox','REDA'),(5867,'masap-communication-pilot-to-atc','Communication Pilot-to-ATC','','SOPs should state who (PF, PM, FE/SO) handles the radios for each phase of flight, as follows: PF makes input to aircraft/autopilot and/or verbally states clearances while PM confirms input is what he/she read back to ATC. Any confusion in the flight deck is immediately cleared up by requesting ATC confirmation. If any crewmember is off the flight deck, all ATC instructions are briefed upon his/her return. Or if any crewmember is off the flight deck all ATC instructions are written down until his/her return and then passed to that crewmember upon return. Similarly, if a crewmember is off ATC frequency (e.g., when making a PA announcement or when talking on company frequency), all ATC instructions are briefed upon his/her return. Refer to AC 120-71A: Standard Operating Procedures for Flight Deck Crewmembers (http://rgl.faa.gov/Regulatory_and_Guidance_Library/rgAdvisoryCircular.nsf/0/b173ba8a295764f086256cde006a44ad/$FILE/AC120-71A.pdf).','checkbox','USAF'),(5868,'masap-communication-pilot-to-atc','Confusing Instructions','','','checkbox','USAF'),(5870,'masap-communication-pilot-to-atc','Interpretation of ATC Instructions','','','checkbox','USAF'),(5871,'masap-communication-pilot-to-atc','Lack of Communication','','Deficiencies in the verbal, written, or a combination of the two methods by which information is exchanged between the flight crews and ATC through a common system of symbols, signs, or behaviors.','checkbox','USAF'),(5872,'masap-communication-pilot-to-atc','Language Difficulty','','Misunderstandings involving people who speak different languages (or even different dialects).','checkbox','USAF'),(5873,'masap-communication-pilot-to-atc','Missed ATC Call','','','checkbox','USAF'),(5874,'masap-communication-pilot-to-atc','Omission of ATC Call','','','checkbox','USAF'),(5875,'masap-communication-pilot-to-atc','Other Pilot to ATC Communication','','Description of additional factor(s), not listed, associated with communicaitons between pilots and ATC.','text-field','USAF'),(5876,'masap-communication-pilot-to-atc','Phraseology','','Denotes the prescribed words and/or phrases to be used in communications and is standardized to red