INSERT INTO `tax_attributes` VALUES (5945,'masap-coordination/communication-event','Dispatch','','Indicates the occurrence was identified by the dispatcher -- an airline employee who is responsible for authorizing the departure of an aircraft. The dispatcher must ensure, among other things, that the aircraft\'s crew have all the proper information necessary for their flight and that the aircraft is in proper mechanical condition.','checkbox','DNAA'),(5946,'masap-coordination/communication-event','Coordination/Communication Event','','Collaboration and transmission of information between internal and external parties.','checkbox','DNAA'),(5947,'masap-coordination/communication-event','Ground/Ramp','','','checkbox','DNAA'),(5948,'masap-coordination/communication-event','Maintenance','','','checkbox','DNAA'),(5949,'masap-coordination/communication-event','Other Coordination/Communication Event','','Description of additional factor(s), not listed, associated with coordination and/or communication events.','text-field','DNAA'),(5950,'masap-crm/tem-skills','Automation Management','','','checkbox','Operator'),(5951,'masap-crm/tem-skills','Communication','','','checkbox','Operator'),(5952,'masap-crm/tem-skills','Leadership Effectiveness','','','checkbox','Operator'),(5953,'masap-crm/tem-skills','Monitor/Cross-Check','','','checkbox','Operator'),(5954,'masap-crm/tem-skills','Planning and Decision Making','','','checkbox','Operator'),(5955,'masap-crm/tem-skills','Situation Awareness','','','checkbox','Operator'),(5956,'masap-crm/tem-skills','Workload Management','','','checkbox','Operator'),(5957,'masap-cross-verification/monitoring','Aircraft Settings','','','checkbox','USAF'),(5959,'masap-cross-verification/monitoring','Cross Verification/Monitoring','','Issues associated with confirmation of cross-checks between pilots relating to aircraft performance, clearances, dispatch releases, position, routing, and settings, To ensure the highest levels of safety each flight crewmember must carefully monitor the aircraft?s flight path and systems and actively cross-check the actions of other crew members. Effective monitoring and cross-checking can be the last barrier or line of defense against accidents because detecting an error or unsafe situation may break the chain of events leading to an accident. Conversely, when this layer of defense is absent, errors and unsafe situations may go undetected, leading to adverse safety consequences. It is difficult for humans to monitor for errors on a continuous basis when these errors rarely occur. Monitoring during high workload periods is important since these periods present situations in rapid flux and because high workload increases vulnerability to error. However, studies show that poor monitoring performance can be present during low workload periods, as well. Lapses in monitoring performance during lower workload periods is often associated with boredom and/or complacency. Crew monitoring performance can be significantly improved by developing and implementing effective SOPs to support monitoring and cross-checking functions, by training crews on monitoring strategies, and by pilots following those SOPs and strategies. Refer to AC 120-71A: Standard Operating Procedures for Flight Deck Crewmembers (http://rgl.faa.gov/Regulatory_and_Guidance_Library/rgAdvisoryCircular.nsf/0/b173ba8a295764f086256cde006a44ad/$FILE/AC120-71A.pdf).','checkbox','USAF'),(5960,'masap-cross-verification/monitoring','Cross Verification/Monitoring Flight Release','','Specifies the paperwork by which an air carrier ensures all activities required for safe dispatch and continuation of a flight to its destination. Refer to Sec. 121.689 (http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/71F65AFDE4568E12852566EF006DF4F3?OpenDocument&Highlight=121.687).','checkbox','USAF'),(5961,'masap-cross-verification/monitoring','Monitoring-Aircraft Performance or Position','','','checkbox','USAF'),(5962,'masap-cross-verification/monitoring','Monitoring-Crew Performance','','','checkbox','USAF'),(5963,'masap-cross-verification/monitoring','Other Cross Verification/Monitoring','','Description of additional factor(s), not listed, associated with cross verification and/or monitoring.','text-field','USAF'),(5964,'masap-data-link-malfunction','Downlink','','','combo-box','Operator'),(5965,'masap-data-link-malfunction','Line of Sight','','','checkbox','Operator'),(5966,'masap-data-link-malfunction','Lost Data Link','','','checkbox','Operator'),(5967,'masap-data-link-malfunction','Radio Box','','','checkbox','Operator'),(5968,'masap-data-link-malfunction','Satcom','','','checkbox','Operator'),(5969,'masap-data-link-malfunction','Uplink','','','combo-box','Operator'),(5971,'masap-departure-event','Departure Event','','Occurrences during aircraft taking off from an airport.','checkbox','USAF'),(5972,'masap-departure-event','Flew Wrong Departure/SID','','','checkbox','USAF'),(5973,'masap-departure-event','Improper TOLD Data','','','checkbox','USAF'),(5974,'masap-departure-event','Incorrect Departure from Airport','','','checkbox','USAF'),(5975,'masap-departure-event','Other Departure Event','','Description of additional factor(s), not listed, associated with departure events.','text-field','USAF'),(5976,'masap-departure-event','RCR Issues','','','checkbox','USAF'),(5977,'masap-dispatch-operations-complications/errors','Adverse Weather','','','combo-box','Operator'),(5978,'masap-dispatch-operations-complications/errors','Aircraft Routing','','','checkbox','Operator'),(5979,'masap-dispatch-operations-complications/errors','Aircraft Routing-Amendment','','','checkbox','UTRS'),(5980,'masap-dispatch-operations-complications/errors','Alternate Airports','','Alternate airport means an airport at which an aircraft may land if a landing at the intended airport becomes inadvisable. No person may dispatch an airplane under IFR or over-the-top unless he lists at least one alternate airport for each destination airport in the dispatch release. Refer to Sec. 121.621: Alternate airport for destination: Flag operations (http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/82CA551664A00A35852566EF006DC9CD?OpenDocument&Highlight=121.641) and Sec. 121.197: Airplanes: Turbine engine powered: Landing limitations: Alternate airports (http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/870542FDF6B7DFD4852566EF006B2804?OpenDocument&Highlight=121.617).','checkbox','UTRS'),(5981,'masap-dispatch-operations-complications/errors','Amended Release Time','','','checkbox','Operator'),(5982,'masap-dispatch-operations-complications/errors','CAT II/III Requirements Not Met','','','checkbox','Operator'),(5983,'masap-dispatch-operations-complications/errors','Company Guidance FOM/DOM, Bulletins, Read File','','','checkbox','Operator'),(5984,'masap-dispatch-operations-complications/errors','Computer Systems','','','checkbox','Operator'),(5985,'masap-dispatch-operations-complications/errors','Deferred Items-MEL/CDL','','Minimum Equipment List (MEL)/Configuration Deviation List (CDL) faults or defects found on an aircraft which do not need immediate action and can be deferred for repair at a later date. This deferred defect status is only given for a strictly limited period of time and rectification must take place before that time has elapsed. Refer to FAR 121.628: Inoperable instruments and equipment (http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/75BFE28E8D694F43852566EF006DCF65?OpenDocument&Highlight=121.628).','checkbox','DNAA'),(5986,'masap-dispatch-operations-complications/errors','Destination Alternate','','','checkbox','Operator'),(5987,'masap-dispatch-operations-complications/errors','Difficult/Lost Communications','','Loss of the ability to communicate by radio.','checkbox','DNAA'),(5988,'masap-dispatch-operations-complications/errors','Dispatch/Operations Center Operations','','Issues associated with airline operations center that provides dispatch, System Operations Control (SOC), weather, maintenance, scheduling, and other support and control services for aircraft operations.','checkbox','Operator'),(5989,'masap-dispatch-operations-complications/errors','Dispatch Operations Complications/Errors','','Issues associated with a human action (or human behavior) that unintentionally deviates from the expected action (or behavior) or fails to achieve what should be done related to the authority over initiating, conducting, or terminating a flight. Refer to FAR 121.533: Responsibility for operational control: Domestic operations. (http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/251824597D3AB384852566EF006D2C10?OpenDocument&Highlight=121.533).','checkbox','DNAA'),(5990,'masap-dispatch-operations-complications/errors','Duty Time','','Each certificate holder conducting domestic or flag operations shall establish the daily duty period for a dispatcher so that it begins at a time that allows him or her to become thoroughly familiar with existing and anticipated weather conditions along the route before he or she dispatches any airplane. He or she shall remain on duty until each airplane dispatched by him or her has completed its flight, or has gone beyond his or her jurisdiction, or until he or she is relieved by another qualified dispatcher. Refer to Sec. 121.465: Aircraft dispatcher duty time limitations: Domestic and flag operations (http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/50C6D4A9F91D95C5852566EF006D0703?OpenDocument&Highlight=121.465)','checkbox','Operator'),(5991,'masap-dispatch-operations-complications/errors','Emergency','','In an emergency situation arising during flight that requires immediate decision and action by an aircraft dispatcher, and that is known to him, the aircraft dispatcher shall advise the pilot in command of the emergency. If the aircraft dispatcher cannot communicate with the pilot, he shall declare an emergency and take any action that he considers necessary under the circumstances. Whenever a pilot in command or dispatcher exercises emergency authority, he shall keep the appropriate ATC facility and dispatch centers fully informed of the progress of the flight. Refer to FAR Sec. 121.557 0 Emergencies: Domestic and flag operations (http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/204EAF3B675364C7852566EF006E1C76?OpenDocument&Highlight=121.557).','checkbox','Operator'),(5992,'masap-dispatch-operations-complications/errors','EOW Requirements Not Met','','http://www.airweb.faa.gov/regulatory_and_guidance_library/rgfar.nsf/0/45E6161C46A16FAB852566EF006C47F2?OpenDocument&Highlight=extended%20over-water','checkbox','Operator'),(5993,'masap-dispatch-operations-complications/errors','ETOPS Requirements Not Met','','Extended-Range Twin-Engine Operations (ETOPS)-refers to the portion of a flight by a twin-engine airplane usually over an ocean that is more than one hour from an airport. ETOPS certification means that a twin-engine airplane model has reliably demonstrated the ability to fly safely from one to three hours from the nearest airport even if one engine fails. Refer to FAR Sec. 121.7 ? Definitions (http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/ABDF70915124A50486257299006B22D6?OpenDocument&Highlight=121.7); Appendix P to Part 121 - Requirements for ETOPS and Polar Operations (http://www.airweb.faa.gov/Regulatory_and_Guidance_Library%5CrgFAR.nsf/0/5ADCCB0071E031DE86257299006B2551?OpenDocument); Sec. 121.624 - ETOPS Alternate Airports (http://www.airweb.faa.gov/Regulatory_and_Guidance_Library%5CrgFAR.nsf/0/E699825B09FC60D586257299006B244A?OpenDocument); Sec. 121.633 - Considering time-limited systems in planning ETOPS alternates (http://www.airweb.faa.gov/Regulatory_and_Guidance_Library%5CrgFAR.nsf/0/C7A1FEB5A0A1DF0986257299006B2497?OpenDocument).','checkbox','Operator'),(5994,'masap-dispatch-operations-complications/errors','Field Conditions','','','checkbox','Operator'),(5995,'masap-dispatch-operations-complications/errors','Flight Altitude','','Rules related to altitude minimums set forth in paragraphs (Day VFR operations) and (Night VFR, IFR, and over-the-top operations) of this section, except when necessary for takeoff or landing, or except when, after considering the character of the terrain, the quality and quantity of meteorological services, the navigational facilities available, and other flight conditions, the Administrator prescribes other minimums for any route or part of a route where he finds that the safe conduct of the flight requires other altitudes. Outside of the United States the minimums prescribed in this section are controlling unless higher minimums are prescribed in the certificate holder\'s operations specifications or by the foreign country over which the aircraft is operating. Refer to Sec. 121.657: Flight altitude rules (http://www.airweb.faa.gov/Regulatory_and_Guidance_Library%5CrgFAR.nsf/0/F31E7E13F726ABD6852566EF006DE68D?OpenDocument).','checkbox','Operator'),(5996,'masap-dispatch-operations-complications/errors','Flight Delay Due to Duty Time','','','checkbox','Operator'),(5997,'masap-dispatch-operations-complications/errors','Flight Following','','The knowledge of the aircraft location and condition with a reasonable degree of certainty such that, in the event of mishap, those on board may be rescued When conducting supplemental operations, requirements for a flight following system for proper monitoring of each flight and flight following centers, located at those points necessary--(i) To ensure the proper monitoring of the progress of each flight with respect to its departure at the point of origin and arrival at its destination, including intermediate stops and diversions therefrom, and maintenance or mechanical delays encountered at those points or stops; and (ii) To ensure that the pilot in command is provided with all information necessary for the safety of the flight. Refer to Sec. 121.125: Flight following system(http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/56D0745CB0A9B2D9852566EF006ADD4B?OpenDocument&Highlight=121.125).','checkbox','DNAA'),(5998,'masap-dispatch-operations-complications/errors','Flight Planning/Load','','Specified information provided to air traffic services units, relative to an intended flight or portion of a flight of an aircraft.  The term \'flight plan\' is used to mean variously, full information on all items comprised in the flight plan description, covering the whole route of a flight, or limited information required when the purpose is to obtain a clearance for a minor portion of a flight such as to cross an airway, to take off from, or to land at a controlled aerodrome.','checkbox','DNAA'),(5999,'masap-dispatch-operations-complications/errors','Flight Release','','Specifies the paperwork by which an air carrier ensures all activities required for safe dispatch and continuation of a flight to its destination. Refer to Sec. 121.689 (http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/71F65AFDE4568E12852566EF006DF4F3?OpenDocument&Highlight=121.687).','checkbox','Operator'),(6000,'masap-dispatch-operations-complications/errors','Flight Release-Amendment','','As delineated in FAR Sec. 121.631: Original dispatch or flight release, redispatch or amendment of dispatch or flight release (http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/53B827A8900F3F8D852566EF006DD22D?OpenDocument&Highlight=121.631): (a) The dispatch or flight release may be amended en route to include any alternate airport that is within the fuel range of the aircraft as specified in Secs. 121.639 through 121.647. (c) No person may change an original destination or alternate airport that is specified in the original dispatch or flight release to another airport while the aircraft is en route unless the other airport is authorized for that type of aircraft and the appropriate requirements of Secs. 121.593 through 121.661 and 121.173 are met at the time of redispatch or amendment of the flight release. (d) Each person who amends a dispatch or flight release en route shall record that amendment.','checkbox','Operator'),(6001,'masap-dispatch-operations-complications/errors','Flight Release-Other','','Specifies additional issues, not listed, that are associated with the system by which an air carrier ensures all activities required for safe dispatch and continuation of a flight to its destination. Refer to Sec. 121.689 (http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/71F65AFDE4568E12852566EF006DF4F3?OpenDocument&Highlight=121.687).','checkbox','Operator'),(6002,'masap-dispatch-operations-complications/errors','Flight Release-Re-release','','','checkbox','Operator'),(6003,'masap-dispatch-operations-complications/errors','Fuel Planning','','No person may dispatch or take off an airplane unless it has enough fuel--(a) To fly to the airport to which it is dispatched; (b) Thereafter, to fly to and land at the most distant alternate airport (where required) for the airport to which dispatched; and (c) Thereafter, to fly for 45 minutes at normal cruising fuel consumption or, for certificate holders who are authorized to conduct day VFR operations in their operations specifications and who are operating nontransport category airplanes type certificated after December 31, 1964, to fly for 30 minutes at normal cruising fuel consumption for day VFR operations. Refer to Sec. 121.639: Fuel supply: All domestic operations (http://www.airweb.faa.gov/Regulatory_and_Guidance_Library%5CrgFAR.nsf/0/1CC5B5DAD63E4806852566EF006DD813?OpenDocument).','checkbox','Operator'),(6004,'masap-dispatch-operations-complications/errors','Load Manifest','','Each certificate holder is responsible for the preparation and accuracy of a load manifest form before each takeoff. The form must be prepared and signed for each flight by employees of the certificate holder who have the duty of supervising the loading of aircraft and preparing the load manifest forms or by other qualified persons authorized by the certificate holder. Refer to Sec. 121.665: Load manifest (http://www.airweb.faa.gov/Regulatory_and_Guidance_Library%5CrgFAR.nsf/0/E26142F09B8723AA852566EF006DEC4D?OpenDocument)','checkbox','Operator'),(6005,'masap-dispatch-operations-complications/errors','MEL/CDL Reference','','Specification of where to find specific information related to the Minimum Equipment List (MEL)/Configuration Deviation List (CDL).','text-field','Operator'),(6006,'masap-dispatch-operations-complications/errors','Minimum Fuel Declaration','','No person may dispatch or take off an airplane unless it has enough fuel-to fly for 45 minutes at normal cruising fuel consumption or, for certificate holders who are authorized to conduct day VFR operations in their operations specifications and who are operating nontransport category airplanes type certificated after December 31, 1964, to fly for 30 minutes at normal cruising fuel consumption for day VFR operations. Refer to Sec. 121.639 - Fuel supply: All domestic operations (http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/1CC5B5DAD63E4806852566EF006DD813?OpenDocument&Highlight=121.639).','checkbox','Operator'),(6007,'masap-dispatch-operations-complications/errors','Navigation Facilities','','','checkbox','Operator'),(6008,'masap-dispatch-operations-complications/errors','NOTAMs','','Notices to Airmen (NOTAM) ? a notice containing information (not known sufficiently in advance to publicize by other means) concerning the establishment, condition, or change in any component (facility, service, or procedure) of, or hazard in, the National Airspace System (NAS); the timely knowledge of which is essential to personnel concerned with flight operations.Refer to AC 150/5200-28C: Notices to Airmen (NOTAMS (http://www.faa.gov/airports_airtraffic/airports/resources/advisory_circulars/media/150-5200-28C/150_5200_28c.pdf).','checkbox','UTRS'),(6009,'masap-dispatch-operations-complications/errors','Operational Control Issues','','The exercise of authority over initiating, conducting, or terminating a flight. FAR 121.533: Responsibility for Operational Control: Domestic Operations, states, \'The pilot in command and the aircraft dispatcher are jointly responsible for the preflight planning, delay, and dispatch release of a flight.\' Refer to FAR 121.533: Responsibility for operational control: Domestic operations. (http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/251824597D3AB384852566EF006D2C10?OpenDocument&Highlight=121.533).','checkbox','Operator'),(6010,'masap-dispatch-operations-complications/errors','Other Dispatch Operations Complications/Errors','','Description of additional factor(s), not listed, associated with dispatch operations complications and/or errors.','text-field','DNAA'),(6011,'masap-dispatch-operations-complications/errors','RVSM','','Reduced Vertical Separation Minimums (RVSM) is the airspace where Air Traffic Control separates aircraft by a minimum of 1,000 feet vertically between flight level (FL) 290 and FL 410 inclusive. RVSM airspace is special qualification airspace; the operator and the aircraft used by the operator must be approved by the Administrator. Air traffic control notifies operators of RVSM by providing route planning information. Refer to AIM Section 6. Operational Policy/Procedures for Reduced Vertical Separation Minimum (RVSM) in the Domestic U.S., Alaska, Offshore Airspace and the San Juan FIR (http://www.faa.gov/airports_airtraffic/air_traffic/publications/atpubs/aim/Chap4/aim0406.html).','checkbox','Operator'),(6012,'masap-dispatch-operations-complications/errors','Security','','Actual or potential breaches of regulations or security practices caused by airport personnel and/or passengers. Failure of company employees to ensure the highest level of security surrounding a flight (example: leaving the jetway door open and unattended during boarding).','checkbox','Operator'),(6013,'masap-dispatch-operations-complications/errors','Takeoff Alternate','','','checkbox','Operator'),(6014,'masap-dispatch-operations-complications/errors','Weather Observations','','','combo-box','Operator'),(6015,'masap-documentation-error','Closed in Error','','Status of documentation was finalized erroneously.','checkbox','USAF'),(6016,'masap-documentation-error','Conflicting Maintenance Document','','Significant difference(s) or contradictions between the sets of reference paperwork information or guidance that are used to perform maintenance tasks.','checkbox','USAF'),(6017,'masap-documentation-error','Confusing Software','','','checkbox','USAF'),(6018,'masap-documentation-error','Documentation Error','','Issues associated with a human action (or human behavior) that unintentionally deviates from the expected action (or behavior) or fails to achieve what should be done associated with the reference paperwork used to perform maintenance tasks.','checkbox','USAF'),(6019,'masap-documentation-error','Incorrect Paperwork/Log Book Entry','','','checkbox','USAF'),(6020,'masap-documentation-error','Incorrect Reference','','','checkbox','USAF'),(6021,'masap-documentation-error','Maintenance Not Scheduled','','','checkbox','USAF'),(6022,'masap-documentation-error','Missed Recertification/Downgrade','','','checkbox','USAF'),(6023,'masap-documentation-error','Missing Airworthiness Release','','','checkbox','USAF'),(6024,'masap-documentation-error','Missing Paperwork/Log Book Entry','','','checkbox','USAF'),(6025,'masap-documentation-error','Not Documented','','','checkbox','USAF'),(6026,'masap-documentation-error','Other Documentation Error','','Description of additional factor(s), not listed, associated with documentation errors.','text-field','USAF'),(6027,'masap-documentation-error','Reference Data Not Used','','','checkbox','USAF'),(6028,'masap-documentation-error','Specifications','','','checkbox','USAF'),(6029,'masap-documentation-error','Work Card Error','','Deviating from an accepted practices specified on the card that shows the  required maintenance steps for repairing an aircraft system or component.','checkbox','USAF'),(6030,'masap-documentation/information/technical-data','Documentation/Information/Technical Data','','Issues associated with the written or computerized source material, provided by the airline, vendors, and manufacturers, that a maintenance technician needs to carry out a task or job, including factors such as accessibility, availability, clarity, complexity, correctness, sufficiency, and understandability.','checkbox','MEDA Rev g.'),(6031,'masap-documentation/information/technical-data','Inadequate Illustrations','','','checkbox','Operator'),(6032,'masap-documentation/information/technical-data','Incorrectly Modified Manufacturer\'s MM/SB','','','checkbox','MEDA Rev g.'),(6033,'masap-documentation/information/technical-data','Incorrect/Missing Documentation','','Ambiguity, erroneous, or lack of written description of policies, processes, procedures, objectives, requirements, authorities, responsibilities, or work instructions.','checkbox','MEDA Rev g.'),(6034,'masap-documentation/information/technical-data','Incorrect/Missing Release Final Weight and Balance','','','checkbox','Operator'),(6035,'masap-documentation/information/technical-data','Information Not Used','','','checkbox','MEDA Rev g.'),(6036,'masap-documentation/information/technical-data','Insufficient','','','checkbox','REDA'),(6037,'masap-documentation/information/technical-data','Interpretation of Charts','','','checkbox','DNAA'),(6038,'masap-documentation/information/technical-data','Management of Flight Plan, Flight Release, Weather or NOTAMs','','','checkbox','DNAA'),(6039,'masap-documentation/information/technical-data','Management of HAZMAT Information','','','checkbox','DNAA'),(6040,'masap-documentation/information/technical-data','Management of Weight and Balance','','','checkbox','DNAA'),(6041,'masap-documentation/information/technical-data','Management or Interpretation of MEL/CDL','','Responsibility for and clarification of Minimum Equipment List (MEL)/Configuration Deviation List (CDL) information. Refer to FAR 125.201: Inoperable instruments and equipment (http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/58CF936FD6E2A36186256959004E132E?OpenDocument&Highlight=125.201).','checkbox','DNAA'),(6042,'masap-documentation/information/technical-data','Management or Interpretation of Pre-Departure Clearance','','(1) Guidance and control of the execution of or (2) Explanation and/or clarification of Pre-Departure Clearance (PDC)-An authorization by ATC for an aircraft to proceed under specified traffic conditions within controlled airspace. An application with the Terminal Data Link System (TDLS) that provides clearance information to subscribers, through a service provider, in text to the cockpit or gate printer.','checkbox','DNAA'),(6043,'masap-documentation/information/technical-data','Not Available/Inaccessible','','','checkbox','MEDA Rev g.'),(6044,'masap-documentation/information/technical-data','Not Understandable','','','checkbox','MEDA Rev g.'),(6045,'masap-documentation/information/technical-data','Other Documentation/Information/Technical Data','','Description of additional factor(s), not listed, associated with documentation, information, and/or technical data.','text-field','MEDA Rev g.'),(6046,'masap-documentation/information/technical-data','Reference Material Not Available','','','checkbox','Operator'),(6047,'masap-documentation/information/technical-data','Too Much/Conflicting Information','','Excessive material provided and/or significant difference(s) or contradictions between the sets of reference paperwork information or guidance.','checkbox','MEDA Rev g.'),(6048,'masap-documentation/information/technical-data','Unclear Reference Material','','','checkbox','Operator'),(6049,'masap-documentation/information/technical-data','Reviewing, Recording or Departing with Wrong Logbook or Information','','','checkbox','DNAA'),(6050,'masap-employee-issues','Employee Conduct','','','checkbox','USAF'),(6051,'masap-employee-issues','Employee Issues','','Occurrences associated with airline personnel including employee conduct, intoxication, and unsafe activities.','checkbox','USAF'),(6052,'masap-employee-issues','Intoxicated','','Impaired performance or abnormal behavior caused by alcohol or drugs.','checkbox','USAF'),(6053,'masap-employee-issues','Other Employee Issues','','Description of additional factor(s), not listed, associated with employee issues.','text-field','USAF'),(6054,'masap-enemy-threats-hostile-fire','Enemy Threats/Hostile Fire','','','combo-box','USAF'),(6055,'masap-enemy-threats-hostile-fire','Enemy Threats/Hostile Fire Narrative','','','memo-field','USAF'),(6056,'masap-environment','EMI','','','checkbox','USAF'),(6057,'masap-environment','Environment','','Issues associated with the work environment, ramp, and facilities such as temperature extremes, high noise levels, inadequate lighting, markings, unusual vibrations, and dirty work surfaces. Operational conditions include traffic density, communication density, workload, etc. Ambient conditions include weather, EMI, vibration, acoustics, etc.','checkbox','MEDA Rev g.'),(6058,'masap-environment','Vibrations','','http://www.workriteergo.com/ergonomics/glossary.asp','checkbox','MEDA Rev g.'),(6059,'masap-environment','Ground Based Interference','','','checkbox','USAF'),(6060,'masap-environment','Noise Levels: High','','','checkbox','MEDA Rev g.'),(6061,'masap-environment','Hygienic/Internal Environment','','','combo-box','USAF'),(6062,'masap-environment','Indoor','','','checkbox','Operator'),(6063,'masap-environment','Lighting','','The amount of artificial or natural light.','checkbox','MEDA Rev g.'),(6064,'masap-environment','Noise Levels: Excessive','','','checkbox','Operator'),(6065,'masap-environment','Noise Levels: Marginal','','','checkbox','Operator'),(6066,'masap-environment','Noise Levels: Normal','','','checkbox','Operator'),(6067,'masap-environment','Other Environment','','','text-field','USAF'),(6068,'masap-environment','Other Environment','','Description of additional factor(s), not listed, associated with the environment.','text-field','MEDA Rev g.'),(6069,'masap-environment','Outdoor','','','checkbox','Operator'),(6070,'masap-environment','Radiation','','','combo-box','USAF'),(6071,'masap-environment','RFI','','','checkbox','USAF'),(6072,'masap-environment','Surface: Contaminated','','','checkbox','Operator'),(6073,'masap-environment','Surface: Dry','','','checkbox','M-DNAA V7.0 B1.5'),(6074,'masap-environment','Surface: Ice','','','checkbox','M-DNAA V7.0 B1.5'),(6075,'masap-environment','Surface: Snow','','','checkbox','Operator'),(6076,'masap-environment','Surface: Wet','','','checkbox','M-DNAA V7.0 B1.5'),(6077,'masap-environment','Temperature: Cold','','Inadequate temperature in the work environment that impedes personnel from carrying out their work without undue discomfort.','checkbox','MEDA Rev g.'),(6078,'masap-environment','Temperature: Hot','','Excessive heat in the work environment that impedes personnel from carrying out their work without undue discomfort.','checkbox','MEDA Rev g.'),(6079,'masap-environment','Temperature: Moderate','','Degree of hotness or coldness in the work environment that is within reasonable or average limits that allows personnel to carry out their work without undue discomfort.','checkbox','Operator'),(6080,'masap-environment','Visibility: Dawn','','The first appearance of light in the eastern sky before sunrise.','checkbox','M-DNAA V7.0 B1.6'),(6081,'masap-environment','Day','','The period of the day between dawn and dusk.','checkbox','M-DNAA V7.0 B1.6'),(6082,'masap-environment','Visibility: Dusk','','The period of waning light from the time of sunset to dark.','checkbox','M-D