g 14 days','','','combo-box','USAF'),(6337,'masap-fault-isolation/test/inspection-error','Access Not Closed','','','checkbox','USAF'),(6338,'masap-fault-isolation/test/inspection-error','Conflicting Information','','Two or more policies or procedures that provide contradictory information or guidance regarding the analysis and identification of malfunctions.','checkbox','M-DNAA V7.0 B2.5'),(6339,'masap-fault-isolation/test/inspection-error','Did not Detect Fault','','Unable to identify defect or anomaly of a system element or of the components.','checkbox','MEDA Rev g.'),(6340,'masap-fault-isolation/test/inspection-error','Equipment/Tooling Not Available','','','checkbox','Operator'),(6341,'masap-fault-isolation/test/inspection-error','Fault Isolation/Test/Inspection Error','','Issues associated with evaluating the condition of a system, component, equipment, or tool to correct the cause of the malfunction, including accessibility, deactivation/reactivation, inability to detect fault, and not found factors.','checkbox','MEDA Rev g.'),(6342,'masap-fault-isolation/test/inspection-error','Inadequate Troubleshooting','','No guidance and/or rules were available regarding the activities, tasks, steps, decisions, calculations and processes associated with evaluating the condition of a system, component, equipment, or tool to isolate the source of a problem and correct the cause of the malfunction, including accessibility, deactivation/reactivation, inability to detect fault, and not found factors.','checkbox','M-DNAA V7.0 B2.5'),(6343,'masap-fault-isolation/test/inspection-error','Incorrect Procedure','','Inaccurate or erroneous activities, tasks, steps, decisions, calculations and processes associated with evaluating the condition of a system, component, equipment, or tool to isolate the source of a problem and correct the cause of the malfunction, including accessibility, deactivation/reactivation, inability to detect fault, and not found factors.','checkbox','M-DNAA V7.0 B2.5'),(6344,'masap-fault-isolation/test/inspection-error','Inspection Not Accomplished/RII','','','checkbox','Operator'),(6345,'masap-fault-isolation/test/inspection-error','Lack of Experience/Training','','','checkbox','M-DNAA V7.0 B2.5'),(6346,'masap-fault-isolation/test/inspection-error','Not Found by Fault Isolation','','Indicates that the source of the malfunction was not identified by evaluating the condition of a system, component, equipment, or tool, including accessibility, deactivation/reactivation, inability to detect fault, and not found factors.','checkbox','MEDA Rev g.'),(6347,'masap-fault-isolation/test/inspection-error','Not Found by Inspection','','Indicates that the source of the malfunction was not determined by examining by sight and/or touch (with or without inspection enhancing tools/equipment).','checkbox','MEDA Rev g.'),(6348,'masap-fault-isolation/test/inspection-error','Not Found by Operational/Functional Test','','System malfunctions or failures were unable to be determined through the process of operating a system under specified conditions, observing or recording the results, and making an evaluation of some aspect of the system.','checkbox','MEDA Rev g.'),(6349,'masap-fault-isolation/test/inspection-error','Other Fault Isolation/Test/Inspection Error','','Description of additional factors, not listed, associated with fault isolation, test, and inspection errors.','text-field','MEDA Rev g.'),(6350,'masap-fault-isolation/test/inspection-error','Personnel Not Available','','','checkbox','Operator'),(6351,'masap-fault-isolation/test/inspection-error','Procedure Not Followed','','Non-adherence to the available guidance and/or rules regarding the activities, tasks, steps, decisions, calculations and processes associated with evaluating the condition of a system, component, equipment, or tool to isolate the source of a problem and correct the cause of the malfunction, including accessibility, deactivation/reactivation, inability to detect fault, and not found factors','checkbox','M-DNAA V7.0 B2.5'),(6352,'masap-feedback','General Comments','','','memo-field','USAF'),(6353,'masap-feedback','How long did it take to complete the form','','','combo-box','USAF'),(6354,'masap-feedback','Is the level of detail appropriate?','','','combo-box','USAF'),(6355,'masap-fire-smoke-fumes-or-odor','APU-Fire/Overheat','','','checkbox','USAF'),(6356,'masap-fire-smoke-fumes-or-odor','Batteries-Personal Electronic Devices','','','checkbox','USAF'),(6357,'masap-fire-smoke-fumes-or-odor','Cabin','','Cabin fires generally result from one of three sources: (1) careless smoking on the part of the pilot and/or passengers; (2) electrical system malfunctions; (3) heating system malfunctions. A fire in the cabin presents the pilot with two immediate demands: attacking the fire, and getting the airplane safely on the ground as quickly as possible. A fire or smoke in the cabin should be controlled by identifying and shutting down the faulty system.','checkbox','USAF'),(6358,'masap-fire-smoke-fumes-or-odor','Cargo','','Fire protection requirements based on cargo compartment classification.','checkbox','USAF'),(6359,'masap-fire-smoke-fumes-or-odor','Discharged Fire Bottle','','Fire extinguishing containers as described in FAR Sec. 25.1199 Extinguishing agent containers (http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/A1C92A8F1393638D85256673004D3CB1?OpenDocument&Highlight=25.1199).','checkbox','USAF'),(6360,'masap-fire-smoke-fumes-or-odor','Engines','','','checkbox','USAF'),(6361,'masap-fire-smoke-fumes-or-odor','Fire','','The process of combustion of inflammable materials producing heat and light and (often) smoke.','checkbox','USAF'),(6362,'masap-fire-smoke-fumes-or-odor','Fire/Smoke Detector Activated','','Smoke detector system or equivalent that provides a warning light in the cockpit or provides a warning light or audio warning in the passenger cabin which would be readily detected by a flight attendant, taking into consideration the positioning of flight attendants throughout the passenger compartment during various phases of flight. Refer to FAR Sec. 25.854: Lavatory fire protection (http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/6FEEDA1FE296DDD2852566720051A398?OpenDocument&Highlight=25.854).','checkbox','USAF'),(6363,'masap-fire-smoke-fumes-or-odor','Fire, Smoke, Fumes, or Odor','','Occurrences and issues associated with fire, fumes, smoke, or odors in or on the aircraft, in flight or on the ground, including combustion of flammable material caused by an improper combination of heat, fuel, and oxygen; smoke or fumes detected in or outside the aircraft due to passenger smoking or undeclared combustible item in cargo; operational error (deicing crew spaying into APU inlet); or mechanical malfunction (engine failure or high oil temperature). Fire precautions are specified in FAR Sec. 121.221 (http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/A2AE7C6BE0B63517852566EF006B3907?OpenDocument&Highlight=121.221)','checkbox','USAF'),(6364,'masap-fire-smoke-fumes-or-odor','Fire/Smoke Warning','','Indicates activation of the smoke detector system or equivalent that provides a warning light in the cockpit or provides a warning light or audio warning in the passenger cabin which would be readily detected by a flight attendant, taking into consideration the positioning of flight attendants throughout the passenger compartment during various phases of flight','checkbox','USAF'),(6365,'masap-fire-smoke-fumes-or-odor','Flight Deck','','Also called the cockpit, it the compartment in the front of the airplane where the flight crew performs their job of flying the aircraft. It is the most forward part of the fuselage and contains all the instruments needed to fly the plane. The flight deck has seats for the pilot and co-pilot; a flight engineer, on some planes; and seats for one or two observers that could be from the airline itself, or from FAA. The flight deck is off limits to passengers during flight and to flight attendants during takeoffs and landings.','checkbox','USAF'),(6366,'masap-fire-smoke-fumes-or-odor','Fumes','','The concentration of flammable constituents in air that exceed 25 percent of their flammability limit.','checkbox','USAF'),(6367,'masap-fire-smoke-fumes-or-odor','Location','','Indicates the spot or position where the fire, fumes, smoke, or odors is detected.','combo-box','USAF'),(6368,'masap-fire-smoke-fumes-or-odor','Odor','','Types of gases, vapors, or particles that stimulate the olfactory organs; typically in an unpleasant or objectionable manner.','checkbox','USAF'),(6369,'masap-fire-smoke-fumes-or-odor','Other Fire, Smoke, Fumes, or Odor Event','','Description of additional factor(s), not listed, associated with fire, smoke, fumes, or odor incidents or events.','text-field','USAF'),(6370,'masap-fire-smoke-fumes-or-odor','Smoke','','The airborne solid and liquid particulates and gases evolved when a material undergoes pyrolysis or combustion, together with the quantity of air that is entrained or otherwise mixed into the mass.','checkbox','USAF'),(6371,'masap-fire-smoke-fumes-or-odor','Wheel Well/Landing Gear','','Landing Gear-The collection of devices including wheels, skis, and floats that enable a flight vehicle to land and move about on land, water or other surfaces and supports the weight of the aircraft when it lands. The landing gear is often retractable - it can be pulled into the fuselage of the aircraft to reduce drag during flight. Another word for undercarriage','checkbox','USAF'),(6372,'masap-flight-crew-coordination','Altitude Planning/Awareness','','','checkbox','USAF'),(6373,'masap-flight-crew-coordination','Attention to/Distraction from Flight Duties','','Issues involve proper allocation of tasks to individuals, avoidance of work overloads in self and in others, prioritization of tasks during periods of high workload, and preventing nonessential factors from distracting attention from adherence to SOPs, particularly those relating to critical tasks. Refer to AC 120-51E: Crew Resource Management Training (http://rgl.faa.gov/Regulatory_and_Guidance_Library/rgAdvisoryCircular.nsf/0/80038cf51aace53686256e24005cbb23/$FILE/AC120-51e.pdf).','checkbox','USAF'),(6374,'masap-flight-crew-coordination','Decisionmaking','','Decision-making is a systematic approach to the mental process used by pilots to consistently determine the best course of action in response to a given set of circumstances.','checkbox','USAF'),(6375,'masap-flight-crew-coordination','Flight Crew Coordination','','Factors associated with interface between flight crewmembers such as awareness, collaboration, decision making, planning, workload management.','checkbox','USAF'),(6376,'masap-flight-crew-coordination','Judgment or Assessment of Risk','','Mental process of recognizing and analyzing all pertinent information in a particular situation , a rational evaluation of alternative actions in response to it, and a timely decision on which action to take.','checkbox','USAF'),(6377,'masap-flight-crew-coordination','Flight Crew Coordination: Other','','Indicates additional factors, not listed, associated with interface between flight crewmembers such as awareness, collaboration, decision making, planning, workload management.','text-field','USAF'),(6378,'masap-flight-crew-coordination','Planning','','Issues include methods to improve monitoring and accomplishing required tasks, asking for and responding to new information, and preparing in advance for required activities. Refer to AC 120-51E: Crew Resource Management Training (http://rgl.faa.gov/Regulatory_and_Guidance_Library/rgAdvisoryCircular.nsf/0/80038cf51aace53686256e24005cbb23/$FILE/AC120-51e.pdf).','checkbox','USAF'),(6379,'masap-flight-crew-coordination','Statement or Clarification of Plans','','','checkbox','USAF'),(6380,'masap-flight-crew-coordination','Timing of Flight Duties/Workload Distribution','','Stressing the importance of maintaining awareness of the operational environment and anticipating contingencies. Instruction may address practices (e.g., vigilance, planning and time management, prioritizing tasks, and avoiding distractions) that result in higher levels of situation awareness, including: Preparation/Planning/Vigilance and Workload Distribution/Distraction Avoidance, Refer to AC 120-51E: Crew Resource Management Training (http://rgl.faa.gov/Regulatory_and_Guidance_Library/rgAdvisoryCircular.nsf/0/80038cf51aace53686256e24005cbb23/$FILE/AC120-51e.pdf).','checkbox','USAF'),(6381,'masap-flight-crew-employee-information','Augmented Crew','','','checkbox','USAF'),(6382,'masap-flight-crew-employee-information','Basic Crew','','','checkbox','USAF'),(6383,'masap-flight-crew-employee-information','Consecutive Days on Duty/Flown','','','combo-box','UTRS'),(6384,'masap-flight-crew-employee-information','Contact Name','','','text-field','USAF'),(6385,'masap-flight-crew-employee-information','Crew Duties At Time of Event','','','combo-box','USAF'),(6386,'masap-flight-crew-employee-information','Crew Position At Time of Event','','','combo-box','USAF'),(6387,'masap-flight-crew-employee-information','Duty off Time','','','date-time-field','UTRS'),(6388,'masap-flight-crew-employee-information','Duty on Time','','','date-time-field','UTRS'),(6389,'masap-flight-crew-employee-information','Age','','','combo-box','UTRS'),(6390,'masap-flight-crew-employee-information','Flight Leg of Event','','','combo-box','UTRS'),(6391,'masap-flight-crew-employee-information','Experience (Total Years)','','Specifies the total number of years of experience for the flight crew employee in years.','real-field','USAF'),(6392,'masap-flight-crew-employee-information','Familiarity with Other Pilot','','','combo-box','USAF'),(6393,'masap-flight-crew-employee-information','Fighter Position at Time of Event','','','combo-box','Operator'),(6394,'masap-flight-crew-employee-information','Gender','','',