th the modifications of the position of the landing gear and flaps.','checkbox','USAF'),(6414,'masap-flight-crew-reaction','Contacted ATC','','','checkbox','USAF'),(6415,'masap-flight-crew-reaction','Contacted Command Authority','','','checkbox','USAF'),(6416,'masap-flight-crew-reaction','Corrected Pitch/Power','','','checkbox','USAF'),(6417,'masap-flight-crew-reaction','Declared Critically Low Fuel','','Specification of inadequate fuel reserve to complete flight operation','checkbox','USAF'),(6419,'masap-flight-crew-reaction','Did You Declare Safety of Flight','','','checkbox','USAF'),(6420,'masap-flight-crew-reaction','Engine Shutdown','','Engine shutdown is from the start of the shutdown sequence until the engine(s) cease rotation.','checkbox','USAF'),(6423,'masap-flight-crew-reaction','Executed Missed Approach','','Maneuver conducted by a pilot when an instrument approach cannot be completed to a landing. The route of flight and altitude are shown on instrument approach procedure charts. A pilot executing a missed approach prior to the Missed Approach Point (MAP) must continue along the final approach to the MAP.','checkbox','USAF'),(6424,'masap-flight-crew-reaction','Exercised Captain Emergency Authority','','The pilot-in-command of an aircraft is directly responsible for and is the final authority as to the operation of that aircraft. In an emergency requiring immediate action, the pilot-in-command may deviate from any rule in 14 CFR Part 91, Subpart A, General, and Subpart B, Flight Rules, to the extent required to meet that emergency. Refer to AIM Chapter 6-1-1: Emergency Procedures: Pilot Responsibility and Authority (http://www.faa.gov/airports_airtraffic/air_traffic/publications/atpubs/aim/Chap6/aim0601.html) and 14 CFR Section 91.3(b) (http://www.airweb.faa.gov/Regulatory_and_Guidance_Library%5CrgFAR.nsf/0/E63BBEDC3044A110852566CF00612076?OpenDocument).','checkbox','USAF'),(6425,'masap-flight-crew-reaction','Exited Adverse Environment','','','checkbox','USAF'),(6426,'masap-flight-crew-reaction','Exited Penetrated Airspace','','','checkbox','USAF'),(6427,'masap-flight-crew-reaction','Flight Crew Response','','Reaction to the occurrence by licensed cockpit personnel charged with duties essential to the operation of an aircraft during a flight duty period.','checkbox','USAF'),(6428,'masap-flight-crew-reaction','Landed in Emergency Condition','','An unscheduled airplane landing that is made under emergency circumstances when any distress, urgency condition, or critical problem is discovered that is not under the pilot\'s control.','checkbox','USAF'),(6429,'masap-flight-crew-reaction','Operated in Degraded Conditions','','','checkbox','USAF'),(6430,'masap-flight-crew-reaction','Operational Control Issues','','The exercise of authority over initiating, conducting, or terminating a flight. FAR 121.533: Responsibility for Operational Control: Domestic Operations, states, \'The pilot in command and the aircraft dispatcher are jointly responsible for the preflight p\'','checkbox','USAF'),(6431,'masap-flight-crew-reaction','Flight Crew Response: Other','','','text-field','USAF'),(6432,'masap-flight-crew-reaction','Overcame Equipment Problem','','','checkbox','USAF'),(6433,'masap-flight-crew-reaction','Overrode Automation','','','checkbox','USAF'),(6434,'masap-flight-crew-reaction','Precautionary Landing','','A premeditated landing, on or off an airport, when further flight is possible but inadvisable. Examples of conditions that may call for a precautionary landing include deteriorating weather, being lost, fuel shortage, and gradually developing engine trouble.','checkbox','USAF'),(6435,'masap-flight-crew-reaction','Regained Aircraft Control','','','checkbox','USAF'),(6436,'masap-flight-crew-reaction','Rejected Landing (Less than 50 ft. AGL)','','A planned landing that is discontinued for reasons such as conflicting traffic, weather, or landing surface obstacles.','checkbox','USAF'),(6437,'masap-flight-crew-reaction','Requested Emergency Equipment','','Actions undertaken to obtain assistance. Refer to AIM Chapter 6-3-2: Emergency Procedures: Obtaining Emergency Assistance (http://www.faa.gov/airports_airtraffic/air_traffic/publications/atpubs/aim/Chap6/aim0603.html).','checkbox','USAF'),(6438,'masap-flight-crew-reaction','Reset Circuit Breakers','','ndicates that the Circuit Breakers (CBs) designed to open an electrical circuit automatically at a predetermined overload of current were returned to its original state.','combo-box','USAF'),(6439,'masap-flight-crew-reaction','Returned to Assigned Airspace','','','checkbox','USAF'),(6440,'masap-flight-crew-reaction','Returned to Assigned Altitude','','When possible, if the altitude assigned is different from the altitude requested by the pilot, ATC will inform the pilot when to expect climb or descent clearance or to request altitude change from another facility. If this has not been received prior to crossing the boundary of the ATC facility\'s area and assignment at a different altitude is still desired, the pilot should reinitiate the request with the next facility. Refer to AIM Section 4-4-3d: Altitude Data (http://www.faa.gov/airports_airtraffic/air_traffic/publications/atpubs/aim/Chap4/aim0404.html).','checkbox','USAF'),(6441,'masap-flight-crew-reaction','Returned to Assigned Speed','','If ATC determines (before an approach clearance is issued) that it is no longer necessary to apply speed adjustment procedures, they will inform the pilot to resume normal speed. Approach clearances supersede any prior speed adjustment assignments, and pilots are expected to make their own speed adjustments, as necessary, to complete the approach. Refer to AIM Section 4-4-11: Speed Adjustments (http://www.faa.gov/airports_airtraffic/air_traffic/publications/atpubs/aim/Chap4/aim0404.html).','checkbox','USAF'),(6442,'masap-flight-crew-reaction','Returned to Departure Airport','','When an aircraft has taken off and experiences a situation requiring it to return to the departure airport','checkbox','USAF'),(6443,'masap-flight-crew-reaction','Returned to Assigned Course/Heading','','To turn back to the specified direction of flight in the horizontal plane, measured in degrees from north.','checkbox','USAF'),(6445,'masap-flight-crew-reaction','If you should have and did not, why?','','','text-field','USAF'),(6446,'masap-flight-crew-reaction','Took Evasive Action','','','checkbox','USAF'),(6447,'masap-flight-crew-reaction','Took Precautionary Avoidance Action','','','checkbox','USAF'),(6448,'masap-flight-information','Scheduled Arrival Airport, Runway and Gate','','The airport, runway, and gate to which an aircraft is planned to be flying to.','airport-ext-field','USAF'),(6449,'masap-flight-information','Departure Airport, Runway and Gate','','The airport, runway, and gate from which an aircraft takes off.','airport-ext-field','USAF'),(6450,'masap-flight-information','Date/Time of End of Flight','','','date-time-field','USAF'),(6451,'masap-flight-information','Filed Altitude (MSL)','','The altitude specified in the flight plan measured in feet from Mean Sea Level (MSL)','real-field','USAF'),(6452,'masap-flight-information','How full is flight (Percent)?','','Specifies how full the flight is as a percentage.','integer-field','USAF'),(6453,'masap-flight-information','Flight Plan','','','combo-box','USAF'),(6454,'masap-flight-information','Landing Airport, Runway and Gate','','Airport where aircraft landed, Runway and Gate.','airport-ext-field','USAF'),(6455,'masap-flight-information','Mission Number','','','text-field','USAF'),(6456,'masap-flight-information','Multi-Ship/Formation','','','checkbox','USAF'),(6457,'masap-flight-information','NVD/NVG','','','checkbox','USAF'),(6458,'masap-flight-information','Non-Revenue Flight','','','combo-box','USAF'),(6459,'masap-flight-information','Flight Number','','A one to four character alpha-numeric code for a particular flight.','text-field','USAF'),(6460,'masap-flight-information','Number in Formation','','','combo-box','Operator'),(6461,'masap-flight-information','Number of Aircraft','','','integer-field','USAF'),(6462,'masap-flight-information','Number of Passengers Aboard','','Specifies the number of passengers onboard the flight, including origination, stopovers and connections.','integer-field','USAF'),(6463,'masap-flight-information','Phase of Flight','','','combo-box','USAF'),(6464,'masap-flight-information','RPA Phase of Flight','','','combo-box','Operator'),(6465,'masap-flight-information','Date/Time of Start of Flight','','','date-time-field','USAF'),(6466,'masap-flight-information','Tactical Ops','','','checkbox','USAF'),(6467,'masap-flight-information','Time of Day','','','combo-box','USAF'),(6468,'masap-flight-information','Transponder Code','','The number assigned to a particular multiple pulse reply signal transmitted by a transponder. The transponder is the airborne radar beacon receiver/transmitter portion of the Air Traffic Control Radar Beacon System (ATCRBS) which automatically receives radio signals from interrogators on the ground, and selectively replies with a specific reply pulse or pulse group only to those interrogations being received on the mode to which it is set to respond.','integer-field','USAF'),(6469,'masap-flight-information','Unaided','','','checkbox','USAF'),(6470,'masap-flight-interruption','Air Turnback','','','checkbox','USAF'),(6471,'masap-flight-interruption','Diversion-Other Alternate','','Diversion to an airport at which an aircraft may land if a landing at the intended airport becomes inadvisable. The alternate airport in a dispatch or flight release unless the airplane (at the weight anticipated at the time of arrival at the airport), is based on the assumptions in Sec. 121.185 (http://www.airweb.faa.gov/Regulatory_and_Guidance_Library%5CrgFAR.nsf/0/E451561401706738852566EF006B1F85?OpenDocument), can be brought to a full stop landing, within 70 percent of the effective length of the runway (FAR Sec 121.187: http://www.airweb.faa.gov/Regulatory_and_Guidance_Library%5CrgFAR.nsf/0/3D19A47BB501824D852566EF006B20E4?OpenDocument).','checkbox','USAF'),(6472,'masap-flight-interruption','Diversion-Filed Alternate','','Diversion to an airport at which an aircraft may land if a landing at the intended airport becomes inadvisable. Alternate airport means an airport at which an aircraft may land if a landing at the intended airport becomes inadvisable. The alternate airport in a dispatch or flight release unless the airplane (at the weight anticipated at the time of arrival at the airport), is based on the assumptions in Sec. 121.185 (http://www.airweb.faa.gov/Regulatory_and_Guidance_Library%5CrgFAR.nsf/0/E451561401706738852566EF006B1F85?OpenDocument), can be brought to a full stop landing, within 70 percent of the effective length of the runway (FAR Sec 121.187: http://www.airweb.faa.gov/Regulatory_and_Guidance_Library%5CrgFAR.nsf/0/3D19A47BB501824D852566EF006B20E4?OpenDocument).','checkbox','USAF'),(6473,'masap-flight-interruption','Planned Emergency Landing','','','checkbox','USAF'),(6474,'masap-flight-interruption','Evacuation','','Occurrence where either: (a) person(s) are injured during an evacuation; (b) an unnecessary evacuation was performed; (c) evacuation equipment failed to perform as required; or (d) the evacuation was a factor in the outcome.','checkbox','USAF'),(6475,'masap-flight-interruption','Flight Cancellation','','','checkbox','USAF'),(6476,'masap-flight-interruption','Flight Delay','','Reportable delays are delays to IFR traffic of 15 minutes or more, experienced by individual flights. Delays may result from detaining an aircraft at the gate, short of the runway, on the runway, on a taxiway and/or in a holding configuration anywhere en route. Delays are normally attributed to the following five factors: weather, volume, equipment, runway, and other. The ?other? category is used for abatement, flight check, etc.','checkbox','USAF'),(6477,'masap-flight-interruption','Flight Delay Duration (Min)','','Arrival delay equals the difference of the actual arrival time minus the scheduled arrival time in minutes. Delay calculations begin when the aircraft enters ATC jurisdiction, e.g., calls for taxi on ATC controlled airport property, or enters a holding pattern.','integer-field','USAF'),(6478,'masap-flight-interruption','Flight Delay Duration (Hrs)','','Arrival delay equals the difference of the actual arrival time minus the scheduled arrival time in hours. Delay calculations begin when the aircraft enters ATC jurisdiction, e.g., calls for taxi on ATC controlled airport property, or enters a holding pattern.','integer-field','USAF'),(6479,'masap-flight-interruption','Diversion','','Occurrences associated with change in scheduled flight routing/path to land at other than its original destination for reasons beyond the control of the pilot or company as a result of a malfunction, error, or external conditions, e.g., periods of significant weather','checkbox','USAF'),(6480,'masap-flight-interruption','Flight Interruption','','Occurrences associated with change in scheduled flight routing/path as a result of a malfunction, error, or external conditions, including when an aircraft is rerouted to an airport other than the planned primary destination airport.','checkbox','USAF'),(6481,'masap-flight-interruption','Gate Turnback','','When an aircraft has departed the gate and has returned to a gate without taking off.','checkbox','USAF'),(6482,'masap-flight-interruption','In-Flight Shutdown','','','checkbox','USAF'),(6483,'masap-flight-interruption','No Disruption','','','checkbox','USAF'),(6484,'masap-flight-interruption','Other Flight Diversion/Air-Ground Return','','Description of additional factor(s), not listed, associated with flight diversion or air-ground return.','text-field','USAF'),(6485,'masap-flight-interruption','Precautionary Landing','','A premeditated landing, on or off an airport, when further flight is possible but inadvisable. Examples of conditions that may call for a precautionary landing include deteriorating weather, being lost, fuel shortage, and gradually developing engine trouble.','checkbox','USAF'),(6486,'masap-flight-interruption','Rejected Takeoff','','Response associated with actions taken by a pilot that prevents a normal take-off once the aircraft has been cleared into position for takeoff and has crossed the hold line due to mechanical failures, conflicting traffic, aircraft malfunction, weather, or take-off surface obstacles.','checkbox','USAF'),(6487,'masap-flight-interruption','Rejected Takeoff: High Speed','','','checkbox','USAF'),(6488,'masap-flight-interruption','Rejected Takeoff: Initiation Speed (KIAS)','','','real-field','USAF'),(6489,'masap-flight-interruption','Rejected Takeoff: Low Speed','','','checkbox','USAF'),(6490,'masap-flight-interruption','Unplanned Emergency Landing','','','checkbox','USAF'),(6491,'masap-foreign-object-damage-error','Debris Falling into Open Systems','','A small amount of solid material, such as such as rocks, trash, wood, glass, rubble, or wreckage, that can cause damage by falling into or onto aircraft components, engines, tires, or skin that are uncovered.','checkbox','MEDA Rev g.'),(6492,'masap-foreign-object-damage-error','Debris on Ramp','','Foreign object debris that can cause damage to aircraft engines, tires, or skin from rocks, trash, or the actual debris found on runways, taxiways, and aprons. Refer to AC 150/5210-20: Ground Vehicle Operations on Airports (http://rgl.faa.gov/Regulatory_and_Guidance_Library/rgAdvisoryCircular.nsf/0/a2e66627b5f230ee86256d4f005af1fd/$FILE/150-5210-20.pdf) and AC 150/5380-5B: Debris Hazards at Civil Airports (http://rgl.faa.gov/Regulatory_and_Guidance_Library/rgAdvisoryCircular.nsf/0/50579dabea81c38686256c6a00721b80/$FILE/150-5380-5b.pdf).','checkbox','MEDA Rev g.'),(6493,'masap-foreign-object-damage-error','Foreign Object Damage Error','','Issues associated with the potential damage or performance/safety degradation to aircraft, equipment, personnel, and vehicles caused by miscellaneous articles, debris, and substances, including debris falling into open systems, debris on ramp, and material left in aircraft/engine.','checkbox','MEDA Rev g.'),(6494,'masap-foreign-object-damage-error','Lost Tool','','Caused by misplaced implement used to perform or facilitate manual or mechanical work.','checkbox','Operator'),(6495,'masap-foreign-object-damage-error','Material Dropped into Open System','','','checkbox','REDA'),(6496,'masap-foreign-object-damage-error','Material Left in Aircraft/Engine','','','checkbox','MEDA Rev g.'),(6497,'masap-foreign-object-damage-error','Other Foreign Object Damage Error','','Description of additional factors, not listed, associated with foreign object damage errors.','text-field','MEDA Rev g.'),(6498,'masap-fuel-event','Critically Low Fuel for Approach/Landing','','Specification of inadequate fuel reserve to complete flight operation','checkbox','USAF'),(6499,'masap-fuel-event','Fuel Distribution/Loading','','System to transfer fuel from one storage tank to another or from the storage tanks to the engines.','checkbox','USAF'),(6500,'masap-fuel-event','Fuel Event','','Occurrence involving the units and components storing and delivering fuel to the aircraft, including distribution, jettisoning, and refueling.','checkbox','USAF'),(6501,'masap-fuel-event','Fuel Load Incorrect/Fueling','','Issues associated with the provisioning by ground personnel related to the useable fuel, not the fuel required to fill the lines or that which remains trapped in the tank sumps.','checkbox','USAF'),(6502,'masap-fuel-event','Fuel Quantity Below Flight Plan/Re-Release Limits','','Indicates that the fuel load on board does not meets the requirements of the dispatch release and is inadequate for the route of flight.','checkbox','USAF'),(6503,'masap-fuel-event','Imbalance','','When the fuel tanks on opposite sides of the aircraft do not contain the same amount of fuel.','checkbox','USAF'),(6504,'masap-fuel-event','Jettison','','','checkbox','USAF'),(6505,'masap-fuel-event','Low Fuel Condition','','Occurrences associated with fuel resources provided for a particular operation being deficient in quality, quantity, or timeliness or not appropriate for the situation.','checkbox','USAF'),(6506,'masap-fuel-event','Fuel Event: Other','','Indicates additional occurrence, not listed, involving the units and components storing and delivering fuel to the aircraft, including distribution, jettisoning, and refueling.','text-field','USAF'),(6507,'masap-fuel-event','Fuel Quantity','','Indicates that the fuel load on board does not meets the requirements of the dispatch release and is inadequate for the route of flight.','combo-box','USAF'),(6508,'masap-fuel-event','Spillage','','The inadvertent release of fuel due to ground agent?s/mechanic?s failure to correctly load.','checkbox','USAF'),(6509,'masap-fuel-event','Venting','','','checkbox','USAF'),(6510,'masap-geographic-location','Airport','','Location of flight-crew or dispatcher expressed as three character IATA or four character ICAO code.','airport-ext-field','USAF'),(6511,'masap-geographic-location','Airspace','','The space above ground or water areas which is or is not controlled, assigned, and/or designated.','combo-box','USAF'),(6512,'masap-geographic-location','Airway/Route','','Specification of the airway/route associated with the occurrence. Airways--a Class E airspace area established in the form of a corridor, the centerline of which is defined by radio navigational aids. Route-- A route for which an IFR altitude has been established and published; e.g., Federal Airways, Jet Routes, Area Navigation Routes, Specified Direct Routes.','text-field','USAF'),(6513,'masap-geographic-location','Helipad Designated LZ','','','text-field','USAF'),(6514,'masap-geographic-location','Military Grid Reference System','','','text-field','USAF'),(6515,'masap-geographic-location','Navigational Aid/VORTAC','','http://www.faa.gov/airports_airtraffic/air_traffic/publications/atpubs/PCG/N.HTM','navaid-field','USAF'),(6516,'masap-geographic-location','Position','','The intersection of lines of reference, usually expressed in degrees/minutes/seconds of latitude and longitude, used to determine position or location of event.','lat-long-field','USAF'),(6517,'masap-geographic-location','STAR/SID/Approach','','STAR/SID/Approach procedure aircraft was on during event.','procedure-field','USAF'),(6518,'masap-geographic-location','Unknown/Other AirSpace','','','text-field','USAF'),(6519,'masap-geographic-location','Waypoint/Fix','','Waypoint-a predetermined geographical position that is defined in terms of latitude/longitude coordinates. Waypoints may be a simple named point in space or associated with existing navaids, intersections, or fixes. waypoint is most often used for route/instrument approach definition, progress reports, published VFR routes, visual reporting points or points for transitioning and/or circumnavigating controlled and/or special use airspace, that is defined relative to a VORTAC station or in terms of latitude/longitude coordinates. RNAV procedures make use of both fly-over and fly-by waypoints. Fix- a geographical position determined by visual reference to the surface, by reference to one or more radio NAVAIDs, by celestial plotting, or by another navigational device. Refer to AIM Chapter 1-1: Area Navigation (Navigation Aids) (http://www.faa.gov/airports_airtraffic/air_traffic/publications/atpubs/aim/Chap1/aim0101.html).','waypoint-field','USAF'),(6520,'masap-ground-equipment-use','Defective Equipment Use','','','checkbox','REDA'),(6521,'masap-ground-equipment-use','Driven into Equipment/Facility','','','checkbox','REDA'),(6522,'masap-ground-equipment-use','Driven off Ramp/Taxiway','','','checkbox','REDA'),(6523,'masap-ground-equipment-use','Driven/Pushed/Towed Into','','','checkbox','REDA'),(6524,'masap-ground-equipment-use','Driven Too Fast for Conditions','','','checkbox','REDA'),(6525,'masap-ground-equipment-use','Equipment Left in Wrong Place','','','checkbox','REDA'),(6526,'masap-ground-equipment-use','Ground Equipment Use','','Issues associated with correct use of equipment, including equipment defects, returned to incorrect place, and operated incorrectly or in an unsafe manner.','checkbox','REDA'),(6527,'masap-ground-equipment-use','Improper Aircraft Handling','','','checkbox','REDA'),(6528,'masap-ground-equipment-use','Improper Aircraft Operations Error','','Issues associated with the correct operation of the aircraft, including driven into equipment/facility and driven off ramp/taxiway. Refer to Example Application of Ramp Error Decision Aid (REDA) (http://204.108.6.79/products/documents/REDA%20Example%20Application.pdf).','checkbox','REDA'),(6529,'masap-ground-equipment-use','Improper Use of Equipment Error','','Issues associated with the in correct use of equipment, including equipment defects, returned to incorrect place, and operated incorrectly or in an unsafe manner. Refer to Example Application of Ramp Error Decision Aid (REDA) (http://204.108.6.79/products/documents/REDA%20Example%20Application.pdf).','checkbox','REDA'),(6530,'masap-ground-equipment-use','Incorrectly Operated','','','checkbox','REDA'),(6531,'masap-ground-equipment-use','Not for Intended Use','','','checkbox','REDA'),(6532,'masap-ground-equipment-use','Other Ground Equipment Use','','Description of additional factor(s), not listed, associated with ground equipment use.','text-field','REDA'),(6533,'masap-ground-safety-equipment','Equipment Modification','','','checkbox','Operator'),(6534,'masap-ground-safety-equipment','Ground Safety Equipment','','Occurrences and issues associated with failure of equipment used in ground operations for loading, servicing, or towing aircraft.','checkbox','Operator'),(6535,'masap-ground-safety-equipment','Hearing Protection','','','checkbox','Operator'),(653