tb.pdf). These include explosive, flammable, poisonous, corrosive, reactive, or radioactive, or any combination, and requires special care in handling because of the hazards it poses to public health and welfare, safety, and/or the environment. Refer to AC 121-21B: Information Guide for Training Programs and Manual Requirements in the Air Transportation of Hazardous Materials (http://rgl.faa.gov/Regulatory_and_Guidance_Library/rgAdvisoryCircular.nsf/1ab39b4ed563b08985256a35006d56af/e90c50d06627fb54862569ea00777bfe/$FILE/AC121-21B.pdf).','checkbox','USAF'),(6551,'masap-hazmat-event/potential-injury','Hazmat Not Labeled','','','checkbox','USAF'),(6552,'masap-hazmat-event/potential-injury','No MSDS','','Missing material safety data sheet (MSDS)- is a form containing data regarding the properties of a particular substance.','checkbox','USAF'),(6553,'masap-hazmat-event/potential-injury','Non-Compliance','','A failure to follow the guidance or rules created by the company for employees, passengers, and other individuals relating to proper standards and practices for hazardous materials that could possible result in harm.','checkbox','USAF'),(6554,'masap-hazmat-event/potential-injury','Other HAZMAT Event/Potential Injury','','Description of additional factor(s), not listed, associated with HAZMAT events and potential injuries.','text-field','USAF'),(6555,'masap-hazmat-event/potential-injury','Spillage','','The inadvertent release of fuel due to ground agent?s/mechanic?s failure to correctly load.','checkbox','USAF'),(6556,'masap-hazmat-event/potential-injury','Storage','','','checkbox','USAF'),(6557,'masap-hazmat-event/potential-injury','Training','','','checkbox','USAF'),(6558,'masap-helo-flight-crew-employee-information','Crew Position At Time of Event','','','combo-box','USAF'),(6559,'masap-helo-flight-information','Helo Phase of Flight','','','combo-box','USAF'),(6560,'masap-how-event-detected','618th TACC','','','checkbox','USAF'),(6561,'masap-how-event-detected','Aerial Port','','','checkbox','USAF'),(6562,'masap-how-event-detected','ATC','','Indicates that the occurrence was detected by Air Traffic Control (ATC). - A service operated by appropriate authority to promote the safe, orderly and expeditious flow of air traffic.','checkbox','USAF'),(6563,'masap-how-event-detected','Changeover Crew','','','checkbox','Operator'),(6564,'masap-how-event-detected','Dispatch','','Indicates the occurrence was identified by the dispatcher -- an airline employee who is responsible for authorizing the departure of an aircraft. The dispatcher must ensure, among other things, that the aircraft\'s crew have all the proper information necessary for their flight and that the aircraft is in proper mechanical condition.','checkbox','USAF'),(6565,'masap-how-event-detected','Emergency Personnel','','','checkbox','USAF'),(6566,'masap-how-event-detected','Engineering','','','checkbox','USAF'),(6567,'masap-how-event-detected','Flight Crew','','Occurrences associated with the activities of cockpit personnel authorized for flight.','checkbox','USAF'),(6568,'masap-how-event-detected','Flight Deck Observer','','','checkbox','USAF'),(6569,'masap-how-event-detected','Ground Service Technicians','','','checkbox','USAF'),(6570,'masap-how-event-detected','LRE','','','checkbox','Operator'),(6571,'masap-how-event-detected','Maintenance Personnel','','','checkbox','USAF'),(6572,'masap-how-event-detected','MCE','','','checkbox','Operator'),(6573,'masap-how-event-detected','MOC','','Maintenance Operations Control','checkbox','USAF'),(6574,'masap-how-event-detected','Operations Center/Maintenance Control','','','checkbox','USAF'),(6575,'masap-how-event-detected','Other Aircraft/Pilot','','Description of additional factor(s), not listed, associated with the detection of an event by another aircraft or pilot.','checkbox','USAF'),(6576,'masap-how-event-detected','Other (Detector)','','Description of additional factor(s), not listed, associated with how an event was detected.','text-field','USAF'),(6577,'masap-how-event-detected','Passenger','','','checkbox','USAF'),(6578,'masap-how-event-detected','Quality Assurance','','Issues associated with the corporate department who are responsible for developing a planned and systematic pattern of actions necessary to provide adequate confidence that an item or product conforms to established requirements.','checkbox','USAF'),(6579,'masap-how-event-detected','Regulatory Compliance','','A group within the company that ensures that the rules established by the federal regulations under which flight operations are conducted (as specified in the Code of Federal Regulations (CFR), particularly the Federal Aviation Regulations(FARs) are followed.','checkbox','USAF'),(6580,'masap-how-event-detected','Safety','','','checkbox','USAF'),(6581,'masap-how-event-detected','Self Awareness/Scan','','','checkbox','USAF'),(6582,'masap-how-event-detected','Sole Source/Individual','','','checkbox','USAF'),(6583,'masap-how-event-detected','SOF','','','checkbox','USAF'),(6584,'masap-how-event-detected','Unknown','','','checkbox','USAF'),(6585,'masap-human-error','Altitude Planning/Awareness','','','checkbox','USAF'),(6586,'masap-human-error','Disregard for Polices/Procedures','','','checkbox','USAF'),(6587,'masap-human-error','Human Error','','Issues associated with a human action (or human behavior) that unintentionally deviates from the expected action (or behavior) or fails to achieve what should be done. Errors can be predictable and random. Errors can also be categorized as primary or contributory. Primary errors are those committed by personnel immediately and directly involved with the accident. Contributory errors result from actions on the part of personnel whose duties preceded and affected the situation during which the results of the error became apparent. The difference between a computed, observed, or measured value or condition and true, specified, or theoretically correct value or condition. A mistake in engineering, requirement specification, or design, implementation, or operation which could result in a failure, and /or contributory hazard. There are four types of Human Errors: 1) Omission 2) Commission 3) Sequence 4) Timing.','checkbox','USAF'),(6589,'masap-human-error','Judgment Error','','','checkbox','USAF'),(6590,'masap-human-error','Maintenance Error (MEL, Oversight, MOC, Non-Compliance)','','Issues associated with maintenance actions that unintentionally deviates from the expected action (or behavior) or fails to achieve what should be done associated with maintenance actions including the Minimum Equipment List (MEL), overseeing maintenance tasking, Maintenance Operational Control (MOC), and failure to follow the regulations and requirements.','checkbox','USAF'),(6591,'masap-human-error','Misapplication of Flight Controls','','','checkbox','USAF'),(6592,'masap-human-error','Misapplication of Polices/Procedures','','','checkbox','USAF'),(6593,'masap-human-error','Misapplication of System Knowledge','','','checkbox','USAF'),(6594,'masap-human-error','Necessary Action Delayed','','','checkbox','USAF'),(6595,'masap-human-error','Necessary Action Ignored','','','checkbox','USAF'),(6596,'masap-human-error','Other Human Error','','Description of additional factor(s), not listed, associated with human error.','text-field','USAF'),(6597,'masap-human-error','Poor Performance Planning','','Deficiencies in the accomplishment of a task in accordance with a set standard of completeness and accuracy.','checkbox','USAF'),(6598,'masap-human-error','Weight and Balance Error','','Issues associated with employee action that unintentionally deviates from the expected action or fails to achieve what should be done related to the proper distribution of the load according to policies and procedures.','checkbox','USAF'),(6599,'masap-human-factors','Aircrew Error','','','combo-box','USAF'),(6600,'masap-human-factors','air-medical-crew Error','','','combo-box','USAF'),(6602,'masap-human-factors','Automation-GPS or HTAWS','','','checkbox','USAF'),(6603,'masap-human-factors','CRM','','','combo-box','USAF'),(6604,'masap-human-factors','Equipment Limitation','','Equipment is planned, built, and/or installed in such a way that it is difficult to use or which could lead to failures or errors.','checkbox','USAF'),(6605,'masap-human-factors','Equipment Placement','','','checkbox','USAF'),(6606,'masap-human-factors','Ergonomics','','Issues due to incompatibilities in system design. Ergonomics (or human factors) is the scientific discipline concerned with the understanding of interactions among humans and other elements of a system, and the profession that applies theory, principles, data and methods to design in order to optimize human well-being and overall system performance. Ergonomists contribute to the design and evaluation of tasks, jobs, products, environments and systems in order to make them compatible with the needs, abilities and limitations of people.','checkbox','USAF'),(6607,'masap-human-factors','Intentional Deviation/Disregard','','','checkbox','USAF'),(6608,'masap-human-factors','Keystroke Error','','','checkbox','Operator'),(6609,'masap-human-factors','MRM','','','combo-box','USAF'),(6610,'masap-human-factors','Other Human Factors','','Description of additional factor(s), not listed, associated with human factors.','text-field','USAF'),(6611,'masap-human-factors','Poor Product Design','','Inadequate design of equipment item, including human engineering features which facilitate usage and maintenance such as handles, self-test capability, labeling, connector spacing, and keying','checkbox','USAF'),(6612,'masap-human-factors','Scheduling Issues','','','checkbox','USAF'),(6613,'masap-human-factors','User Interface','','Refers to the aspects of hardware or software which can be seen (or heard or otherwise perceived) by the human user, and the commands and mechanisms the user uses to control its operation and input data.','checkbox','USAF'),(6614,'masap-illness/injury-event','Airport Medical Response','','','checkbox','USAF'),(6615,'masap-illness/injury-event','Contacted Ground Medical Service','','Use of services, like MedAire, to provide the carrier with medical assistance and guidance in flight.','combo-box','USAF'),(6616,'masap-illness/injury-event','Emergency/Life Support Issues','','Occurrences and issues associated with the utilization, deficiencies, or failures of emergency or life support personnel and procedures.','checkbox','USAF'),(6617,'masap-illness/injury-event','Emergency Personnel','','Individuals called to the scene of a crisis or responding to emergency calls to provide assistance, including emergency medical technicians, police, hotline/crisis line personnel; fire and rescue; child protective services and others.','checkbox','USAF'),(6618,'masap-illness/injury-event','Flight Deck Crew','','Medical condition for a flight deck crewmember which occurred while performing required duties that significantly degrades their ability to function and requiring treatment or absence from duty, categorized as: (1) Fatality -- a death that occurs onboard the aircraft due to accident or illness; (2) Incapacitation -- total inability of an employee to perform in a normal manner due to a medical condition; (3) Illness--a non-fatal medical condition occurring on the aircraft to an employee that significantly degrades their ability to function; (4) Injury-non-fatal injury to an employee requiring medical attention or absence from duty. A serious injury is defined as any injury any injury which: (1) Requires hospitalization for more than 48 hours, commencing within 7 days from the date the injury was received; (2) Results in a fracture of any bone (except simple fractures of fingers, toes, or nose); (3) Causes severe hemorrhages, nerve, muscle, or tendon damage; (4) Involves any internal organ; or (5) Involves second or third degree burns, or any burns affecting more than 5 percent of the body surface','combo-box','USAF'),(6619,'masap-illness/injury-event','Location Where Injury Occurred','','','combo-box','USAF'),(6620,'masap-illness/injury-event','Medical Emergency','','A medical emergency is a sudden onset of a condition that poses an immediate threat to a person\'s health or life requiring immediate medical care and includes such conditions as heart attacks, cardiovascular accidents, poisonings, loss of consciousness or respiration, convulsions or other such acute medical conditions.','checkbox','USAF'),(6621,'masap-illness/injury-event','Medical Onboard','','','checkbox','USAF'),(6622,'masap-illness/injury-event','Illness/Injury Event: Other','','Indicates additional occurrences and issues, not listed, associated with non-fatal medical condition to passengers, crew, or other employees that significantly degrades their ability to function.','text-field','USAF'),(6623,'masap-illness/injury-event','Turbulence','','The irregular and instantaneous motions of air which is made up of a number of small of eddies that travel in the general air current. Atmospheric turbulence is caused by random fluctuations in the wind flow. It can be caused by thermal or convective currents, differences in terrain and wind speed, along a frontal zone, or variation in temperature and pressure. Duration and classification of intensity are categorized as (AIM Table 7-1-9: Turbulence Reporting Criteria Table (http://www.faa.gov/airports_airtraffic/air_traffic/publications/atpubs/aim/Chap7/aim0701.html#7-1-24): (1) Light-Turbulence that momentarily causes slight, erratic changes in altitude and/or attitude (pitch, roll, yaw) (Reported as Light Turbulence or Turbulence) or that causes slight, rapid and somewhat rhythmic bumpiness without appreciable changes in altitude or attitude (Reported as Light Chop*); (2) Moderate-Turbulence that is similar to Light Turbulence but of greater intensity. Changes in altitude and/or attitude occur but the aircraft remains in positive control at all times. It usually causes variations in indicated airspeed (Reported as Moderate Turbulence) or Turbulence that is similar to Light Chop but of greater intensity. It causes rapid bumps or jolts without appreciable changes in aircraft altitude or attitude (Reported as Moderate Chop*); (3) Severe-Turbulence that causes large, abrupt changes in altitude and/or attitude. It usually causes large variations in indicated airspeed. Aircraft may be momentarily out of control (Report as Severe Turbulence)*; (4) Extreme: Turbulence in which the aircraft is violently tossed about and is practically impossible to control. It may cause structural damage (Reported as Extreme Turbulence). *High level turbulence (normally above 15,000 feet ASL) not associated with cumuliform cloudiness, including thunderstorms, should be reported as CAT (Clear Air Turbulence) preceded by the appropriate intensity, or light or moderate chop.','combo-box','USAF'),(6624,'masap-illness/injury-event','Type of Injury','','','combo-box','USAF'),(6625,'masap-improper-installation','Faulty Hardware Attachment','','','checkbox','Operator'),(6626,'masap-improper-installation','Cross Connection','','','checkbox','MEDA Rev g.'),(6627,'masap-improper-installation','Damaged on Installation','','','checkbox','MEDA Rev g.'),(6628,'masap-improper-installation','Extra Parts Installed','','','checkbox','MEDA Rev g.'),(6629,'masap-improper-installation','Hardware Missing (Not Installed)','','','checkbox','Operator'),(6630,'masap-improper-installation','Improper Location','','','checkbox','MEDA Rev g.'),(6631,'masap-improper-installation','Incomplete Installation','','','checkbox','MEDA Rev g.'),(6632,'masap-improper-installation','Ineffective Part','','','checkbox','Operator'),(6633,'masap-improper-installation','Improper Installation','','Issues associated with employee action that unintentionally deviates from the expected action or fails to achieve what should be done related to connection, setting-in position, and/or preparing for use of equipment or part, including not closing access, causing damage, improper deactivation/reactivation, incorrect installation, use of wrong equipment or part.','checkbox','MEDA Rev g.'),(6634,'masap-improper-installation','Lack of Parts/Resources','','','checkbox','M-DNAA V7.0 C1.9'),(6635,'masap-improper-installation','Missing Part (Not Installed)','','Unable to complete installation to inability to locate required part.','checkbox','MEDA Rev g.'),(6636,'masap-improper-installation','Non-LRU Replaced (Shop Level Task)','','','checkbox','M-DNAA V7.0 B2.1'),(6637,'masap-improper-installation','Not Secured','','','checkbox','M-DNAA V7.0 B2.1'),(6638,'masap-improper-installation','Non Re/Deactivated','','','checkbox','MEDA Rev g.'),(6639,'masap-improper-installation','Other Installation Error','','Description of additional factor(s), not listed, associated with  installation error.','text-field','MEDA Rev g.'),(6640,'masap-improper-installation','Panel Left Open','','','checkbox','MEDA Rev g.'),(6641,'masap-improper-installation','Required Equipment Not Installed','','','checkbox','Operator'),(6642,'masap-improper-installation','Wrong Orientation','','','checkbox','MEDA Rev g.'),(6643,'masap-improper-installation','Wrong Equipment/Part Installed','','','checkbox','MEDA Rev g.'),(6644,'masap-improper-procedure','Improper Procedure','','','checkbox','Operator'),(6645,'masap-improper-procedure','Missed Discrepancy','','','checkbox','Operator'),(6646,'masap-improper-procedure','Other Incorrect Procedure','','Description of additional factor(s), not listed, associated with incorrect procedures.','text-field','M-DNAA V7.0 B2.7'),(6647,'masap-improper-procedure','Procedure Not Followed','','','checkbox','M-DNAA V7.0 B2.7'),(6648,'masap-improper-procedure','Procedures Not Workable','','','checkbox','UTRS'),(6649,'masap-improper-procedure','Skipped Procedure','','','checkbox','M-DNAA V7.0 B2.7'),(6650,'masap-improper-procedure','Skipped Steps','','','checkbox','M-DNAA V7.0 B2.7'),(6651,'masap-improper-procedure','Skipped Warning','','','checkbox','M-DNAA V7.0 B2.7'),(6652,'masap-improper-procedure','Wrong Procedure Followed','','','checkbox','M-DNAA V7.0 B2.7'),(6653,'masap-improper-servicing','Access Not Closed','','','checkbox','MEDA Rev g.'),(6654,'masap-improper-servicing','Not Enough Gas/Liquid','','','checkbox','MEDA Rev g.'),(6655,'masap-improper-servicing','Other Servicing Error','','Description of additional factor(s), not listed, associated with the servicing error.','text-field','MEDA Rev g.'),(6656,'masap-improper-servicing','Performed But Not Documented','','','checkbox','M-DNAA V7.0 B2.3'),(6657,'masap-improper-servicing','Not Performed','','','checkbox','MEDA Rev g.'),(6658,'masap-improper-servicing','Servicing Error','','Issues associated with employee action that unintentionally deviates from the expected action or fails to achieve what should be done related to the replenishment of aircraft supplies, such as fluids and lubrication, necessary to maintain an aircraft in a sound overall condition, including access closure, deactivation/reactivation, incorrect fluid, not performing service, and quantity.','checkbox','MEDA Rev g.'),(6659,'masap-improper-servicing','System/Equipment not Deactivated/Reactivated','','','checkbox','MEDA Rev g.'),(6660,'masap-improper-servicing','Too Much Gas/Liquid','','','checkbox','MEDA Rev g.'),(6661,'masap-improper-servicing','Wrong Gas/Liquid','','','checkbox','MEDA Rev g.'),(6662,'masap-incursion-event','Incursion Event','','Occurrences on or near an airport runway associated with the collision with, risk of collision, or evasive action taken by an aircraft to avoid, a vehicle, person, object on the ground, or other aircraft on an active ramp, runway, or taxiway by an aircraft or ground vehicle other than the vehicle cleared for operation on that surface.','checkbox','USAF'),(6663,'masap-incursion-event','Other Incursion Event','','Description of additional factor(s), not listed, associated with incursion incidents or events.','text-field','USAF'),(6664,'masap-incursion-event','Ramp Incursion','','Occurrences on or near an airport runway associated with the collision with, risk of collision, or evasive action taken by an aircraft to avoid, a vehicle, person, object on the ground, or other aircraft on an active ramp by an aircraft or ground vehicle other than the vehicle cleared for operation on that surface that creates a collision hazard or loss of separation while an aircraft taking off, intending to takeoff, landing, or intending to land.','checkbox','USAF'),(6665,'masap-incursion-event','Runway Incursion','','http://web.nbaa.org/public/ops/safety/icao_pri07.pdf','checkbox','USAF'),(6666,'masap-incursion-event','Runway Incursion Error Type','','Runway Incursion Error Type defined as: (1) Operational Error/Deviation-an action by an air traffic controller that results in less than the required minimum separation between two or more aircraft, or between an aircraft and obstacle (e.g., vehicles, equipment, personnel on runways/an occurrence attributable to an element of the air traffic system in which applicable separation minima were maintained, but an aircraft, vehicle, equipment, or personnel encroached upon a landing area that was delegated to another position of operation without prior coordination and approval; (2) Pilot Deviation-an action of a pilot that violates any FARs; or (3) Vehicle/Pedestrian Deviation-Vehicles or pedestrians moving on the runway movement area without authorization from air traffic control that interferes with aircraft operations.','combo-box','USAF'),(6667,'masap-incursion-event','Runway Incursion Severity','','Runway Incursion severity classified as: A-separation decreases and participants take extreme action to narrowly avoid a collision, or the event results in a collision; B-separation decreases and there is a significant potential for collision; C-Separation decreases but there is ample time and distance to avoid a potential collision; D-Little or no chance of collision but meets the definition of a runway incursion.','combo-box','USAF'),(6668,'masap-incursion-event','Taxiway Incursion','','Occurrences on or near an airport runway associated with the collision with, risk of collision, or evasive action taken by an aircraft to avoid, a vehicle, person, object on the ground, or other aircraft on an active taxiway by an aircraft or ground vehicle other than the vehicle cleared for operation on that surface.','checkbox','USAF'),(6669,'masap-individual-factors','Aircrew Hypoxia','','','checkbox','USAF'),(6670,'masap-individual-factors','Aircrew Loss of Consciousness','','','checkbox','USAF'),(6671,'masap-individual-factors','Aircrew Trapped Gas Disorder','','','checkbox','USAF'),(6672,'masap-individual-factors','Decompression Sickness','','','checkbox','USAF'),(6673,'masap-individual-factors','Environmental Stressors','','Environmental factors that can adversely affect employee?s level of alertness, including heat, humidity, cold, altitude, vibration, and noise.','checkbox','USAF'),(6674,'masap-individual-factors','Experience Level','','Employee has too little/too much experience in this area and this had a negative impact on the situation','checkbox','USAF'),(6675,'masap-individual-factors','Extended Duty','','Combination of long work periods and other non-duty factors contribute to on-the-job fatigue, by limiting the available time for recreation, rest, and sleep. Over extended working periods, repeated inadequate sleep periods can result in accumulated sleep debt and associated operator fatigue. Among the primary aspects of extended work and/or commuting periods are: (1) long commutes to or from work on a daily basis; (2) long waits after reporting for work before duty begins, (3) forced interruptions in work that extend the duty day; (4) long commutes from home to report for work prior to beginning a multi-day work period.','checkbox','USAF'),(6676,'masap-individual-factors','Fatigue','','scitech.dot.gov/research/human/docs/fatigue/fmr07-03.doc','checkbox','USAF'),(6677,'masap-individual-factors','Fear/Panic','','Crewmember afraid or suddenly frightened','checkbox','USAF'),(6678,'masap-individual-factors','High Workload/Task Saturation','','Excessive amount of work to be performed in a given time period.','checkbox','USAF'),(6679,'masap-individual-factors','Inadequate Training','','','checkbox','USAF'),(6680,'masap-individual-factors','Injury Incurred by Laser','','','checkbox','USAF'),(6681,'masap-individual-factors','Insufficient Attention to Detail','','Lack of effort towards discovering the small elements of the situation','checkbox','USAF'),(6682,'masap-individual-factors','Interruption/Distraction','','Interruption caused focus of attention to be shifted or diverted away from task. Issues involve proper allocation of tasks to individuals, avoidance of work overloads in self and in others, prioritization of tasks during periods of high workload, and preventing nonessential factors from distracting attention from adherence to SOPs, particularly those relating to critical tasks. Refer to AC 120-51E: Crew Resource Management Training (http://rgl.faa.gov/Regulatory_and_Guidance_Library/rgAdvisoryCircular.nsf/0/80038cf51aace53686256e24005cbb23/$FILE/AC120-51e.pdf).','checkbox','USAF'),(6683,'masap-individual-factors','Lack of Assertiveness','','','checkbox','USAF'),(6684,'masap-individual-factors','Lack of Motivation','','Drive or influence that is internally or externally generated','checkbox','USAF'),(6685,'masap-individual-factors','Lack of Rest Periods','','Impact on fatigue due to unavailability of planned rest period to supplement sleep and to temporarily restore alertness on the job. Rest periods are free of all restraint or duty for an employee and free of all responsibility for work or duty should the occasion arise. Refer to FAR Sec. 121.471: Flight time limitations and rest requirements-All flight crewmembers (http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/0CD035F7648A95F8852566EF006D0B3D?OpenDocument&Highlight=121.471); Sec. 121.481: Flight time limitations-One or two pilot crews (http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/0CD035F7648A95F8852566EF006D0B3D?OpenDocument&Highlight=121.481); Sec. 121.505: Flight time limitations-Two pilot crews: airplanes (http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/0CD035F7648A95F8852566EF006D0B3D?OpenDocument&Highlight=121.505); and Sec. 121.467: Flight attendant duty period limitations and rest requirements (http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/0CD035F7648A95F8852566EF006D0B3D?OpenDocument&Highlight=121.467).','checkbox','USAF'),(6686,'masap-individual-factors','Lack of Situational Awareness','','Not having accurate perception and understanding of all the factors and conditions going around you within the four fundamental risk elements that affect safety before, during, and after the flight or knowing which parameters are important.','checkbox','USAF'),(6687,'masap-individual-factors','Memory Lapse (Forgot)','','A planned action was unintentionally omitted.','checkbox','USAF'),(6688,'masap-individual-factors','No Training','','','checkbox','USAF'),(6689,'masap-individual-factors','On Time Performance Pressure','','Issues associated with pressure to ensure that the aircraft leaves  and arrives at its destination on time.','checkbox','USAF'),(6690,'masap-individual-factors','Other Individual Factors','','Description of additional factor(s), not listed, associated with individual factors.','text-field','USAF'),(6691,'masap-individual-factors','Peer Pressure','','Constraints or burdens generated by one\'s friends or coworkers','checkbox','USAF'),(6692,'masap-individual-factors','Perceptual Illusion/Spatial Disorientation','','Misinterpretation of visual or spatial cues due to illusions of motion and disorientation, stimuli difficult to perceive.','checkbox','USAF'),(6693,'masap-individual-factors','Personal Attitudes Toward Safety','','Individual beliefs and feelings about safety','checkbox','USAF'),(6694,'masap-individual-factors','Personal Event','','Includes family problem, car accident, etc.','checkbox','USAF'),(6695,'masap-individual-factors','Stress','','Individual mental or physical tension from the pressures of everyday living that can impair performance. Difficulties, particularly at work, can occupy thought processes enough to markedly decrease alertness. Distraction can so interfere with judgment that unwarranted risks are taken, such as flying into deteriorating weather conditions to keep on schedule. Stress and fatigue can be an extremely hazardous combination. Refer to AIM Chapter 8-1-1f: Fitness For Flight Stress (http://www.faa.gov/airports_airtraffic/air_traffic/publications/atpubs/aim/Chap8/aim0801.html).','checkbox','USAF'),(6696,'masap-individual-factors','Physical Health','','Factors related to general health/fitness/lifestyle (including hearing and sight) which may affect work performance and safety, as opposed to specific illness or incapacitation.','checkbox','USAF'),(6697,'masap-individual-factors','Procedural-Checklists/Flows/Crosschecking','','','checkbox','USAF'),(6698,'masap-individual-factors','Proficiency','','','checkbox','Operator'),(6699,'masap-individual-factors','Self-Induced Time Pressure','','Individual personal desire to depart the gate/arrive at the destination at the scheduled time','checkbox','USAF'),(6700,'masap-individual-factors','Sleep Disruption','','Impact of fatigue due to sleep interruptions or disturbances sleep that can make returning to sleep more difficult.  It has been shown that both the number and timing of disruptions can affect daytime sleepiness and fatigue.','checkbox','USAF'),(6701,'masap-individual-factors','Sleep/Work Periods Conflict with Circadian Rhythms','','When work schedules require employees to obtain their sleep during times that are normally awake periods, the quality and quantity of sleep suffers. Work during ?low? periods of the circadian rhythm (approximately 0100-0400 hours and 1300-1600 hours) can be associated with drowsiness and a low level of alertness.','checkbox','USAF'),(6702,'masap-individual-factors','Untimely Training','','','checkbox','USAF'),(6703,'masap-job/task','Awkward Position','','http://www.ergoweb.com/resources/faq/glossary.cfm','checkbox','REDA'),(6704,'masap-job/task','Complex/Confusing','','','checkbox','MEDA Rev g.'),(6705,'masap-job/task','Different from Other Similar Tasks','','','checkbox','MEDA Rev g.'),(6706,'masap-job/task','Emergency Mission','','','checkbox','USAF'),(6707,'masap-job/task','Job/Task Factors','','Issues associated with the ground personnel or maintenance technician\'s job assignment and associated combination or sequence of tasks, including complexity, confusion, differences from similar tasks, and repetition/monotony.','checkbox','MEDA Rev g.'),(6708,'masap-job/task','Vibrations','','http://www.workriteergo.com/ergonomics/glossary.asp','checkbox','Operator'),(6709,'masap-job/task','Long Duration','','','checkbox','REDA'),(6710,'masap-job/task','New Task or Task Change','','','checkbox','MEDA Rev g.'),(6711,'masap-job/task','Other Job/Task Factors','','Description of additional factor(s), not listed, associated with job and task factors.','text-field','MEDA Rev g.'),(6712,'masap-job/task','Repetitive/Monotonous','','','checkbox','MEDA Rev g.'),(6713,'masap-job/task','Requires Forceful Exertions','','','checkbox','REDA'),(6714,'masap-job/task','Requires Kneeling/Bending/Stooping','','','checkbox','REDA'),(6715,'masap-landing-event','Confined Area Landing','','','checkbox','USAF'),(6716,'masap-landing-event','Crosswind Crab Problem','','','checkbox','USAF'),(6717,'masap-landing-event','Gear Up Landing','','','checkbox','USAF'),(6718,'masap-landing-event','Hard Landing','','A landing of an aircraft in which the vertical component of the speed at which ground contact is made is higher than the maximum normal operating value specified in the aircraft design. A hard landing must be followed by an inspection of the landing gear and support structure for possible damage before the aircraft is permitted to fly again.','checkbox','USAF'),(6719,'masap-landing-event','LAHSO Issue','','Land and Hold Short Operation which include simultaneous takeoffs and landings and/or simultaneous landings when a landing aircraft is able and is instructed by the controller to hold-short of the intersecting runway/taxiway or designated hold-short point. Pilots are expected to promptly inform the controller if the hold short clearance cannot be accepted.','checkbox','USAF'),(6720,'masap-landing-event','Landing Event','','Occurrences during the period from the beginning of the landing flare until aircraft exits the landing runway, comes to a stop on the runway, or when power is applied for takeoff in the case of a touch-and-go landing.','checkbox','USAF'),(6721,'masap-landing-event','Landing Long','','','checkbox','USAF'),(6722,'masap-landing-event','Landing Short','','','checkbox','USAF'),(6723,'masap-landing-event','Misconfiguration','','','checkbox','USAF'),(6724,'masap-landing-event','Other Landing Event','','Description of additional factor(s), not listed, associated with landing incidents or events.','text-field','USAF'),(6725,'masap-landing-event','Overweight Landing','','Any occurrences associated with non-compliance with FAR Sec 121.185 for landing limitations at the destination airport and the aircraft lands heavier than its Maximum Landing Weight (the greatest weight that an airplane normally is allowed to have at landing).','checkbox','USAF'),(6726,'masap-landing-event','RCR Issues','','','checkbox','USAF'),(6727,'masap-landing-event','Tailstrike','','An event involving the over-rotation of the aircraft during takeoff or landing with the tail of the aircraft impacting the ground.','checkbox','USAF'),(6728,