,'masap-leadership/supervision','Unrealistic Attitude/Expectations','','Personal motivational predisposition to respond to persons, situations, or events in a given manner that are not compatible with reality or fact that can, nevertheless, be changed or modified through training as sort of a mental shortcut to decision making.','checkbox','MEDA Rev g.'),(6743,'masap-light/visibility','Light Conditions','','The amount of available natural light.','combo-box','USAF'),(6744,'masap-light/visibility','Light/Visibility','','The amount of available artificial or natural light including ceiling, nighttime operations, restrictions, and Runway Visual Range (RVR). Flight visibility is defined as the average forward horizontal distance, from the cockpit of an aircraft in flight, at which prominent unlighted objects may be seen and identified by day and prominent lighted objects may be seen and identified by night.','checkbox','USAF'),(6745,'masap-light/visibility','Low Visibility/Low Ceiling','','The ability, as determined by atmospheric conditions and expressed in units of distance, to see and identify prominent unlighted objects by day and prominent lighted objects by night.  Low visibility can cause arrival and departure delays when aircraft separation increases for spacing and increased safety.','checkbox','USAF'),(6746,'masap-light/visibility','Nighttime Operations','','Activities occurring between the time between the end of evening civil twilight and the beginning of morning civil twilight, as published in the American Air Almanac, converted to local time.','checkbox','USAF'),(6747,'masap-light/visibility','Other Light/Visibility','','Description of additional factor(s), not listed, associated with light and visibility.','text-field','USAF'),(6748,'masap-light/visibility','Visibility Restrictions','','Limitations on the flight visibility from the cockpit of an aircraft in flight, due to darkness, fog, haze, IMC, low light, mist, smoke, blowing snow, blowing dust and volcanic ash; wind at altitude; and temperature aloft.','checkbox','USAF'),(6749,'masap-light/visibility','RVR (Ft)','','Runway Visual Range: the maximum distance along the runway at which the runway lights are visible to a pilot after touchdown. Also refer to AIM Section 7-1-16. Runway Visual Range (RVR) (http://www.faa.gov/airports_airtraffic/air_traffic/publications/atpubs/aim/Chap7/aim0701.html#7-1-28).','integer-field','USAF'),(6750,'masap-light/visibility','Visibility (SM)','','The ability, as determined by atmospheric conditions and expressed in units of distance, to see and identify prominent unlighted objects by day and prominent lighted objects by night. Visibility is reported as statute miles, hundreds of feet or meters.','integer-field','USAF'),(6751,'masap-machine','Hardware','','','combo-box','USAF'),(6752,'masap-machine','Hardware Design (change name to Design)','','','combo-box','USAF'),(6753,'masap-machine','Other Machine','','','text-field','USAF'),(6754,'masap-machine','Software','','','combo-box','USAF'),(6755,'masap-maintenance-employee-information','Airforce Specialty Code','','','text-field','USAF'),(6756,'masap-maintenance-employee-information','Appropriately Qualified for Task?','','','checkbox','M-DNAA V7.0 A1.6'),(6757,'masap-maintenance-employee-information','Consecutive Days on Duty','','','integer-field','UTRS'),(6758,'masap-maintenance-employee-information','Contact Name','','','text-field','USAF'),(6759,'masap-maintenance-employee-information','Current Workshift','','','combo-box','M-DNAA V7.0 A2.2'),(6760,'masap-maintenance-employee-information','Days Since Last Day Off at Time of Event','','','real-field','M-DNAA V7.0 A3.8'),(6761,'masap-maintenance-employee-information','Did Event Occur on Overtime?','','','checkbox','M-DNAA V7.0 A3.6'),(6762,'masap-maintenance-employee-information','Duty Off Time','','','date-time-field','Operator'),(6763,'masap-maintenance-employee-information','Duty On Time','','','date-time-field','Operator'),(676