gned To','','','combo-box','USAF'),(6776,'masap-maintenance-employee-information','Work Location','','','combo-box','M-DNAA V7.0 A2.1'),(6777,'masap-maintenance-factors','Attention to Detail','','','checkbox','USAF'),(6778,'masap-maintenance-factors','Complacency','','','checkbox','USAF'),(6779,'masap-maintenance-factors','Equipment Limitations','','','checkbox','USAF'),(6780,'masap-maintenance-factors','Failure to Follow Tech Orders','','','checkbox','USAF'),(6781,'masap-maintenance-factors','Maintenance Fatigue','','','checkbox','USAF'),(6782,'masap-maintenance-factors','Rushed by Supervision','','','checkbox','USAF'),(6783,'masap-maintenance-ground-operations-event','AGE','','','checkbox','USAF'),(6784,'masap-maintenance-ground-operations-event','APU Operations','','The Auxiliary Power Unit provides power for engine-starting and other systems while on the ground (ATA code 49-**).','checkbox','Operator'),(6785,'masap-maintenance-ground-operations-event','MTX-Comp Base Error','','','text-field','USAF'),(6786,'masap-maintenance-ground-operations-event','Cargo Damaged','','','checkbox','Operator'),(6787,'masap-maintenance-ground-operations-event','Cargo Loading','','Occurrences associated with the act of loading cargo and baggage onto a flight.','checkbox','Operator'),(6788,'masap-maintenance-ground-operations-event','Clearance Deviation-Surface Incident','','http://www.faa.gov/runwaysafety/pdf/report4.pdf','checkbox','Operator'),(6789,'masap-maintenance-ground-operations-event','De-Icing Fluid Application','','','checkbox','Operator'),(6790,'masap-maintenance-ground-operations-event','De-Icing','','Indicates occurrence or issues associated with preflight ground servicing to remove existing frozen precipitation, frost or ice from aircraft surfaces. The processes may involve the application of various fluids to the aircraft','checkbox','DNAA'),(6791,'masap-maintenance-ground-operations-event','Difficult/Lost Communications','','Loss of the ability to communicate by radio.','checkbox','DNAA'),(6792,'masap-maintenance-ground-operations-event','Equipment','','','checkbox','Operator'),(6793,'masap-maintenance-ground-operations-event','Equipment In Safety Zone','','','checkbox','Operator'),(6794,'masap-maintenance-ground-operations-event','Equipment Relocation','','','checkbox','Operator'),(6795,'masap-maintenance-ground-operations-event','Equipment Unsafe Driving','','','checkbox','Operator'),(6796,'masap-maintenance-ground-operations-event','Equipment Malfunction/Inoperative','','','checkbox','DNAA'),(6797,'masap-maintenance-ground-operations-event','Fleet Services-Fuel/Cleaners/Caterers','','','checkbox','Operator'),(6798,'masap-maintenance-ground-operations-event','FOD','','Foreign Object Debris. Debris on the ramp, taxiway or runway that may cause damage to the aircraft.','checkbox','Operator'),(6799,'masap-maintenance-ground-operations-event','Fueling','','','checkbox','Operator'),(6800,'masap-maintenance-ground-operations-event','Ground Services Procedures','','','checkbox','Operator'),(6801,'masap-maintenance-ground-operations-event','HAZMAT Exposure','','Contact with any Hazardous Material (HAZMAT) substance/material defined as pose a potential risk to life, health, or property by various regulations administered by the US Environmental Protection Agency and the US Department of Transportation as specified in 49 CFR 172.101 Hazardous Materials Table (http://www.setonresourcecenter.com/transportation/49CFR/172_101tb.pdf). These include explosive, flammable, poisonous, corrosive, reactive, or radioactive, or any combination, and requires special care in handling because of the hazards it poses to public health and welfare, safety, and/or the environment. Refer to AC 121-21B: Information Guide for Training Programs and Manual Requirements in the Air Transportation of Hazardous Materials (http://rgl.faa.gov/Regulatory_and_Guidance_Library/rgAdvisoryCircular.nsf/1ab39b4ed563b08985256a35006d56af/e90c50d06627fb54862569ea00777bfe/$FILE/AC121-21B.pdf).','checkbox','DNAA'),(6802,'masap-maintenance-ground-operations-event','Improper Documentation','','Incorrect or erroneous information or meaningful data and its supporting medium (e.g., paper, electronic, etc.).','checkbox','ASRS'),(6803,'masap-maintenance-ground-operations-event','Late Delivery of Cargo','','','checkbox','Operator'),(6804,'masap-maintenance-ground-operations-event','Maintenance Error Description','','Description of the specific maintenance error (e.g., auto pressure controller installed in wrong location) involved in the event or incident.','text-field','MEDA Rev g.'),(6805,'masap-maintenance-ground-operations-event','Maintenance Procedures','','','checkbox','Operator'),(6806,'masap-maintenance-ground-operations-event','Marshalling/Wing Walkers','','','checkbox','DNAA'),(6807,'masap-maintenance-ground-operations-event','MEL','','Minimum Equipment List (MEL)/Configuration Deviation List (CDL) faults or defects found on an aircraft which do not need immediate action and can be deferred for repair at a later date. This deferred defect status is only given for a strictly limited period of time and rectification must take place before that time has elapsed. Refer to FAR 125.201: Inoperable instruments and equipment (http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/58CF936FD6E2A36186256959004E132E?OpenDocument&Highlight=125.201).','checkbox','Operator'),(6808,'masap-maintenance-ground-operations-event','Non Mission Capable','','','checkbox','USAF'),(6809,'masap-maintenance-ground-operations-event','OtherGround Operation Event','','Description of additional factor(s), not listed, associated with ramp and aircraft servicing station operations complications.','text-field','DNAA'),(6810,'masap-maintenance-ground-operations-event','Parking','','','checkbox','DNAA'),(6811,'masap-maintenance-ground-operations-event','Planning','','','checkbox','Operator'),(6812,'masap-maintenance-ground-operations-event','Pushback','','Aircraft is moving in the gate, ramp, or parking area, assisted by a tow vehicle [tug].  Pushback/towing is a phase of flight.','checkbox','DNAA'),(6813,'masap-maintenance-ground-operations-event','Ramp-Operations-Event','','','checkbox','DNAA'),(6814,'masap-maintenance-ground-operations-event','Replacement Equipment','','','checkbox','Operator'),(6815,'masap-maintenance-ground-operations-event','Taxi Obstacles','','','checkbox','USAF'),(6816,'masap-maintenance-ground-operations-event','Transportation','','','checkbox','Operator'),(6817,'masap-maintenance-ground-operations-event','Unsafe Activity','','','checkbox','Operator'),(6818,'masap-maintenance-ground-operations-event','Unsafe Condition','','','checkbox','UTRS'),(6819,'masap-maintenance-ground-operations-event','Wrong Logbook','','','checkbox','DNAA'),(6820,'masap-maintenance-operations','Aircraft Parts','','Products which have proper markings, certification, and are in compliance with an established U.S. Government or industry-accepted specification which must include all information necessary to produce and conform the part and approved for use by the Original Equipment Manufacturer (OEM) or Technical Standard Order (TSO) holder.. The specifications must be published so that any party may manufacture the part. Examples include, but at not limited to: National Aerospace Standards (NS), Air Force Navy Aeronautical Standard (AN), Society of Automotive Engineers (SAE), SAE Aerospace Standard (AS), Military Standard (MS), etc. An object that cannot normally be broken down further without destroying its designated use.','checkbox','Operator'),(6821,'masap-maintenance-operations','Hangar Operations','','','checkbox','Operator'),(6822,'masap-maintenance-operations','Line Maintenance','','','checkbox','Operator'),(6823,'masap-maintenance-operations','Maintenance Operations','','Occurrences and issues associated with the coordination and standard operating procedures used by maintenance personnel to maintain or prepare the aircraft for service including hangar operations, MOC, parts, and tools. Maintenance means inspection, overhaul, repair, preservation, and the replacement of parts, but excludes preventive maintenance.','checkbox','Operator'),(6824,'masap-maintenance-operations','MOC','','Maintenance Operations Control (MOC) - an office at a maintenance provider (or airline) open 24 hours/365 days, staffed with qualified technical specialists and equipped to communicate both verbally and by written message with technicians and pilots of aircraft away from base, both while airborne and on ground.','checkbox','Operator'),(6825,'masap-maintenance-operations','Other Maintenance Operations','','Description of additional factor(s), not listed, associated with maintenance operations.','text-field','Operator'),(6826,'masap-maintenance-operations','Tools','','Items used to repair or replace parts in the aircraft.','checkbox','Operator'),(6827,'masap-maintenance-operations','Work Area Appearance','','','checkbox','Operator'),(6828,'masap-maintenance-quality-assurance','DSV (Direct Safety Violation)','','','checkbox','USAF'),(6829,'masap-maintenance-quality-assurance','MI (Management Inspection)','','','checkbox','USAF'),(6830,'masap-maintenance-quality-assurance','PI (Personnel Inspection)','','','checkbox','USAF'),(6831,'masap-maintenance-quality-assurance','QVI (Quality Verification Inspection)','','','checkbox','USAF'),(6832,'masap-maintenance-quality-assurance','SI (Special Inspection)','','','checkbox','USAF'),(6833,'masap-maintenance-quality-assurance','TDV (Technical Data Violation)','','','checkbox','USAF'),(6834,'masap-maintenance-quality-assurance','UCR (Unsatisfactory Condition Report)','','','checkbox','USAF'),(6835,'masap-maintenance-reaction-after-event','Maintenance Reaction After Event','','Indicates the reaction by maintenance after an event.','checkbox','ASRS'),(6836,'masap-maintenance-reaction-after-event','Aircraft Released for Service','','Indicates that the aircraft