),(6881,'masap-mission-information','MDS (Mission Designated System)','','','text-field','USAF'),(6882,'masap-mission-information','Mission Phase','','','editable-combo-box','USAF'),(6883,'masap-mission-information','Mission Planning RM Accomplished','','','combo-box','USAF'),(6884,'masap-mission-information','Why RM was Not Accomplished','','','text-field','USAF'),(6885,'masap-mission-information','Mission Type','','','editable-combo-box','USAF'),(6886,'masap-mission-information','Payload Ops','','','checkbox','USAF'),(6887,'masap-mission-information','SOH (State of Health)','','','checkbox','USAF'),(6888,'masap-navigation/position-control','Mag Heading Cruise Altitude Rule Deviation','','','checkbox','USAF'),(6889,'masap-navigation/position-control','Clearance Deviation-Heading/Navigation Error','','','checkbox','USAF'),(6890,'masap-navigation/position-control','Climb or Descent Beyond Assigned Altitude','','','checkbox','USAF'),(6891,'masap-navigation/position-control','Climb or Descent Not Reaching Assigned Altitude','','','checkbox','USAF'),(6892,'masap-navigation/position-control','Controlled Flight Towards Terrain','','A situation where a mechanically normally functioning airplane is inadvertently flown into the ground, water, or an obstacle. There are two basic causes of CFIT accidents; both involve flight crew situational awareness. One definition of situational awareness is an accurate perception by pilots of the factors and conditions currently affecting the safe operation of the aircraft and the crew. The causes of CFIT are the flight crews? lack of vertical position awareness or their lack of horizontal position awareness in relation to terrain and obstacles.','checkbox','USAF'),(6893,'masap-navigation/position-control','Failure to Hold Short','','Noncompliance with an air traffic control clearance to the pilot with a LAHSO (Land and Hold Short) clearance to not proceed beyond a designated point such as a specified runway or taxiway. This point may be located prior to an intersecting runway, taxiway, predetermined point, or approach/departure flight path.','checkbox','USAF'),(6894,'masap-navigation/position-control','Ground Navigation on Runway/Takeoff','','','checkbox','USAF'),(6895,'masap-navigation/position-control','Ground Navigation on Taxiway/Ramp','','','checkbox','USAF'),(6896,'masap-navigation/position-control','Heading or Course Deviation','','Significant horizontal divergences from the intended flight path and use of the CDI (Course Deviation Indicator)-The vertical needle of a VOR indicator which shows the aircraft\'s relative to the selected VOR radio.','checkbox','USAF'),(6897,'masap-navigation/position-control','Loss of Primary Navigation Source','','','checkbox','USAF'),(6898,'masap-navigation/position-control','Navigation/Position Control','','Occurrences and issues associated with the failure of any equipment on the aircraft used for navigation.','checkbox','USAF'),(6899,'masap-navigation/position-control','Other Airborne Navigation','','Description of additional factor(s), not listed, associated with the airborne navigation event.','text-field','USAF'),(6900,'masap-navigation/position-control','Other Ground Navigation','','Description of additional factor(s), not listed, associated with ground navigation','text-field','USAF'),(6901,'masap-navigation/position-control','Other Navigation/Position Control','','Description of additional factor(s), not listed, associated with navigation and position control.','text-field','USAF'),(6902,'masap-navigation/position-control','RVSM Requirements Not Met','','Reduced Vertical Separation Minimums (RVSM) reduces the vertical separation between flight level (FL) 290?410 from 2000 ft to 1000 ft and makes six additional FLs available for operation. The additional FLs enable more aircraft to fly more time/fuel efficient profiles and provides the potential for enhanced airspace capacity. RVSM operators must receive authorization from the appropriate civil aviation authority. RVSM aircraft must meet required equipage and altitude-keeping performance standards. Operators must operate in accordance with RVSM policies/procedures applicable to the airspace where they are flying. Operators must operate in accordance with RVSM policies/procedures applicable to the airspace where they are flying. 14 CFR Section 91.180 (http://www.airweb.faa.gov/Regulatory_and_Guidance_Library%5CrgFAR.nsf/0/FE1C4A0CF129E93D86256E00004FEEB6?OpenDocument) applies to Reduced Vertical Separation Minimums (RVSM) operations within the U.S. 14 CFR Section 91.706 (http://www.airweb.faa.gov/Regulatory_and_Guidance_Library%5CrgFAR.nsf/0/087757B5C4DCE46A852566FA004B37E5?OpenDocument) applies to RVSM operations outside the U.S. Both sections require that the operator obtain authorization prior to operating in RVSM airspace. Refer to AIM Section 6. Operational Policy/Procedures for Reduced Vertical Separation Minimum (RVSM) in the Domestic U.S., Alaska, Offshore Airspace and the San Juan FIR (http://www.faa.gov/airports_airtraffic/air_traffic/publications/atpubs/aim/Chap4/aim0406.html).','checkbox','USAF'),(6903,'masap-navigation/position-control','Uncontrolled Traffic Pattern Deviation','','','checkbox','USAF'),(6904,'masap-non-compliance-with-afis-policies/procedures','AFIs','','Failure to follow the guidance or rules created by the company for employees relating to proper standards and practices and with federal regulations under which flight operations are conducted (as specified in the Code of Federal Regulations (CFR), particularly the Federal Aviation Regulations(FARs)).','checkbox','DNAA'),(6905,'masap-non-compliance-with-afis-policies/procedures','AFI Violation','','Specific section of the Code of Federal Regulations (CFR), containing the text of public regulations issued by the agencies of the Federal government, that was disregarded.','text-field','M-DNAA V7.0 B1.1'),(6906,'masap-non-compliance-with-afis-policies/procedures','Aircraft System SOPs','','The standard operating procedure (SOP) is a set of instructions having the force of a directive, covering those features of operations that lend themselves to a definite or standardized procedure without loss of effectiveness.','checkbox','Operator'),(6907,'masap-non-compliance-with-afis-policies/procedures','Airworthiness Directive','','Issued by one or more Airworthiness Authorities, this is a legally-binding requirement for work to be done on a specific aircraft, or engine, or component (type, model, or serial number/s). The work may involve modification, inspection, or other preventative measures, and may involve a one-off task or a task that needs to be repeated. AD?s always have a threshold expressed in Flight Hours (FH) and/or Flight Cycles (FC) and/or Calendar Time (by which time the task must have been performed). Airworthiness Directives (AD notes) must be compiled with within the required time limit, and the fact of compliance, the date of compliance, and the method of compliance must be recorded in the aircraft\'s maintenance records.','checkbox','DNAA'),(6908,'masap-non-compliance-with-afis-policies/procedures','Cabin Procedures','','','checkbox','Operator'),(6909,'masap-non-compliance-with-afis-policies/procedures','Checklist/Flows SOP Non-Compliance','','Issues associated with failure in the means in which an employee follows the documents stating recommended or required actions, including list of action items, steps, or elements needed for a task and Standard Operating Procedures (SOPs).','checkbox','Operator'),(6910,'masap-non-compliance-with-afis-policies/procedures','Company Policy SOP Non-Compliance','','Issues associated with failure in the means in which an employee follows the documents stating recommended or required actions, including the goal or mission of the company, the core values and attitude of that the company, and Standard Operating Procedures (SOPs).','checkbox','DNAA'),(6911,'masap-non-compliance-with-afis-policies/procedures','Flight/Duty Time Violation','','The total time from the moment a flight crew member commences duty, immediately subsequent to a rest period and prior to making a flight or a series of flights, to the moment the flight crew member is relieved of all duties having completed such flight or series of flights.','checkbox','DNAA'),(6912,'masap-non-compliance-with-afis-policies/procedures','HAZMAT Violation','','Deliberate action not in accordance with rules and recognized procedures associated with Hazardous Materials (HAZMAT) or other regulated material that could result in the potential injury of personnel leading. Hazardous material is defined as any substance/material defined as pose a potential risk to life, health, or property by various regulations administered by the US Environmental Protection Agency and the US Department of Transportation as specified in 49 CFR 172.101 Hazardous Materials Table (http://www.setonresourcecenter.com/transportation/49CFR/172_101tb.pdf). These include explosive, flammable, poisonous, corrosive, reactive, or radioactive, or any combination, and requires special care in handling because of the hazards it poses to public health and welfare, safety, and/or the environment. Refer to AC 121-21B: Information Guide for Training Programs and Manual Requirements in the Air Transportation of Hazardous Materials (http://rgl.faa.gov/Regulatory_and_Guidance_Library/rgAdvisoryCircular.nsf/1ab39b4ed563b08985256a35006d56af/e90c50d06627fb54862569ea00777bfe/$FILE/AC121-21B.pdf)','checkbox','ASRS'),(6913,'masap-non-compliance-with-afis-policies/procedures','Incorrect/Missing Manual Information','','','checkbox','Operator'),(6914,'masap-non-compliance-with-afis-policies/procedures','Non-Compliance with AFIs, Policies/Procedures','','A failure to follow the guidance or rules created by the company for employees, passengers, and other individuals relating to proper standards and practices and with federal regulations under which flight operations are conducted (as specified in the Code of Federal Regulations (CFR), particularly the Federal Aviation Regulations(FARs).','checkbox','DNAA'),(6916,'masap-non-compliance-with-afis-policies/procedures','Non-Compliance-Service Advisory','','','checkbox','DNAA'),(6917,'masap-non-compliance-with-afis-policies/procedures','Other Non-Compliance with AFIs, Policies/Procedures','','Description of additional factor(s), not listed, associated with non-compliance with CFRs, politices, and procedures.','text-field','DNAA'),(6918,'masap-non-compliance-with-afis-policies/procedures','Problem Enforcing AFIs','','Issues associated with obtain compliance with the guidance or rules created by the company for employees, passengers, and other individuals relating to proper standards and practices and with federal regulations under which flight operations are conducted (as specified in the Code of Federal Regulations (CFR), particularly the Federal Aviation Regulations(FARs)).','checkbox','Operator'),(6919,'masap-non-compliance-with-afis-policies/procedures','Published Procedure','','','checkbox','DNAA'),(6920,'masap-non-compliance-with-afis-policies/procedures','Reduced Safety Standards','','','checkbox','Operator'),(6921,'masap-non-compliance-with-afis-policies/procedures','Reference','','','text-field','Operator'),(6922,'masap-non-compliance-with-afis-policies/procedures','Required Legal Separation','','http://www.faa.gov/airports_airtraffic/air_traffic/publications/atpubs/PCG/S.HTM','checkbox','DNAA'),(6923,'masap-non-compliance-with-afis-policies/procedures','Scheduling Rules','','','checkbox','Operator'),(6924,'masap-non-compliance-with-afis-policies/procedures','Smoking Ban Violation','','When a passenger smokes on board an aircraft or ramp or in the terminal.','checkbox','Operator'),(6925,'masap-non-compliance-with-afis-policies/procedures','Speed','','','checkbox','DNAA'),(6926,'masap-non-compliance-with-afis-policies/procedures','Sterile Cockpit Violation','','http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/DD19266CEBDAC9DB852566EF006D346F?OpenDocument&Highlight=121.542','checkbox','DNAA'),(6927,'masap-non-compliance-with-afis-policies/procedures','TSRs','','The Transportation Security Administration (TSA) issues and administers Transportation Security Regulations (TSRs), which are codified in Title 49 of the Code of Federal Regulations (CFR), Chapter XII, parts 1500 through 1699 (http://ecfr.gpoaccess.gov/cgi/t/text/text-idx?sid=ca8e98bee9f342fd78d92cbedeffaf98&c=ecfr&tpl=/ecfrbrowse/Title49/49cfrv9_02.tpl#1200).','checkbox','Operator'),(6928,'masap-non-compliance-with-afis-policies/procedures','Weather Minimums','','Weather condition requirements established for a particular operation or type of operation; e.g., IFR takeoff or landing, alternate airport for IFR flight plans, VFR flight, etc.','checkbox','DNAA'),(6929,'masap-organization/procedures','Crew Selection','','Pairing of crewmembers that are not suitable together','checkbox','Operator'),(6930,'masap-organization/procedures','Guidance and Directives','','http://medallionfoundation.org/Definition_of_terms.htm','checkbox','MEDA Rev g.'),(6931,'masap-organization/procedures','Improper Record Keeping Procedures','','','checkbox','M-DNAA V7.0 C1.10'),(6932,'masap-organization/procedures','Inadequate Flight Management','','Improper oversight or lack of oversight from Flight Management','checkbox','Operator'),(6933,'masap-organization/procedures','Inadequate Ground Management','','Improper oversight or lack of oversight form Ground Management','checkbox','Operator'),(6934,'masap-organization/procedures','Inadequate Training','','Issues associated with ensuring that the airline sponsored programs developed to impart the knowledge and skills necessary to qualify for job position are in accordance with airline and FAA regulations.','checkbox','Operator'),(6935,'masap-organization/procedures','Lack of Accountability','','Chain of command unclear; no person or entity is responsible','checkbox','Operator'),(6936,'masap-organization/procedures','Lack of Teamwork','','Deficiencies in effective leadership through coordinating activities and maintaining proper balance between respecting authority and practicing assertiveness.','checkbox','Operator'),(6937,'masap-organization/procedures','Manpower Staffing','','Issues associated with personnel strength, expressed in the numbers, series, and grades of personnel required and/or availability and in relationship to the applicable organizational level.','checkbox','Operator'),(6938,'masap-organization/procedures','Mismanagement of Assets','','Inappropriate allocation of resources','checkbox','Operator'),(6939,'masap-organization/procedures','Not Enough Resources','','','checkbox','Operator'),(6940,'masap-organization/procedures','Other Organizational Procedures','','Description of additional factor(s), not listed, associated with organzational factors','text-field','Operator'),(6941,'masap-organization/procedures','Quality of Support from Management','','Includes engineering, planning, technical pubs','checkbox','MEDA Rev g.'),(6942,'masap-organization/procedures','Reduced Safety Standards','','','checkbox','M-DNAA V7.0 C1.10'),(6943,'masap-organization/procedures','Safety Culture','','The product of individual and group values, attitudes, competencies, and patterns of behavior that determine the commitment to, and the style and proficiency of, the organization\'s management of safety. Organizations with a positive safety culture are characterized by communications founded on mutual trust, by shared perceptions of the importance of safety, and by confidence in the efficacy of preventive measures. Refer to AC 120-92: Introduction to Safety Management Systems for Air Operators) (http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgAdvisoryCircular.nsf/0/6485143d5ec81aae8625719b0055c9e5/$FILE/AC%20120-92.pdf).','checkbox','Operator'),(6944,'masap-organization/procedures','Work Group Normal Practice (Norm)','','Recommended methods, rules, and designs for voluntary compliance.','checkbox','MEDA Rev g.'),(6945,'masap-organization/procedures','Work Process/Procedure','','','checkbox','MEDA Rev g.'),(6946,'masap-organization/procedures','Work Process/Procedure not Documented','','','checkbox','MEDA Rev g.'),(6947,'masap-organization/procedures','Work Process/Procedure not Followed','','','checkbox','MEDA Rev g.'),(6948,'masap-other-events','Rescue Operation','','','checkbox','USAF'),(6949,'masap-other-events','Weapons Related','','','checkbox','USAF'),(6950,'masap-phase-of-operation','A Check','','The most frequent regular check carried out on an aircraft (apart from daily/before flight check). Typically performed every 8 to 12 weeks and often generically referred to as a Light Maintenance check. These checks can be sequentially numbered with, for example, a ?2A? check including a few more tasks than a ?1A? check.','checkbox','Operator'),(6951,'masap-phase-of-operation','AOS','','Aircraft Out of Service (AOS)','checkbox','Operator'),(6952,'masap-phase-of-operation','Audit','','A methodical, planned examination of processes, records, and transactions to verify compliance, accuracy, completeness, and traceability. Inspections are normally a part of an audit. Results are primarily presented in terms of findings and concerns. Auditing measures against a defined standard, but does not analyze the standard. Refer to AC 145-5: Repair Station Internal Evaluation Programs (http://rgl.faa.gov/Regulatory_and_Guidance_Library/rgAdvisoryCircular.nsf/0/6d35dfced414e703862569e00074d653/$FILE/AC145-5.pdf).','checkbox','Operator'),(6953,'masap-phase-of-operation','B Check','','','checkbox','Operator'),(6954,'masap-phase-of-operation','Catering','','','checkbox','Operator'),(6955,'masap-phase-of-operation','C Check','','Next most frequent check after an A check. Typically performed every 12 to 18 months. These checks can also be sequentially numbered with, for example a ?2C? check including rather more tasks than a ?1C? check, and so on.','checkbox','Operator'),(6956,'masap-phase-of-operation','Daily','','','checkbox','Operator'),(6957,'masap-phase-of-operation','Deferred Maintenance','','','checkbox','UTRS'),(6958,'masap-phase-of-operation','De-Icing','','Indicates occurrence during preflight ground servicing to remove existing frozen precipitation, frost or ice from aircraft surfaces.','checkbox','Operator'),(6959,'masap-phase-of-operation','engine-run','','This applies anytime aircraft engines were rotated','checkbox','USAF'),(6960,'masap-phase-of-operation','Fueling','','','checkbox','Operator'),(6961,'masap-phase-of-operation','Ground Servicing','','','checkbox','Operator'),(6962,'masap-phase-of-operation','Hangar','','','checkbox','Operator'),(6963,'masap-phase-of-operation','In-Flight','','','checkbox','Operator'),(6964,'masap-phase-of-operation','Inspection','','Visual examination to detect deviations, violations, or other problems along with the marking and documentation of detected defaults.','checkbox','Operator'),(6965,'masap-phase-of-operation','Jacking','','','checkbox','UTRS'),(6966,'masap-phase-of-operation','Launch/ Recovery','','','checkbox','USAF'),(6967,'masap-phase-of-operation','Loading/Unloading','','','checkbox','Operator'),(6968,'masap-phase-of-operation','Phase of Operation','','Specifies ground or maintenance activities occurring at time of event.','checkbox','Operator'),(6969,'masap-phase-of-operation','Ops Check/ Testing','','','checkbox','USAF'),(6970,'masap-phase-of-operation','Other Phase of Operation','','Description of additional factor(s), not listed, associated with the phase of operation.','text-field','Operator'),(6971,'masap-phase-of-operation','Parked','','','checkbox','Operator'),(6972,'masap-phase-of-operation','Phase','','','checkbox','Operator'),(6973,'masap-phase-of-operation','Phase/ ISO','','','checkbox','USAF'),(6974,'masap-phase-of-operation','PreFlight','','The check and preparation of the aircraft before takeoff. Refer to Appendix 16: Preflight of AC 120-71A: Standard Operating Procedures for Flight Deck Crewmembers (http://rgl.faa.gov/Regulatory_and_Guidance_Library/rgAdvisoryCircular.nsf/0/b173ba8a295764f086256cde006a44ad/$FILE/AC120-71A.pdf).','checkbox','Operator'),(6975,'masap-phase-of-operation','Repair','','Major repair means a repair: (1) That, if improperly done, might appreciably affect weight, balance, structural strength, performance, powerplant operation, flight characteristics, or other qualities affecting airworthiness; or (2) That is not done according to accepted practices or cannot be done by elementary operations. Minor repair means a repair other than a major repair.','checkbox','Operator'),(6976,'masap-phase-of-operation','Research','','','checkbox','UTRS'),(6977,'masap-phase-of-operation','RON','','Remain Overnight (RON)','checkbox','Operator'),(6978,'masap-phase-of-operation','Routine Maintenance','','','checkbox','Operator'),(6979,'masap-phase-of-operation','Scheduled Maintenance','','Include hourly and special inspections','checkbox','USAF'),(6980,'masap-phase-of-operation','Servicing','','','checkbox','Operator'),(6981,'masap-phase-of-operation','Tailstrike During Taxi','','','checkbox','Operator'),(6982,'masap-phase-of-operation','Taxi','','The movement of an airplane under its own power on the surface of an airport (14 CFR Section 135.100 [Note]).','checkbox','Operator'),(6983,'masap-phase-of-operation','Testing','','Evaluation of the condition of a system, component, tool, or equipment.','checkbox','Operator'),(6984,'masap-phase-of-operation','Towing','','','checkbox','Operator'),(6985,'masap-phase-of-operation','Weekly','','','checkbox','Operator'),(6986,'masap-policy/procedural-issues','ATC Polices/Procedures','','Indicates an occurance associated with company personnel error regarding an Air Traffic Control related duty/responsibility.','checkbox','USAF'),(6987,'masap-policy/procedural-issues','Briefings','','Issues associated with the guidance or rules created by the company for relating proper standards and practices for briefings. Briefings should be clear and concise, using standard terminology. Briefings should reaffirm established policies and procedures.','checkbox','USAF'),(6988,'masap-policy/procedural-issues','Callout','','','checkbox','USAF'),(6989,'masap-policy/procedural-issues','Checklists/Flows/Crosschecking','','The brief document stating recommended or required actions.  Used as a quick reference guide for critical procedures and responsibilities.','checkbox','USAF'),(6990,'masap-policy/procedural-issues','Conflicting','','Two or more policies or procedures provide incompatible information or guidance regarding the same operation.','checkbox','USAF'),(6991,'masap-policy/procedural-issues','Confusing','','Difficult to understand or follow information in guidance and/or rules','checkbox','USAF'),(6992,'masap-policy/procedural-issues','Currency','','Up to date guidance and/or rules with the most recent available.','checkbox','USAF'),(6993,'masap-policy/procedural-issues','Emergency/Safety Equipment','','Emergency or safety equipment aboard the aircraft to include slide deployments. Refer to ATA code 25-61) and FAR Sec. 121.309: Emergency equipment (http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/65020F664E8C966786256A6500582F36?OpenDocument&Highlight=sec.,121.309).','checkbox','USAF'),(6994,'masap-policy/procedural-issues','Equipment Usage','','','checkbox','USAF'),(6995,'masap-policy/procedural-issues','Failure to Respond to or Set Alerts','','','checkbox','USAF'),(6996,'masap-policy/procedural-issues','CFRs','','The CFR (The Code of Federal Regulations) contains the text of public regulations issued by the agencies of the Federal government. The CFR is the official, subject matter order, compilation of the Federal regulations of a general applicability and legal effect, that are currently in force. In accordance with section 1510(d) of title 44 of the U.S. Code, the Code of Federal Regulations is compiled and published by the Office of the Federal Register of the National Archives and Records Administration. The Code is divided into 50 titles by subject matter. Each title is divided into sections. Sections within a title may be grouped together as subtitles, chapters, subchapters, parts, subparts, or divisions. Titles may also have appendices which may be divided into sections, rules and/or forms. The CFR does not include statutes enacted by Congress, decisions of the Federal courts, or treaties.','checkbox','USAF'),(6997,'masap-policy/procedural-issues','Inaccurate Polices/Procedures','','Incorrect or erroneous guidance or information provided in guidance and/or rules.','checkbox','USAF'),(6998,'masap-policy/procedural-issues','Inadequate Polices/Procedures','','Deficiencies in the quality, quantity, or timeliness with the guidance and/or rules for a particular operation.','checkbox','USAF'),(6999,'masap-policy/procedural-issues','International Polices/Procedures','','Significant difference between International and Domestic guidance and/or rules for the same operation.','checkbox','USAF'),(7000,'masap-policy/procedural-issues','Nonstandard Operations','','','checkbox','USAF'),(7001,'masap-policy/procedural-issues','Not Available','','The guidance and/or rules for a particular operation is not accessible or at hand.','checkbox','USAF'),(7002,'masap-policy/procedural-issues','Other Polices/Procedures Issues','','Description of additional factor(s), not listed, associated with policies and procedures issues.','text-field','USAF'),(7003,'masap-policy/procedural-issues','Pilot vs Maintenance Interactions','','','checkbox','USAF'),(7004,'masap-policy/procedural-issues','CFRs, Polices, and Procedures','','Issues associated with the guidance or rules created by the company for employees relating proper standards and practices.','checkbox','USAF'),(7005,'masap-policy/procedural-issues','Preflight Inspection','','Guidance and/or rules regarding the thorough and systematic means by which a pilot determines if the aircraft is airworthy and in condition for safe operation. Refer to Chapter 7: Flight Manuals and Other Documents (http://www.faa.gov/library/manuals/aviation/pilot_handbook/media/faa-h-8083-25-2of4.pdf).','checkbox','USAF'),(7006,'masap-policy/procedural-issues','RVSM Procedure','','Issues associated with the specific process associated with Reduced Vertical Separation Minimums (RVSM). RVSM operators must receive authorization from the appropriate civil aviation authority. RVSM aircraft must meet required equipage and altitude-keeping performance standards. Operators must operate in accordance with RVSM policies/procedures applicable to the airspace where they are flying. Operators must operate in accordance with RVSM policies/procedures applicable to the airspace where they are flying. 14 CFR Section 91.180 (http://www.airweb.faa.gov/Regulatory_and_Guidance_Library%5CrgFAR.nsf/0/FE1C4A0CF129E93D86256E00004FEEB6?OpenDocument) applies to Reduced Vertical Separation Minimums (RVSM) operations within the U.S. 14 CFR Section 91.706 (http://www.airweb.faa.gov/Regulatory_and_Guidance_Library%5CrgFAR.nsf/0/087757B5C4DCE46A852566FA004B37E5?OpenDocument) applies to RVSM operations outside the U.S. Both sections require that the operator obtain authorization prior to operating in RVSM airspace. Refer to AIM Section 6. Operational Policy/Procedures for Reduced Vertical Separation Minimum (RVSM) in the Domestic U.S., Alaska, Offshore Airspace and the San Juan FIR (http://www.faa.gov/airports_airtraffic/air_traffic/publications/atpubs/aim/Chap4/aim0406.html).','checkbox','USAF'),(7007,'masap-policy/procedural-issues','Unfamiliar','','Unaware of guidance and/or rules regarding this operation.','checkbox','USAF'),(7008,'masap-policy/procedural-issues','Version Conflict','','','checkbox','USAF'),(7009,'masap-potential-risk','Aircraft Damage','','','checkbox','Operator'),(7010,'ma