,'checkbox','USAF'),(7108,'masap-technical-data-error','Other Technical Data','','Description of additional factor(s), not listed, associated with technical data.','text-field','Operator'),(7109,'masap-technical-data-error','Technical Data Error','','Issues associated with deficiencies of the written materials provided for personnel to maintain and repair equipment and parts, including manuals, MELs, reference materials, and work cards.','checkbox','Operator'),(7110,'masap-technical-data-error','Manuals','','Any of the written material for the operation of the flight including the FOM, aircraft manuals, MEL, checklist placards and the QRH.','checkbox','Operator'),(7111,'masap-technical-data-error','Improper MEL/Deferral','','Issues associated with deficiencies of the written materials provided for personnel related to Minimum Equipment List (MEL)/Configuration Deviation List (CDL) faults or defects found on an aircraft which do not need immediate action and can be deferred for repair at a later date. This deferred defect status is only given for a strictly limited period of time and rectification must take place before that time has elapsed. Refer to FAR 125.201: Inoperable instruments and equipment (http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/58CF936FD6E2A36186256959004E132E?OpenDocument&Highlight=125.201).','checkbox','Operator'),(7112,'masap-technical-data-error','Reference Material','','','checkbox','Operator'),(7113,'masap-technical-data-error','Work Cards','','Document that provides the details of the required maintenance steps for repairing an aircraft system or component. Also referred to as Job Card, Task Card, etc.','checkbox','Operator'),(7114,'masap-technical-knowledge/skills','Aircraft Configuration Knowledge','','','checkbox','REDA'),(7115,'masap-technical-knowledge/skills','Inadequate Aircraft System Knowledge','','','checkbox','MEDA Rev g.'),(7116,'masap-technical-knowledge/skills','Inadequate Task Experience','','','checkbox','MEDA Rev g.'),(7117,'masap-technical-knowledge/skills','Inadequate Task Knowledge','','','checkbox','MEDA Rev g.'),(7118,'masap-technical-knowledge/skills','Inadequate Task Planning','','','checkbox','MEDA Rev g.'),(7119,'masap-technical-knowledge/skills','Other Technical Knowledge/Skills/Training','','Description of additional factor(s), not listed, associated with technical knowledge, skills, and training.','text-field','MEDA Rev g.'),(7120,'masap-technical-knowledge/skills','Inadequate Skills','','Not having the appropriate procedural, psychomotor, and perceptual skills required for tasking. They are the abilities that are gained through conventional training, are perfected, and become almost automatic through experience.','checkbox','MEDA Rev g.'),(7121,'masap-technical-knowledge/skills','Technical Knowledge/Skills/Training','','','checkbox','MEDA Rev g.'),(7122,'masap-technical-knowledge/skills','Training Issues','','','combo-box','MEDA Rev g.'),(7123,'masap-technical-knowledge/skills','Training Situation','','','combo-box','MEDA Rev g.'),(7124,'masap-terrain-proximity','Airborne Conflict','','','combo-box','USAF'),(7125,'masap-terrain-proximity','ATC Low Altitude Warning','','','checkbox','USAF'),(7126,'masap-terrain-proximity','Below Minimum Altitude','','','checkbox','USAF'),(7127,'masap-terrain-proximity','GPWS Warning','','The type of warning that originate from the Ground Proximity Warning System (GPWS). Warnings are provided by the GPWS in the following circumstances: 1) excessive descent rate; 2) excessive terrain closure rate; 3) excessive altitude loss after take-off or go-around; 4) unsafe terrain clearance while not in landing configuration; a) gear not locked down; b) flaps not in a landing position; and 5) excessive descent below the instrument glide path.','combo-box','USAF'),(7128,'masap-terrain-proximity','Ground Conflict','','','combo-box','USAF'),(7129,'masap-terrain-proximity','Other Terrain Proximity Event','','Description of additional factor(s), not listed, associated with terrain proximity incidents or events.','text-field','USAF'),(7130,'masap-terrain-proximity','Terrain Following','','','combo-box','USAF'),(7131,'masap-terrain-proximity','Terrain Proximity','','Occurrences associated with potential terrain hazards such as excessive closure rate to terrain and/or insufficient terrain clearance, including GPSW warnings.','checkbox','USAF'),(7132,'masap-traffic-proximity','ATC Conflict','','','checkbox','USAF'),(7133,'masap-traffic-proximity','Closest Horizontal Proximity (Ft)','','Proximity at closest point horizontally in feet.','real-field','USAF'),(7134,'masap-traffic-proximity','Closest Vertical Proximity (Ft)','','Proximity at closest point vertically in feet.','real-field','USAF'),(7135,'masap-traffic-proximity','Complied with RA Command','','','checkbox','USAF'),(7136,'masap-traffic-proximity','Direction of Traffic (Horizontal) (Ft)','','','real-field','USAF'),(7137,'masap-traffic-proximity','Direction of Traffic (Vertical) (Ft)','','','real-field','USAF'),(7138,'masap-traffic-proximity','Took Evasive Action','','Indicates that the flight crew','checkbox','USAF'),(7139,'masap-traffic-proximity','NMAC','','','checkbox','USAF'),(7140,'masap-traffic-proximity','Other Traffic Proximity','','Description of additional factor(s), not listed, associated with traffic proximity','text-field','USAF'),(7141,'masap-traffic-proximity','System Generated Ground Collision Warning','','','checkbox','Operator'),(7142,'masap-traffic-proximity','System Generated Mid-Air Collision Warning','','','checkbox','Operator'),(7143,'masap-traffic-proximity','TCAS Not Available','','','checkbox','USAF'),(7144,'masap-traffic-proximity','TCAS RA','','If the intruder gets within 15 to 35 seconds, depending upon altitude, of Closest Point of Approach (CPA), it is considered a threat, and an aural and visual TCAS Resolution Advisory (RA) is issued to the flight crew advising that a particular maneuver should, or should not, be performed to attain or maintain minimum safe vertical separation from an intruder. This level provides a recommended vertical maneuver using modified Instantaneous Vertical Speed Indicators (IVSIs), and voice messages to provide adequate vertical separation from the threat aircraft or prevents initiation of a maneuver that would place the TCAS II aircraft in jeopardy. The TCAS II is considered a backup system to the ?SEE AND AVOID? concept and the ATC radar environment. Refer to AC 20-151 (http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgAdvisoryCircular.nsf/0/76056bd8e04b1cc086256fb0006a579b/$FILE/AC%2020-151.pdf).','checkbox','USAF'),(7145,'masap-traffic-proximity','TCAS RA Command','','The TCAS Resolution Advisories (RAs) are annunciated by the various voice messages, as appropriate, along with the expected pilot response categorized as Climb-- climb at the rate depicted by the green (fly to) arc on the Instantaneous Vertical Speed Indicator (IVSI), nominally between 1,500 and 2,000 fpm; Descend-- descend at the rate depicted by the green (fly to) arc on the IVSI nominally between 1,500 and 2,000 fpm; Monitor Vertical Speed--ensure that vertical speed is out of the illuminated IVSI red arc until the RA is completed; Other additional commands as specified in Appendix 1 of AC 20-151 (http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgAdvisoryCircular.nsf/0/76056bd8e04b1cc086256fb0006a579b/$FILE/AC%2020-151.pdf).','combo-box','USAF'),(7146,'masap-traffic-proximity','TCAS TA','','If the traffic gets within 25 to 48 seconds, depending upon altitude, of projected Closest Point of Approach (CPA), it is then considered an intruder, and an aural and visual Traffic Advisory (TA) is issued to a flight crew, identifying the location of nearby traffic meeting certain minimum separation criteria.. This level calls attention to what may develop into a collision threat using the traffic advisory display and the voice message, ?TRAFFIC - TRAFFIC.? It permits mental and physical preparation for a possible maneuver to follow and assists the pilot in achieving visual acquisition of the intruding aircraft. Refer to AC 20-151 (http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgAdvisoryCircular.nsf/0/76056bd8e04b1cc086256fb0006a579b/$FILE/AC%2020-151.pdf).','checkbox','USAF'),(7147,'masap-traffic-proximity','TCAS/Traffic Conflict','','Traffic Alert And Collision Avoidance System (TCAS)-An airborne collision avoidance system based on radar beacon signals which operates independent of ground-based equipment. TCAS-I generates traffic advisories only. TCAS-II generates traffic advisories, and resolution (collision avoidance) advisories in the vertical plane.','checkbox','USAF'),(7148,'masap-traffic-proximity','Visual','','','checkbox','USAF'),(7149,'masap-training-ground-service-technicians','HAZMAT','','Hazardous Material (HAZMAT) is defined as any substance/material defined as pose a potential risk to life, health, or property by various regulations administered by the US Environmental Protection Agency and the US Department of Transportation as specified in 49 CFR 172.101 Hazardous Materials Table (http://www.setonresourcecenter.com/transportation/49CFR/172_101tb.pdf). These include explosive, flammable, poisonous, corrosive, reactive, or radioactive, or any combination, and requires special care in handling because of the hazards it poses to public health and welfare, safety, and/or the environment. Refer to AC 121-21B: Information Guide for Training Programs and Manual Requirements in the Air Transportation of Hazardous Materials (http://rgl.faa.gov/Regulatory_and_Guidance_Library/rgAdvisoryCircular.nsf/1ab39b4ed563b08985256a35006d56af/e90c50d06627fb54862569ea00777bfe/$FILE/AC121-21B.pdf)','checkbox','Operator'),(7150,'masap-training-ground-service-technicians','Marshalling','','Guidance by ground staff/vehicle during pushback or taxi onto a stand.','checkbox','Operator'),(7151,'masap-training-ground-service-technicians','Other Ground Service Technicians Training','','Description of additional factor(s), not listed, associated with ground service technician training.','text-field','Operator'),(7152,'masap-training-ground-service-technicians','Policies/Procedures','','','checkbox','Operator'),(7153,'masap-training-ground-service-technicians','Pushback','','Aircraft is moving in the gate, ramp, or parking area, assisted by a tow vehicle [tug].  Pushback/towing is a phase of flight.','checkbox','Operator'),(7154,'masap-training-ground-service-technicians','Safety Zone','','','checkbox','Operator'),(7155,'masap-training-ground-service-technicians','Security','','Training related to handling actual or potential breaches of regulations or security practices caused by company employees, airport personnel, and/or passengers and failure of company employees to ensure the highest level of security surrounding a flight (example: leaving the jetway door open and unattended during boarding).','checkbox','Operator'),(7156,'masap-training-ground-service-technicians','Ground Service Technicians Training','','Programs developed to impart the knowledge and skills necessary to qualify for Ground Service Technician position.','checkbox','Operator'),(7157,'masap-training-maintenance-technicians','Air Start','','Occurrences, issues, and training associated with the starting of an aircraft engine while the aircraft is airborne, preceded by engine shutdown during training flights or by actual engine failure.','checkbox','Operator'),(7158,'masap-training-maintenance-technicians','APU Operations','','The Auxiliary Power Unit provides power for engine-starting and other systems while on the ground (ATA code 49-**)','checkbox','Operator'),(7159,'masap-training-maintenance-technicians','Other Maintenance Technicians Training','','Description of additional factor(s), not listed, associated with maintenance technician training.','text-field','Operator'),(7160,'masap-training-maintenance-technicians','Policies/Procedures','','Standard Operating Procedures (SOPs) that ensure that maintenance tasking and operations are performed in accordance with FAA and airline regulations.','checkbox','Operator'),(7161,'masap-training-maintenance-technicians','Taxi/Tow Operations','','','checkbox','Operator'),(7162,'masap-training-maintenance-technicians','Maintenance Technicians Training','','Training program to ensure that each person (including inspection personnel) who determines the adequacy of work done is fully informed about procedures and techniques and new equipment in use and is competent to perform his duties. It also include training in knowledge and skills related to human performance, including coordination with other maintenance personnel and flight crew.','checkbox','Operator'),(7163,'masap-training-organization','Other Organization Training','','Description of additional factor(s), not listed, associated with organzational training.','text-field','Operator'),(7164,'masap-training-organization','Publish Article','','','checkbox','Operator'),(7165,'masap-training-organization','Standardization','','','checkbox','Operator'),(7166,'masap-training-organization','Supplement','','','checkbox','Operator'),(7167,'masap-training-organization','Organization Training','','','checkbox','Operator'),(7168,'masap-training-pilots','Computer Based Training','','','checkbox','Operator'),(7169,'masap-training-pilots','CRM','','Crew Resource Management (CRM) refers to the effective use of all available resources: human resources, hardware, and information. Other groups routinely working with the cockpit crew, who are involved in decisions required to operate a flight safely, are also essential participants in an effective CRM process. These groups include but are not limited to: (a) Aircraft dispatchers; (b) Flight attendants; (c) Maintenance personnel; (d) Air traffic controllers. Refer to AC 120-51E: Crew Resource Management Training (http://rgl.faa.gov/Regulatory_and_Guidance_Library/rgAdvisoryCircular.nsf/0/80038cf51aace53686256e24005cbb23/$FILE/AC120-51e.pdf).','checkbox','Operator'),(7170,'masap-training-pilots','Emergency Equipment','','http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/65020F664E8C966786256A6500582F36?OpenDocument&Highlight=sec.,121.309','checkbox','Operator'),(7171,'masap-training-pilots','Flight Deck Procedures','','','checkbox','Operator'),(7172,'masap-training-pilots','General Operating Systems','','','checkbox','Operator'),(7173,'masap-training-pilots','Initial Indoctrination/Awareness','','Indoctrination/awareness typically consists of classroom presentations and focuses on communications and decisionmaking, interpersonal relations, crew coordination, leadership, and adherence to SOPs, among others. In this component of CRM training, the concepts are developed, defined, and related to the safety of line operations. This component also provides a common conceptual framework and a common vocabulary for identifying crew coordination problems. Refer to AC 120-51E: Crew Resource Management Training (http://rgl.faa.gov/Regulatory_and_Guidance_Library/rgAdvisoryCircular.nsf/0/80038cf51aace53686256e24005cbb23/$FILE/AC120-51e.pdf).','checkbox','Operator'),(7174,'masap-training-pilots','MEL','','Minimum Equipment List (MEL)/Configuration Deviation List (CDL) faults or defects found on an aircraft which do not need immediate action and can be deferred for repair at a later date. This deferred defect status is only given for a strictly limited period of time and rectification must take place before that time has elapsed. Refer to FAR 125.201: Inoperable instruments and equipment (http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/58CF936FD6E2A36186256959004E132E?OpenDocument&Highlight=125.201).','checkbox','Operator'),(7175,'masap-training-pilots','Other Pilot Training','','Description of additional factor(s), not listed, associated with pilot training.','text-field','Operator'),(7176,'masap-training-pilots','Overwater','','','checkbox','Operator'),(7177,'masap-training-pilots','Policies/Procedures','','','checkbox','UTRS'),(7178,'masap-training-pilots','Recurrent','','CRM training must be included as a regular part of the recurrent training requirement. Recurrent CRM training should include classroom or briefing room refresher training to review and amplify CRM components, followed by practice and feedback exercises, such as LOFT, preferably with taped feedback; or a suitable substitute, such as role-playing in a flight training device and taped feedback. It is recommended that these recurrent CRM exercises take place with a full crew, each member operating in his or her normal crew position. A complete crew should always be scheduled, and every attempt should be made to maintain crew integrity. Recurrent training LOFT, which includes CRM, should be conducted with current line crews, and preferably not with instructors or check airmen as stand-ins. Refer to AC 120-51E: Crew Resource Management Training (http://rgl.faa.gov/Regulatory_and_Guidance_Library/rgAdvisoryCircular.nsf/0/80038cf51aace53686256e24005cbb23/$FILE/AC120-51e.pdf).','checkbox','Operator'),(7179,'masap-training-pilots','Simulator PC','','','checkbox','Operator'),(7180,'masap-training-pilots','Simulator PT','','','checkbox','Operator'),(7181,'masap-training-pilots','SPT','','Special Purpose Training','checkbox','Operator'),(7182,'masap-training-pilots','Standardization','','','checkbox','Operator'),(7183,'masap-training-pilots','Pilot Training','','Issues associated with the initial, upgrade, and recurring education and instruction provided to flight crews, including aircraft operation, CRM, emergency, and procedures. Refer to Sec. 121.415: Crewmember and dispatcher training requirements (http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/DEE20F600326435B86256A65005A7516?OpenDocument&Highlight=121.427).','checkbox','Operator'),(7184,'masap-training-pilots','Transition','','','checkbox','Operator'),(7185,'masap-training-pilots','Upgrade','','','checkbox','Operator'),(7186,'masap-uncommanded/unintended-aircraft-state-or-lo','Aircraft Upset (Multi Axis)','','','checkbox','USAF'),(7187,'masap-uncommanded/unintended-aircraft-state-or-lo','Bank','','Angle of rotation or roll about the longitudinal axis. Maximum bank angle permissible during approach is specified in the approved operating manual used by the pilot, and is generally not more than 30?; the maximum bank angle permissible during landing may be considerably less than 30?, as specified in that manual. Refer to AC 120-71A: Standard Operating Procedures for Flight Deck Crewmembers (http://rgl.faa.gov/Regulatory_and_Guidance_Library/rgAdvisoryCircular.nsf/0/b173ba8a295764f086256cde006a44ad/$FILE/AC120-71A.pdf).','checkbox','USAF'),(7188,'masap-uncommanded/unintended-aircraft-state-or-lo','Blade Stall','','','checkbox','USAF'),(7189,'masap-uncommanded/unintended-aircraft-state-or-lo','Other Uncommanded/Unintended Aircraft State or Loss of Control','','Description of additional factor(s), not listed, associated with uncommanded or unintended aircraft state or loss of control.','text-field','USAF'),(7190,'masap-uncommanded/unintended-aircraft-state-or-lo','Pitch','','The propeller blade setting as determined by the blade angle measured in a manner, and at a radius, specified by the instruction manual for the propeller.','checkbox','USAF'),(7191,'masap-uncommanded/unintended-aircraft-state-or-lo','Roll','','','checkbox','USAF'),(7192,'masap-uncommanded/unintended-aircraft-state-or-lo','Speed','','','combo-box','USAF'),(7193,'masap-uncommanded/unintended-aircraft-state-or-lo','Uncommanded/Unintended Aircraft State or Loss of Control','','Occurrences associated with the loss of aircraft control while inflight.','checkbox','USAF'),(7194,'masap-uncommanded/unintended-aircraft-state-or-lo','Yaw','','A rotational motion in which the aircraft turns around its vertical axis. This causes the aircraft\'s nose to move to the pilot\'s right or left. Pushing the right rudder pedal will tilt the rudder to the right. The pilot will see the nose of the aircraft turn to the right.','checkbox','USAF'),(7195,'masap-weapons-employment-issues','Aircrew Error','','','checkbox','USAF'),(7196,'masap-weapons-employment-issues','Aircrew Error Details','','','text-field','USAF'),(7197,'masap-weapons-employment-issues','ECM Issues','','','checkbox','USAF'),(7198,'masap-weapons-employment-issues','Expendables Issues','','','checkbox','USAF'),(7199,'masap-weapons-employment-issues','Incorrect Switch Positioning','','','checkbox','USAF'),(7200,'masap-weapons-employment-issues','No Range Clearance','','','checkbox','USAF'),(7201,'masap-weapons-employment-issues','No Release Clearance','','','checkbox','USAF'),(7202,'masap-weapons-employment-issues','Other Weapons Employment Issues','','','text-field','USAF'),(7203,'masap-weapons-employment-issues','System Malfuntion','','','checkbox','USAF'),(7204,'masap-weapons-employment-issues','System Malfuntion Details','','','text-field','USAF'),(7205,'masap-weapons-employment-issues','Weapons Deconfliction','','','checkbox','USAF'),(7206,'masap-weather','Clear','','The state of the sky when no clouds or obscurations are observed or detected from the point of observation.','checkbox','USAF'),(7207,'masap-weather','Clear Air Turbulence','','Clear Air Turbulence is turbulence encountered in air where no clouds are present. This term is commonly applied to high-level turbulence associated with wind shear. CAT is often encountered in the vicinity of the jet stream. CAT has become a very serious operational factor to flight operations at all levels and especially to jet traffic flying in excess of 15,000 feet. All pilots encountering CAT conditions are urgently requested to report time, location, and intensity (light, moderate, severe, or extreme) of the element to the FAA facility with which they are maintaining radio contact. If time and conditions permit, elements should be reported according to the standards for other PIREPs and position reports. Refer to AIM Chapters 7-1-26: Clear Air Turbulence (CAT) PIREPs and 7-1-24. PIREPs Relating to Turbulence (http://www.faa.gov/airports_airtraffic/air_traffic/publications/atpubs/aim/Chap7/aim0701.html#7-1-26).','checkbox','USAF'),(7208,'masap-weather','Cloud Conditions','','A visible collection of minute particle matter, such as water droplets and/or ice crystals, in the free air. A cloud forms in the atmosphere as a result of condensation of water vapor. Condensation nuclei, such as in smoke or dust particles, form a surface upon which water vapor can condense. The state of the clouds are defined as: Broken--Clouds which cover between 5/8ths and 7/8ths of the sky; Few--Used to describe a cloud layer that covers between 1/8th and 2/8ths of the sky; Overcast--Sky condition when greater than 9/10 of the sky is covered by clouds; Scattered--A cloud layer that covers between 3/8ths and 1/2 of the sky; Sky Clear--Sky condition of less than 1/10 cloud coverage; Vertical Visibility--means the vertical visibility through a layer of obstructing cloud based on the ground.','combo-box','USAF'),(7210,'masap-weather','Excessive Cold','','Atmospheric temperature very cold.','checkbox','USAF'),(7211,'masap-weather','Excessive Heat','','Heat index of at least 105 degrees F for more than 3 hours per day for 2 consecutive days or heat index more than 115? F for any period of time.','checkbox','USAF'),(7213,'masap-weather','Freezing Drizzle','','Drizzle is precipitation at ground level or aloft in the form of liquid water drops which have diameters less than 0.5 mm and greater than 0.05 mm. Freezing drizzle is drizzle that exists at air temperatures less than 0?C (supercooled), remains in liquid form, and freezes upon contact with objects on the surface or airborne. The intensity of drizzle (based on visibility) is categorized as (AIM Chapter 7-1-20): (1) Light-Visibility more than 1/2 statute mile, (2) Moderate-Visibility from more than 1/4 statute mile to 1/2 statute mile; (3) Heavy. Visibility 1/4 statute mile or less (http://www.faa.gov/airports_airtraffic/air_traffic/publications/atpubs/aim/Chap7/aim0701.html#7-1-20).','combo-box','USAF'),(7214,'masap-weather','Freezing Fog','','A suspension of numerous minute water droplets which freezes upon impact with ground or other exposed objects, generally reducing the horizontal visibility at the earth\'s surface to less than 1 km (5/8 mile).','checkbox','USAF'),(7215,'masap-weather','Freezing Rain','','Freezing rain is precipitation at ground level or aloft in the form of liquid water drops which have diameters greater than 0.5 mm. Freezing rain is rain that exists at air temperatures less than 0?C (supercooled), remains in liquid form, and freezes upon contact with objects on the ground or in the air. Refer to AIM Chapter TBL 7-1-8 Icing Conditions (http://www.faa.gov/airports_airtraffic/air_traffic/publications/atpubs/aim/Chap7/aim0701.html#7-1-22).','combo-box','USAF'),(7218,'masap-weather','Headwind','','','checkbox','USAF'),(7219,'masap-weather','Humidity','','The amount of water vapor in the air.','checkbox','USAF'),(7220,'masap-weather','Hurricane','','A severe tropical cyclone with sustained winds over 74 miles per hour (65 knots) or greater in the North Atlantic Ocean, Caribbean Sea, Gulf of Mexico, and in the eastern North Pacific Ocean','checkbox','USAF'),(7221,'masap-weather','Ice Pellets','','A type of precipitation consisting of transparent or translucent pellets of ice, 5 mm or less in diameter. They may be spherical, irregular, or (rarely) conical in shape. Ice pellets usually bounce when hitting hard ground, and make a sound upon impact with the following categories (AIM Chapter 7-1-19): (1) Light-Scattered pellets that do not completely cover an exposed surface regardless of duration. Visibility is not affected; (2) Moderate-Slow accumulation on ground. Visibility reduced by ice pellets to less than 7 statute miles; (3) Heavy-Rapid accumulation on ground. Visibility reduced by ice pellets to less than 3 statute miles (http://www.faa.gov/airports_airtraffic/air_traffic/publications/atpubs/aim/Chap7/aim0701.html#7-1-19).','combo-box','USAF'),(7222,'masap-weather','Icing','','The accumulation of snow, ice, freezing rain, or frost on aircraft surfaces that adversely affects aircraft control or performance. The types of icing are: Clear Ice--A glossy, clear, or translucent ice formed by the relatively slow freezing or large supercooled water droplets; Mixed--A mixture of clear ice and rime ice; and Rime Ice--Rough, milky, opaque ice formed by the instantaneous freezing of small supercooled water droplets. The intensity of icing is specified as: Light--The rate of accumulation may create a problem if flight is prolonged in this environment (over 1 hour). Occasional use of deicing/anti-icing equipment removes/prevents accumulation. It does not present a problem if the deicing/anti-icing equipment is used; Moderate--The rate of accumulation is such that even short encounters become potentially hazardous and use of deicing/anti-icing equipment or flight diversion is necessary; Severe--The rate of accumulation is such that deicing/anti-icing equipment fails to reduce or control the hazard. Immediate flight diversion is necessary; Trace--Ice becomes perceptible. Rate of accumulation is slightly greater than the rate of sublimation. Deicing/anti-icing equipment is not utilized unless encountered for an extended period of time (over 1 hour) Also, refer to AIM Chapter 7-1-22. PIREPs Relating to Airframe Icing (http://www.faa.gov/airports_airtraffic/air_traffic/publications/atpubs/aim/Chap7/aim0701.html#7-1-22)) and Section 7-1-23. Definitions of Inflight Icing Terms (http://www.faa.gov/airports_airtraffic/air_traffic/publications/atpubs/aim/Chap7/aim0701.html#7-1-23).','combo-box','USAF'),(7223,'masap-weather','Lightning/Static','','Any and all forms of visible electrical discharge produced by a thunderstorm, including a static discharge generated by weather that causes damage or has a significant affect on the operation of the aircraft; this includes St Elmo\'s fire.','combo-box','USAF'),(7224,'masap-weather','Marginal','','Refers to the general weather conditions pilots can expect at the surface. MVFR means Minimum or Marginal Visual Flight Rules. MVFR criteria means a ceiling between 1,000 and 3,000 feet and/or 3 to 5 miles visibility.','checkbox','USAF'),(7225,'masap-weather','Meteorological Conditions','','The state of the atmosphere, mainly with respect to its effects upon life and human activities. Weather consists of the short-term (minutes to months) variations of the atmosphere. Refer to AIM Chapter 7. Safety of Flight Section 1. Meteorology (http://www.faa.gov/airports_airtraffic/air_traffic/publications/atpubs/aim/Chap7/aim0701.html#7-1-28).','combo-box','USAF'),(7226,'masap-weather','Microburst','','Microbursts are small scale intense downdrafts which, on reaching the surface, spread outward in all directions from the downdraft center. This causes the presence of both vertical and horizontal wind shears that can be extremely hazardous to all types and categories of aircraft, especially at low altitudes. Due to their small size, short life span, and the fact that they can occur over areas without surface precipitation, microbursts are not easily detectable using conventional weather radar or wind shear alert systems. Parent clouds producing microburst activity can be any of the low or middle layer convective cloud types. Note, however, that microbursts commonly occur within the heavy rain portion of thunderstorms, and in much weaker, benign appearing convective cells that have little or no precipitation reaching the ground. Microburst wind shear may create a severe hazard for aircraft within 1,000 feet of the ground, particularly during the approach to landing and landing and take-off phases. The impact of a microburst on aircraft which have the unfortunate experience of penetrating one is characterized in (Refer to AIM Chapter 7-1-27: Microburst, Figure 7-1-16). The aircraft may encounter a headwind (performance increasing) followed by a downdraft and tailwind (both performance decreasing), possibly resulting in terrain impact (http://www.faa.gov/airports_airtraffic/air_traffic/publications/atpubs/aim/Chap7/aim0701.html#7-1-16).','checkbox','USAF'),(7227,'masap-weather','Mixed','','Any of the following combinations of freezing and frozen precipitation: snow and sleet, snow and freezing rain, or sleet alone. Rain may also be present.','checkbox','USAF'),(7228,'masap-weather','Mountain Wave','','A wave in the atmosphere caused by a barrier, such as a mountain. Sometimes it is marked by lenticular clouds to the lee side of mountain barriers. May be called a standing wave or a lee wave.','checkbox','USAF'),(7229,'masap-weather','Other Weather','','Description of additional factor(s), not listed, associated with the weather.','text-field','USAF'),(7230,'masap-weather','Rain','','Liquid water droplets that fall from the atmosphere, having diameters greater than drizzle (0.5 mm), categorized as (AIM Chapter 7-1-19): (1) Light-From scattered drops that, regardless of duration, do not completely wet an exposed surface up to a condition where individual drops are easily seen; (2) Moderate-Individual drops are not clearly identifiable; spray is observable just above pavements and other hard surfaces; (3) Heavy-Rain seemingly falls in sheets; individual drops are not identifiable; heavy spray to height of several inches is observed over hard surfaces (http://www.faa.gov/airports_airtraffic/air_traffic/publications/atpubs/aim/Chap7/aim0701.html#7-1-28.).','combo-box','USAF'),(7232,'masap-weather','Snow','','A porous, permeable aggregate of ice grains that can be predominantly single crystals or close groupings of several crystals. The intensity of snow (based on visibility) is categorized as (AIM Chapter 7-1-20): (1) Light-Visibility more than 1/2 statute mile, (2) Moderate-Visibility from more than 1/4 statute mile to 1/2 statute mile; (3) Heavy. Visibility 1/4 statute mile or less (http://www.faa.gov/airports_airtraffic/air_traffic/publications/atpubs/aim/Chap7/aim0701.html#7-1-20).','combo-box','USAF'),(7233,'masap-weather','Sun','','','checkbox','USAF'),(7234,'masap-weather','Temperature (Degrees C)','','The degree of hotness or coldness of the air measured on a temperature scale by means of a thermometer and specified as degrees C (Celsius Scale).','real-field','USAF'),(7235,'masap-weather','Thunderstorms','','Produced by a cumulonimbus cloud, it is a microscale event of relatively short duration characterized by thunder, lightning, gusty surface winds, turbulence, hail, icing, precipitation, moderate to extreme up and downdrafts, and under the most severe conditions, tornadoes. Refer to AIM 7-1-29. Thunderstorms and 7-1-30. Thunderstorm Flying (http://www.faa.gov/airports_airtraffic/air_traffic/publications/atpubs/aim/Chap7/aim0701.html#7-1-28).','combo-box','USAF'),(7236,'masap-weather','Tornado','','A violently rotating column of air in contact with and extending between a convective cloud and the surface of the earth. It is the most destructive of all storm-scale atmospheric phenomena. They can occur anywhere in the world given the right conditions, but are most frequent in the United States in an area bounded by the Rockies on the west and the Appalachians in the east.','checkbox','USAF'),(7237,'masap-weather','Turbulence','','The irregular and instantaneous motions of air which is made up of a number of small of eddies that travel in the general air current. Atmospheric turbulence is caused by random fluctuations in the wind flow. It can be caused by thermal or convective currents, differences in terrain and wind speed, along a frontal zone, or variation in temperature and pressure. Duration and classification of intensity are categorized as (AIM Table 7-1-9: Turbulence Reporting Criteria Table (http://www.faa.gov/airports_airtraffic/air_traffic/publications/atpubs/aim/Chap7/aim0701.html#7-1-24): (1) Light-Turbulence that momentarily causes slight, erratic changes in altitude and/or attitude (pitch, roll, yaw) (Reported as Light Turbulence or Turbulence) or that causes slight, rapid and somewhat rhythmic bumpiness without appreciable changes in altitude or attitude (Reported as Light Chop*); (2) Moderate-Turbulence that is similar to Light Turbulence but of greater intensity. Changes in altitude and/or attitude occur but the aircraft remains in positive control at all times. It usually causes variations in indicated airspeed (Reported as Moderate Turbulence) or Turbulence that is similar to Light Chop but of greater intensity. It causes rapid bumps or jolts without appreciable changes in aircraft altitude or attitude (Reported as Moderate Chop*); (3) Severe-Turbulence that causes large, abrupt changes in altitude and/or attitude. It usually causes large variations in indicated airspeed. Aircraft may be momentarily out of control (Report as Severe Turbulence)*; (4) Extreme: Turbulence in which the aircraft is violently tossed about and is practically impossible to control. It may cause structural damage (Reported as Extreme Turbulence). *High level turbulence (normally above 15,000 feet ASL) not associated with cumuliform cloudiness, including thunderstorms, should be reported as CAT (Clear Air Turbulence) preceded by the appropriate intensity, or light or moderate chop.','combo-box','USAF'),(7238,'masap-weather','Unknown','','Insufficient information exists to categorize the weather condition associated with the occurrence.','checkbox','USAF'),(7239,'masap-weather','Volcanic Ash','','Fine particles of pulverized rock blown from an explosion vent of a volcano. Measuring less than 1/10 inch in diameter, ash may be either solid or molten when first erupted. By far the most common variety is vitric ash (glassy particles formed by gas bubbles bursting through liquid magma). AIM Section 7-1-28: PIREPs Relating to Volcanic Ash Activity (http://www.faa.gov/airports_airtraffic/air_traffic/publications/atpubs/aim/Chap7/aim0701.html#7-1-28) indicates that pilots should submit PIREPs regarding volcanic activity using the Volcanic Activity Reporting (VAR) form (http://www.faa.gov/airports_airtraffic/air_traffic/publications/atpubs/aim/Appendices/aimapd2.html#Appendix2). If a VAR form is not immediately available, relay enough information to identify the position and type of volcanic activity. Further, pilots should verbally transmit the data required in items 1 through 8 of the VAR as soon as possible. The data required in items 9 through 16 of the VAR should be relayed after landing if possible.','combo-box','USAF'),(7240,'masap-weather','Weather','','The state of the atmosphere at a specific time and with respect to its effect on life and human activities. It is the short term variations of the atmosphere, as opposed to the long term, or climatic, changes. It is often referred to in terms of brightness, cloudiness, humidity, precipitation, temperature, visibility, and wind. Refer to AIM Chapter 7. Safety of Flight Section 1. Meteorology (http://www.faa.gov/airports_airtraffic/air_traffic/publications/atpubs/aim/Chap7/aim0701.html#7-1-28).','checkbox','USAF'),(7241,'masap-weather','Weather Description','','','text-field','USAF'),(7242,'masap-weather','Wind','','Air that flows in relation to the earth\'s surface, generally horizontally. There are four areas of wind that are measured: direction, speed, character (gusts and squalls), and shifts. Surface winds are measured by wind vanes and anemometers, while upper level winds are detected through pilot balloons, rawin, or aircraft reports.','combo-box','USAF'),(7243,'masap-weather','Wind Direction (Degrees)','','The direction, in degrees, from which the wind is blowing. For example, an easterly wind is blowing from the east, not toward the east. It is reported with reference to true north, or 360 degrees on the compass, and expressed to the nearest 10 degrees, or to one of the 16 points of the compass (N, NE, WNW, etc.).','integer-field','USAF'),(7244,'masap-weather','Windshear','','A sudden, drastic change in wind speed and/or wind direction in a short distance resulting in a tearing or shearing effect. It can exist in a horizontal or vertical direction and occasionally in both. The recommended method for wind shear reporting is to state the loss or gain of airspeed and the altitudes at which it was encountered. Refer to AIM Chapter 7-1-25. Wind Shear PIREPs (http://www.faa.gov/airports_airtraffic/air_traffic/publications/atpubs/aim/Chap7/aim0701.html#7-1-25)','combo-box','USAF'),(7245,'masap-weather','Wind Speed (Knots)','','The velocity of air in motion relative to the surface of the earth specified in knots.','integer-field','USAF'),(7246,'masap-weather','Wind Type','','Specifies the direction from which the wind is blowing as: Cross Wind--A wind blowing in a direction perpendicular to the course of a moving object; Headwind-- A wind that opposes the intended progress of an exposed, moving object; Tail Wind --A wind blowing in the same direction as the heading of a moving object thus assisting the object\'s intended progress; Wind Shift--A change in wind direction of 45 degrees or more, which takes place in less than 15 minutes. It may the result of a frontal passage, from katabatic winds, sea breezes, or thunderstorms, and in some instances, the change may be gradual or abrupt.','combo-box','USAF'),(7247,'masap-weight-and-balance-event','Aircraft Loaded Weight/CG Error','','','checkbox','USAF'),(7248,'masap-weight-and-balance-event','Cargo','','Refers to everything carried in the cargo compartments of the aircraft and the condition (i.e., restrained, shifting, or other) of bags, mail, freight, express, and company material. It also includes live animals, dangerous goods, and hazardous materials.  as subcategories of the above. Refer to AC 120-27E: Aircraft Weight and Balance Control (http://rgl.faa.gov/Regulatory_and_Guidance_Library/rgAdvisoryCircular.nsf/0/84087a61b8fb9582862570220064e03c/$FILE/AC120-27E.pdf).','combo-box','USAF'),(7249,'masap-weight-and-balance-event','Cargo Loading Error','','','checkbox','USAF'),(7250,'masap-weight-and-balance-event','Cargo Shift','','Movment of cargo between zones or compartments that can cause potential hazards.','checkbox','USAF'),(7251,'masap-weight-and-balance-event','Center of Gravity','','Issues associated with the specified forward and aft points within which the Center of Gravity (CG) must be located during flight. These limits are indicated on pertinent airplane specifications.. CG is defined as the point at which an airplane would balance if it were possible to suspend it at that point. It is the mass center of the airplane, or the theoretical point at which the entire weight of the airplane is assumed to be concentrated. It may be expressed in inches from the reference datum, or in percent of mean aerodynamic cord (MAC). The location depends on the distribution of the weight in the airplane.','checkbox','USAF'),(7252,'masap-weight-and-balance-event','Maximum Landing Weight (lbs)','','The greatest weight that an airplane normally is allowed to have at landing in pounds.','integer-field','USAF'),(7253,'masap-weight-and-balance-event','Maximum Takeoff Weight (lbs)','','The maximum allowable weight for takeoff in pounds of the aircraft according to the Certificate of Airworthiness, the flight manual or other official document.','integer-field','USAF'),(7254,'masap-weight-and-balance-event','Maximum Taxi Weight (lbs)','','The total weight of a loaded aircraft, including all fuel, in pounds. It is greater than the takeoff weight due to the fuel that will be burned during the taxi and runup operations. Taxi weight may also be referred to as ramp weight.','integer-field','USAF'),(7255,'masap-weight-and-balance-event','Maximum Zero Fuel Weight (lbs)','','The maximum weight, exclusive of usable fuel in pounds.','integer-field','USAF'),(7256,'masap-weight-and-balance-event','Other Weight and Balance Event','','Description of additional factor(s), not listed, associated with the weight and balance events and errors.','text-field','USAF'),(7257,'masap-weight-and-balance-event','Overweight for Ground Surface Limits','','Total weight approved of loaded aircraft, including weight of start, taxi, and runup fuel exceeding those allowed for ground maneuvers.','checkbox','USAF'),(7258,'masap-weight-and-balance-event','Overweight Takeoff','','The exceedances of the maximum allowable aircraft weight at the start of the takeoff run. Refer to AC 120-27E: Aircraft Weight and Balance Control (http://rgl.faa.gov/Regulatory_and_Guidance_Library/rgAdvisoryCircular.nsf/0/84087a61b8fb9582862570220064e03c/$FILE/AC120-27E.pdf).','checkbox','USAF'),(7259,'masap-weight-and-balance-event','Overweight Taxi','','Total weight of a loaded aircraft, including all fuel exceeding those allowed for taxi operations.','checkbox','USAF'),(7260,'masap-weight-and-balance-event','Weight and Balance','','The aircraft is said to be in weight and balance when the gross weight of the aircraft is under the max grow weight, and the center of gravity is within limits and will remain in limits for the duration of the flight.','checkbox','USAF'),(7261,'masap-when-event-detected','Aircraft Cleaning','','Occurrence was identified during the process of cleaning the aircraft and restocking aircraft essentials (trash, magazines, blankets, etc.).','checkbox','Operator'),(7262,'masap-when-event-detected','Aircraft De-Ice','','Indicates occurrence was detected during preflight ground servicing intended to remove ice from aircraft surfaces.','checkbox','Operator'),(7263,'masap-when-event-detected','Ground Delay','','Occurrence was identified during the restoration or maintenance of an item in serviceable condition, including servicing, repair, modification, overhaul, inspection, troubleshooting, and determination of condition.','checkbox','Operator'),(7264,'masap-when-event-detected','Hangar','','Indicates occurrence was detected during procedures performed by hangar maintenance personnel, including company personnel and/or a contract vendor, used to maintain or prepare the aircraft for service. May include action(s) taken/not taken by company personnel and/or a contract vendor. May include inadequate service from another company\'s maintenance personnel (vendor).','checkbox','M-DNAA V7.0 B1.3'),(7265,'masap-when-event-detected','In-Flight','','Occurrence was identified during procedures performed by hangar maintenance personnel, including company personnel and/or a contract vendor, used to maintain or prepare the aircraft for service. May include action(s) taken/not taken by company personnel and/or a contract vendor. May include inadequate service from another company\'s maintenance personnel (vendor).','checkbox','ASRS'),(7266,'masap-when-event-detected','Landing Zone','','','checkbox','Operator'),(7267,'masap-when-event-detected','Line','','Occurrence was identified during procedures performed by line maintenance personnel used to maintain or prepare the aircraft for service. May include action(s) taken/not taken by company personnel and/or a contract vendor. May include inadequate service from another company\'s maintenance personnel (vendor).','checkbox','M-DNAA V7.0 B1.3'),(7268,'masap-when-event-detected','Other','','Description of additional factor(s), not listed, associated with when an event was detected..','text-field','M-DNAA V7.0 B1.3'),(7269,'masap-when-event-detected','Other When Event Detected','','Description of additional factor(s), not listed, associated with when the incident or event was detected.','text-field','ASRS'),(7270,'masap-when-event-detected','Paperwork Audit','','Scheduled, formal reviews and verifications to evaluate compliance with policy, standards, and/or contractual requirements. The starting point for an audit is the management and operations of the organization, and it moves outward to the organization\'s activities and products/service. Refer to AC 120-92: Introduction to Safety Management Systems for Air Operators) (http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgAdvisoryCircular.nsf/0/6485143d5ec81aae8625719b0055c9e5/$FILE/AC%20120-92.pdf).','checkbox','M-DNAA V7.0 B1.4'),(7271,'masap-when-event-detected','PostFlight','','Activities after a flight is completed when the engine is shut down and the airplane is secured.','checkbox','M-DNAA V7.0 B1.3'),(7272,'masap-when-event-detected','PreFlight','','Indicates occurrence was detected during the check and preparation of the aircraft before takeoff.','checkbox','ASRS'),(7273,'masap-when-event-detected','When Event Detected','','Specifies the activity that identified the occurrence of the event.','checkbox','ASRS'),(7274,'masap-when-event-detected','Pushback/Tow','','Indicates occurrence was detected while aircraft was moving in the gate, ramp, or parking area, assisted by a tow vehicle [tug].','checkbox','Operator'),(7275,'masap-when-event-detected','Ramp','','Indicates occurrence was detected while the aircraft was located in the parking area at an airport, usually adjacent to a terminal.','checkbox','M-DNAA V7.0 B1.3'),(7276,'masap-when-event-detected','Routine Inspection','','','checkbox','ASRS'),(7277,'masap-when-event-detected','Shop','','','checkbox','M-DNAA V7.0 B1.3'),(7278,'masap-when-event-detected','Taxi','','Indicates occurrence was detected while the airplane was moving of an under its own power on the surface of an airport.','checkbox','ASRS'),(7279,'masap-wildlife-event','Bird Watch Condition','','','combo-box','USAF'),(7280,'masap-wildlife-event','Other Wildlife Event','','','text-field','USAF'),(7281,'masap-wildlife-event','Wildlife Present','','','checkbox','USAF'),(7282,'masap-wildlife-event','Wi