'combo-box','USAF'),(7310,'masap-wuc','71000 Radio Navigation','','','combo-box','USAF'),(7311,'masap-wuc','72000 Radar Navigation','','','combo-box','USAF'),(7312,'masap-wuc','74000 Fire Control System','','','combo-box','USAF'),(7313,'masap-wuc','75000 Weapons Delivery Systems','','','combo-box','USAF'),(7314,'masap-wuc','76000 Electronic Countermeasures/ Tactical Warfare','','','combo-box','USAF'),(7315,'masap-wuc','82000 Computer and Data Display','','','combo-box','USAF'),(7316,'masap-wuc','91000 Emergency Equipment','','','combo-box','USAF'),(7317,'masap-wuc','96000 Personnel and Miscellaneous Equipment','','','combo-box','USAF'),(7318,'masap-wuc','97000 Explosive Equipment','','','combo-box','USAF'),(7319,'medical-crew-activities-duties','Other','','','text-field','Operator'),(7320,'medical-crew-activities-duties','Patient Loading/Unloading','','','checkbox','Operator'),(7321,'meeting-minutes','Meeting ID','','ERC Meeting ID used on system output','bigint-field','UTRS'),(7322,'meeting-minutes','Notes','','A brief record that provides additional information in an unstructured format, especially those written down to aid the memory.','memo-field','UTRS'),(7323,'meeting-review','Comment','','A brief record that provides additional information in an unstructured format, especially those written down to aid the memory.','memo-field','UTRS'),(7324,'meeting-review','Recommended Disposition','','','combo-box','UTRS'),(7325,'meeting-review','Meeting ID','','ERC Meeting ID used on system output','bigint-field','UTRS'),(7326,'meeting-review','Mark for Review','','','combo-box','UTRS'),(7327,'meeting-review','Review Date/Time','','','date-time-field','UTRS'),(7328,'meeting-review','User Name','','','text-field','UTRS'),(7329,'minimum-fa-crew-not-on-board','During Passenger Boarding','','','checkbox','UTRS'),(7330,'minimum-fa-crew-not-on-board','During Passenger Deplaning','','','checkbox','Operator'),(7331,'minimum-fa-crew-not-on-board','Left Aircraft With Passenger(s) On Board','','','checkbox','UTRS'),(7332,'minimum-fa-crew-not-on-board','Through Flight','','','checkbox','Operator'),(7333,'mtx-suggestions','Adhere to Procedures','','','checkbox','Operator'),(7334,'mtx-suggestions','Change Policy','','','checkbox','Operator'),(7335,'mtx-suggestions','Change Procedures','','','checkbox','Operator'),(7336,'mtx-suggestions','Employee Training/Awareness','','','checkbox','Operator'),(7337,'mtx-suggestions','Modify Equipment','','','checkbox','Operator'),(7338,'mtx-suggestions','Other Suggestions','','','text-field','Operator'),(7339,'mtx-suggestions','Repair Equipment','','','checkbox','Operator'),(7340,'mtx-suggestions','Repair Facilities','','','checkbox','Operator'),(7341,'mtx-suggestions','Repair/Modify Aircraft','','','checkbox','Operator'),(7342,'mtx-suggestions','Repair Vehicle','','','checkbox','Operator'),(7343,'narrative','Narrative','','Additional clarifying information on the particulars of an event or incident.','memo-field','UTRS'),(7344,'narrative-investigation','Additional Information','','Narrative to summarize addition information','memo-field','UTRS'),(7345,'narrative-investigation','Airport Information Summary','','Narrative to support airport tax_attributes','memo-field','UTRS'),(7346,'narrative-investigation','Environment Summary','','Narrative to support environment summary','memo-field','UTRS'),(7347,'narrative-investigation','Event Description Summary','','Narrative to support description tax_attributes','memo-field','UTRS'),(7348,'narrative-investigation','Tests and Research','','Narrative to describe test and research results','memo-field','UTRS'),(7349,'narrative-losa','Captain Comments','','','memo-field','Operator'),(7350,'narrative-losa','First Officer Comments','','','memo-field','Operator'),(7351,'narrative-losa','Observer Comments','','','memo-field','Operator'),(7352,'navigation/position-control','Mag Heading Cruise Altitude Rule Deviation','','','checkbox','ASRS'),(7353,'navigation/position-control','Class II Navigation Error','','','checkbox','Operator'),(7354,'navigation/position-control','Clearance Deviation-Heading/Navigation Error','','','checkbox','DNAA'),(7355,'navigation/position-control','Clearance Deviation-Taxi Error','','','checkbox','UTRS'),(7356,'navigation/position-control','Climb or Descent Beyond Assigned Altitude','','','checkbox','DNAA'),(7357,'navigation/position-control','Climb or Descent Not Reaching Assigned Altitude','','','checkbox','DNAA'),(7358,'navigation/position-control','Controlled Flight Towards Terrain','http://www.faa.gov/library/manuals/aviation/instrument_procedures_handbook/media/AppendixD1.pdf','A situation where a mechanically normally functioning airplane is inadvertently flown into the ground, water, or an obstacle. There are two basic causes of CFIT accidents; both involve flight crew situational awareness. One definition of situational awareness is an accurate perception by pilots of the factors and conditions currently affecting the safe operation of the aircraft and the crew. The causes of CFIT are the flight crews? lack of vertical position awareness or their lack of horizontal position awareness in relation to terrain and obstacles.','checkbox','ASRS'),(7359,'navigation/position-control','Failure to Hold Short','http://www.faa.gov/airports_airtraffic/air_traffic/publications/atpubs/PCG/H.HTM','Noncompliance with an air traffic control clearance to the pilot with a LAHSO (Land and Hold Short) clearance to not proceed beyond a designated point such as a specified runway or taxiway. This point may be located prior to an intersecting runway, taxiway, predetermined point, or approach/departure flight path.','checkbox','DNAA'),(7360,'navigation/position-control','Ground Navigation on Ramp','','','checkbox','UTRS'),(7361,'navigation/position-control','Ground Navigation on Runway/Takeoff','','','checkbox','DNAA'),(7362,'navigation/position-control','Ground Navigation on Taxiway','','','checkbox','DNAA'),(7363,'navigation/position-control','Ground Navigation on Taxiway/Ramp','','','checkbox','DNAA'),(7364,'navigation/position-control','Heading or Course Deviation','http://virtualskies.arc.nasa.gov/glossary/C.html','Significant horizontal divergences from the intended flight path and use of the CDI (Course Deviation Indicator)-The vertical needle of a VOR indicator which shows the aircraft\'s relative to the selected VOR radio.','checkbox','DNAA'),(7365,'navigation/position-control','Loss of Primary Navigation Source','','','checkbox','Operator'),(7366,'navigation/position-control','Navigation/Position Control','','Occurrences and issues associated with the failure of any equipment on the aircraft used for navigation.','checkbox','DNAA'),(7367,'navigation/position-control','Other Airborne Navigation','','Description of additional factor(s), not listed, associated with the airborne navigation event.','text-field','DNAA'),(7368,'navigation/position-control','Other Ground Navigation','','Description of additional factor(s), not listed, associated with ground navigation','text-field','DNAA'),(7369,'navigation/position-control','Other Navigation/Position Control','','Description of additional factor(s), not listed, associated with navigation and position control.','text-field','DNAA'),(7370,'navigation/position-control','Polar Nav Error','','','checkbox','Operator'),(7371,'navigation/position-control','RNAV','','','combo-box','Operator'),(7372,'navigation/position-control','RVSM Requirements Not Met','http://www.faa.gov/ats/ato/rvsm1.htm','Reduced Vertical Separation Minimums (RVSM) reduces the vertical separation between flight level (FL) 290?410 from 2000 ft to 1000 ft and makes six additional FLs available for operation. The additional FLs enable more aircraft to fly more time/fuel efficient profiles and provides the potential for enhanced airspace capacity. RVSM operators must receive authorization from the appropriate civil aviation authority. RVSM aircraft must meet required equipage and altitude-keeping performance standards. Operators must operate in accordance with RVSM policies/procedures applicable to the airspace where they are flying. Operators must operate in accordance with RVSM policies/procedures applicable to the airspace where they are flying. 14 CFR Section 91.180 (http://www.airweb.faa.gov/Regulatory_and_Guidance_Library%5CrgFAR.nsf/0/FE1C4A0CF129E93D86256E00004FEEB6?OpenDocument) applies to Reduced Vertical Separation Minimums (RVSM) operations within the U.S. 14 CFR Section 91.706 (http://www.airweb.faa.gov/Regulatory_and_Guidance_Library%5CrgFAR.nsf/0/087757B5C4DCE46A852566FA004B37E5?OpenDocument) applies to RVSM operations outside the U.S. Both sections require that the operator obtain authorization prior to operating in RVSM airspace. Refer to AIM Section 6. Operational Policy/Procedures for Reduced Vertical Separation Minimum (RVSM) in the Domestic U.S., Alaska, Offshore Airspace and the San Juan FIR (http://www.faa.gov/airports_airtraffic/air_traffic/publications/atpubs/aim/Chap4/aim0406.html).','checkbox','Operator'),(7373,'navigation/position-control','Uncontrolled Traffic Pattern Deviation','','','checkbox','ASRS'),(7374,'non-compliance-with-fars-policies/procedures','Aircraft System SOPs','','The standard operating procedure (SOP) is a set of instructions having the force of a directive, covering those features of operations that lend themselves to a definite or standardized procedure without loss of effectiveness.','checkbox','Operator'),(7375,'non-compliance-with-fars-policies/procedures','Airworthiness Directive','http://www.faa.gov/library/manuals/aircraft/airplane_handbook/media/faa-h-8083-3a-7of7.pdf','Issued by one or more Airworthiness Authorities, this is a legally-binding requirement for work to be done on a specific aircraft, or engine, or component (type, model, or serial number/s). The work may involve modification, inspection, or other preventative measures, and may involve a one-off task or a task that needs to be repeated. AD?s always have a threshold expressed in Flight Hours (FH) and/or Flight Cycles (FC) and/or Calendar Time (by which time the task must have been performed). Airworthiness Directives (AD notes) must be compiled with within the required time limit, and the fact of compliance, the date of compliance, and the method of compliance must be recorded in the aircraft\'s maintenance records.','checkbox','DNAA'),(7376,'non-compliance-with-fars-policies/procedures','Cabin Procedures','','','checkbox','Operator'),(7377,'non-compliance-with-fars-policies/procedures','Carry on Baggage Limit','','','checkbox','Operator'),(7378,'non-compliance-with-fars-policies/procedures','Checklist/Flows SOP Non-Compliance','','Issues associated with failure in the means in which an employee follows the documents stating recommended or required actions, including list of action items, steps, or elements needed for a task and Standard Operating Procedures (SOPs).','checkbox','Operator'),(7379,'non-compliance-with-fars-policies/procedures','Company Policy SOP Non-Compliance','','Issues associated with failure in the means in which an employee follows the documents stating recommended or required actions, including the goal or mission of the company, the core values and attitude of that the company, and Standard Operating Procedures (SOPs).','checkbox','DNAA'),(7380,'non-compliance-with-fars-policies/procedures','Did Not Initialize Cabin Phone','','','checkbox','Operator'),(7381,'non-compliance-with-fars-policies/procedures','Errors/Violations by Others','','','checkbox','Operator'),(7382,'non-compliance-with-fars-policies/procedures','Exit Row/Moving Passenger Post Brief','','','checkbox','Operator'),(7383,'non-compliance-with-fars-policies/procedures','Failure to Qualify','','','combo-box','Operator'),(7384,'non-compliance-with-fars-policies/procedures','CFRs','http://www.opm.gov/glossary','Failure to follow the guidance or rules created by the company for employees relating to proper standards and practices and with federal regulations under which flight operations are conducted (as specified in the Code of Federal Regulations (CFR), particularly the Federal Aviation Regulations(FARs)).','checkbox','DNAA'),(7385,'non-compliance-with-fars-policies/procedures','CFR Violation Part No','http://www.opm.gov/glossary','Specific section of the Code of Federal Regulations (CFR), containing the text of public regulations issued by the agencies of the Federal government, that was disregarded.','text-field','M-DNAA V7.0 B1.1'),(7386,'non-compliance-with-fars-policies/procedures','Flight/Duty Time Violation','www.faa.gov/safety/programs_initiatives/oversight/iasa/model_aviation/media/PART08.doc','The total time from the moment a flight crew member commences duty, immediately subsequent to a rest period and prior to making a flight or a series of flights, to the moment the flight crew member is relieved of all duties having completed such flight or series of flights.','checkbox','DNAA'),(7387,'non-compliance-with-fars-policies/procedures','HAZMAT Violation','http://rgl.faa.gov/Regulatory_and_Guidance_Library/rgAdvisoryCircular.nsf/1ab39b4ed563b08985256a35006d56af/e90c50d06627fb54862569ea00777bfe/$FILE/AC121-21B.pdf','Deliberate action not in accordance with rules and recognized procedures associated with Hazardous Materials (HAZMAT) or other regulated material that could result in the potential injury of personnel leading. Hazardous material is defined as any substance/material defined as pose a potential risk to life, health, or property by various regulations administered by the US Environmental Protection Agency and the US Department of Transportation as specified in 49 CFR 172.101 Hazardous Materials Table (http://www.setonresourcecenter.com/transportation/49CFR/172_101tb.pdf). These include explosive, flammable, poisonous, corrosive, reactive, or radioactive, or any combination, and requires special care in handling because of the hazards it po