.S. DOT and IATA/ICAO List of Dangerous Goods.','combo-box','Operator'),(7647,'passenger-misconduct','Date FAA FUP Sent','','','date-time-field','Operator'),(7648,'passenger-misconduct','Date Station Report Received','','','date-time-field','Operator'),(7649,'passenger-misconduct','Date Station Report Required','','','date-time-field','Operator'),(7650,'passenger-misconduct','Discrimination','','','checkbox','Operator'),(7651,'passenger-misconduct','Disruptive Passenger','http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgAdvisoryCircular.nsf/0/ae2f03bf51b4d2d28625721000498e0d/$FILE/AC90-103.pdf','Unruly behavior by an airline passenger aboard an aircraft or within an airport that interferes with personnel performing their duties successfully, and has the potential to compromise the safety of the aircraft and those on board, e.g., irrational behavior that creates the potential for physical conflict, nonviolent threatening behavior, verbal harassment, inebriation, and threats (both verbal and written). It does not include battery or possible medical conditions. All aircrews are requested to immediately report incidents of interference with flightcrews to the appropriate ATC controlling facility. Reports should include level of interference, UTC, whether priority handling is being requested, if the crew is requesting to divert due to the incident, a confirmation the flight deck is secure, and any other information deemed necessary for ATC, law enforcement, and other governmental action taken to safeguard the safety of aviation operations in the NAS. Refer to AC 90-103 (http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgAdvisoryCircular.nsf/0/ae2f03bf51b4d2d28625721000498e0d/$FILE/AC90-103.pdf)','checkbox','Operator'),(7652,'passenger-misconduct','Dissatisfied','','','checkbox','Operator'),(7653,'passenger-misconduct','FAA Date Notified','','','date-time-field','Operator'),(7654,'passenger-misconduct','FAA FUP Required','','','checkbox','Operator'),(7655,'passenger-misconduct','FAA Notification Required','','','checkbox','Operator'),(7656,'passenger-misconduct','Intoxicated Passenger','http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/4169CCE6717F88B386256BC9004338B6?OpenDocument&Highlight=121.575','Impaired performance or abnormal behavior by a passenger under the influence of alcohol. Refer to FAR Sec. 121.575 (http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/4169CCE6717F88B386256BC9004338B6?OpenDocument&Highlight=121.575).','checkbox','DNAA'),(7657,'passenger-misconduct','Was the lavatory smoke detector activated?','http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/19F361F192E8D87D852566EF006B91A3?OpenDocument&Highlight=121.308','No person may smoke in any airplane lavatory. Refer to FAR Sec. 121.317: Passenger information [requirements, smoking prohibitions, and additional seat belt requirements.] (http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/A8411424A9034439862569050061F24E?OpenDocument&Highlight=121.317). Smoke detector system or equivalent in lavatory that provides a warning light in the cockpit or provides a warning light or audio warning in the passenger cabin which would be readily detected by a flight attendant, taking into consideration the positioning of flight attendants throughout the passenger compartment during various phases of flight.','checkbox','Operator'),(7658,'passenger-misconduct','Lavatory Smoke Detector Alarm Sound','http://www.airweb.faa.gov/Regulatory_and_Guidance_Library%5CrgFAR.nsf/0/19F361F192E8D87D852566EF006B91A3?OpenDocument','Each lavatory in the airplane must be equipped with a smoke detector system or equivalent that provides a warning light in the cockpit or provides a warning light or audio warning in the passenger cabin which would be readily detected by a flight attendant, taking into consideration the positioning of flight attendants throughout the passenger compartment during various phases of flight (FAR Sec 121.308: Lavatory fire protection).','checkbox','Operator'),(7659,'passenger-misconduct','Law Enforcement Met Aircraft','','','checkbox','Operator'),(7660,'passenger-misconduct','No Smoking Briefing Given Prior to Departure','http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/672D8459E74DF1DC86256D64004A5A21?OpenDocument&Highlight=121.583','As specified in FAR Sec. 121.583 Carriage of persons without compliance with the passenger-carrying requirements of this part (http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/672D8459E74DF1DC86256D64004A5A21?OpenDocument&Highlight=121.583) paragraph (c),  before each takeoff, each certificate holder operating an airplane carrying persons covered by paragraph (a) of this section shall ensure that all such persons have been orally briefed by the appropriate crewmember on--(1) Smoking.','checkbox','Operator'),(7661,'passenger-misconduct','Were the No Smoking Placards present both inside and outside the lav, is applicable?','http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/A8411424A9034439862569050061F24E?OpenDocument&Highlight=121.317','','checkbox','Operator'),(7662,'passenger-misconduct','Other Passenger Misconduct','','Description of additional factor(s), not listed, that are associated with passenger misconduct.','text-field','Operator'),(7663,'passenger-misconduct','Other Passenger Smoking Event','http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/A8411424A9034439862569050061F24E?OpenDocument&Highlight=121.317','Description of additional factor(s), not listed, that are associated with passenger smoking events..','text-field','Operator'),(7664,'passenger-misconduct','Was the passenger actually observed smoking?','http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/A8411424A9034439862569050061F24E?OpenDocument&Highlight=121.317','','checkbox','Operator'),(7665,'passenger-misconduct','Passenger Admitted to Smoking','http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/A8411424A9034439862569050061F24E?OpenDocument&Highlight=121.317','','checkbox','Operator'),(7666,'passenger-misconduct','Passenger Disabled or Attempted to Disable Smoke Detector','http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/A8411424A9034439862569050061F24E?OpenDocument&Highlight=121.317','No person may smoke in any airplane lavatory. Refer to FAR Sec. 121.317: Passenger information [requirements, smoking prohibitions, and additional seat belt requirements.] (http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/A8411424A9034439862569050061F24E?OpenDocument&Highlight=121.317).','checkbox','Operator'),(7667,'passenger-misconduct','Passenger Misconduct','','Any non-normal behavior or condition that disrupts the operation or presents a hazard, to include intoxication, disruptiveness, and carry on bag arguments.','checkbox','Operator'),(7668,'passenger-misconduct','Level of Passenger Misconduct','','Any non-normal behavior or condition that disrupts the operation or presents a hazard, to include intoxication, disruptiveness, and carry on bag arguments. Passenger misconduct based on TSA four level system and ATA cabin ops group; Level 1--disruptive behavior; Level 2--physically abusive behavior; Level 3--eminent threat of death or serious bodily injury; Level 4--attempted or actual breach of flight deck. Based on TSA designation as: Level 1-Disruptive Behavior: Passenger does NOT comply with verbal requests; Level 2-Physically Abusive Behavior; Level 3-Imminent Threat of Death or Serious Bodily Injury: Notify Captain and request authorities meet the flight, complete report; Level 4-Attempted or Actual Breach of Flight Deck: Notify Captain and request authorities meet the flight.','combo-box','Operator'),(7669,'passenger-misconduct','Passenger Not Seated When Seat Belt Sign Illuminated','','','checkbox','Operator'),(7670,'passenger-misconduct','Passenger Refusal to Comply with Initial Request to Stop Smoking','http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/A8411424A9034439862569050061F24E?OpenDocument&Highlight=121.317','When a passenger smokes on board an aircraft or ramp or in the terminal and does not comply with to cease. Refer to FAR Sec. 121.317: Passenger information [requirements, smoking prohibitions, and additional seat belt requirements.] (http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/A8411424A9034439862569050061F24E?OpenDocument&Highlight=121.317).','checkbox','Operator'),(7671,'passenger-misconduct','Passenger Smoking Incident','http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/A8411424A9034439862569050061F24E?OpenDocument&Highlight=121.317','When a passenger smokes on board an aircraft or ramp or in the terminal','combo-box','Operator'),(7672,'passenger-misconduct','Was the passenger given a verbal warning?','','','checkbox','Operator'),(7673,'passenger-misconduct','Was the passenger given the written warning?','','','checkbox','Operator'),(7674,'passenger-misconduct','PED','','','checkbox','Operator'),(7675,'passenger-misconduct','Personal Item Stowage','http://rgl.faa.gov/Regulatory_and_Guidance_Library/rgAdvisoryCircular.nsf/0/84087a61b8fb9582862570220064e03c/$FILE/AC120-27E.pd','The placing and securing of items the operator may allow a passenger to carry aboard, in addition to a carry-on bag, completely under a passenger seat or in an approved stowage compartment. Typically, an operator may allow one personal item such as a purse, briefcase, computer and case, camera and case, diaper bag, or an item of similar size. Other items, such as coats, umbrellas, reading material, food for immediate consumption, infant restraining device, and passenger assist/comfort animals and devices, are allowed to be carried on the aircraft and are not counted against the personal item allowance. Refer to AC 120-27E: Aircraft Weight and Balance Contr