l-injury-event','Hazardous Environment Exposure','','For example, Noise, Heat, Cold weather','combo-box','Operator'),(7796,'personal-injury-event','Hazardous Substance Exposure','','For example, toxic or noxious substances','combo-box','MEDA Rev g.'),(7797,'personal-injury-event','Hazardous Thermal Environment Exposure','','For example, heat, cold, or humidity','checkbox','MEDA Rev g.'),(7798,'personal-injury-event','Was employee hospitalized overnight as in-patient','','','combo-box','Operator'),(7799,'personal-injury-event','Incorrect Body Position for Manual Handling','','','checkbox','REDA'),(7800,'personal-injury-event','What object or substance directly harmed the employee','','','text-field','UTRS'),(7801,'personal-injury-event','Type of Injury/Illness','','','combo-box','UTRS'),(7802,'personal-injury-event','Lifting/Carrying','','','checkbox','Operator'),(7803,'personal-injury-event','Medical Treatment Sought','','','combo-box','Operator'),(7804,'personal-injury-event','Motor Vehicle Injury','','','checkbox','Operator'),(7805,'personal-injury-event','On the Job Injury','http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgOrders.nsf/0/6aae93ff516cd6fd862571fb00661605/$FILE/VS%208000.1.pdf','Medical condition for an employee which occurred while performing required duties that significantly degrades their ability to function and requiring medical treatment or absence from duty A serious injury is defined as any injury any injury which: (1) Requires hospitalization for more than 48 hours, commencing within 7 days from the date the injury was received; (2) Results in a fracture of any bone (except simple fractures of fingers, toes, or nose); (3) Causes severe hemorrhages, nerve, muscle, or tendon damage; (4) Involves any internal organ; or (5) Involves second or third degree burns, or any burns affecting more than 5 percent of the body surface.','checkbox','Operator'),(7806,'personal-injury-event','OSHA Recordable Event','','','checkbox','UTRS'),(7807,'personal-injury-event','Other Personal Injury Event','','Description of additional factor(s), not listed, associated with personal injury incidents or events.','text-field','MEDA Rev g., REDA'),(7808,'personal-injury-event','Personal Injury Event','','Occurrences and issues associated with injury requiring treatment or absence from duty, which occurred while performing required duties.','checkbox','MEDA Rev g., REDA'),(7809,'personal-injury-event','Pinch Hazard','','','checkbox','Operator'),(7810,'personal-injury-event','Pushing/Pulling','','','checkbox','Operator'),(7811,'personal-injury-event','Reaching','','','checkbox','Operator'),(7812,'personal-injury-event','Report to Corporate Safety','','','checkbox','UTRS'),(7813,'personal-injury-event','Struck By/Bumped','','Personnel subjected to a blow or stroke by vehicles or other powered mobile equipment where at least one vehicle was in regular operation and the impact was caused by a traffic accident or forward/backward travel of the vehicle.','checkbox','MEDA Rev g.'),(7814,'personal-injury-event','Treating Physician','','','text-field','Operator'),(7815,'personal-injury-event','Treatment Location Address','','','text-field','Operator'),(7816,'personal-injury-event','Turbulence','http://www.faa.gov/airports_airtraffic/air_traffic/publications/atpubs/aim/Chap7/aim0701.html#7-1-24','The irregular and instantaneous motions of air which is made up of a number of small of eddies that travel in the general air current. Atmospheric turbulence is caused by random fluctuations in the wind flow. It can be caused by thermal or convective currents, differences in terrain and wind speed, along a frontal zone, or variation in temperature and pressure. Duration and classification of intensity are categorized as (AIM Table 7-1-9: Turbulence Reporting Criteria Table (http://www.faa.gov/airports_airtraffic/air_traffic/publications/atpubs/aim/Chap7/aim0701.html#7-1-24): (1) Light-Turbulence that momentarily causes slight, erratic changes in altitude and/or attitude (pitch, roll, yaw) (Reported as Light Turbulence or Turbulence) or that causes slight, rapid and somewhat rhythmic bumpiness without appreciable changes in altitude or attitude (Reported as Light Chop*); (2) Moderate-Turbulence that is similar to Light Turbulence but of greater intensity. Changes in altitude and/or attitude occur but the aircraft remains in positive control at all times. It usually causes variations in indicated airspeed (Reported as Moderate Turbulence) or Turbulence that is similar to Light Chop but of greater intensity. It causes rapid bumps or jolts without appreciable changes in aircraft altitude or attitude (Reported as Moderate Chop*); (3) Severe-Turbulence that causes large, abrupt changes in altitude and/or attitude. It usually causes large variations in indicated airspeed. Aircraft may be momentarily out of control (Report as Severe Turbulence)*; (4) Extreme: Turbulence in which the aircraft is violently tossed about and is practically impossible to control. It may cause structural damage (Reported as Extreme Turbulence). *High level turbulence (normally above 15,000 feet ASL) not associated with cumuliform cloudiness, including thunderstorms, should be reported as CAT (Clear Air Turbulence) preceded by the appropriate intensity, or light or moderate chop.','combo-box','Operator'),(7817,'pet-animal-information','Animal Loading Error','','','combo-box','UTRS'),(7818,'pet-animal-information','Escaped Animal','','','checkbox','UTRS'),(7819,'pet-animal-information','Kennel Condition','','','combo-box','UTRS'),(7820,'pet-animal-information','Other Pet Information','','','text-field','UTRS'),(7821,'pet-animal-information','Passenger Notification Details ','','','text-field','UTRS'),(7822,'pet-animal-information','Pet Loss ','','','checkbox','UTRS'),(7823,'pet-animal-information','Reportable Reason ','','','checkbox','UTRS'),(7824,'pet-animal-information','Reported to DOT ','','','checkbox','UTRS'),(7825,'pet-animal-information','State of Hawaii-Documentation','','','combo-box','UTRS'),(7826,'phase-of-flight','Approach Type','','If event occurred during landing, what type of approach was flown?','combo-box','DAWG'),(7827,'phase-of-flight','Flight Phase at Start of Event','http://intlaviationstandards.org/Documents/PhaseofFlightDefinitions.pdf','Phase of flight refers to a period within a flight.  A flight begins when any person boards the aircraft with the intention of flight and continues until such time as all such persons have disembarked. (ICAO Annex 13)','combo-box','DAWG'),(7828,'phase-of-operation','100 Hour','','','checkbox','Operator'),(7829,'phase-of-operation','A Check','http://www.srtechnics.com/cms/index.asp?TopicID=214','The most frequent regular check carried out on an aircraft (apart from daily/before flight check). Typically performed every 8 to 12 weeks and often generically referred to as a Light Maintenance check. These checks can be sequentially numbered with, for example, a ?2A? check including a few more tasks than a ?1A? check.','checkbox','Operator'),(7830,'phase-of-operation','Acquisition','','','checkbox','Operator'),(7831,'phase-of-operation','Annual','','','checkbox','Operator'),(7832,'phase-of-operation','AOG','','Aircraft on Ground','checkbox','UTRS'),(7833,'phase-of-operation','AOS','','Aircraft Out of Service (AOS)','checkbox','Operator'),(7834,'phase-of-operation','Audit','http://www.faa.gov/library/manuals/aviation/risk_management/ss_handbook/media/app_a_1200.PDF','A methodical, planned examination of processes, records, and transactions to verify compliance, accuracy, completeness, and traceability. Inspections are normally a part of an audit. Results are primarily presented in terms of findings and concerns. Auditing measures against a defined standard, but does not analyze the standard. Refer to AC 145-5: Repair Station Internal Evaluation Programs (http://rgl.faa.gov/Regulatory_and_Guidance_Library/rgAdvisoryCircular.nsf/0/6d35dfced414e