policy/procedural-issues','CFRs','http://www.opm.gov/glossary','The CFR (The Code of Federal Regulations) contains the text of public regulations issued by the agencies of the Federal government. The CFR is the official, subject matter order, compilation of the Federal regulations of a general applicability and legal effect, that are currently in force. In accordance with section 1510(d) of title 44 of the U.S. Code, the Code of Federal Regulations is compiled and published by the Office of the Federal Register of the National Archives and Records Administration. The Code is divided into 50 titles by subject matter. Each title is divided into sections. Sections within a title may be grouped together as subtitles, chapters, subchapters, parts, subparts, or divisions. Titles may also have appendices which may be divided into sections, rules and/or forms. The CFR does not include statutes enacted by Congress, decisions of the Federal courts, or treaties.','checkbox','DNAA'),(7900,'policy/procedural-issues','Inaccurate Polices/Procedures','','Incorrect or erroneous guidance or information provided in guidance and/or rules.','checkbox','DNAA'),(7901,'policy/procedural-issues','Inadequate Polices/Procedures','','Deficiencies in the quality, quantity, or timeliness with the guidance and/or rules for a particular operation.','checkbox','DNAA'),(7902,'policy/procedural-issues','International Polices/Procedures','','Significant difference between International and Domestic guidance and/or rules for the same operation.','checkbox','DNAA'),(7903,'policy/procedural-issues','Merger Related Issue','','Issues due to Merger of Airlines.','checkbox','Operator'),(7904,'policy/procedural-issues','Nonstandard Operations','','','checkbox','DNAA'),(7905,'policy/procedural-issues','Not Available','','The guidance and/or rules for a particular operation is not accessible or at hand.','checkbox','DNAA'),(7906,'policy/procedural-issues','Other Polices/Procedures Issues','','Description of add