','New System Design','','','combo-box','UTRS'),(8254,'sms-risk-assessment-and-control','Assess Safety Risk','','Performance Objective: The organization will assess risk associated with each identified hazard and define risk acceptance procedures and levels of management that can make safety risk acceptance decisions.','combo-box','UTRS'),(8255,'sms-risk-assessment-and-control','Control/Mitigate Safety Risk','','Performance Objective: The organization will design and implement a risk control for each identified hazard for which there is an unacceptable risk, to reduce to acceptable levels the potential for death, serious physical harm, or damage to equipment or property. The residual or substitute risk will be analyzed before implementing any risk control.','combo-box','UTRS'),(8256,'sms-safety-performance-monitoring-and-measurement','Analysis of Data','','Performance Objective: The organization will analyze data to assess the performance and effectiveness of risk controls in the organization\'s operational processes and the SMS, and to identify root causes of deficiencies and potential new hazards.','combo-box','UTRS'),(8257,'sms-safety-performance-monitoring-and-measurement','Continuous Monitoring','','Performance Objective: The organization will monitor operational data, including products and services received from contractors, to identify hazards, measure the effectiveness of safety risk controls, and assess system performance.','combo-box','UTRS'),(8258,'sms-safety-performance-monitoring-and-measurement','Employee Reporting and Feedback System','','Performance Objective: The organization will establish and maintain a confidential employee safety reporting and feedback system.  Data obtained from this system will be monitored to identify emerging hazards and to assess performance of risk controls in the operational systems.','combo-box','UTRS'),(8259,'sms-safety-performance-monitoring-and-measurement','External Audituing of the SMS','','Performance Objective: The organization will include the results of assessments performed by oversight organizations in its analysis of data.','combo-box','UTRS'),(8260,'sms-safety-performance-monitoring-and-measurement','Internal Audits by Operational Departments','','Performance Objective: The organization will perform regularly scheduled internal audits of its operational processes, including those performed by contractors, to determine the performance and effectiveness of risk controls.','combo-box','UTRS'),(8261,'sms-safety-performance-monitoring-and-measurement','Internal Evaluation','','Performance Objective: The organization will conduct internal evaluations of the SMS and operational processes at planned intervals, to determine that the SMS conforms to its objectives and expectations.','combo-box','UTRS'),(8262,'sms-safety-performance-monitoring-and-measurement','Investigation','','Performance Objective: The organization will establish procedures to collect data and investigate incidents, accidents, and instances of potential regulatory non-compliance to identify potential new hazards or risk control failures.','combo-box','UTRS'),(8263,'sms-safety-performance-monitoring-and-measurement','Management Review','','Performance Objective: Top management will conduct regular reviews of the SMS, including outputs of safety risk management, safety assurance, and lessons learned. Management reviews will include assessing the performance and effectiveness of an organization\'s operational processes and the need for improvements.','combo-box','UTRS'),(8264,'sms-safety-performance-monitoring-and-measurement','Preventative and Corrective Action','','Performance Objective: The organization will take corrective and preventive action to eliminate the causes of nonconformance identified during analysis, to prevent recurrence.','combo-box','UTRS'),(8265,'sms-safety-performance-monitoring-and-measurement','System Assessment','','Performance Objective: The organization will perform an assessment of the performance and effectiveness of risk controls, conformance to SMS expectations as stated herein, and the objectives of the safety policy.','combo-box','UTRS'),(8266,'sms-safety-policies-and-objectives','Documentation and Records','','Performance Objectives: The organization will have documented safety policies; objectives, procedures, a document/record management process and a safety management plan that meet organizational safety expectations and objectives.','combo-box','UTRS'),(8267,'sms-safety-policies-and-objectives','Emergency Preparedness and Response','','Performance Objective: The organization will develop and implement procedures that it will follow in the event of an accident or incident to mitigate the effects of these events.','combo-box','UTRS'),(8268,'sms-safety-policies-and-objectives','Management Commitment and Safety Accountabilities','','Performance Objective: The organization will appoint a management representative to manage, monitor and coordinate the SMS processes.','combo-box','UTRS'),(8269,'sms-safety-policies-and-objectives','Safety Policy','','Performance Objective: The organization will define, document, and communicate the safety roles, responsibilities, and authorities throughout its organization.','combo-box','UTRS'),(8270,'speed-deviation','Airframe Overspeed','http://www.faa.gov/library/manuals/aircraft/airplane_handbook/media/faa-h-8083-3a-7of7.pdf','Any occurrences associated with a condition in which an engine has produced more RPM than the manufacturer recommends, or a condition in which the actual engine speed is higher than the desired engine speed as set on the propeller control.','checkbox','Operator'),(8271,'speed-deviation','Airspeed Above Flap Configuration Limit','http://www.faa.gov/library/manuals/aircraft/airplane_handbook/media/faa-h-8083-3a-7of7.pdf','http://www.faa.gov/library/manuals/aircraft/airplane_handbook/media/faa-h-8083-3a-7of7.pdf','checkbox','DNAA'),(8272,'speed-deviation','Airspeed Above Gear Configuration Limit','http://www.faa.gov/library/manuals/aircraft/airplane_handbook/media/faa-h-8083-3a-7of7.pdf','http://www.faa.gov/library/manuals/aircraft/airplane_handbook/media/faa-h-8083-3a-7of7.pdf','checkbox','DNAA'),(8273,'speed-deviation','Airspeed Above VMO/MMO','http://www.faa.gov/library/manuals/aircraft/airplane_handbook/media/faa-h-8083-3a-7of7.pdf','Any occurrences associated with the airspeed exceeding the maximum operating speed express in knots (VMO) or the maximum operating speed express in terms of a decimal of mach speed (MMO).','checkbox','DNAA'),(8275,'speed-deviation','Airspeed Below Minimum for Configuration','','','checkbox','DNAA'),(8276,'speed-deviation','Clearance Deviation-Airspeed','http://www.faa.gov/airports_airtraffic/air_traffic/publications/atpubs/aim/Chap4/aim0404.html','','checkbox','Operator'),(8277,'speed-deviation','Exceeded Aircraft Limitations','','','checkbox','Operator'),(8278,'speed-deviation','Buffeting: High Speed','http://ecfr.gpoaccess.gov/cgi/t/text/text-idx?c=ecfr&sid=43d67d5e1e3a78768e6d4ec4741be468&rgn=div8&view=text&node=14:1.0.1.3.11.2.161.39&idno=14','The beating of an aerodynamic structure or surface by unsteady flow, gusts, etc.; the irregular shaking or oscillation of a vehicle component owing to turbulent air or separated flow.','checkbox','DNAA'),(8279,'speed-deviation','Buffeting: Low Speed','http://ecfr.gpoaccess.gov/cgi/t/text/text-idx?c=ecfr&sid=43d67d5e1e3a78768e6d4ec4741be468&rgn=div8&view=text&node=14:1.0.1.3.11.2.161.39&idno=14','The beating of an aerodynamic structure or surface by unsteady flow, gusts, etc.; the irregular shaking or oscillation of a vehicle component owing to turbulent air or separated flow.','checkbox','Operator'),(8280,'speed-deviation','Low Speed Stall','','','checkbox','DNAA'),(8281,'speed-deviation','Off Assigned Speed or Airspace Limit','','','checkbox','DNAA'),(8282,'speed-deviation','Other Speed Deviation','','Description of additional factor(s), not listed, associated with speed deviations.','text-field','DNAA'),(8283,'speed-deviation','Speed Deviation','','Divergences from assigned speed restriction.','checkbox','DNAA'),(8284,'station-operation-issues','Access Panel Left Open','','Specifies that a ground service/mtx personnel left an access panel on the aircraft open prior to departure.','checkbox','Operator'),(8285,'station-operation-issues','Air Start','','','checkbox','Operator'),(8286,'station-operation-issues','Crew Hotel/Transportation','','','checkbox','Operator'),(8287,'station-operation-issues','De-Icing','http://www.fly.faa.gov/Products/Training/Traffic_Management_for_Pilots/TFM_Final_Draft.pdf','Indicates occurrence or issues associated with preflight ground servicing to remove existing frozen precipitation, frost or ice from aircraft surfaces. The processes may involve the application of various fluids to the aircraft','checkbox','Operator'),(8288,'station-operation-issues','HAZMAT','http://rgl.faa.gov/Regulatory_and_Guidance_Library/rgAdvisoryCircular.nsf/1ab39b4ed563b08985256a35006d56af/e90c50d06627fb54862569ea00777bfe/$FILE/AC121-21B.pdf','Hazardous Material (HAZMAT) is defined as any substance/material defined as pose a potential risk to life, health, or property by various regulations administered by the US Environmental Protection Agency and the US Department of Transportation as specified in 49 CFR 172.101 Hazardous Materials Table (http://www.setonresourcecenter.com/transportation/49CFR/172_101tb.pdf). These include explosive, flammable, poisonous, corrosive, reactive, or radioactive, or any combination, and requires special care in handling because of the hazards it poses to public health and welfare, safety, and/or the environment. Refer to AC 121-21B: Information Guide for Training Programs and Manual Requirements in the Air Transportation of Hazardous Materials (http://rgl.faa.gov/Regulatory_and_Guidance_Library/rgAdvisoryCircular.nsf/1ab39b4ed563b08985256a35006d56af/e90c50d06627fb54862569ea00777bfe/$FILE/AC121-21B.pdf)','checkbox','Operator'),(8289,'station-operation-issues','Other Station Operation Issues','','Description of additional factor(s), not listed, associated with station operations issues.','text-field','Operator'),(8290,'station-operation-issues','Procedures','','Standard Operating Procedures (SOPs) delineated in reference materials that ensure that station operations are performed in accordance with FAA and airline regulations.','checkbox','Operator'),(8291,'station-operation-issues','Remote Dispatch','','','checkbox','Operator'),(8292,'station-operation-issues','Station Operation Issues','','Occurrences and issues related to the station customer service and operations including Hazmat, servicing, gate operations, security, and ground deicing.','checkbox','Operator'),(8293,'station-operation-issues','Weather Resources','http://www.faa.gov/airports_airtraffic/air_traffic/publications/atpubs/aim/Chap7/aim0701.html#7-1-28','The National Weather Service (NWS) maintains an extensive surface, upper air, and radar weather observing program; a nationwide aviation weather forecasting service; and provides limited pilot briefing service (interpretational). The majority of pilot weather briefings are provided by FAA personnel at Flight Service Stations (AFSSs/FSSs). Aviation routine weather reports (METAR) are taken manually by NWS, FAA, contractors, or supplemental observers. METAR reports are also provided by Automated Weather Observing System (AWOS) and Automated Surface Observing System (ASOS). Refer to AIM Chapter 7. Safety of Flight Section 1. Meteorology (http://www.faa.gov/airports_airtraffic/air_traffic/publications/atpubs/aim/Chap7/aim0701.html#7-1-28).','checkbox','Operator'),(8294,'station-ops-complications-customer-service','ADA','http://www.usdoj.gov/crt/ada/adahom1.htm','The Americans with Disabilities Act (ADA) is a U.S. law passed in 1990 that prohibits discrimination against people with disabilities. Also refer to AC 150/5360-14 Access to Airports by Individual with Disabilities dated 06/30/1999 (http://rgl.faa.gov/Regulatory_and_Guidance_Library/rgAdvisoryCircular.nsf/0/254ad61892d56d7b86256c6a007219bd/$FILE/150-5360-14.pdf).','checkbox','Operator'),(8295,'station-ops-complications-customer-service','Agent  Availability','','','checkbox','Operator'),(8296,'station-ops-complications-customer-service','Aislechair','','','checkbox','Operator'),(8297,'station-ops-complications-customer-service','Baggage Claim','','','checkbox','Operator'),(8298,'station-ops-complications-customer-service','Board Room','','','checkbox','Operator'),(8299,'station-ops-complications-customer-service','Gate Staff','','','checkbox','Operator'),(8300,'station-ops-complications-customer-service','Boarding','','Issues associated loading or removing passengers from the aircraft.','checkbox','Operator'),(8301,'station-ops-complications-customer-service','Deplanning','','','checkbox','Operator'),(8302,'station-ops-complications-customer-service','Jetbridge Operations','','','checkbox','Operator'),(8303,'station-ops-complications-customer-service','Other Station Ops Complications-Customer Service','','Description of additional factor(s), not listed, associated with customer service station operations complications.','text-field','Operator'),(8304,'station-ops-complications-customer-service','Passenger Count Incorrect','','','checkbox','Operator'),(8305,'station-ops-complications-customer-service','Passenger Dissatisfied','','','checkbox','Operator'),(8306,'station-ops-complications-customer-service','Seat Assignment','','','checkbox','Operator'),(8307,'station-ops-complications-customer-service','Security','','Actual or potential breaches of regulations or security practices caused by company employees, airport personnel, and/or passengers and failure of company employees to ensure the highest level of security surrounding a flight (example: leaving the jetway door open and unattended during boarding)','checkbox','Operator'),(8308,'station-ops-c