operation of the flight including the FOM, aircraft manuals, MEL, checklist placards and the QRH.','checkbox','Operator'),(8483,'technical-data-error','Improper MEL/Deferral','http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/58CF936FD6E2A36186256959004E132E?OpenDocument&Highlight=125.201','Issues associated with deficiencies of the written materials provided for personnel related to Minimum Equipment List (MEL)/Configuration Deviation List (CDL) faults or defects found on an aircraft which do not need immediate action and can be deferred for repair at a later date. This deferred defect status is only given for a strictly limited period of time and rectification must take place before that time has elapsed. Refer to FAR 125.201: Inoperable instruments and equipment (http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/58CF936FD6E2A36186256959004E132E?OpenDocument&Highlight=125.201).','checkbox','Operator'),(8484,'technical-data-error','Reference Material','','','checkbox','Operator'),(8485,'technical-data-error','Work Cards','','Document that provides the details of the required maintenance steps for repairing an aircraft system or component. Also referred to as Job Card, Task Card, etc.','checkbox','Operator'),(8486,'technical-knowledge/skills','Aircraft Configuration Knowledge','','','checkbox','REDA'),(8487,'technical-knowledge/skills','Inadequate Airline Process Knowledge','','','checkbox','MEDA Rev g.'),(8488,'technical-knowledge/skills','Computing Skills','','','checkbox','MEDA'),(8489,'technical-knowledge/skills','English Language Proficiency','','','checkbox','MEDA'),(8490,'technical-knowledge/skills','Inadequate Aircraft System Knowledge','','','checkbox','MEDA Rev g.'),(8491,'technical-knowledge/skills','Inadequate Task Experience','','','checkbox','MEDA Rev g.'),(8492,'technical-knowledge/skills','Inadequate Task Knowledge','','','checkbox','MEDA Rev g.'),(8493,'technical-knowledge/skills','Inadequate Task Planning','','','checkbox','MEDA Rev g.'),(8494,'technical-knowledge/skills','Other Technical Knowledge/Skills/Training','','Description of additional factor(s), not listed, associated with technical knowledge, skills, and training.','text-field','MEDA Rev g.'),(8495,'technical-knowledge/skills','Inadequate Skills','http://www.faa.gov/library/manuals/aviation/pilot_handbook/media/faa-h-8083-25-4of4.pdf','Not having the appropriate procedural, psychomotor, and perceptual skills required for tasking. They are the abilities that are gained through conventional training, are perfected, and become almost automatic through experience.','checkbox','MEDA Rev g.'),(8496,'technical-knowledge/skills','Teamwork Skills','','','checkbox','MEDA'),(8497,'technical-knowledge/skills','Technical Knowledge/Skills/Training','','','checkbox','MEDA Rev g.'),(8498,'technical-knowledge/skills','Training Issues','','','combo-box','MEDA Rev g.'),(8499,'technical-knowledge/skills','Training Situation','','','combo-box','MEDA Rev g.'),(8500,'terrain-proximity','Airborne Conflict','','','combo-box','ASRS'),(8501,'terrain-proximity','ATC Low Altitude Warning','','','checkbox','DNAA'),(8502,'terrain-proximity','Below Minimum Altitude','','','checkbox','DNAA'),(8503,'terrain-proximity','GPWS Warning','','The type of warning that originate from the Ground Proximity Warning System (GPWS). Warnings are provided by the GPWS in the following circumstances: 1) excessive descent rate; 2) excessive terrain closure rate; 3) excessive altitude loss after take-off or go-around; 4) unsafe terrain clearance while not in landing configuration; a) gear not locked down; b) flaps not in a landing position; and 5) excessive descent below the instrument glide path.','combo-box','Operator'),(8504,'terrain-proximity','Ground Conflict','','','combo-box','ASRS'),(8505,'terrain-proximity','Other Terrain Proximity Event','','Description of additional factor(s), not listed, associated with terrain proximity incidents or events.','text-field','DNAA'),(8506,'terrain-proximity','Terrain Proximity','http://www.airweb.faa.gov/Regulatory_and_Guidance_Library%5CrgFAR.nsf/0/465764AB441B0864862568C8006451A9?OpenDocument','Occurrences associated with potential terrain hazards such as excessive closure rate to terrain and/or insufficient terrain clearance, including GPSW warnings.','checkbox','DNAA'),(8507,'traffic-proximity','ATC Conflict','','','checkbox','DNAA'),(8508,'traffic-proximity','Closest Horizontal Proximity (Ft)','','Proximity at closest point horizontally in feet.','real-field','DAWG'),(8509,'traffic-proximity','Closest Vertical Proximity (Ft)','','Proximity at closest point vertically in feet.','real-field','DAWG'),(8510,'traffic-proximity','Complied with RA Command','','','checkbox','Operator'),(8511,'traffic-proximity','Direction of Traffic (Horizontal) (Ft)','','','real-field','DAWG'),(8512,'traffic-proximity','Direction of Traffic (Vertical) (Ft)','','','real-field','DAWG'),(8513,'traffic-proximity','Took Evasive Action','http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgAdvisoryCircular.nsf/0/76056bd8e04b1cc086256fb0006a579b/$FILE/AC%2020-151.pdf','Indicates that the flight crew','checkbox','ASRS'),(8514,'traffic-proximity','NMAC','http://www.faa.gov/airports_airtraffic/air_traffic/publications/atpubs/aim/Chap7/aim0706.html#7-6-3','Near Mid-Air Collision (NMAC) is an incident associated with the operation of an aircraft in which the possibility of a collision occurs as a result of proximity of less than 500 feet to another aircraft, or a report is received from a pilot or flight crew member stating that a collision hazard existed between two or more aircraft. It is the responsibility of the pilot and/or flight crew to determine whether a Near Midair Collision situation actually occurred and, if so, to initiate an NMAC report. For the initial report, the pilot/crew should notify the nearest Air Traffic facility on the ATC frequency while airborne, or by phone immediately after landing. Refer to AIM Section 7.6.3 (http://www.faa.gov/airports_airtraffic/air_traffic/publications/atpubs/aim/Chap7/aim0706.html#7-6-3) http://www.airline-safety-records.com/a_nmac.htm','checkbox','DNAA'),(8515,'traffic-proximity','Other Traffic Proximity','','Description of additional factor(s), not listed, associated with traffic proximity','text-field','UTRS'),(8516,'traffic-proximity','Pattern Conflict ','','','checkbox','UTRS'),(8517,'traffic-proximity','RAAS','','','combo-box','Operator'),(8518,'traffic-proximity','TCAS Not Available','','','checkbox','Operator'),(8519,'traffic-proximity','TCAS RA','http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgAdvisoryCircular.nsf/0/76056bd8e04b1cc086256fb0006a579b/$FILE/AC%2020-151.pdf','If the intruder gets within 15 to 35 seconds, depending upon altitude, of Closest Point of Approach (CPA), it is considered a threat, and an aural and visual TCAS Resolution Advisory (RA) is issued to the flight crew advising that a particular maneuver should, or should not, be performed to attain or maintain minimum safe vertical separation from an intruder. This level provides a recommended vertical maneuver using modified Instantaneous Vertical Speed Indicators (IVSIs), and voice messages to provide adequate vertical separation from the threat aircraft or prevents initiation of a maneuver that would place the TCAS II aircraft in jeopardy. The TCAS II is considered a backup system to the ?SEE AND AVOID? concept and the ATC radar environment. Refer to AC 20-151 (http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgAdvisoryCircular.nsf/0/76056bd8e04b1cc086256fb0006a579b/$FILE/AC%2020-151.pdf).','checkbox','DAWG'),(8520,'traffic-proximity','TCAS RA Command','http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgAdvisoryCircular.nsf/0/76056bd8e04b1cc086256fb0006a579b/$FILE/AC%2020-151.pdf','The TCAS Resolution Advisories (RAs) are annunciated by the various voice messages, as appropriate, along with the expected pilot response categorized as Climb-- climb at the rate depicted by the green (fly to) arc on the Instantaneous Vertical Speed Indicator (IVSI), nominally between 1,500 and 2,000 fpm; Descend-- descend at the rate depicted by the green (fly to) arc on the IVSI nominally between 1,500 and 2,000 fpm; Monitor Vertical Speed--ensure that vertical speed is out of the illuminated IVSI red arc until the RA is completed; Other additional commands as specified in Appendix 1 of AC 20-151 (http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgAdvisoryCircular.nsf/0/76056bd8e04b1cc086256fb0006a579b/$FILE/AC%2020-151.pdf).','combo-box','DAWG'),(8521,'traffic-proximity','TCAS TA','http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgAdvisoryCircular.nsf/0/76056bd8e04b1cc086256fb0006a579b/$FILE/AC%2020-151.pdf','If the traffic gets within 25 to 48 seconds, depending upon altitude, of projected Closest Point of Approach (CPA), it is then considered an intruder, and an aural and visual Traffic Advisory (TA) is issued to a flight crew, identifying the location of nearby traffic meeting certain minimum separation criteria.. This level calls attention to what may develop into a collision threat using the traffic advisory display and the voice message, ?TRAFFIC - TRAFFIC.? It permits mental and physical preparation for a possible maneuver to follow and assists the pilot in achieving visual acquisition of the intruding aircraft. Refer to AC 20-151 (http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgAdvisoryCircular.nsf/0/76056bd8e04b1cc086256fb0006a579b/$FILE/AC%2020-151.pdf).','checkbox','DAWG'),(8522,'traffic-proximity','Threat Aircraft','','','checkbox','Operator'),(8523,'traffic-proximity','TCAD Activated','','','checkbox','UTRS'),(8524,'traffic-proximity','TCAS/Traffic Conflict','http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgAdvisoryCircular.nsf/0/76056bd8e04b1cc086256fb0006a579b/$FILE/AC%2020-151.pdf','Traffic Alert And Collision Avoidance System (TCAS)-An airborne collision avoidance system based on radar beacon signals which operates independent of ground-based equipment. TCAS-I generates traffic advisories only. TCAS-II generates traffic advisories, and resolution (collision avoidance) advisories in the vertical plane.','checkbox','UTRS'),(8525,'training-central-load-planners','Cockpit Jump Seat Observation','http://rgl.faa.gov/Regulatory_and_Guidance_Library/rgAdvisoryCircular.nsf/0/876CC3EF90DD8BAC862570C00078C818?OpenDocument&Highlight=121-32','As specified in Sec. 121.463: Aircraft dispatcher qualifications, initial dispatcher training includes operating familiarization consisting of at least 5 hours observing operations under this part from the flight deck or, for airplanes without an observer seat on the flight deck, from a forward passenger seat with headset or speaker (http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/FDB312A7CEEB3356852566EF006D059B?OpenDocument&Highlight=121.463). Aircraft dispatchers are required to observe operations from the cockpit jump seat as part of their annual qualification under part 121. Refer to AC 121-32a Dispatch Resource Management Training (http://rgl.faa.gov/Regulatory_and_Guidance_Library/rgAdvisoryCircular.nsf/0/876CC3EF90DD8BAC862570C00078C818?OpenDocument&Highlight=121-32).','checkbox','Operator'),(8526,'training-central-load-planners','Communications','http://rgl.faa.gov/Regulatory_and_Guidance_Library/rgAdvisoryCircular.nsf/0/876cc3ef90dd8bac862570c00078c818/$FILE/AC%20121-32a.pdf','Includes internal and external influences on interpersonal communications. External factors include job title, corporate complexity, age, experience, gender, organizational culture, education, etc. Internal factors include speaking skills, listening skills, decisionmaking skills, conflict resolution techniques, and the use of appropriate assertiveness and advocacy. All training activities involving pilots, flight attendants, aircraft dispatchers, and aircraft mechanics should stress the importance of clear and unambiguous communication. Refer to AC 121-32A: Dispatch Resource Management Training (http://rgl.faa.gov/Regulatory_and_Guidance_Library/rgAdvisoryCircular.nsf/0/876cc3ef90dd8bac862570c00078c818/$FILE/AC%20121-32a.pdf)','checkbox','Operator'),(8527,'training-central-load-planners','Decisionmaking','http://rgl.faa.gov/Regulatory_and_Guidance_Library/rgAdvisoryCircular.nsf/0/876cc3ef90dd8bac862570c00078c818/$FILE/AC%20121-32a.pdf','The aircraft dispatcher assumes a leadership role within the operational environment; therefore, DRM training should teach effective decisionmaking skills through use of inquiry, advocacy, and assertion. Training should focus on effective techniques of seeking and evaluating information, showing the influence of biases and other factors that impact decision quality. There are benefits in providing aircraft dispatchers with operational models of the decision process. Aircraft dispatchers may refer to these models to make good choices in situations when information is incomplete or contradictory. Refer to AC 121-32A: Dispatch Resource Management Training (http://rgl.faa.gov/Regulatory_and_Guidance_Library/rgAdvisoryCircular.nsf/0/876cc3ef90dd8bac862570c00078c818/$FILE/AC%20121-32a.pdf).','checkbox','Operator'),(8528,'training-central-load-planners','Deferred Items-MEL/CDL','http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/75BFE28E8D694F43852566EF006DCF65?OpenDocument&Highlight=121.628','Minimum Equipment List (MEL)/Configuration Deviation List (CDL) faults or defects found on an aircraft which do not need immediate action and can be deferred for repair at a later date. This deferred defect status is only given for a strictly limited period of time and rectification must take place before that time has elapsed. Refer to FAR 121.628: Inoperable instruments and equipment (http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/75BFE28E8D694F43852566EF006DCF65?OpenDocument&Highlight=121.628).','checkbox','Operator'),(8529,'training-central-load-planners','Dispatcher Training','http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/DEE20F600326435B86256A65005A7516?OpenDocument&Highlight=121.427','Issues associated with the initial, upgrade, and recurring education and instruction provided to dispatchers, including field conditions, flight planning, flight releases, MELs, NOTAMS, operational control. Refer to Sec. 121.415: Crewmember and dispatcher training requirements (http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/DEE20F600326435B86256A65005A7516?OpenDocument&Highlight=121.427), and Sec. 121.463: Aircraft dispatcher qualifications','checkbox','Operator'),(8530,'training-central-load-planners','Flight Releases','http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/71F65AFDE4568E12852566EF006DF4F3?OpenDocument&Highlight=121.687','Training related to the paperwork by which an air carrier ensures all activities required for safe dispatch and continuation of a flight to its destination. Refer to Sec. 121.689 (http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/71F65AFDE4568E12852566EF006DF4F3?OpenDocument&Highlight=121.687).','checkbox','Operator'),(8531,'training-central-load-planners','DRM Training','http://rgl.faa.gov/Regulatory_and_Guidance_Library/rgAdvisoryCircular.nsf/0/876cc3ef90dd8bac862570c00078c818/$FILE/AC%20121-32a.pdf','Dispatch Resource Management (DRM) training addresses the challenge of optimizing communication between diverse groups within an airline and the related interpersonal issues while using available resources. This includes effective teambuilding, conflict resolution, situational awareness, information transfer and dissemination, problem solving, decision making, and dealing with automated systems. DRM has evolved because of the joint responsibility for the preflight planning, delay, and dispatch release of a flight between the pilot in command (PIC) and aircraft dispatcher. DRM training consists of three components: initial indoctrination/awareness, recurrent practice and feedback, and continual reinforcement. DRM training should employ scenario-based training to the extent possible to emphasize effective use of the dispatcher\'s tools and resources. Refer to AC 121-32a Dispatch Resource Management Training (http://rgl.faa.gov/Regulatory_and_Guidance_Library/rgAdvisoryCircular.nsf/0/876CC3EF90DD8BAC862570C00078C818?OpenDocument&Highlight=121-32).','checkbox','Operator'),(8532,'training-central-load-planners','Field Conditions','','','checkbox','Operator'),(8533,'training-central-load-planners','Flight Planning-Initial','http://virtualskies.arc.nasa.gov/glossary/F.html','Determining the route and proper method of navigation which the aircraft will use before the actual flight.','checkbox','Operator'),(8534,'training-central-load-planners','Initial','http://rgl.faa.gov/Regulatory_and_Guidance_Library/rgAdvisoryCircular.nsf/0/876CC3EF90DD8BAC862570C00078C818?OpenDocument&Highlight=121-32','Refer to AC 121-32a Dispatch Resource Management Training (http://rgl.faa.gov/Regulatory_and_Guidance_Library/rgAdvisoryCircular.nsf/0/876CC3EF90DD8BAC862570C00078C818?OpenDocument&Highlight=121-32).','checkbox','Operator'),(8535,'training-central-load-planners','NOTAMs','http://www.faa.gov/airports_airtraffic/airports/resources/advisory_circulars/media/150-5200-28C/150_5200_28c.pdf','Notices to Airmen (NOTAM) ? a notice containing information (not known sufficiently in advance to publicize by other means) concerning the establishment, condition, or change in any component (facility, service, or procedure) of, or hazard in, the National Airspace System (NAS); the timely knowledge of which is essential to personnel concerned with flight operations.Refer to AC 150/5200-28C: Notices to Airmen (NOTAMS (http://www.faa.gov/airports_airtraffic/airports/resources/advisory_circulars/media/150-5200-28C/150_5200_28c.pdf).','checkbox','Operator'),(8536,'training-central-load-planners','Operational Control','http://rgl.faa.gov/Regulatory_and_Guidance_Library/rgAdvisoryCircular.nsf/0/876CC3EF90DD8BAC862570C00078C818?OpenDocument&Highlight=121-32','Training related to the exercise of authority over initiating, conducting, or terminating a flight as defined in AC 121-32a Dispatch Resource Management Training (http://rgl.faa.gov/Regulatory_and_Guidance_Library/rgAdvisoryCircular.nsf/0/876CC3EF90DD8BAC862570C00078C818?OpenDocument&Highlight=121-32).','checkbox','Operator'),(8537,'training-central-load-planners','Other Dispatcher Training','','Description of additional factor(s), not listed, associated with the training of dispatchers.','text-field','Operator'),(8538,'training-central-load-planners','Policies/Procedures','','','checkbox','Operator'),(8539,'training-central-load-planners','Recurrent','http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/164CEEC0F24E617086256A65005AF47F?OpenDocument&Highlight=121.427','Recurrent training must ensure that each crew member or dispatcher is adequately trained and currently proficient with respect to the type airplane (including differences training, if applicable) and crewmember position involved. Refer to FAR Sec. 121.427: Recurrent training (http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/164CEEC0F24E617086256A65005AF47F?OpenDocument&Highlight=121.427) and AC 121-32a Dispatch Resource Management Training (http://rgl.faa.gov/Regulatory_and_Guidance_Library/rgAdvisoryCircular.nsf/0/876CC3EF90DD8BAC862570C00078C818?OpenDocument&Highlight=121-32).','checkbox','Operator'),(8540,'training-customer-service-representatives','Documentation','','Written description of policies, processes, procedures, objectives, requirements, authorities, responsibilities, or work instructions.','checkbox','Operator'),(8541,'training-customer-service-representatives','Other Customer Service Representatives Training','','Description of additional factor(s), not listed, associated with the training of customer service representatives.','text-field','Operator'),(8542,'training-customer-service-representatives','Passenger Carry Ons','http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/4EFABB63E579B5F7852566EF006DB146?OpenDocument&Highlight=121.589','Issues associated with programs and curriculum developed to impart the knowledge and skills necessary to comply with regulations and interactions with passengers regarding small pieces of luggage brought on the plane that are stored under the seat or stowed in an overhead compartment above the seats. Refer to: Sec. 121.589: Carry-on baggage (http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/4EFABB63E579B5F7852566EF006DB146?OpenDocument&Highlight=121.589).','checkbox','Operator'),(8543,'training-customer-service-representatives','Policies/Procedures','','Standard Operating Procedures (SOPs) delineated in training materials that ensure that tasking provided by Customer Service Representatives are performed in accordance with FAA and airline regulations.','checkbox','Operator'),(8544,'training-customer-service-representatives','Security','','Training related to handling actual or potential breaches of regulations or security practices caused by company employees, airport personnel, and/or passengers and failure of company employees to ensure the highest level of security surrounding a flight (example: leaving the jetway door open and unattended during boarding).','checkbox','Operator'),(8545,'training-customer-service-representatives','Special Handling Passengers','','','checkbox','Operator'),(8546,'training-customer-service-representatives','Customer Service Representatives Training','','Programs developed to impart the knowledge and skills necessary to qualify for the position of Customer Service Representative.','checkbox','Operator'),(8547,'training-dispatchers','Cockpit Jump Seat Observation','http://rgl.