y/rgAdvisoryCircular.nsf/0/876cc3ef90dd8bac862570c00078c818/$FILE/AC%20121-32a.pdf','The aircraft dispatcher assumes a leadership role within the operational environment; therefore, DRM training should teach effective decisionmaking skills through use of inquiry, advocacy, and assertion. Training should focus on effective techniques of seeking and evaluating information, showing the influence of biases and other factors that impact decision quality. There are benefits in providing aircraft dispatchers with operational models of the decision process. Aircraft dispatchers may refer to these models to make good choices in situations when information is incomplete or contradictory. Refer to AC 121-32A: Dispatch Resource Management Training (http://rgl.faa.gov/Regulatory_and_Guidance_Library/rgAdvisoryCircular.nsf/0/876cc3ef90dd8bac862570c00078c818/$FILE/AC%20121-32a.pdf).','checkbox','Operator'),(8550,'training-dispatchers','Deferred Items-MEL/CDL','http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/75BFE28E8D694F43852566EF006DCF65?OpenDocument&Highlight=121.628','Minimum Equipment List (MEL)/Configuration Deviation List (CDL) faults or defects found on an aircraft which do not need immediate action and can be deferred for repair at a later date. This deferred defect status is only given for a strictly limited period of time and rectification must take place before that time has elapsed. Refer to FAR 121.628: Inoperable instruments and equipment (http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/75BFE28E8D694F43852566EF006DCF65?OpenDocument&Highlight=121.628).','checkbox','Operator'),(8551,'training-dispatchers','Dispatcher Training','http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/DEE20F600326435B86256A65005A7516?OpenDocument&Highlight=121.427','Issues associated with the initial, upgrade, and recurring education and instruction provided to dispatchers, including field conditions, flight planning, flight releases, MELs, NOTAMS, operational control. Refer to Sec. 121.415: Crewmember and dispatcher training requirements (http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/DEE20F600326435B86256A65005A7516?OpenDocument&Highlight=121.427), and Sec. 121.463: Aircraft dispatcher qualifications','checkbox','Operator'),(8552,'training-dispatchers','Flight Releases','http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/71F65AFDE4568E12852566EF006DF4F3?OpenDocument&Highlight=121.687','Training related to the paperwork by which an air carrier ensures all activities required for safe dispatch and continuation of a flight to its destination. Refer to Sec. 121.689 (http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/71F65AFDE4568E12852566EF006DF4F3?OpenDocument&Highlight=121.687).','checkbox','Operator'),(8553,'training-dispatchers','DRM Training','http://rgl.faa.gov/Regulatory_and_Guidance_Library/rgAdvisoryCircular.nsf/0/876cc3ef90dd8bac862570c00078c818/$FILE/AC%20121-32a.pdf','Dispatch Resource Management (DRM) training addresses the challenge of optimizing communication between diverse groups within an airline and the related interpersonal issues while using available resources. This includes effective teambuilding, conflict resolution, situational awareness, information transfer and dissemination, problem solving, decision making, and dealing with automated systems. DRM has evolved because of the joint responsibility for the preflight planning, delay, and dispatch release of a flight between the pilot in command (PIC) and aircraft dispatcher. DRM training consists of three components: initial indoctrination/awareness, recurrent practice and feedback, and continual reinforcement. DRM training should employ scenario-based training to the extent possible to emphasize effective use of the dispatcher\'s tools and resources. Refer to AC 121-32a Dispatch Resource Management Training (http://rgl.faa.gov/Regulatory_and_Guidance_Library/rgAdvisoryCircular.nsf/0/876CC3EF90DD8BAC862570C00078C818?OpenDocument&Highlight=121-32).','checkbox','Operator'),(8554,'training-dispatchers','Field Conditions','','','checkbox','Operator'),(8555,'training-dispatchers','Flight Planning-Initial','http://virtualskies.arc.nasa.gov/glossary/F.html','Determining the route and proper method of navigation which the aircraft will use before the actual flight.','checkbox','Operator'),(8556,'training-dispatchers','Initial','http://rgl.faa.gov/Regulatory_and_Guidance_Library/rgAdvisoryCircular.nsf/0/876CC3EF90DD8BAC862570C00078C818?OpenDocument&Highlight=121-32','Refer to AC 121-32a Dispatch Resource Management Training (http://rgl.faa.gov/Regulatory_and_Guidance_Library/rgAdvisoryCircular.nsf/0/876CC3EF90DD8BAC862570C00078C818?OpenDocument&Highlight=121-32).','checkbox','Operator'),(8557,'training-dispatchers','NOTAMs','http://www.faa.gov/airports_airtraffic/airports/resources/advisory_circulars/media/150-5200-28C/150_5200_28c.pdf','Notices to Airmen (NOTAM) ? a notice containing information (not known sufficiently in advance to publicize by other means) concerning the establishment, condition, or change in any component (facility, service, or procedure) of, or hazard in, the National Airspace System (NAS); the timely knowledge of which is essential to personnel concerned with flight operations.Refer to AC 150/5200-28C: Notices to Airmen (NOTAMS (http://www.faa.gov/airports_airtraffic/airports/resources/advisory_circulars/media/150-5200-28C/150_5200_28c.pdf).','checkbox','Operator'),(8558,'training-dispatchers','Operational Control','http://rgl.faa.gov/Regulatory_and_Guidance_Library/rgAdvisoryCircular.nsf/0/876CC3EF90DD8BAC862570C00078C818?OpenDocument&Highlight=121-32','Training related to the exercise of authority over initiating, conducting, or terminating a flight as defined in AC 121-32a Dispatch Resource Management Training (http://rgl.faa.gov/Regulatory_and_Guidance_Library/rgAdvisoryCircular.nsf/0/876CC3EF90DD8BAC862570C00078C818?OpenDocument&Highlight=121-32).','checkbox','Operator'),(8559,'training-dispatchers','Other Dispatcher Training','','Description of additional factor(s), not listed, associated with the training of dispatchers.','text-field','Operator'),(8560,'training-dispatchers','Policies/Procedures','','','checkbox','Operator'),(8561,'training-dispatchers','Recurrent','http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/164CEEC0F24E617086256A65005AF47F?OpenDocument&Highlight=121.427','Recurrent training must ensure that each crew member or dispatcher is adequately trained and currently proficient with respect to the type airplane (including differences training, if applicable) and crewmember position involved. Refer to FAR Sec. 121.427: Recurrent training (http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/164CEEC0F24E617086256A65005AF47F?OpenDocument&Highlight=121.427) and AC 121-32a Dispatch Resource Management Training (http://rgl.faa.gov/Regulatory_and_Guidance_Library/rgAdvisoryCircular.nsf/0/876CC3EF90DD8BAC862570C00078C818?OpenDocument&Highlight=121-32).','checkbox','Operator'),(8562,'training-flight-attendants','Cabin Maintenance Log','','','checkbox','Operator'),(8563,'training-flight-attendants','Computer Based Training','','','checkbox','Operator'),(8564,'training-flight-attendants','Drills','','','checkbox','Operator'),(8565,'training-flight-attendants','Emergency Equipment','http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/65020F664E8C966786256A6500582F36?OpenDocument&Highlight=sec.,121.309','Issues associated with programs and curriculum developed to impart the knowledge and skills necessary to comply with rules and regulations associated with the emergency or safety equipment aboard the aircraft, including slide deployments (ATA code 25-61).','checkbox','Operator'),(8566,'training-flight-attendants','Initial','','','checkbox','Operator'),(8567,'training-flight-attendants','Life Support','','','checkbox','Operator'),(8568,'training-flight-attendants','Other Flight Attendants Training','','Description of additional factor(s), not listed, associated with flight attendant training.','text-field','Operator'),(8569,'training-flight-attendants','Overwater','','','checkbox','Operator'),(8570,'training-flight-attendants','Policies/Procedures','','','checkbox','UTRS'),(8571,'training-flight-attendants','Recurrent','','Recurrent training must ensure that each flight attendant is adequately trained and currently proficient with respect to the type airplane (including differences training, if applicable) and crewmember position involved.','checkbox','Operator'),(8572,'training-flight-attendants','Reports','','','checkbox','Operator'),(8573,'training-flight-attendants','Security','','Training related to handling actual or potential breaches of regulations or security practices caused by company employees, airport personnel, and/or passengers and failure of company employees to ensure the highest level of security surrounding a flight (example: leaving the jetway door open and unattended during boarding).','checkbox','Operator'),(8574,'training-flight-attendants','Flight Attendants Training','','Programs developed to impart the knowledge and skills necessary to qualify to be a flight attendant.','checkbox','Operator'),(8575,'training-ground-service-technicians','HAZMAT','http://rgl.faa.gov/Regulatory_and_Guidance_Library/rgAdvisoryCircular.nsf/1ab39b4ed563b08985256a35006d56af/e90c50d06627fb54862569ea00777bfe/$FILE/AC121-21B.pdf','Hazardous Material (HAZMAT) is defined as any substance/material defined as pose a potential risk to life, health, or property by various regulations administered by the US Environmental Protection Agency and the US Department of Transportation as specified in 49 CFR 172.101 Hazardous Materials Table (http://www.setonresourcecenter.com/transportation/49CFR/172_101tb.pdf). These include explosive, flammable, poisonous, corrosive, reactive, or radioactive, or any combination, and requires special care in handling because of the hazards it poses to public health and welfare, safety, and/or the environment. Refer to AC 121-21B: Information Guide for Training Programs and Manual Requirements in the Air Transportation of Hazardous Materials (http://rgl.faa.gov/Regulatory_and_Guidance_Library/rgAdvisoryCircular.nsf/1ab39b4ed563b08985256a35006d56af/e90c50d06627fb54862569ea00777bfe/$FILE/AC121-21B.pdf)','checkbox','Operator'),(8576,'training-ground-service-technicians','Marshalling','','Guidance by ground staff/vehicle during pushback or taxi onto a stand.','checkbox','Operator'),(8577,'training-ground-service-technicians','Other Ground Service Technicians Training','','Description of additional factor(s), not listed, associated with ground service technician training.','text-field','Operator'),(8578,'training-ground-service-technicians','Policies/Procedures','','','checkbox','Operator'),(8579,'training-ground-service-technicians','Pushback','http://intlaviationstandards.org/Glossary.html','Aircraft is moving in the gate, ramp, or parking area, assisted by a tow vehicle [tug].  Pushback/towing is a phase of flight.','checkbox','Operator'),(8580,'training-ground-service-technicians','Safety Zone','','','checkbox','Operator'),(8581,'training-ground-service-technicians','Security','','Training related to handling actual or potential breaches of regulations or security practices caused by company employees, airport personnel, and/or passengers and failure of company employees to ensure the highest level of security surrounding a flight (example: leaving the jetway door open and unattended during boarding).','checkbox','Operator'),(8582,'training-ground-service-technicians','Ground Service Technicians Training','','Programs developed to impart the knowledge and skills necessary to qualify for Ground Service Technician position.','checkbox','Operator'),(8583,'training-maintenance-technicians','Air Start','http://www.faa.gov/airports_airtraffic/air_traffic/publications/atpubs/PCG/A.HTM','Occurrences, issues, and training associated with the starting of an aircraft engine while the aircraft is airborne, preceded by engine shutdown during training flights or by actual engine failure.','checkbox','Operator'),(8584,'training-maintenance-technicians','APU Operations','','The Auxiliary Power Unit provides power for engine-starting and other systems while on the ground (ATA code 49-**)','checkbox','Operator'),(8585,'training-maintenance-technicians','Other Maintenance Technicians Training','','Description of additional factor(s), not listed, associated with maintenance technician training.','text-field','Operator'),(8586,'training-maintenance-technicians','Policies/Procedures','','Standard Operating Procedures (SOPs) that ensure that maintenance tasking and operations are performed in accordance with FAA and airline regulations.','checkbox','Operator'),(8587,'training-maintenance-technicians','Taxi/Tow Operations','','','checkbox','Operator'),(8588,'training-maintenance-technicians','Maintenance Technicians Training','http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/8262799F358ED611852566EF006C6B27?OpenDocument&Highlight=121.375','Training program to ensure that each person (including inspection personnel) who determines the adequacy of work done is fully informed about procedures and techniques and new equipment in use and is competent to perform his duties. It also include training in knowledge and skills related to human performance, including coordination with other maintenance personnel and flight crew.','checkbox','Operator'),(8589,'training-organization','Other Organization Training','','Description of additional factor(s), not listed, associated with organzational training.','text-field','Operator'),(8590,'training-organization','Publish Article','','','checkbox','Operator'),(8591,'training-organization','Standardization','','','checkbox','Operator'),(8592,'training-organization','Supplement','','','checkbox','Operator'),(8593,'training-organization','Organization Training','','','checkbox','Operator'),(8594,'training-pilots','Computer Based Training','','','checkbox','Operator'),(8595,'training-pilots','CRM','http://rgl.faa.gov/Regulatory_and_Guidance_Library/rgAdvisoryCircular.nsf/0/80038cf51aace53686256e24005cbb23/$FILE/AC120-51e.pdf','Crew Resource Management (CRM) refers to the effective use of all available resources: human resources, hardware, and information. Other groups routinely working with the cockpit crew, who are involved in decisions required to operate a flight safely, are also essential participants in an effective CRM process. These groups include but are not limited to: (a) Aircraft dispatchers; (b) Flight attendants; (c) Maintenance personnel; (d) Air traffic controllers. Refer to AC 120-51E: Crew Resource Management Training (http://rgl.faa.gov/Regulatory_and_Guidance_Library/rgAdvisoryCircular.nsf/0/80038cf51aace53686256e24005cbb23/$FILE/AC120-51e.pdf).','checkbox','Operator'),(8596,'training-pilots','Emergency Equipment','http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/65020F664E8C966786256A6500582F36?OpenDocument&Highlight=sec.,121.309','http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/65020F664E8C966786256A6500582F36?OpenDocument&Highlight=sec.,121.309','checkbox','Operator'),(8597,'training-pilots','Flight Deck Procedures','','','checkbox','Operator'),(8598,'training-pilots','General Operating Systems','','','checkbox','Operator'),(8599,'training-pilots','Home Study','','','checkbox','Operator'),(8600,'training-pilots','Initial Indoctrination/Awareness','http://rgl.faa.gov/Regulatory_and_Guidance_Library/rgAdvisoryCircular.nsf/0/80038cf51aace53686256e24005cbb23/$FILE/AC120-51e.pdf','Indoctrination/awareness typically consists of classroom presentations and focuses on communications and decisionmaking, interpersonal relations, crew coordination, leadership, and adherence to SOPs, among others. In this component of CRM training, the concepts are developed, defined, and related to the safety of line operations. This component also provides a common conceptual framework and a common vocabulary for identifying crew coordination problems. Refer to AC 120-51E: Crew Resource Management Training (http://rgl.faa.gov/Regulatory_and_Guidance_Library/rgAdvisoryCircular.nsf/0/80038cf51aace53686256e24005cbb23/$FILE/AC120-51e.pdf).','checkbox','Operator'),(8601,'training-pilots','MEL','http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/58CF936FD6E2A36186256959004E132E?OpenDocument&Highlight=125.201','Minimum Equipment List (MEL)/Configuration Deviation List (CDL) faults or defects found on an aircraft which do not need immediate action and can be deferred for repair at a later date. This deferred defect status is only given for a strictly limited period of time and rectification must take place before that time has elapsed. Refer to FAR 125.201: Inoperable instruments and equipment (http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/58CF936FD6E2A36186256959004E132E?OpenDocument&Highlight=125.201).','checkbox','Operator'),(8602,'training-pilots','Other Pilot Training','','Description of additional factor(s), not listed, associated with pilot training.','text-field','Operator'),(8603,'training-pilots','Overwater','','','checkbox','Operator'),(8604,'training-pilots','Policies/Procedures','','','checkbox','UTRS'),(8605,'training-pilots','Recurrent','http://rgl.faa.gov/Regulatory_and_Guidance_Library/rgAdvisoryCircular.nsf/0/80038cf51aace53686256e24005cbb23/$FILE/AC120-51e.pdf','CRM training must be included as a regular part of the recurrent training requirement. Recurrent CRM training should include classroom or briefing room refresher training to review and amplify CRM components, followed by practice and feedback exercises, such as LOFT, preferably with taped feedback; or a suitable substitute, such as role-playing in a flight training device and taped feedback. It is recommended that these recurrent CRM exercises take place with a full crew, each member operating in his or her normal crew position. A complete crew should always be scheduled, and every attempt should be made to maintain crew integrity. Recurrent training LOFT, which includes CRM, should be conducted with current line crews, and preferably not with instructors or check airmen as stand-ins. Refer to AC 120-51E: Crew Resource Management Training (http://rgl.faa.gov/Regulatory_and_Guidance_Library/rgAdvisoryCircular.nsf/0/80038cf51aace53686256e24005cbb23/$FILE/AC120-51e.pdf).','checkbox','Operator'),(8606,'training-pilots','Simulator PC','','','checkbox','Operator'),(8607,'training-pilots','Simulator PT','','','checkbox','Operator'),(8608,'training-pilots','SPT','','Special Purpose Training','checkbox','Operator'),(8609,'training-pilots','Standardization','','','checkbox','Operator'),(8610,'training-pilots','Systems Airbus','','','combo-box','Operator'),(8611,'training-pilots','Systems Boeing','','','combo-box','Operator'),(8612,'training-pilots','Systems Embraer','','','combo-box','Operator'),(8613,'training-pilots','Pilot Training','http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/DEE20F600326435B86256A65005A7516?OpenDocument&Highlight=121.427','Issues associated with the initial, upgrade, and recurring education and instruction provided to flight crews, including aircraft operation, CRM, emergency, and procedures. Refer to Sec. 121.415: Crewmember and dispatcher training requirements (http://www.airweb.faa.gov/Regulatory_and_Guidance_Library/rgFAR.nsf/0/DEE20F600326435B86256A65005A7516?OpenDocument&Highlight=121.427).','checkbox','Operator'),(8614,'training-pilots','Transition','','','checkbox','Operator'),(8615,'training-pilots','Upgrade','','','checkbox','Operator'),(8616,'trip-details','Bid Number','','','text-field','Operator'),(8617,'trip-details','Original Trip Number','','','text-field','Operator'),(8618,'trip-details','Other Trip Details','','','text-field','Operator'),(8619,'trip-details','Revised Trip Number','','','text-field','Operator'),(8620,'uncommanded/unintended-aircraft-state-or-loss-of','Aircraft Upset (Multi Axis)','','','checkbox','DNAA'),(8621,'uncommanded/unintended-aircraft-state-or-loss-of','Bank','http://rgl.faa.gov/Regulatory_and_Guidance_Library/rgAdvisoryCircular.nsf/0/b173ba8a295764f086256cde006a44ad/$FILE/AC120-71A.pdf','Angle of rotation or roll about the longitudinal axis. Maximum bank angle permissible during approach is specified in the approved operating manual used by the pilot, and is generally not more than 30?; the maximum bank angle permissible during landing may be considerably less than 30?, as specified in that manual. Refer to AC 120-71A: Standard Operating Procedures for Flight Deck Crewmembers (http://rgl.faa.gov/Regulatory_and_Guidance_Library/rgAdvisoryCircular.nsf/0/b173ba8a295764f086256cde006a44ad/$FILE/AC120-71A.pdf).','checkbox','DNAA'),(8622,'uncommanded/unintended-aircraft-state-or-loss-of','Other Uncommanded/Unintended Aircraft State or Loss of Control','','Description of additional factor(s), not listed, associated with uncommanded or unintended aircraft state or loss of control.','text-field','DNAA'),(8623,'uncommanded/unintended-aircraft-state-or-loss-of','Pitch','http://www.airweb.faa.gov/Regulatory_and_Guidance_Library%5CrgFAR.nsf/0/7B29C0FFCE0C430A86256EDF00478339?OpenDocument','The propeller blade setting as determined by the blade angle measured in a manner, and at a radius, specified by the instruction manual for the propeller.','checkbox','DNAA'),(8624,'uncommanded/unintended-aircraft-state-or-loss-of','Roll','','','checkbox','DNAA'),(8625,'uncommanded/unintended-aircraft-state-or-loss-of','Speed','','','combo-box','DNAA'),(8626,'uncommanded/unintended-aircraft-state-or-loss-of','Uncommanded/Unintended Aircraft State or Loss of Control','','Occurrences associated with the loss of aircraft control while inflight.','checkbox','DNAA'),(8627,'uncommanded/unintended-aircraft-state-or-loss-of','Yaw','http://members.airlines.org/about/d.aspx?nid=7954','A rotational motion in which the aircraft turns around its vertical axis. This causes the aircraft\'s nose to move to the pilot\'s right or left. Pushing the right rudder pedal will tilt the rudder to the right. The pilot will see the nose of the aircraft turn to the right.','checkbox','DNAA'),(8628,'vehicle-details','Number of Vehicle','','','integer-field','Operator'),(8629,'vehicle-details','Operator Name','','','text-field','Operator'),(8630,'vehicle-details','Other Vehicle Information','','','text-field','Operator'),(8631,'vehicle-details','Report Filed with Airport Authority','','','combo-box','Operator'),(8632,'vehicle-details','Vehicle in Motion','','','combo-box','Operator'),(8633,'vehicle-details','Vehicle Owner','','','text-field','Operator'),(8634,'vehicle-details','Vehicle Type','','','text-field','Operator'),(8635,'volcanic-ash','Airport','','Location of flight-crew or dispatcher expressed as three character IATA or four character ICAO code.','airport-ext-field','Operator'),(8636,'volcanic-ash','Airport Elevation','','','integer-field','UTRS'),(8637,'volcanic-ash','Airspace','','The space above ground or water areas which is or is not controlled, assigned, and/or designated.','combo-box','ASRS'),(8638,'volcanic-ash','Ash Cloud Density','','','combo-box','Operator'),(8639,'volcanic-ash','Ash Color','','','combo-box','Operator'),(8640,'volcanic-ash','Direction from Airport (deg mag)','','','real-field','UTRS'),(8641,'volcanic-ash','Distance from Airport Center (SM)','','','real-field','UTRS'),(8642,'volcanic-ash','Effect on Aircraft','','','combo-box','Operator'),(8643,'volcanic-ash','Eruption Observation','','','combo-box','Operator'),(8644,'volcanic-ash','Eruption Type','','','combo-box','Operator'),(8645,'volcanic-ash','Navigational Aid/VORTAC','http://www.faa.gov/airports_airtraffic/air_traffic/publications/atpubs/PCG/N.HTM','http://www.faa.gov/airports_airtraffic/air_traffic/publications/atpubs/PCG/N.HTM','navaid-field','DAWG'),(8646,'volcanic-ash','Other Effects','','','combo-box','Operator'),(8647,'volcanic-ash','Other Information','','','text-field','Operator'),(8648,'volcanic-ash','Position','http://www.faa.gov/airports_airtraffic/air_traffic/publications/atpubs/PCG/C.HTM','The intersection of lines of reference, usually expressed in degrees/minutes/seconds of latitude and longitude, used to determine position or location of event.','lat-long-field','DAWG'),(8649,'volcanic-ash','Position of Activity','','','combo-box','Operator'),(8650,'volcanic-ash','STAR/SID/Approach','','STAR/SID/Approach procedure aircraft was on during event.','procedure-field','DAWG'),(8651,'volcanic-ash','Proximity to Airport','','','combo-box','UTRS'),(8652,'volcanic-ash','Unknown/Other AirSpace','','','text-field','DAWG'),(8653,'volcanic-ash','Waypoint/Fix','http://www.faa.gov/airports_airtraffic/air_traffic/publications/atpubs/PCG/W.HTM','Waypoint-a predetermined geographical position that is defined in terms of latitude/longitude coordinates. Waypoints may be a simple named point in space or associated with existing navaids, intersections, or fixes. waypoint is most often used for route/instrument approach definition, progress reports, published VFR routes, visual reporting points or points for transitioning and/or circumnavigating controlled and/or special use airspace, that is defined relative to a VORTAC station or in terms of latitude/longitude coordinates. RNAV procedures make use of both fly-over and fly-by waypoints. Fix- a geographical position determined by visual reference to the surface, by reference to one or more radio NAVAIDs, by celestial plotting, or by another navigational device. Refer to AIM Chapter 1-1: Area Navigation (Navigation Aids) (http://www.faa.gov/airports_airtraffic/air_traffic/publications/atpubs/aim/Chap1/aim0101.html).','waypoint-field','DAWG'),(8654,'weather','Clear','http://www.weather.com/glossary/c.html','The state of the sky when no clouds or obscurations are observed or detected from the point of observation.','checkbox','ASRS'),(8655,'weather','Clear Air Turbulence','http://www.faa.gov/airports_airtraffic/air_traffic/publications/atpubs/PCG/C.HTM','Clear Air Turbulence is turbulence encountered in air where no clouds are present. This term is commonly applied to high-level turbulence associated with wind shear. CAT is often encountered in the vicinity of the jet stream. CAT has become a very serious operational factor to flight operations at all levels and especially to jet traffic flying in excess of 15,000 feet. All pilots encountering CAT conditions are urgently requested to report time, location, and intensity (light, moderate, severe, or extreme) of the element to the FAA facility with which they are maintaining radio contact. If time and conditions permit, elements should be reported according to the standards for other PIREPs and position reports. Refer to AIM Chapters 7-1-26: Clear Air Turbulence (CAT) PIREPs and 7-1-24. PIREPs Relating to Turbulence (http://www.faa.gov/airports_airtraffic/air_traffic/publications/atpubs/aim/Chap7/aim0701.html#7-1-26).','checkbox','UTRS'),(8656,'weather','Cloud Conditions','http://www.weather.com/glossary/c.html','A visible collection of minute particle matter, such as water droplets and/or ice crystals, in the free air. A cloud forms in the atmosphere as a result of condensation of water vapor. Condensation nuclei, such as in smoke or dust particles, form a surface upon which water vapor can condense. The state of the clouds are defined as: Broken--Clouds which cover between 5/8ths and 7/8ths of the sky; Few--Used to describe a cloud layer that covers between 1/8th and 2/8ths of the sky; Overcast--Sky condition when greater than 9/10 of the sky is covered by clouds; Scattered--A cloud layer that covers between 3/8ths and 1/2 of the sky; Sky Clear--Sky condition of less than 1/10 cloud coverage; Vertical Visibility--means the vertical visibility through a layer of obstructing cloud based on the ground.','combo-box','Operator'),(8658,'weather','Excessive Cold','','Atmospheric temperature very cold.','checkbox','Operator'),(8659,'weather','Excessive Heat','','Heat index of at least 105 degrees F for more than 3 hours per day for 2 consecutive days or heat index more than 115? F for any period of time.','checkbox','Operator'),(8661,'weather','Freezing Drizzle','http://www.faa.gov/airports_airtraffic/air_traffic/publications/atpubs/aim/Chap7/aim0701.html#7-1-20','Drizzle is precipitation at ground level or aloft in the form of liquid water drops which have diameters less than 0.5 mm and greater than 0.05 mm. Freezing drizzle is drizzle that exists at air temperatures less than 0?C (supercooled), remains in liquid form, and freezes upon contact with objects on the surface or airborne. The intensity of drizzle (based on visibility) is categorized as (AIM Chapter 7-1-20): (1) Light-Visibility more than 1/2 statute mile, (2) Moderate-Visibility from more than 1/4 statute mile to 1/2 statute mile; (3) Heavy. Visibility 1/4 statute mile or less (http://www.faa.gov/airports_airtraffic/air_traffic/publications/atpubs/aim/Chap7/aim0701.html#7-1-20).','combo-box','DAWG'),(8662,'weather','Freezing Fog','http://aircrafticing.grc.nasa.gov/resources/glossary.html','A suspension of numerous minute water droplets which freezes upon impact with ground or other exposed objects, generally reducing the horizontal visibility at the earth\'s surface to less than 1 km (5/8 mile).','checkbox','Operator'),(8663,'weather','Freezing Rain','http://www.faa.gov/airports_airtraffic/air_traffic/publications/atpubs/aim/Chap7/aim0701.html#7-1-22','Freezing rain is precipitation at ground level or aloft in the form of liquid water drops which have diameters greater than 0.5 mm. Freezing rain is rain that exists at air temperatures less than 0?C (supercooled), remains in liquid form, and freezes upon contact with objects on the ground or in the air. Refer to AIM Chapter TBL 7-1-8 Icing Conditions (http://www.faa.gov/airports_airtraffic/air_traffic/publications/atpubs/aim/Chap7/aim0701.html#7-1-22).','combo-box','DNAA'),(8666,'weather','haze','','','checkbox','UTRS'),(8667,'weather','Headwind','','','checkbox','Operator'),(8668,'weather','Humidity','http://www.weather.com/glossary/h.html','The amount of water vapor in the air.','checkbox','MEDA Rev g.'),(8669,'weather','Hurricane','http://www.weather.com/glossary/h.html','A severe tropical cyclone with sustained winds over 74 miles per hour (65 knots) or greater in the North Atlantic Ocean, Caribbean Sea, Gulf of Mexico, and in the eastern North Pacific Ocean','checkbox','DAWG'),(8670,'weather','Ice Pellets','http://www.faa.gov/airports_airtraffic/air_traffic/publications/atpubs/aim/Chap7/aim0701.html#7-1-19','A type of precipitation consisting of transparent or translucent pellets of ice, 5 mm or less in diameter. They may be spherical, irregular, or (rarely) conical in shape. Ice pellets usually bounce when hitting hard ground, and make a sound upon impact with the following categories (AIM Chapter 7-1-19): (1) Light-Scattered pellets that do not completely cover an exposed surface regardless of duration. Visibility is not affected; (2) Moderate-Slow accumulation on ground. Visibility reduced by ice pellets to less than 7 statute miles; (3) Heavy-Rapid accumulation on ground. Visibility reduced by ice pellets to less than 3 statute miles (http://www.faa.gov/airports_airtraffic/air_traffic/publications/atpubs/aim/Chap7/aim0701.html#7-1-19).','combo-box','DAWG'),(8671,'weather','Icing','http://www.faa.gov/airports_airtraffic/air_traffic/publications/atpubs/PCG/I.HTM','The accumulation of snow, ice, freezing rain, or frost on aircraft surfaces that adversely affects aircraft control or performance. The types of icing are: Clear Ice--A glossy, clear, or translucent ice formed by the relatively slow freezing or large supercooled water droplets; Mixed--A mixture of clear ice and rime ice; and Rime Ice--Rough, milky, opaque ice formed by the instantaneous freezing of small supercooled water droplets. The intensity of icing is specified as: Light--The rate of accumulation may create a problem if flight is prolonged in this environment (over 1 hour). Occasional use of deicing/anti-icing equipment removes/prevents accumulation. It does not present a problem if the deicing/anti-icing equipment is used; Moderate--The rate of accumulation is such that even short encounters become potentially hazardous and use of deicing/anti-icing equipment or flight diversion is necessary; Severe--The rate of accumulation is such that deicing/anti-icing equipment fails to reduce or control the hazard. Immediate flight diversion is necessary; Trace--Ice becomes perceptible. Rate of accumulation is slightly greater than the rate of sublimation. Deicing/anti-icing equipment is not utilized unless encountered for an extended period of time (over 1 hour) Also, refer to AIM Chapter 7-1-22. PIREPs Relating to Airframe Icing (http://www.faa.gov/airports_airtraffic/air_traffic/publications/atpubs/aim/Chap7/aim0701.html#7-1-22)) and Section 7-1-23. Definitions of Inflight Icing Terms (http://www.faa.gov/airports_airtraffic/air_traffic/publications/atpubs/aim/Chap7/aim0701.html#7-1-23).','combo-box','ASRS'),(8672,'weather','Lightning/Static','http://weather.aviation.ca//content/view/21/36/','Any and all forms of visible electrical discharge produced by a thunderstorm, including a static discharge generated by weather that causes damage or has a significant affect on the operation of the aircraft; this includes St Elmo\'s fire.','combo-box','DNAA'),(8673,'weather','Lightning Strike','','','checkbox','Operator'),(8674,'weather','Marginal','http://www.weather.com/glossary/m.html','Refers to the general weather conditions pilots can expect at the surface. MVFR means Minimum or Marginal Visual Flight Rules. MVFR criteria means a ceiling between 1,000 and 3,000 feet and/or 3 to 5 miles visibility.','checkbox','ASRS'),(8675,'weather','Meteorological Conditions','http://www.faa.gov/airports_airtraffic/air_traffic/publications/atpubs/aim/Chap7/aim0701.html#7-1-28','The state of the atmosphere, mainly with respect to its effects upon life and human activities. Weather consists of the short-term (minutes to months) variations of the atmosphere. Refer to AIM Chapter 7. Safety of Flight Section 1. Meteorology (http://www.faa.gov/airports_airtraffic/air_traffic/publications/atpubs/aim/Chap7/aim0701.html#7-1-28).','combo-box','Operator'),(8676,'weather','Microburst','http://www.faa.gov/airports_airtraffic/air_traffic/publications/atpubs/PCG/M.HTM','Microbursts are small scale intense downdrafts which, on reaching the surface, spread outward in all directions from the downdraft center. This causes the presence of both vertical and horizontal wind shears that can be extremely hazardous to all types and categories of aircraft, especially at low altitudes. Due to their small size, short life span, and the fact that they can occur over areas without surface precipitation, microbursts are not easily detectable using conventional weather radar or wind shear alert systems. Parent clouds producing microburst activity can be any of the low or middle layer convective cloud types. Note, however, that microbursts commonly occur within the heavy rain portion of thunderstorms, and in much weaker, benign appearing convective cells that have little or no precipitation reaching the ground. Microburst wind shear may create a severe hazard for aircraft within 1,000 feet of the ground, particularly during the approach to landing and landing and take-off phases. The impact of a microburst on aircraft which have the unfortunate experience of penetrating one is characterized in (Refer to AIM Chapter 7-1-27: Microburst, Figure 7-1-16). The aircraft may encounter a headwind (performance increasing) followed by a downdraft and tailwind (both performance decreasing), possibly resulting in terrain impact (http://www.faa.gov/airports_airtraffic/air_traffic/publications/atpubs/aim/Chap7/aim0701.html#7-1-16).','checkbox','DNAA'),(8677,'weather','Mixed','http://www.weather.com/glossary/m.html','Any of the following combinations of freezing and frozen precipitation: snow and sleet, snow and freezing rain, or sleet alone. Rain may also be present.','checkbox','ASRS'),(8678,'weather','Mountain Wave','http://www.weather.com/glossary/m.html','A wave in the atmosphere caused by a barrier, such as a mountain. Sometimes it is marked by lenticular clouds to the lee side of mountain barriers. May be called a standing wave or a lee wave.','checkbox','DNAA'),(8679,'weather','Not as Forecasted','','','checkbox','UTRS'),(8680,'weather','Other Weather','','Description of additional factor(s), not listed, associated with the weather.','text-field','UTRS'),(8681,'weather','Rain','http://www.faa.gov/airports_airtraffic/air_traffic/publications/atpubs/aim/Chap7/aim0701.html#7-1-28','Liquid water droplets that fall from the atmosphere, having diameters greater than drizzle (0.5 mm), categorized as (AIM Chapter 7-1-19): (1) Light-From scattered drops that, regardless of duration, do not completely wet an exposed surface up to a condition where individual drops are easily seen; (2) Moderate-Individual drops are not clearly identifiable; spray is observable just above pavements and other hard surfaces; (3) Heavy-Rain seemingly falls in sheets; individual drops are not identifiable; heavy spray to height of several inches is observed over hard surfaces (http://www.faa.gov/airports_airtraffic/air_traffic/publications/atpubs/aim/Chap7/aim0701.html#7-1-28.).','combo-box','ASRS'),(8683,'weather','Snow','http://www.faa.gov/airports_airtraffic/air_traffic/publications/atpubs/aim/Chap7/aim0701.html#7-1-20','A porous, permeable aggregate of ice grains that can be predominantly single crystals or close groupings of several crystals. The intensity of snow (based on visibility) is categorized as (AIM Chapter 7-1-20): (1) Light-Visibility more than 1/2 statute mile, (2) Moderate-Visibility from more than 1/4 statute mile to 1/2 statute mile; (3) Heavy. Visibility 1/4 statute mile or less (http://www.faa.gov/airports_airtraffic/air_traffic/publications/atpubs/aim/Chap7/aim0701.html#7-1-20).','combo-box','ASRS'),(8684,'weather','Sun','','','checkbox','Operator'),(8685,'weather','Temperature (Degrees C)','http://www.weather.com/glossary/t.html','The degree of hotness or coldness of the air measured on a temperature scale by means of a thermometer and specified as degrees C (Celsius Scale).','real-field','DAWG'),(8686,'weather','Thunderstorms','http://www.weather.com/glossary/t.html','Produced by a cumulonimbus cloud, it is a microscale event of relatively short duration characterized by thunder, lightning, gusty surface winds, turbulence, hail, icing, precipitation, moderate to extreme up and downdrafts, and under the most severe conditions, tornadoes. Refer to AIM 7-1-29. Thunderstorms and 7-1-30. Thunderstorm Flying (http://www.faa.gov/airports_airtraffic/air_traffic/publications/atpubs/aim/Chap7/aim0701.html#7-1-28).','combo-box','DNAA'),(8687,'weather','Tornado','http://www.weather.com/glossary/t.html','A violently rotating column of air in contact with and extending between a convective cloud and the surface of the earth. It is the most destructive of all storm-scale atmospheric phenomena. They can occur anywhere in the world given the right conditions, but are most frequent in the United States in an area bounded by the Rockies on the west and the Appalachians in the east.','checkbox','DAWG'),(8688,'weather','Turbulence','http://www.faa.gov/airports_airtraffic/air_traffic/publications/atpubs/aim/Chap7/aim0701.html#7-1-24','The irregular and instantaneous motions of air which is made up of a number of small of eddies that travel in the general air current. Atmospheric turbulence is caused by random fluctuations in the wind flow. It can be caused by thermal or convective currents, differences in terrain and wind speed, along a frontal zone, or variation in temperature and pressure. Duration and classification of intensity are categorized as (AIM Table 7-1-9: Turbulence Reporting Criteria Table (http://www.faa.gov/airports_airtraffic/air_traffic/publications/atpubs/aim/Chap7/aim0701.html#7-1-24): (1) Light-Turbulence that momentarily causes slight, erratic changes in altitude and/or attitude (pitch, roll, yaw) (Reported as Light Turbulence or Turbulence) or that causes slight, rapid and somewhat rhythmic bumpiness without appreciable changes in altitude or attitude (Reported as Light Chop*); (2) Moderate-Turbulence that is similar to Light Turbulence but of greater intensity. Changes in altitude and/or attitude occur but the aircraft remains in positive control at all times. It usually causes variations in indicated airspeed (Reported as Moderate Turbulence) or Turbulence that is similar to Light Chop but of greater intensity. It causes rapid bumps or jolts without appreciable changes in aircraft altitude or attitude (Reported as Moderate Chop*); (3) Severe-Turbulence that causes large, abrupt changes in altitude and/or attitude. It usually causes large variations in indicated airspeed. Aircraft may be momentarily out of control (Report as Severe Turbulence)*; (4) Extreme: Turbulence in which the aircraft is violently tossed about and is practically impossible to control. It may cause structural damage (Reported as Extreme Turbulence). *High level turbulence (normally above 15,000 feet ASL) not associated with cumuliform cloudiness, including thunderstorms, should be reported as CAT (Clear Air Turbulence) preceded by the appropriate intensity, or light or moderate chop.','combo-box','DNAA'),(8689,'weather','Unknown','','Insufficient information exists to categorize the weather condition associated with the occurrence.','checkbox','ASRS'),(8690,'weather','Visibility','','','combo-box','Operator'),(8691,'weather','Volcanic Ash','http://www.faa.gov/airports_airtraffic/air_traffic/publications/atpubs/aim/Chap7/aim0701.html#7-1-28','Fine particles of pulverized rock blown from an explosion vent of a volcano. Measuring less than 1/10 inch in diameter, ash may be either solid or molten when first erupted. By far the most common variety is vitric ash (glassy particles formed by gas bubbles bursting through liquid magma). AIM Section 7-1-28: PIREPs Relating to Volcanic Ash Activity (http://www.faa.gov/airports_airtraffic/air_traffic/publications/atpubs/aim/Chap7/aim0701.html#7-1-28) indicates that pilots should submit PIREPs regarding volcanic activity using the Volcanic Activity Reporting (VAR) form (http://www.faa.gov/airports_airtraffic/air_traffic/publications/atpubs/aim/Appendices/aimapd2.html#Appendix2). If a VAR form is not immediately available, relay enough information to identify the position and type of volcanic activity. Further, pilots should verbally transmit the data required in items 1 through 8 of the VAR as soon as possible. The data required in items 9 through 16 of the VAR should be relayed after landing if possible.','combo-box','DNAA'),(8692,'weather','Weather','http://www.faa.gov/airports_airtraffic/air_traffic/publications/atpubs/aim/Chap7/aim0701.html#7-1-28','The state of the atmosphere at a specific time and with respect to its effect on life and human activities. It is the short term variations of the atmosphere, as opposed to the long term, or climatic, changes. It is often referred to in terms of brightness, cloudiness, humidity, precipitation, temperature, visibility, and wind. Refer to AIM Chapter 7. Safety of Flight Section 1. Meteorology (http://www.faa.gov/airports_airtraffic/air_traffic/publications/atpubs/aim/Chap7/aim0701.html#7-1-28).','checkbox','DAWG'),(8693,'weather','Weather Description','','','text-field','Operator'),(8694,'weather','Wind','http://www.weather.com/glossary/w.html','Air that flows in relation to the earth\'s surface, generally horizontally. There are four areas of wind that are measured: direction, speed, character (gusts and squalls), and shifts. Surface winds are measured by wind vanes and anemometers, while upper level winds are detected through pilot balloons, rawin, or aircraft reports.','combo-box','MEDA Rev g.'),(8695,'weather','Wind Direction (Degrees)','http://www.weather.com/glossary/w.html','The direction, in degrees, from which the wind is blowing. For example, an easterly wind is blowing from the east, not toward the east. It is reported with reference to true north, or 360 degrees on the compass, and expressed to the nearest 10 degrees, or to one of the 16 points of the compass (N, NE, WNW, etc.).','integer-field','DAWG'),(8696,'weather','Wind Gust Speed','','','integer-field','Operator'),(8697,'weather','Windshear','http://www.faa.gov/airports_airtraffic/air_traffic/publications/atpubs/aim/Chap7/aim0701.html#7-1-25','A sudden, drastic change in wind speed and/or wind direction in a short distance resulting in a tearing or shearing effect. It can exist in a horizontal or vertical direction and occasionally in both. The recommended method for wind shear reporting is to state the loss or gain of airspeed and the altitudes at which it was encountered. Refer to AIM Chapter 7-1-25. Wind Shear PIREPs (http://www.faa.gov/airports_airtraffic/air_traffic/publications/atpubs/aim/Chap7/aim0701.html#7-1-25)','combo-box','DNAA'),(8698,'weather','Windshear Alert','','','checkbox','Operator'),(8699,'weather','Wind Speed (Knots)','http://www.weather.com/glossary/w.html','The velocity of air in motion relative to the surface of the earth specified in knots.','integer-field','DAWG'),(8700,'weather','Wind Type','http://virtualskies.arc.nasa.gov/glossary/W.html','Specifies the direction from which the wind is blowing as: Cross Wind--A wind blowing in a direction perpendicular to the course of a moving object; Headwind-- A wind that opposes the intended progress of an exposed, moving object; Tail Wind --A wind blowing in the same direction as the heading of a moving object thus assisting the object\'s intended progress; Wind Shift--A change in wind direction of 45 degrees or more, which takes place in less than 15 minutes. It may the result of a frontal passage, from katabatic winds, sea breezes, or thunderstorms, and in some instances, the change may be gradual or abrupt.','combo-box','DNAA'),(8701,'weight-and-balance-event','Actual Center of Gravity','Alaska','','real-field','Operator'),(8702,'weight-and-balance-event','Actual Load Did Not Match Inbound Load Message','','','checkbox','Operator'),(8703,'weight-and-balance-event','Actual Weight','Alaska','','real-field','Operator'),(8704,'weight-and-balance-event','Actual ZFW','','','real-field','Operator'),(8705,'weight-and-balance-event','Aircraft Loaded Weight/CG Error','','','checkbox','Operator'),(8706,'weight-and-balance-event','Aircraft Loaded Weight/CG Error','','','combo-box','Operator'),(8707,'weight-and-balance-event','Calculation Error','','','checkbox','Operator'),(8708,'weight-and-balance-event','Cargo','http://rgl.faa.gov/Regulatory_and_Guidance_Library/rgAdvisoryCircular.nsf/0/84087a61b8fb9582862570220064e03c/$FILE/AC120-27E.pdf','Refers to everything carried in the cargo compartments of the aircraft and the condition (i.e., restrained, shifting, or other) of bags, mail, freight, express, and company material. It also includes live animals, dangerous goods, and hazardous materials.  as subcategories of the above. Refer to AC 120-27E: Aircraft Weight and Balance Control (http://rgl.faa.gov/Regulatory_and_Guidance_Library/rgAdvisoryCircular.nsf/0/84087a61b8fb9582862570220064e03c/$FILE/AC120-27E.pdf).','combo-box','UTRS'),(8709,'weight-and-balance-event','Cargo/Bag Documentation Error','','','combo-box','Operator'),(8710,'weight-and-balance-event','Cargo Loading Error','','','checkbox','Operator'),(8711,'weight-and-balance-event','Cargo Shift','','Movment of cargo between zones or compartments that can cause potential hazards.','checkbox','Operator'),(8712,'weight-and-balance-event','Center of Gravity','http://www.faa.gov/library/manuals/aircraft/airplane_handbook/media/faa-h-8083-3a-7of7.pdf','Issues associated with the specified forward and aft points within which the Center of Gravity (CG) must be located during flight. These limits are indicated on pertinent airplane specifications.. CG is defined as the point at which an airplane would balance if it were possible to suspend it at that point. It is the mass center of the airplane, or the theoretical point at which the entire weight of the airplane is assumed to be concentrated. It may be expressed in inches from the reference datum, or in percent of mean aerodynamic cord (MAC). The location depends on the distribution of the weight in the airplane.','checkbox','DNAA'),(8713,'weight-and-balance-event','Center of Gravity Error Type','','','combo-box','UTRS'),(8714,'weight-and-balance-event','CG Difference','','','real-field','Operator'),(8715,'weight-and-balance-event','CLP Contacted','','','checkbox','Operator'),(8716,'weight-and-balance-event','Center of Gravity Location at Time of Accident/Incident in Inches','','expressed in inches','real-field','NTSB 6120-1'),(8717,'weight-and-balance-event','CG from Datum','','indicates datum (location specified by mfg) is point of reference used for determining cg location','checkbox','NTSB 6120-1'),(8718,'weight-and-balance-event','CG from Nose','','indicates nose is point of reference used for determining cg location','checkbox','NTSB 6120-1'),(8719,'weight-and-balance-event','Percent Mean Aerodynamic Cord (%MAC)','','expressed in %','real-field','NTSB 6120-1'),(8720,'weight-and-balance-event','Exceeded CG limitations','','','checkbox','Operator'),(8721,'weight-and-balance-event','Exceeded PIT/ULD limitations','','','checkbox','Operator'),(8722,'weight-and-balance-event','Exceeded running load restrictions','','','checkbox','Operator'),(8723,'weight-and-balance-event','Incorrect Planning Tool Used','','','checkbox','Operator'),(8724,'weight-and-balance-event','Input Error','','','checkbox','Operator'),(8725,'weight-and-balance-event','Items not in Documented Pit','','','checkbox','Operator'),(8726,'weight-and-balance-event','Load Verification Error','','','checkbox','Operator'),(8727,'weight-and-balance-event','Maximum Landing Weight (lbs)','http://www.faa.gov/library/manuals/aircraft/airplane_handbook/media/faa-h-8083-3a-7of7.pdf','The greatest weight that an airplane normally is allowed to have at landing in pounds.','integer-field','Operator'),(8728,'weight-and-balance-event','MTOW Exceeded','','','checkbox','Operator'),(8729,'weight-and-balance-event','Maximum Takeoff Weight (lbs)','http://www.faa.gov/library/manuals/aircraft/airplane_handbook/media/faa-h-8083-3a-7of7.pdf','The maximum allowable weight for takeoff in pounds of the aircraft according to the Certificate of Airworthiness, the flight manual or other official document.','integer-field','Operator'),(8730,'weight-and-balance-event','Maximum Taxi Weight (lbs)','http://www.faa.gov/library/manuals/aircraft/airplane_handbook/media/faa-h-8083-3a-7of7.pdf','The total weight of a loaded aircraft, including all fuel, in pounds. It is greater than the takeoff weight due to the fuel that will be burned during the taxi and runup operations. Taxi weight may also be referred to as ramp weight.','integer-field','Operator'),(8731,'weight-and-balance-event','Maximum Zero Fuel Weight (lbs)','http://www.faa.gov/library/manuals/aircraft/airplane_handbook/media/faa-h-8083-3a-7of7.pdf','The maximum weight, exclusive of usable fuel in pounds.','integer-field','Operator'),(8732,'weight-and-balance-event','Other Weight and Balance Event','http://rgl.faa.gov/Regulatory_and_Guidance_Library/rgAdvisoryCircular.nsf/0/84087a61b8fb9582862570220064e03c/$FILE/AC120-27E.pdf','Description of additional factor(s), not listed, associated with the weight and balance events and errors.','text-field','DNAA'),(8733,'weight-and-balance-event','Over Max Zero Fuel Weight','','','checkbox','Operator'),(8734,'weight-and-balance-event','Over Release Weight','','','checkbox','Operator'),(8735,'weight-and-balance-event','Overweight for Ground Surface Limits','http://www.faa.gov/library/manuals/aircraft/airplane_handbook/media/faa-h-8083-3a-7of7.pdf','Total weight approved of loaded aircraft, including weight of start, taxi, and runup fuel exceeding those allowed for ground maneuvers.','checkbox','DNAA'),(8736,'weight-and-balance-event','Overweight Takeoff','http://rgl.faa.gov/Regulatory_and_Guidance_Library/rgAdvisoryCircular.nsf/0/84087a61b8fb9582862570220064e03c/$FILE/AC120-27E.pdf','The exceedances of the maximum allowable aircraft weight at the start of the takeoff run. Refer to AC 120-27E: Aircraft Weight and Balance Control (http://rgl.faa.gov/Regulatory_and_Guidance_Library/rgAdvisoryCircular.nsf/0/84087a61b8fb9582862570220064e03c/$FILE/AC120-27E.pdf).','checkbox','Operator'),(8737,'weight-and-balance-event','Overweight Taxi','http://www.faa.gov/library/manuals/aircraft/airplane_handbook/media/faa-h-8083-3a-7of7.pdf','Total weight of a loaded aircraft, including all fuel exceeding those allowed for taxi operations.','checkbox','DNAA'),(8738,'weight-and-balance-event','Passenger Loading/Count Error','http://rgl.faa.gov/Regulatory_and_Guidance_Library/rgAdvisoryCircular.nsf/0/84087a61b8fb9582862570220064e03c/$FILE/AC120-27E.pdf','Issues associated with a employee action that unintentionally deviates from the expected action (or behavior) or fails to achieve what should be done related to the determining the weight of passengers and their bags. Refer to AC 120-27E: Aircraft Weight and Balance Control (http://rgl.faa.gov/Regulatory_and_Guidance_Library/rgAdvisoryCircular.nsf/0/84087a61b8fb9582862570220064e03c/$FILE/AC120-27E.pdf).','checkbox','Operator'),(8739,'weight-and-balance-event','Passenger Loading/Count Error Type','','','combo-box','UTRS'),(8740,'weight-and-balance-event','Payload>10,000 Kgs','','','checkbox','Operator'),(8741,'weight-and-balance-event','Reported Center of Gravity','Alaska','','real-field','Operator'),(8742,'weight-and-balance-event','Reported Weight','Alaska','','real-field','Operator'),(8743,'weight-and-balance-event','Reported ZFW','','','real-field','Operator'),(8744,'weight-and-balance-event','Reported ZFW','','','checkbox','Operator'),(8745,'weight-and-balance-event','Shelf Weight Exceedence','','','checkbox','Operator'),(8746,'weight-and-balance-event','Weight and Balance','http://www.faa.gov/library/manuals/aircraft/airplane_handbook/media/faa-h-8083-3a-7of7.pdf','The aircraft is said to be in weight and balance when the gross weight of the aircraft is under the max grow weight, and the center of gravity is within limits and will remain in limits for the duration of the flight.','checkbox','DNAA'),(8747,'weight-and-balance-event','Weight Difference','','','integer-field','Operator'),(8748,'when-event-detected','Aircraft Cleaning','','Occurrence was identified during the process of cleaning the aircraft and restocking aircraft essentials (trash, magazines, blankets, etc.).','checkbox','Operator'),(8749,'when-event-detected','Aircraft De-Ice','http://aircrafticing.grc.nasa.gov/resources/glossary.html','Indicates occurrence was detected during preflight ground servicing intended to remove ice from aircraft surfaces.','checkbox','Operator'),(8750,'when-event-detected','At Receiving Facility','','','checkbox','Operator'),(8751,'when-event-detected','At Sending Facility','','','checkbox','Operator'),(8752,'when-event-detected','Boarding','','','checkbox','Operator'),(8753,'when-event-detected','Cabin Phases','','Phase of operation as they pertain to cabin operations.','combo-box','Operator'),(8754,'when-event-detected','Departure','','','